    t[181] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0432\u0456\u0434\u043a\u0440\u0438\u0439\u0442\u0435 \u0444\u0430\u0454\u0440\u0432\u043e\u043b \u0430\u0431\u043e \u0432\u0438\u043c\u043a\u043d\u0456\u0442\u044c \u0432\u0438\u0449\u0435\u0432\u043a\u0430\u0437\u0430\u043d\u0438\u0439 \u0432\u0445\u0456\u0434\u043d\u0438\u0439 TCP.";
    t[184] = "I2P Support Forum";
    t[185] = "\u0424\u043e\u0440\u0443\u043c \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0438 I2P";
    t[192] = "SAM (Simple Anonymous Messaging) is a protocol which allows a client application written in any programming language to communicate over I2P, by using a socket-based interface to the I2P router. For more information, see the <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[193] = "SAM (\u041f\u0440\u043e\u0441\u0442\u0435 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0435 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f) - \u0446\u0435 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b, \u0449\u043e \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u043c \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043a\u0430\u043c, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u043c \u043d\u0430 \u0431\u0443\u0434\u044c-\u044f\u043a\u0456\u0439 \u043c\u043e\u0432\u0456 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0443\u0432\u0430\u043d\u043d\u044f, \u0441\u043f\u0456\u043b\u043a\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u0447\u0435\u0440\u0435\u0437 I2P, \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0447\u0438 \u0441\u043e\u043a\u0435\u0442\u043d\u0438\u0439 \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441 \u0434\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u043d\u0430 <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>\u0430\u043d\u0433\u043b\u043e\u043c\u043e\u0432\u043d\u0456\u0439 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u0457</a>.";
    t[194] = "not found in network database";
    t[195] = "\u043d\u0435 \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043e \u0432 \u0431\u0430\u0437\u0456 \u0434\u0430\u043d\u0438\u0445 \u043c\u0435\u0440\u0435\u0436\u0456";
    t[198] = "Router Sitemap";
    t[199] = "\u041a\u0430\u0440\u0442\u0430 \u0441\u0430\u0439\u0442\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[206] = "This setting determines the number of peer tests to run concurrently, used to determine peer latency. [Default is 4]";
    t[207] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0442\u0435\u0441\u0442\u0456\u0432 \u043f\u0456\u0440\u0456\u0432, \u044f\u043a\u0456 \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0438\u043a\u043e\u043d\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u043f\u0430\u0440\u0430\u043b\u0435\u043b\u044c\u043d\u043e \u0434\u043b\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0438 \u043f\u0456\u0440\u0430. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 4]";
    t[208] = "News Updates";
    t[209] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043d\u043e\u0432\u0438\u043d";
    t[212] = "Role";
    t[213] = "\u0420\u043e\u043b\u044c";
    t[218] = "Test running?";
    t[219] = "\u0422\u0435\u0441\u0442\u043e\u0432\u0438\u0439 \u0437\u0430\u043f\u0443\u0441\u043a?";
    t[222] = "Latest News";
    t[223] = "\u041e\u0441\u0442\u0430\u043d\u043d\u0456 \u043d\u043e\u0432\u0438\u043d\u0438";
    t[228] = "Bad client index.";
    t[229] = "\u041d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0438\u0439 \u0456\u043d\u0434\u0435\u043a\u0441 \u043a\u043b\u0456\u0454\u043d\u0442\u0430";
    t[232] = "When set to true, the router will change its identity and UDP port every time the router restarts. [Default is false]";
    t[233] = "\u042f\u043a\u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e True, \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0437\u043c\u0456\u043d\u044e\u0432\u0430\u0442\u0438\u043c\u0435 \u0441\u0432\u043e\u044e \u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c \u0442\u0430 \u043f\u043e\u0440\u0442 UDP \u043a\u043e\u0436\u043d\u043e\u0433\u043e \u0440\u0430\u0437\u0443, \u043a\u043e\u043b\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0454\u0442\u044c\u0441\u044f. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0454 \u043f\u043e\u043c\u0438\u043b\u043a\u043e\u0432\u0438\u043c]";
    t[234] = "Note: Your contribution to the network (network share) is determined by the allocation of upstream bandwidth (upload speed).";
    t[235] = "\u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430. \u0412\u0430\u0448 \u0432\u043d\u0435\u0441\u043e\u043a \u0443 \u043c\u0435\u0440\u0435\u0436\u0443 (\u0441\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456) \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u0440\u043e\u0437\u043f\u043e\u0434\u0456\u043b\u043e\u043c \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0432\u0438\u0441\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u043a\u0430\u043d\u0430\u043b\u0443 (\u0448\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f).";
    t[236] = "Advanced Router Configuration";
    t[237] = "\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "\u0412\u0438\u0434\u0456\u043b\u0456\u0442\u044c \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u043e\u0442\u043e\u043a\u0456\u0432 \u043f\u0440\u043e\u0446\u0435\u0441\u043e\u0440\u0456\u0432 \u0434\u043b\u044f \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u042f\u043a\u0449\u043e \u0432\u0430\u0448 \u043f\u0440\u043e\u0446\u0435\u0441\u043e\u0440 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0454 \u0433\u0456\u043f\u0435\u0440\u0442\u0456\u043d\u0434\u0443\u0432\u0430\u043d\u043d\u044f \u0430\u0431\u043e \u043e\u0434\u043d\u043e\u0447\u0430\u0441\u043d\u0443 \u0431\u0430\u0433\u0430\u0442\u043e\u043f\u043e\u0442\u043e\u043a\u0443, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u043e\u043c\u043d\u043e\u0436\u0438\u0442\u0438 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u0446\u0435\u0441\u043e\u0440\u043d\u0438\u0445 \u044f\u0434\u0435\u0440 \u043d\u0430 2, \u0449\u043e\u0431 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u043e\u0442\u043e\u043a\u0456\u0432 \u0434\u043b\u044f \u0432\u0438\u0434\u0456\u043b\u0435\u043d\u043d\u044f, \u0456\u043d\u0430\u043a\u0448\u0435 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u0446\u0435\u0441\u043e\u0440\u043d\u0438\u0445 \u044f\u0434\u0435\u0440 = \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0445 \u043f\u043e\u0442\u043e\u043a\u0456\u0432. \u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u0434\u0456\u043b\u0438\u0442\u0438 \u043c\u0435\u043d\u0448\u0435, \u043d\u0456\u0436 \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u043d\u0438\u0439 \u043c\u0430\u043a\u0441\u0438\u043c\u0443\u043c, \u0449\u043e\u0431 \u043f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0442\u0438\u0441\u044f, \u0449\u043e \u0443 \u0432\u0430\u0441 \u0454 \u0443\u0440\u044f\u0434 \u0434\u043b\u044f \u0456\u043d\u0448\u0438\u0445 \u0437\u0430\u0432\u0434\u0430\u043d\u044c.";
    t[240] = "Watchdog warning";
    t[241] = "\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u0436\u0435\u043d\u043d\u044f \u0441\u0442\u043e\u0440\u043e\u0436\u0430";
