    t[243] = "\u041f\u0440\u0438\u0445\u043e\u0432\u0430\u0442\u0438 \u043f\u0456\u043a\u0442\u043e\u0433\u0440\u0430\u043c\u0443 \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u043e\u0457 \u043f\u0430\u043d\u0435\u043b\u0456";
    t[244] = "WAN Common Interface Configuration";
    t[245] = "\u0417\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f WAN-\u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0456\u0432";
    t[260] = "The default settings are optimized for general usage and normally don't need to be changed.";
    t[261] = "\u041f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043e\u043f\u0442\u0438\u043c\u0456\u0437\u043e\u0432\u0430\u043d\u0456 \u0434\u043b\u044f \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f, \u0456 \u0437\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0457\u0445 \u043d\u0435 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0437\u043c\u0456\u043d\u044e\u0432\u0430\u0442\u0438.";
