    t[274] = "Sitemap";
    t[275] = "\u041a\u0430\u0440\u0442\u0430 \u0441\u0430\u0439\u0442\u0443";
    t[276] = "IPv6 Addresses";
    t[277] = "\u0410\u0434\u0440\u0435\u0441\u0438 IPv6";
    t[282] = "Disabled floodfill";
    t[283] = "Floodfill \u0434\u0435\u0430\u043a\u0442\u0438\u0432\u043e\u0432\u0430\u043d\u043e";
    t[286] = "Note that there can only be a single reference to the <i class=example>default</i> keyword in a filter file. If unstated, all connections are permitted unless explicitly forbidden. Errors in the filter file will prevent a stopped tunnel from starting, so be sure to double check the syntax before deployment.";
    t[287] = "\u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u0443 \u0444\u0430\u0439\u043b\u0456 \u0444\u0456\u043b\u044c\u0442\u0440\u0443 \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u043b\u0438\u0448\u0435 \u043e\u0434\u043d\u0435 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u043d\u0430 \u043a\u043b\u044e\u0447\u043e\u0432\u0435 \u0441\u043b\u043e\u0432\u043e <i class=example>default</i>. \u042f\u043a\u0449\u043e \u0446\u0435 \u043d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u043e, \u0432\u0441\u0456 \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u044e\u0442\u044c\u0441\u044f, \u043a\u0440\u0456\u043c \u044f\u0432\u043d\u043e \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u0435\u043d\u0438\u0445. \u041f\u043e\u043c\u0438\u043b\u043a\u0438 \u0432 \u0444\u0430\u0439\u043b\u0456 \u0444\u0456\u043b\u044c\u0442\u0440\u0443 \u043d\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0442\u044c \u0437\u0443\u043f\u0438\u043d\u0435\u043d\u043e\u043c\u0443 \u0442\u0443\u043d\u0435\u043b\u044e \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438\u0441\u044f, \u0442\u043e\u043c\u0443 \u0434\u0432\u0456\u0447\u0456 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435 \u0441\u0438\u043d\u0442\u0430\u043a\u0441\u0438\u0441 \u043f\u0435\u0440\u0435\u0434 \u0432\u043f\u0440\u043e\u0432\u0430\u0434\u0436\u0435\u043d\u043d\u044f\u043c.";
    t[288] = "Automatic blocking";
    t[289] = "\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u0435 \u0431\u043b\u043e\u043a\u0443\u0432\u0430\u043d\u043d\u044f";
