    t[296] = "Enter new family name";
    t[297] = "\u0412\u0432\u0435\u0434\u0456\u0442\u044c \u043d\u043e\u0432\u0435 \u043f\u0440\u0456\u0437\u0432\u0438\u0449\u0435";
    t[304] = "Router Logs";
    t[305] = "\u0416\u0443\u0440\u043d\u0430\u043b\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[312] = "Enabled floodfill";
