    t[353] = "IP-\u0430\u0434\u0440\u0435\u0441\u0430";
    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "\u041a\u043e\u043b\u0438 \u0441\u0442\u0432\u043e\u0440\u044e\u0454\u0442\u044c\u0441\u044f \u043d\u043e\u0432\u0438\u0439 \u0441\u0435\u0440\u0432\u0456\u0441\u043d\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0430\u0431\u043e \u0441\u0435\u0440\u0432\u0456\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u043f\u0435\u0440\u0448\u0435 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c web-\u0441\u0435\u0440\u0432\u0435\u0440 jetty \u0447\u0438 \u043f\u043b\u0430\u0433\u0456\u043d), \u0433\u0435\u043d\u0435\u0440\u0443\u0454\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u0438\u0439 \u043a\u043b\u044e\u0447 \u0448\u0438\u0444\u0440\u0443\u0432\u0430\u043d\u043d\u044f, \u044f\u043a\u0438\u0439 de-facto \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044e\u0454 \u043f\u0440\u0430\u0432\u043e \u0432\u043e\u043b\u043e\u0434\u0456\u043d\u043d\u044f \u0430\u0434\u0440\u0435\u0441\u043e\u044e. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0439\u043e\u0433\u043e \u0456\u043c\u0435\u043d\u0443\u044e\u0442\u044c <code>&hellip;privKey.dat</code> \u0430\u0431\u043e <code>eepPriv.dat</code>, \u0445\u043e\u0447\u0430 \u043a\u0440\u0430\u0449\u0435 \u0437\u043c\u0456\u043d\u0438\u0442\u0438 \u0456\u043c'\u044f \u0442\u0430\u043a, \u0449\u043e\u0431 \u0432\u043a\u0430\u0437\u0430\u0442\u0438, \u044f\u043a\u043e\u043c\u0443 \u0441\u0435\u0440\u0432\u0456\u0441\u0443 \u0432\u0456\u043d \u043d\u0430\u043b\u0435\u0436\u0438\u0442\u044c, \u0430 \u043f\u043e\u0442\u0456\u043c \u043f\u0435\u0440\u0435\u0432\u0438\u0437\u043d\u0430\u0447\u0438\u0442\u0438 \u0439\u043e\u0433\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f\u0445 \u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0432 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u0426\u0435\u0439 \u0444\u0430\u0439\u043b .dat \u0441\u043b\u0456\u0434 \u0431\u0435\u0437\u043f\u0435\u0447\u043d\u043e \u0437\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u0440\u0435\u0437\u0435\u0440\u0432\u043d\u0443 \u043a\u043e\u043f\u0456\u044e; \u0432\u0442\u0440\u0430\u0442\u0438\u0432\u0448\u0438 \u0439\u043e\u0433\u043e - \u0432\u0438 \u0432\u0442\u0440\u0430\u0442\u0438\u0442\u0435 \u043f\u0440\u0430\u0432\u043e \u0432\u043e\u043b\u043e\u0434\u0456\u043d\u043d\u044f \u0442\u0430 \u043a\u0435\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u0441\u0432\u043e\u0454\u044e \u0434\u043e\u043c\u0435\u043d\u043d\u043e\u044e \u043d\u0430\u0437\u0432\u043e\u044e!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0441\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0443\u0432\u0430\u0442\u0438 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0444\u0430\u0439\u043b\u0456\u0432 \u043d\u0430 \u0442\u043e\u0440\u0440\u0435\u043d\u0442, \u044f\u043a\u0443 \u0431\u0443\u0434\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0442\u0438 I2PSnark \u043f\u0440\u0438 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u0456 \u0430\u0431\u043e \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u0456 \u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0443. \u0417\u0430\u0437\u043d\u0430\u0447\u0442\u0435, \u0449\u043e \u0441\u0443\u0442\u0442\u0454\u0432\u0435 \u0437\u0431\u0456\u043b\u044c\u0448\u0435\u043d\u043d\u044f \u0446\u044c\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0432\u0456\u0434 \u0442\u0438\u043f\u043e\u0432\u0438\u0445 2000 \u0444\u0430\u0439\u043b\u0456\u0432 \u043c\u043e\u0436\u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0432\u0430\u0442\u0438 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u043e\u0457 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u043a\u0438 \u043d\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0456 \u043f\u0440\u0438\u0439\u043c\u0430\u0447\u0430 \u0434\u043b\u044f \u0437\u0431\u0456\u043b\u044c\u0448\u0435\u043d\u043d\u044f \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0457 \u043a\u0456\u043b\u044c\u043a\u043e\u0441\u0442\u0456 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0438\u0445 \u0444\u0430\u0439\u043b\u0456\u0432, \u044f\u043a\u0443 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c \u043e\u043f\u0435\u0440\u0430\u0446\u0456\u0439\u043d\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0430 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, <code>ulimit -n</code> \u043d\u0430 Linux). \u0429\u043e\u0431 \u0437\u043c\u0456\u043d\u0438\u0442\u0438, \u0434\u043e\u0434\u0430\u0439\u0442\u0435 \u0434\u043e \u0444\u0430\u0439\u043b\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 I2PSnark <code>i2psnark.config</code>. [\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a I2PSnark \u0430\u0431\u043e \u0440\u043e\u0443\u0442\u0435\u0440\u0430]";
    t[370] = "Configure router bandwidth allocation";
    t[371] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 \u0440\u043e\u0437\u043f\u043e\u0434\u0456\u043b \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
