    t[373] = "\u041e\u0441\u044c \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u0456\u043d\u0448\u0438\u0445 \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u0438\u0445 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u044c \u043d\u0430 \u043f\u0456\u0434\u043f\u0438\u0441\u043a\u0443 \u0434\u043e \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0431\u0430\u0436\u0430\u0442\u0438 \u0434\u043e\u0434\u0430\u0442\u0438 \u043e\u0434\u0438\u043d-\u0434\u0432\u0430 \u0437 \u043d\u0438\u0445 \u0434\u043e \u0441\u043f\u0438\u0441\u043a\u0443 <a href='/dns?subscriptions' target=_blank rel=noreferrer>\u0432\u0430\u0448\u0438\u0445 \u043f\u0456\u0434\u043f\u0438\u0441\u043e\u043a susidns</a>. \u0423 \u0440\u0430\u0437\u0456 \u0441\u0443\u043c\u0456\u0441\u0446\u044f \u0430\u0434\u0440\u0435\u0441 \u0432 \u0440\u0456\u0437\u043d\u0438\u0445 \u043f\u0456\u0434\u043f\u0438\u0441\u043a\u0430\u0445, \u043f\u0435\u0440\u0435\u0432\u0430\u0433\u0443 \u043c\u0430\u0442\u0438\u043c\u0443\u0442\u044c \u0441\u043f\u0438\u0441\u043a\u0438 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0456 \u0432\u0433\u043e\u0440\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c susidns \u043f\u0435\u0440\u0435\u0434 \u0442\u0438\u043c\u0438, \u0449\u043e \u0437\u043d\u0430\u0445\u043e\u0434\u044f\u0442\u044c\u0441\u044f \u043d\u0438\u0436\u0447\u0435.";
