    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "\u0412\u0438\u0431\u0435\u0440\u0456\u0442\u044c \u043d\u0430\u0437\u0432\u0443 \u0434\u043b\u044f \u0441\u0432\u043e\u0433\u043e \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0443 (<i>\u0456\u043c\u2019\u044f \u0445\u043e\u0441\u0442\u0443</i>.i2p), \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0447\u0438 \u043c\u0430\u043b\u0456 \u043b\u0456\u0442\u0435\u0440\u0438. \u0429\u043e\u0431 \u043f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0442\u0438\u0441\u044f, \u0449\u043e \u0456\u043c\u2019\u044f \u0445\u043e\u0441\u0442\u0443 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0435, \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435 <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> \u0430\u0431\u043e <a href=http://reg.i2p target=_blank>reg. i2p</a>, \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u043f\u0440\u0438\u0439\u043d\u044f\u0442\u0438 \u0440\u0456\u0448\u0435\u043d\u043d\u044f. \u0412\u0432\u0435\u0434\u0456\u0442\u044c \u043d\u043e\u0432\u0443 \u043d\u0430\u0437\u0432\u0443 \u0434\u043b\u044f \u0441\u0432\u043e\u0433\u043e \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0443 \u043d\u0430 <a href='/i2ptunnel/edit?tunnel=3'>\u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u044e</a>, \u0434\u0435 \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043e <i>\u041d\u0430\u0437\u0432\u0430 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0443</i>, \u0437\u0430\u043c\u0456\u043d\u0438\u0432\u0448\u0438 \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0442\u043d\u0443 <i >mysite.i2p</i> \u0437\u0430\u043f\u043e\u0432\u043d\u044e\u0432\u0430\u0447. \u042f\u043a\u0449\u043e \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435, \u0449\u043e\u0431 \u0432\u0430\u0448 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442 \u0431\u0443\u0432 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u043c \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 I2P, \u0443\u0432\u0456\u043c\u043a\u043d\u0456\u0442\u044c <i>\u0410\u0432\u0442\u043e\u0437\u0430\u043f\u0443\u0441\u043a</i>, \u0430 \u043f\u043e\u0442\u0456\u043c \u043d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c <i>\u0417\u0431\u0435\u0440\u0435\u0433\u0442\u0438</i>.";
    t[556] = "When set to true, this enables gzip compression for the router console and default web applications. [Enabled by default]";
