    t[615] = "\u0429\u043e\u0431 \u0437\u0430\u043f\u043e\u0431\u0456\u0433\u0442\u0438 \u0432\u0438\u0442\u043e\u043a\u0430\u043c DNS, \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u043f\u0440\u0430\u043f\u043e\u0440\u0435\u0446\u044c <i>Proxy DNS \u043f\u0440\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u0456 SOCKS v5</i>.";
    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "\u0411\u043e\u043d\u0443\u0441\u0438 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u043f\u043e\u0437\u0438\u0442\u0438\u0432\u043d\u0438\u043c\u0438 \u0447\u0438 \u043d\u0435\u0433\u0430\u0442\u0438\u0432\u043d\u0438\u043c\u0438 \u0442\u0430 \u0432\u043f\u043b\u0438\u0432\u0430\u0442\u0438 \u043d\u0430 \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0456\u0432 \u0443 \u0448\u0432\u0438\u0434\u043a\u0456 \u0442\u0430 \u0432\u0438\u0441\u043e\u043a\u0456 \u0440\u0456\u0432\u043d\u0456 \u043f\u043e\u0442\u0443\u0436\u043d\u043e\u0441\u0442\u0456. \u0428\u0432\u0438\u0434\u043a\u0456 \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u0430 \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0438 \u0432\u0438\u0441\u043e\u043a\u043e\u0457 \u0454\u043c\u043d\u043e\u0441\u0442\u0456 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0434\u0435\u044f\u043a\u0438\u0445 \u0434\u043e\u0441\u043b\u0456\u0434\u043d\u0438\u0446\u044c\u043a\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432.";
    t[618] = "Yes";
    t[619] = "\u0422\u0430\u043a";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "\u0425\u043e\u0447\u0430 I2P \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438\u043c\u0435 \u043d\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e \u0432 \u0446\u0456\u0439 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457, \u044f\u043a\u0449\u043e \u0432\u0438 \u0441\u043f\u0440\u0430\u0432\u0434\u0456 \u043c\u0430\u0454\u0442\u0435 \u043f\u043e\u043d\u0430\u0434 128 \u041a\u0411/\u0441 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0434\u043b\u044f \u0441\u043f\u0456\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f, \u0434\u043b\u044f \u043c\u0435\u0440\u0435\u0436\u0456 \u0431\u0443\u0434\u0435 \u043d\u0430\u0431\u0430\u0433\u0430\u0442\u043e \u043a\u043e\u0440\u0438\u0441\u043d\u0456\u0448\u0435, \u044f\u043a\u0449\u043e \u0432\u0438 \u0432\u0456\u0434\u043a\u0440\u0438\u0454\u0442\u0435 \u0444\u0430\u0454\u0440\u0432\u043e\u043b.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "\u041a\u043e\u043c\u0430\u043d\u0434\u043d\u0438\u0439 \u0440\u044f\u0434\u043a\u043e\u0432\u0438\u0439 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043e\u043a, \u043f\u043e\u0441\u0442\u0430\u0447\u0435\u043d\u0438\u0439 \u0440\u0430\u0437\u043e\u043c \u0437 I2P, \u044f\u043a\u0438\u0439 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u0440\u0435\u0441\u0443\u0440\u0441\u0456\u0432 URL, \u043f\u043e\u0434\u0456\u0431\u043d\u043e \u0434\u043e <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> \u0430\u0431\u043e <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget \u0442\u0430\u043a\u043e\u0436 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0432\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u044c\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u043c, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u0434\u043b\u044f \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u0456\u043d\u043d\u044f \u0437 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u0445 \u0445\u043e\u0441\u0442\u0456\u0432. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c eepget \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454 HTTP-\u043f\u0440\u043e\u043a\u0441\u0456 \u043d\u0430 <code>127.0.0.1:4444</code>.";
    t[630] = "Mobile console option saved.";
    t[631] = "\u041e\u043f\u0446\u0456\u044f \u043c\u043e\u0431\u0456\u043b\u044c\u043d\u043e\u0457 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0430.";
    t[632] = "Known Floodfills";
    t[633] = "\u0412\u0456\u0434\u043e\u043c\u0456 \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d\u043d\u044f";
    t[634] = "OpenDemocracy";
    t[635] = "\u0412\u0456\u0434\u043a\u0440\u0438\u0442\u0430 \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0456\u044f";
    t[640] = "Enable UPnP to open firewall ports";
    t[641] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0456\u0442\u044c UPnP, \u0449\u043e\u0431 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0438 \u043f\u043e\u0440\u0442\u0438 \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440\u0430";
    t[652] = "Select secret key file";
    t[653] = "\u0412\u0438\u0431\u0435\u0440\u0456\u0442\u044c \u0444\u0430\u0439\u043b \u0441\u0435\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u043a\u043b\u044e\u0447\u0430";
    t[660] = "Please open your firewall or enable UDP.";
    t[661] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0432\u0456\u0434\u043a\u0440\u0438\u0439\u0442\u0435 \u0444\u0430\u0454\u0440\u0432\u043e\u043b \u0430\u0431\u043e \u0443\u0432\u0456\u043c\u043a\u043d\u0456\u0442\u044c UDP.";
    t[666] = "Install I2P system service";
    t[667] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u0443 \u0441\u043b\u0443\u0436\u0431\u0443 I2P";
    t[676] = "Reseed URL Selection";
    t[677] = "\u041f\u043e\u0432\u0442\u043e\u0440\u043d\u0435 \u0437\u0430\u043f\u043e\u0432\u043d\u0435\u043d\u043d\u044f \u0432\u0438\u0431\u043e\u0440\u0443 URL-\u0430\u0434\u0440\u0435\u0441\u0438";
    t[678] = "Same IPv4 /24 as us";
    t[679] = "\u0422\u043e\u0439 \u0441\u0430\u043c\u0438\u0439 IPv4 /24, \u0449\u043e \u0439 \u0443 \u043d\u0430\u0441";
    t[688] = "I2P+ Service now disabled on system start";
    t[689] = "\u0421\u043b\u0443\u0436\u0431\u0430 I2P \u0442\u0435\u043f\u0435\u0440 \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u0430 \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0441\u0438\u0441\u0442\u0435\u043c\u0438";
    t[690] = "Configure Bandwidth";
    t[691] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0443 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c";
    t[692] = "Updating IPv6 setting";
    t[693] = "\u041e\u043d\u043e\u0432\u043b\u044e\u044e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f IPv6";
    t[700] = "Acquired {0} router infos from reseed hosts";
    t[701] = "\u041e\u0442\u0440\u0438\u043c\u0430\u043d\u043e \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043f\u0440\u043e {0} \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0432\u0456\u0434 \u0445\u043e\u0441\u0442\u0456\u0432 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u0437\u0430\u043f\u043e\u0432\u043d\u0435\u043d\u043d\u044f";
    t[706] = "Setup Wizard";
    t[707] = "\u041c\u0430\u0439\u0441\u0442\u0435\u0440";
    t[708] = "Router Console Theme";
    t[709] = "\u0422\u0435\u043c\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[710] = "caps";
    t[711] = "\u043c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u0456";
    t[714] = "Backup quantity";
    t[715] = "\u0420\u0435\u0437\u0435\u0440\u0432\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c";
    t[720] = "Textual router performance statistics";
    t[721] = "\u0421\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0430 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0456 \u0442\u0435\u043a\u0441\u0442\u043e\u0432\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[722] = "Javadocs";
    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "\u0415\u0435\u043f\u0441\u0430\u0439\u0442 - \u0446\u0435 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442, \u044f\u043a\u0438\u0439 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u043e \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u0438\u0439 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P - \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0434\u043e \u043d\u044c\u043e\u0433\u043e \u0434\u043e\u0441\u0442\u0443\u043f, \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0432\u0448\u0438 \u0432\u0435\u0431-\u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f HTTP-\u043f\u0440\u043e\u043a\u0441\u0456 I2P (\u0434\u0438\u0432. \u0432\u0438\u0449\u0435) \u0456 \u043f\u0435\u0440\u0435\u0439\u0448\u043e\u0432\u0448\u0438 \u043d\u0430 \u0441\u0430\u0439\u0442 \u0456\u0437 \u0441\u0443\u0444\u0456\u043a\u0441\u043e\u043c <code>.i2p</code> (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). \u0422\u0430\u043a\u043e\u0436 \u0432\u043f\u0435\u0432\u043d\u0456\u0442\u044c\u0441\u044f, \u0449\u043e \u0432\u0430\u0448 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u0440\u043e\u0437\u0432'\u044f\u0437\u0443\u0432\u0430\u043d\u043d\u044f DNS \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u043e \u043f\u0440\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u0456 \u043f\u0440\u043e\u043a\u0441\u0456 \u0434\u043b\u044f \u0443\u043d\u0438\u043a\u043d\u0435\u043d\u043d\u044f \u0432\u0438\u0442\u043e\u043a\u0456\u0432 DNS.";
    t[730] = "Updating UDP port to {0}";
    t[731] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f UDP-\u043f\u043e\u0440\u0442\u0430 \u043d\u0430 {0}";
    t[732] = "Apache Web Server Security Guide";
    t[733] = "\u041f\u043e\u0441\u0456\u0431\u043d\u0438\u043a \u0437 \u0431\u0435\u0437\u043f\u0435\u043a\u0438 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 Apache";
    t[736] = "Locate the configuration file: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> in the <code>clients.config.d</code> folder in your I2P settings directory, and then edit accordingly:";
    t[737] = "\u0417\u043d\u0430\u0439\u0434\u0456\u0442\u044c \u0444\u0430\u0439\u043b \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> \u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0437\u0456 <code>clients.config.d</code> \u0432 \u0440\u043e\u0431\u043e\u0447\u043e\u043c\u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0437\u0456 I2P, \u0442\u0430 \u0432\u0456\u0434\u0440\u0435\u0434\u0430\u0433\u0443\u0439\u0442\u0435 \u0439\u043e\u0433\u043e \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u043e:";
    t[738] = "Webmail client";
    t[739] = "\u041a\u043b\u0456\u0454\u043d\u0442 \u0432\u0435\u0431-\u043f\u043e\u0448\u0442\u0438";
    t[756] = "Lookup Password";
    t[757] = "\u041f\u043e\u0448\u0443\u043a \u043f\u0430\u0440\u043e\u043b\u044f";
    t[762] = "Rekeying after graceful shutdown";
    t[763] = "\u041f\u043e\u0432\u0442\u043e\u0440\u043d\u0435 \u0432\u0432\u0435\u0434\u0435\u043d\u043d\u044f \u043a\u043b\u044e\u0447\u0430 \u043f\u0456\u0441\u043b\u044f \u043f\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u044f \u0440\u043e\u0431\u043e\u0442\u0438";
    t[770] = "WorldAtlas";
    t[771] = "\u0410\u0442\u043b\u0430\u0441 \u0441\u0432\u0456\u0442\u0443";
    t[772] = "If you can't, I2P supports UPnP (Universal Plug and Play) and UDP hole punching with \"SSU introductions\" to relay traffic.";
    t[773] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u043d\u0435 \u043c\u043e\u0436\u0435\u0442\u0435, I2P \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0454 UPnP (Universal Plug and Play) \u0456 UDP-\u043f\u0435\u0440\u0444\u043e\u0440\u0430\u0446\u0456\u044e \u0437 \"\u0432\u0432\u0435\u0434\u0435\u043d\u043d\u044f\u043c\u0438 SSU\" \u0434\u043b\u044f \u0440\u0435\u0442\u0440\u0430\u043d\u0441\u043b\u044f\u0446\u0456\u0457 \u0442\u0440\u0430\u0444\u0456\u043a\u0443.";
    t[774] = "Set theme universally across all apps";
    t[775] = "\u0423\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u043d\u0443 \u0442\u0435\u043c\u0443 \u0434\u043b\u044f \u0432\u0441\u0456\u0445 \u043f\u0440\u043e\u0433\u0440\u0430\u043c";
    t[776] = "The maximum data transfer values indicate the theoretical maximum, and in practice will normally be much lower.";
    t[777] = "\u041c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0456 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0456 \u0434\u0430\u043d\u0438\u0445 \u0432\u043a\u0430\u0437\u0443\u044e\u0442\u044c \u043d\u0430 \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u043d\u0438\u0439 \u043c\u0430\u043a\u0441\u0438\u043c\u0443\u043c, \u0456 \u043d\u0430 \u043f\u0440\u0430\u043a\u0442\u0438\u0446\u0456, \u044f\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u0431\u0443\u0434\u0443\u0442\u044c \u043d\u0430\u0431\u0430\u0433\u0430\u0442\u043e \u043d\u0438\u0436\u0447\u0438\u043c\u0438.";
    t[778] = "WARN - Firewalled with UDP Disabled";
    t[779] = "\u041f\u041e\u041f\u0415\u0420\u0415\u0414\u0416\u0415\u041d\u041d\u042f - \u0417\u0430 \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u043e\u043c \u0437 \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u0438\u043c UDP";
    t[780] = "Select Stats for Graphing";
    t[781] = "\u0412\u0438\u0431\u0435\u0440\u0456\u0442\u044c \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0443 \u0434\u043b\u044f \u0433\u0440\u0430\u0444\u0456\u043a\u0456\u0432";
    t[784] = "Debugging";
    t[785] = "\u041d\u0430\u043b\u0430\u0433\u043e\u0434\u0436\u0435\u043d\u043d\u044f";
    t[786] = "Hard restart requested";
    t[787] = "\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0439 \u0436\u043e\u0440\u0441\u0442\u043a\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a";
    t[792] = "To assist in debugging I2P, it may be helpful to generate a thread dump which will be written to the {0}wrapper log{1}.";
    t[793] = "\u0429\u043e\u0431 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0442\u0438 \u0443 \u043d\u0430\u043b\u0430\u0433\u043e\u0434\u0436\u0435\u043d\u043d\u0456 I2P, \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u043a\u043e\u0440\u0438\u0441\u043d\u0438\u043c \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u0434\u0430\u043c\u043f \u043f\u043e\u0442\u043e\u043a\u0443, \u044f\u043a\u0438\u0439 \u0431\u0443\u0434\u0435 \u0437\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u0443 {0}\u0436\u0443\u0440\u043d\u0430\u043b \u043e\u0431\u043e\u043b\u043e\u043d\u043a\u0438{1}.";
    t[798] = "Be Patient!";
    t[799] = "\u0411\u0443\u0434\u044c\u0442\u0435 \u0442\u0435\u0440\u043f\u043b\u044f\u0447\u0456!";
    t[800] = "Our info";
    t[801] = "\u041d\u0430\u0448\u0430 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f";
    t[810] = "Internationally renowned security technologist";
    t[811] = "\u0412\u0441\u0435\u0441\u0432\u0456\u0442\u043d\u044c\u043e \u0432\u0456\u0434\u043e\u043c\u0438\u0439 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433 \u0431\u0435\u0437\u043f\u0435\u043a\u0438";
    t[828] = "Recorders";
    t[829] = "\u0417\u0430\u043f\u0438\u0441\u0443\u0432\u0430\u0447\u0456";
    t[830] = "Garlic Routing";
    t[831] = "\u0427\u0430\u0441\u043d\u0438\u043a\u043e\u0432\u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u044f";
    t[832] = "Run analysis on all routers in NetDb";
    t[833] = "\u0417\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u0430\u043d\u0430\u043b\u0456\u0437 \u043d\u0430 \u0432\u0441\u0456\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u0445 \u0443 NetDb";
    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "\u041f\u0435\u0440\u0448\u0435 \u0447\u0438\u0441\u043b\u043e - \u0446\u0435 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0440\u0456\u0432, \u0437 \u044f\u043a\u0438\u043c\u0438 \u0432\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043d\u0430\u0434\u0456\u0441\u043b\u0430\u0432 \u0430\u0431\u043e \u043e\u0442\u0440\u0438\u043c\u0430\u0432 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f \u0437\u0430 \u043e\u0441\u0442\u0430\u043d\u043d\u0456 \u043a\u0456\u043b\u044c\u043a\u0430 \u0445\u0432\u0438\u043b\u0438\u043d. \u0426\u0435 \u043c\u043e\u0436\u0435 \u043a\u043e\u043b\u0438\u0432\u0430\u0442\u0438\u0441\u044f \u0432\u0456\u0434 8-10 \u0434\u043e \u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0441\u043e\u0442\u0435\u043d\u044c, \u0432 \u0437\u0430\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0456 \u0432\u0456\u0434 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u043e\u0457 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456, \u0441\u043f\u0456\u043b\u044c\u043d\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u043d\u043e\u0457 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0442\u0430 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0440\u0430\u0444\u0456\u043a\u0443. \u0414\u0440\u0443\u0433\u0435 \u0447\u0438\u0441\u043b\u043e - \u0446\u0435 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0440\u0456\u0432, \u043f\u043e\u043c\u0456\u0447\u0435\u043d\u0438\u0445 \u0437\u0430 \u043e\u0441\u0442\u0430\u043d\u043d\u044e \u0433\u043e\u0434\u0438\u043d\u0443 \u0430\u0431\u043e \u043e\u043a\u043e\u043b\u043e \u0442\u043e\u0433\u043e. \u041d\u0435 \u0445\u0432\u0438\u043b\u044e\u0439\u0442\u0435\u0441\u044f, \u044f\u043a\u0449\u043e \u0446\u0456 \u0447\u0438\u0441\u043b\u0430 \u0437\u043d\u0430\u0447\u043d\u043e \u043a\u043e\u043b\u0438\u0432\u0430\u044e\u0442\u044c\u0441\u044f. <a href='/configstats#router.activePeers'>[\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0433\u0440\u0430\u0444\u0456\u043a\u0443]</a>.";
    t[838] = "This file should be used only for a very limited number of friends (less than 3).";
    t[839] = "\u0426\u0435\u0439 \u0444\u0430\u0439\u043b \u0441\u043b\u0456\u0434 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043b\u0438\u0448\u0435 \u0434\u043b\u044f \u0434\u0443\u0436\u0435 \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u043e\u0457 \u043a\u0456\u043b\u044c\u043a\u043e\u0441\u0442\u0456 \u0434\u0440\u0443\u0437\u0456\u0432 (\u043c\u0435\u043d\u0448\u0435 \u043d\u0456\u0436 3).";
    t[846] = "I2P Web Server";
    t[847] = "\u0412\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 I2P";
    t[850] = "Fetch news using I2P http proxy";
    t[851] = "\u041e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u043d\u043e\u0432\u0438\u043d\u0438 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e I2P http-\u043f\u0440\u043e\u043a\u0441\u0456";
    t[856] = "{0} for {1}";
    t[857] = "{0} \u0434\u043b\u044f {1}";
