    t[859] = "\u0412\u0438\u0445\u0456\u0434\u043d\u0430 \u043f\u043e\u0448\u0442\u0430 \u0434\u043b\u044f smtp.postman.i2p";
    t[864] = "Unreachable on any transport";
    t[865] = "\u041d\u0435\u0434\u043e\u0441\u044f\u0436\u043d\u0438\u0439 \u0447\u0435\u0440\u0435\u0437 \u0436\u043e\u0434\u043d\u0438\u0439 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u043d\u0438\u0439 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b";
    t[868] = "bits per second";
    t[869] = "\u0431\u0456\u0442 \u0437\u0430 \u0441\u0435\u043a\u0443\u043d\u0434\u0443";
    t[872] = "Down";
    t[873] = "\u0412\u043d\u0438\u0437";
    t[878] = "This setting permits disabling SSU tests to determine if your router is firewalled and can be enabled for routers that are definitely not firewalled but are experiencing intermittent firewalling issues. In the event that testing is disabled, both SSU and NTCP should report your current public ip address on <a href=/info>the router info page</a>. [Restart required]";
    t[879] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438 \u0442\u0435\u0441\u0442\u0438 SSU \u0434\u043b\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0442\u043e\u0433\u043e, \u0447\u0438 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u0432\u0430\u0448 \u0440\u043e\u0443\u0442\u0435\u0440 \u0437\u0430 \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u043e\u043c, \u0456 \u0439\u043e\u0433\u043e \u043c\u043e\u0436\u043d\u0430 \u0430\u043a\u0442\u0438\u0432\u0443\u0432\u0430\u0442\u0438 \u0434\u043b\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432, \u044f\u043a\u0456 \u043d\u0430\u043f\u0435\u0432\u043d\u043e \u043d\u0435 \u043f\u0456\u0434\u0434\u0430\u044e\u0442\u044c\u0441\u044f \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u0443, \u0430\u043b\u0435 \u043c\u0430\u044e\u0442\u044c \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0438 \u0437 \u0442\u0438\u043c\u0447\u0430\u0441\u043e\u0432\u0438\u043c \u0431\u043b\u043e\u043a\u0443\u0432\u0430\u043d\u043d\u044f\u043c. \u0423 \u0440\u0430\u0437\u0456 \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0442\u0435\u0441\u0442\u0443\u0432\u0430\u043d\u043d\u044f, \u044f\u043a SSU, \u0442\u0430\u043a \u0456 NTCP \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0442\u0438 \u0432\u0430\u0448\u0443 \u043f\u043e\u0442\u043e\u0447\u043d\u0443 \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u0443 IP-\u0430\u0434\u0440\u0435\u0441\u0443 \u043d\u0430 <a href=/info>\u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u043f\u0440\u043e \u0440\u043e\u0443\u0442\u0435\u0440</a>. [\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a]";
    t[882] = "Joining the I2P Network using a reseed file";
    t[883] = "\u041f\u0440\u0438\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 I2P \u0437 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\u043c \u0444\u0430\u0439\u043b\u0443 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f";
    t[900] = "New plugin version {0} is available";
    t[901] = "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u0430 \u043d\u043e\u0432\u0430 \u0432\u0435\u0440\u0441\u0456\u044f \u043f\u043b\u0430\u0433\u0456\u043d\u0430 {0}";
