    t[903] = "\u0406\u043d\u0442\u0435\u0440\u0432\u0430\u043b \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f (\u0441\u0435\u043a\u0443\u043d\u0434\u0438)";
