    t[920] = "Downloaded plugin is for new installs only, but the plugin is already installed";
    t[921] = "\u0417\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u0438\u0439 \u043f\u043b\u0430\u0433\u0456\u043d \u0440\u043e\u0437\u0440\u0430\u0445\u043e\u0432\u0430\u043d\u0438\u0439 \u043b\u0438\u0448\u0435 \u043d\u0430 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f, \u0430\u043b\u0435 \u0432\u0456\u043d \u0432\u0436\u0435 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0439";
