    t[940] = "IRC Logs for multiple networks";
    t[941] = "\u0416\u0443\u0440\u043d\u0430\u043b\u0438 IRC \u0434\u043b\u044f \u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u043c\u0435\u0440\u0435\u0436";
