    t[976] = "Externally reachable hostname or IP address";
    t[977] = "\u0417\u043e\u0432\u043d\u0456 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0435 \u0456\u043c'\u044f \u0445\u043e\u0441\u0442\u0430 \u0430\u0431\u043e IP -\u0430\u0434\u0440\u0435\u0441\u0430";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "\u0412\u0430\u0448 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 \u043f\u0440\u0430\u0446\u044e\u0454 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0437\u0430 \u0430\u0434\u0440\u0435\u0441\u043e\u044e <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, \u0430\u043b\u0435 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u0434\u043b\u044f \u0456\u043d\u0448\u0438\u0445 \u0434\u043e \u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u0442\u0443\u043d\u0435\u043b\u044e <i>I2P Webserver</i>. \u041f\u0456\u0441\u043b\u044f \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0442\u0443\u043d\u0435\u043b\u044e \u0432\u0430\u0448 \u0441\u0430\u0439\u0442 \u0431\u0443\u0434\u0435 \u0434\u0443\u0436\u0435 \u0432\u0430\u0436\u043a\u043e \u0437\u043d\u0430\u0439\u0442\u0438 \u0456\u043d\u0448\u0438\u043c. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u0438\u0442\u0438 \u043b\u044e\u0434\u044f\u043c \u0430\u0434\u0440\u0435\u0441\u0443 \u0430\u0431\u043e \u0431\u0430\u0437\u043e\u0432\u0443 32-\u0440\u043e\u0437\u0440\u044f\u0434\u043d\u0443 \u0430\u0434\u0440\u0435\u0441\u0443, \u0430\u043b\u0435 \u043d\u0430 \u0449\u0430\u0441\u0442\u044f \u0432 I2P \u0454 \u043a\u043d\u0438\u0433\u0430 \u0430\u0434\u0440\u0435\u0441, \u0434\u0435 \u043c\u043e\u0436\u043d\u0430 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0442\u0438 \u0456\u043c\u0435\u043d\u0430 \u0434\u043e\u043c\u0435\u043d\u0456\u0432, \u0456 \u0440\u0456\u0437\u043d\u0456 \u0441\u0435\u0440\u0432\u0456\u0441\u0438, \u0434\u0435 \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 <a href=/help/hostnameregistration>\u0437\u0430\u0440\u0435\u0454\u0441\u0442\u0440\u0443\u0432\u0430\u0442\u0438 \u043d\u043e\u0432\u0438\u0439 \u0434\u043e\u043c\u0435\u043d .i2p</a> \u0431\u0435\u0437\u043a\u043e\u0448\u0442\u043e\u0432\u043d\u043e.";
    t[984] = "Major Sybil Warning - above router is closer than average minimum distance";
