    t[1001] = "\u041f\u043e\u043b\u0456\u0442\u0438\u043a\u0430 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f I2P";
    t[1002] = "When set to false, the router will not throttle tunnel build requests from other routers, and should be used with caution. [Default is true, restart required]";
    t[1003] = "\u042f\u043a\u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u043d\u0430 \u0445\u0438\u0431\u043d\u0443, \u0440\u043e\u0443\u0442\u0435\u0440 \u043d\u0435 \u0431\u0443\u0434\u0435 \u043e\u0431\u043c\u0435\u0436\u0443\u0432\u0430\u0442\u0438 \u0437\u0430\u043f\u0438\u0442\u0438 \u043d\u0430 \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0443 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0432\u0456\u0434 \u0456\u043d\u0448\u0438\u0445 \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432 \u0456 \u0441\u043b\u0456\u0434 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0437 \u043e\u0431\u0435\u0440\u0435\u0436\u043d\u0456\u0441\u0442\u044e. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c - \u0456\u0441\u0442\u0438\u043d\u0430, \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438]";
    t[1004] = "Disable UPnP IP address detection";
    t[1005] = "\u0412\u0438\u043c\u043a\u043d\u0443\u0442\u0438 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f IP-\u0430\u0434\u0440\u0435\u0441\u0438 UPnP";
    t[1008] = "However, a restart is always required after this error.";
    t[1009] = "\u041f\u0440\u043e\u0442\u0435 \u043f\u0456\u0441\u043b\u044f \u0446\u0456\u0454\u0457 \u043f\u043e\u043c\u0438\u043b\u043a\u0438 \u0437\u0430\u0432\u0436\u0434\u0438 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438.";
    t[1010] = "There is a fundamental tradeoff between anonymity and performance.";
