    t[1014] = "Securely send the i2preseed.zip file to your friend";
    t[1015] = "\u0411\u0435\u0437\u043f\u0435\u0447\u043d\u043e \u043d\u0430\u0434\u0456\u0448\u043b\u0456\u0442\u044c \u0444\u0430\u0439\u043b i2preseed.zip \u0441\u0432\u043e\u0454\u043c\u0443 \u0434\u0440\u0443\u0433\u0443";
