    t[1100] = "A higher level socket API for clients. Can be enabled/disabled on the <a href=/configclients>Client Configuration page</a>. Can be changed in the <code>bob.config</code> file. [Disabled by default]";
    t[1101] = "\u0412\u0438\u0449\u0438\u0439 \u0440\u0456\u0432\u0435\u043d\u044c API \u0441\u043e\u043a\u0435\u0442\u0456\u0432 \u0434\u043b\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432. \u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e/\u0432\u0438\u043c\u043a\u043d\u0435\u043d\u043e \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href=/configclients>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432</a>. \u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0437\u043c\u0456\u043d\u0435\u043d\u0438\u0439 \u0443 \u0444\u0430\u0439\u043b\u0456 <code>bob.config</code>. [\u0412\u0438\u043c\u043a\u043d\u0435\u043d\u043e \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c]";
