    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "\u0426\u0435 \u043d\u0435\u043c\u043e\u0436\u043b\u0438\u0432\u043e, \u0437\u0430 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u043c BitTorrent (\u0434\u0438\u0432. \u043d\u0438\u0436\u0447\u0435), \u044f\u043a\u0449\u043e \u0434\u043b\u044f \u0441\u043b\u0443\u0436\u0431\u0438, \u0434\u043e \u044f\u043a\u043e\u0457 \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438\u0441\u044f, \u043d\u0435 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0432\u0438\u0445\u0456\u0434\u043d\u0438\u0439 \u043f\u0440\u043e\u043a\u0441\u0456. \u0417\u0430\u0440\u0430\u0437 \u043f\u0440\u0430\u0446\u044e\u0454 \u043b\u0438\u0448\u0435 \u0442\u0440\u0438 \u0442\u0438\u043f\u0438 \u0432\u0438\u0445\u0456\u0434\u043d\u0438\u0445 \u043f\u0440\u043e\u043a\u0441\u0456: HTTP, HTTPS \u0456 \u0435\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0430 \u043f\u043e\u0448\u0442\u0430. \u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u043d\u0430\u0440\u0430\u0437\u0456 \u043d\u0435\u043c\u0430\u0454 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u043e\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0433\u043e SOCKS outproxy. \u042f\u043a\u0449\u043e \u0446\u0435\u0439 \u0442\u0438\u043f \u0441\u043b\u0443\u0436\u0431\u0438 \u043f\u043e\u0442\u0440\u0456\u0431\u0435\u043d, \u0441\u043f\u0440\u043e\u0431\u0443\u0439\u0442\u0435 <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1176] = "Destination requires encryption key";
