    t[1179] = "\u0422\u0438\u043f\u043e\u0432\u0438\u0439 \u043f\u043e\u0440\u0456\u0433";
    t[1186] = "Do not reveal your port numbers to anyone, as they can be used to discover your IP address.";
    t[1187] = "\u041d\u0456\u043a\u043e\u043c\u0443 \u043d\u0435 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u044f\u0439\u0442\u0435 \u0441\u0432\u043e\u0457 \u043d\u043e\u043c\u0435\u0440\u0438 \u043f\u043e\u0440\u0442\u0456\u0432, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0432\u043e\u043d\u0438 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u0456 \u0434\u043b\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0432\u0430\u0448\u043e\u0457 IP-\u0430\u0434\u0440\u0435\u0441\u0438.";
    t[1188] = "Router Hash";
