    t[1197] = "\u041e\u043f\u0443\u0431\u043b\u0456\u043a\u043e\u0432\u0430\u043d\u043e";
    t[1202] = "Upload Speed";
    t[1203] = "\u0428\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u0432\u0438\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f";
    t[1206] = "config service";
    t[1207] = "\u0441\u043b\u0443\u0436\u0431\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457";
    t[1208] = "Watching Big Tech...";
    t[1209] = "\u041f\u0435\u0440\u0435\u0433\u043b\u044f\u0434 Big Tech...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "\u0417\u0441\u0443\u0432 (\u0437\u043c\u0456\u0449\u0435\u043d\u043d\u044f) \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u0430 \u0432\u0430\u0448\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u2019\u044e\u0442\u0435\u0440\u0430 \u0432\u0456\u0434\u043d\u043e\u0441\u043d\u043e \u0441\u0438\u043d\u0445\u0440\u043e\u043d\u0456\u0437\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0437 \u043c\u0435\u0440\u0435\u0436\u0435\u044e \u0447\u0430\u0441\u0443 (\u044f\u043a\u0449\u043e \u0432\u0456\u0434\u043e\u043c\u043e). I2P \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u0442\u043e\u0447\u043d\u043e\u0433\u043e \u0447\u0430\u0441\u0443 \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440\u0456. \u042f\u043a\u0449\u043e \u0437\u0441\u0443\u0432 \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0454 \u043a\u0456\u043b\u044c\u043a\u0430 \u0441\u0435\u043a\u0443\u043d\u0434, \u0431\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0432\u0438\u043f\u0440\u0430\u0432\u0442\u0435 \u0446\u044e \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0443 \u0448\u043b\u044f\u0445\u043e\u043c \u043a\u043e\u0440\u0438\u0433\u0443\u0432\u0430\u043d\u043d\u044f \u0447\u0430\u0441\u0443 \u043d\u0430 \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440\u0456. \u042f\u043a\u0449\u043e I2P \u043d\u0435 \u043c\u043e\u0436\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438\u0441\u044f \u0434\u043e \u0406\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0443, \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u043e 0 \u043c\u0441. \u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u0446\u0435 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454\u0442\u044c\u0441\u044f \u043b\u0438\u0448\u0435 \u0432 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 <i>\u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 (\u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0430)</i>. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0434\u043e\u0434\u0430\u0442\u0438 \u0446\u0435\u0439 \u0440\u043e\u0437\u0434\u0456\u043b \u0434\u043e \u0441\u0432\u043e\u0454\u0457 \u0431\u0456\u0447\u043d\u043e\u0457 \u043f\u0430\u043d\u0435\u043b\u0456 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/configsidebar'>\u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0431\u0456\u0447\u043d\u043e\u0457 \u043f\u0430\u043d\u0435\u043b\u0456</a>.";
    t[1224] = "Sort by inbound rate";
    t[1225] = "\u0421\u043e\u0440\u0442\u0443\u0432\u0430\u0442\u0438 \u0437\u0430 \u0448\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044e \u043d\u0430 \u0432\u0445\u043e\u0434\u0456";
    t[1236] = "Can I download torrents from non-I2P trackers?";
    t[1237] = "\u0427\u0438 \u043c\u043e\u0436\u0443 \u044f \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0443\u0432\u0430\u0442\u0438 \u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0438 \u0437 \u0442\u0440\u0435\u043a\u0435\u0440\u0456\u0432, \u044f\u043a\u0456 \u043d\u0435 \u0454 I2P?";
    t[1250] = "No update URL specified for {0}";
    t[1251] = "\u041d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u043e URL \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0434\u043b\u044f {0}";
    t[1252] = "Under <i>Select zip or su3 file</i> click <i>Browse&hellip;</i>";
    t[1253] = "\u0423 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 <i>\u041e\u0431\u0435\u0440\u0456\u0442\u044c zip \u0430\u0431\u043e su3 \u0444\u0430\u0439\u043b</i> \u043d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u043a\u043d\u043e\u043f\u043a\u0443 <i>\u041e\u0433\u043b\u044f\u0434&hellip;</i>";
    t[1262] = "Filter Router log output";
    t[1263] = "\u0424\u0456\u043b\u044c\u0442\u0440\u0443\u0432\u0430\u0442\u0438 \u0432\u0438\u0432\u0456\u0434 \u0436\u0443\u0440\u043d\u0430\u043b\u0443 \u0440\u043e\u0443\u0442\u0435\u0440\u0430";
    t[1268] = "Anonymous webmail client";
    t[1269] = "\u0410\u043d\u043e\u043d\u0456\u043c\u043d\u0438\u0439 \u043f\u043e\u0448\u0442\u043e\u0432\u0438\u0439 \u043a\u043b\u0456\u0454\u043d\u0442";
    t[1272] = "To migrate the key to a new router, or to setup multihoming (running the same service on multiple routers for redundancy and load-balancing), copy the backed up key to your .i2p directory and specify it in the new server tunnel, or replace the default key in the plugin folder (e.g. the zzzot plugin).";
    t[1273] = "\u0429\u043e\u0431 \u043f\u0435\u0440\u0435\u043d\u0435\u0441\u0442\u0438 \u043a\u043b\u044e\u0447 \u043d\u0430 \u043d\u043e\u0432\u0438\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0430\u0431\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043c\u0443\u043b\u044c\u0442\u0438-\u0430\u0434\u0440\u0435\u0441\u0430\u0446\u0456\u044e (\u0437\u0430\u043f\u0443\u0441\u043a \u0442\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0456\u0441\u0443 \u043d\u0430 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u0445 \u0434\u043b\u044f \u0440\u0435\u0437\u0435\u0440\u0432\u0443 \u0442\u0430 \u0440\u043e\u0437\u043f\u043e\u0434\u0456\u043b\u0443 \u043d\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f), \u0441\u043a\u043e\u043f\u0456\u044e\u0439\u0442\u0435 \u0440\u0435\u0437\u0435\u0440\u0432\u043d\u0443 \u043a\u043e\u043f\u0456\u044e \u043a\u043b\u044e\u0447\u0430 \u0434\u043e \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0443 .i2p \u0442\u0430 \u0432\u043a\u0430\u0436\u0456\u0442\u044c \u0439\u043e\u0433\u043e \u0432 \u043d\u043e\u0432\u043e\u043c\u0443 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u043e\u043c\u0443 \u0442\u0443\u043d\u0435\u043b\u0456, \u0430\u0431\u043e \u0437\u0430\u043c\u0456\u043d\u0456\u0442\u044c \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043a\u043b\u044e\u0447 \u0432 \u043f\u0430\u043f\u0446\u0456 \u043f\u043b\u0430\u0433\u0456\u043d\u0430 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u043f\u043b\u0430\u0433\u0456\u043d\u0430 zzzot).";
    t[1276] = "Configuration";
    t[1277] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f";
    t[1284] = "Enabled I2P+ service autostart at system startup";
    t[1285] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e \u0430\u0432\u0442\u043e\u0437\u0430\u043f\u0443\u0441\u043a \u0441\u043b\u0443\u0436\u0431\u0438 I2P \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0441\u0438\u0441\u0442\u0435\u043c\u0438";
    t[1294] = "No plugin URL specified.";
    t[1295] = "\u041d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u043e URL-\u0430\u0434\u0440\u0435\u0441\u0443 \u043f\u043b\u0456\u0433\u0456\u043d\u0430.";
    t[1296] = "Show the router's workload, and how it's performing";
    t[1297] = "\u041f\u043e\u043a\u0430\u0437\u0430\u0442\u0438 \u0440\u043e\u0431\u043e\u0447\u0435 \u043d\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0442\u0430 \u0439\u043e\u0433\u043e \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u0456\u0441\u0442\u044c";
    t[1298] = "This setting permits an expiry time to be configured (in seconds) for bans enforced via blocklists. By default bans persist for the duration of the router session. [Restart required]";
    t[1299] = "\u0426\u0435\u0439 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0447\u0430\u0441 \u043d\u0430 \u0442\u0435\u0440\u043c\u0456\u043d \u0434\u0456\u0457 (\u0437\u0430 \u043b\u0456\u0447\u0435\u043d\u0456 \u0441\u0435\u043a\u0443\u043d\u0434\u0438) \u0434\u043b\u044f \u0437\u0430\u0431\u043e\u0440\u043e\u043d, \u0437\u0434\u0456\u0439\u0441\u043d\u0435\u043d\u0438\u0445 \u0447\u0435\u0440\u0435\u0437 \u0441\u043f\u0438\u0441\u043e\u043a. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u0438 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0442\u0440\u0438\u0432\u0430\u043b\u043e\u0441\u0442\u0456 \u0441\u0435\u0430\u043d\u0441\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430. [\u041f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e]";
    t[1310] = "Total peers in NetDb";
