    t[1323] = "\u041f\u043e\u0432\u0435\u0440\u043d\u0443\u0442\u0438\u0441\u044f \u0434\u043e \u043f\u043e\u0447\u0430\u0442\u043a\u0443";
    t[1324] = "I2CP";
    t[1325] = "I2CP";
    t[1326] = "This mode enhances anonymity by preventing correlation between public IP address changes and your router identity. Both your router identity and UDP port will be changed.";
    t[1327] = "\u0426\u0435\u0439 \u0440\u0435\u0436\u0438\u043c \u043f\u0456\u0434\u0432\u0438\u0449\u0443\u0454 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c, \u0437\u0430\u043f\u043e\u0431\u0456\u0433\u0430\u044e\u0447\u0438 \u043a\u043e\u0440\u0435\u043b\u044f\u0446\u0456\u0457 \u043c\u0456\u0436 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u043e\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u043c\u0438 \u0437\u043c\u0456\u043d\u0430\u043c\u0438 IP -\u0430\u0434\u0440\u0435\u0441\u0438 \u0442\u0430 \u0432\u0430\u0448\u043e\u044e \u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430. \u0406 \u0432\u0430\u0448\u0430 \u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430, \u0456 \u043f\u043e\u0440\u0442 UDP \u0431\u0443\u0434\u0443\u0442\u044c \u0437\u043c\u0456\u043d\u0435\u043d\u0456.";
    t[1328] = "Plugin Installation";
    t[1329] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u043b\u0430\u0433\u0456\u043d\u0430";
