    t[1342] = "susidns";
    t[1343] = "susidns";
    t[1350] = "If I2P appears to be using too much ram, you can force the router to run the garbage collection routine to free up memory.";
    t[1351] = "\u042f\u043a\u0449\u043e \u0437\u0434\u0430\u0454\u0442\u044c\u0441\u044f, \u0449\u043e I2P \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454 \u0437\u0430\u0431\u0430\u0433\u0430\u0442\u043e \u043e\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0457 \u043f\u0430\u043c\u2019\u044f\u0442\u0456, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u043c\u0443\u0441\u0438\u0442\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u043f\u0440\u043e\u0446\u0435\u0434\u0443\u0440\u0443 \u0437\u0431\u0438\u0440\u0430\u043d\u043d\u044f \u0441\u043c\u0456\u0442\u0442\u044f, \u0449\u043e\u0431 \u0437\u0432\u0456\u043b\u044c\u043d\u0438\u0442\u0438 \u043f\u0430\u043c\u2019\u044f\u0442\u044c.";
