    t[1378] = "Eepsite";
    t[1379] = "Eepsite";
    t[1380] = "When set to true, if your router is serving as a floodfill for the network, your <a href=/configadvanced#ffconf>floodfill participation</a> will be hidden from other routers.";
    t[1381] = "\u041a\u043e\u043b\u0438 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e true, \u044f\u043a\u0449\u043e \u0432\u0430\u0448 \u0440\u043e\u0443\u0442\u0435\u0440 \u043f\u0440\u0430\u0446\u044e\u0454 \u044f\u043a \u0437\u0430\u043f\u043e\u0432\u043d\u044e\u0432\u0430\u0447 \u043f\u0430\u0432\u0443\u0442\u0438\u043d\u0430 \u0434\u043b\u044f \u043c\u0435\u0440\u0435\u0436\u0456, \u0432\u0430\u0448\u0430 <a href=/configadvanced#ffconf>\u0443\u0447\u0430\u0441\u0442\u044c \u0437\u0430\u043f\u043e\u0432\u043d\u044e\u0432\u0430\u0447\u0430 \u043f\u0430\u0432\u0443\u0442\u0438\u043d\u0438</a> \u0431\u0443\u0434\u0435 \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0430 \u0432\u0456\u0434 \u0456\u043d\u0448\u0438\u0445 \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432.";
    t[1382] = "Encryption Key";
    t[1383] = "\u041a\u043b\u044e\u0447 \u0448\u0438\u0444\u0440\u0443\u0432\u0430\u043d\u043d\u044f";
    t[1386] = "UPnP has not found any UPnP-aware, compatible device on your LAN.";
    t[1387] = "UPNP \u043d\u0435 \u0437\u043d\u0430\u0439\u0448\u043b\u0430 \u0436\u043e\u0434\u043d\u043e\u0433\u043e \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u044e, \u0449\u043e \u0437\u043d\u0430\u0445\u043e\u0434\u044f\u0442\u044c\u0441\u044f \u0443 UPNP, \u0441\u0443\u043c\u0456\u0441\u043d\u043e\u043c\u0443 \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u044e \u043d\u0430 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0456\u0439 \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[1404] = "This setting determines which <a href=/profiles#profile_defs>peer capabilities</a> will not be used to build your router's tunnels. e.g. <code>router.excludePeerCaps=LMN</code>";
    t[1405] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454, \u044f\u043a\u0456 <a href=/profiles#profile_defs>\u0437\u0434\u0456\u0431\u043d\u043e\u0441\u0442\u0456 \u043f\u0456\u0440\u0456\u0432</a> \u043d\u0435 \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u0434\u043b\u044f \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0438 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0432\u0430\u0448\u043e\u0433\u043e \u0440\u043e\u0443\u0442\u0435\u0440\u0430. \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, <code>router.excludePeerCaps=LMN</code>";
    t[1406] = "Add item";
    t[1407] = "\u0414\u043e\u0434\u0430\u0442\u0438 \u0435\u043b\u0435\u043c\u0435\u043d\u0442";
