    t[1443] = "\u0412\u0456\u0434\u0441\u0443\u0442\u043d\u0456 \u0442\u0440\u0430\u043d\u0437\u0438\u0442\u043d\u0456 \u0442\u0443\u043d\u0435\u043b\u0456";
    t[1452] = "NTCP / NTCP2";
    t[1453] = "NTCP / NTCP2";
    t[1454] = "Install Plugin from File";
    t[1455] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043f\u043b\u0430\u0433\u0456\u043d \u0437 \u0444\u0430\u0439\u043b\u0430";
    t[1462] = "How long an outbound message waits in the queue. This should generally be a few hundred milliseconds or less. If it is consistently higher than 1000ms, your computer is very slow, or you should adjust your bandwidth limits, or your (BitTorrent?) clients may be sending too much data and should have their transmit bandwidth limit reduced. <a href='/configstats#transport.sendProcessingTime'>[Enable graphing]</a> (transport.sendProcessingTime).";
    t[1463] = "\u042f\u043a\u0438\u0439 \u0447\u0430\u0441 \u0432\u0438\u0445\u0456\u0434\u043d\u0435 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f \u0447\u0435\u043a\u0430\u0454 \u0432 \u0447\u0435\u0440\u0437\u0456. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0446\u0435 \u043a\u0456\u043b\u044c\u043a\u0430 \u0441\u043e\u0442\u0435\u043d\u044c \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434 \u0430\u0431\u043e \u043c\u0435\u043d\u0448\u0435. \u042f\u043a\u0449\u043e \u0432\u043e\u043d\u043e \u043f\u043e\u0441\u0442\u0456\u0439\u043d\u043e \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0454 1000 \u043c\u0441, \u0432\u0430\u0448 \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440 \u0437\u0430\u043d\u0430\u0434\u0442\u043e \u043f\u043e\u0432\u0456\u043b\u044c\u043d\u0438\u0439, \u0430\u0431\u043e \u0441\u043b\u0456\u0434 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043b\u0456\u043c\u0456\u0442\u0438 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456, \u0430\u0431\u043e \u0431\u0456\u0442\u043e\u0440\u0435\u043d\u0442\u043d\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0438 \u043c\u043e\u0436\u0443\u0442\u044c \u043d\u0430\u0434\u0441\u0438\u043b\u0430\u0442\u0438 \u0437\u0430\u043d\u0430\u0434\u0442\u043e \u0431\u0430\u0433\u0430\u0442\u043e \u0434\u0430\u043d\u0438\u0445 \u0456 \u0457\u0445\u043d\u0456\u0439 \u043b\u0456\u043c\u0456\u0442 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0456 \u043c\u0430\u0454 \u0431\u0443\u0442\u0438 \u0437\u043d\u0438\u0436\u0435\u043d\u0438\u0439. <a href='/configstats#transport.sendProcessingTime'>[\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0433\u0440\u0430\u0444\u0456\u043a\u0443]</a> (transport.sendProcessingTime).";
    t[1464] = "Cannot be changed. Binds to all interfaces. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[1465] = "\u041d\u0435 \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0437\u043c\u0456\u043d\u0435\u043d\u0438\u0439. \u041f\u0440\u0438\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043e \u0432\u0441\u0456\u0445 \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0456\u0432. \u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u0438\u0439 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href=/confignet>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0435\u0440\u0435\u0436\u0456</a>.";
    t[1466] = "Round trip time for a tunnel test";
