    t[1571] = "\u0424\u0430\u043a\u0442\u0438\u0447\u043d\u0456 \u0442\u0443\u043d\u0435\u043b\u0456 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u0456 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/tunnels'>\u0422\u0443\u043d\u0435\u043b\u0456\u0432</a>.";
    t[1574] = "The core I2P software, which routes encrypted packets on the I2P network. All routers by default participate in the network except routers running in countries considered hostile (see <i>Strict Countries</i>), which both helps the network and provides cover traffic for any clients or servers connecting to the I2P network through the router.";
    t[1575] = "\u041e\u0441\u043d\u043e\u0432\u043d\u0435 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043d\u0435 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0435\u043d\u043d\u044f I2P, \u044f\u043a\u0435 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0443\u0454 \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0456 \u043f\u0430\u043a\u0435\u0442\u0438 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0443\u0447\u0430\u0441\u0442\u044c \u0443 \u043c\u0435\u0440\u0435\u0436\u0456 \u0431\u0435\u0440\u0443\u0442\u044c \u0432\u0441\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438, \u043a\u0440\u0456\u043c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432, \u0449\u043e \u043f\u0440\u0430\u0446\u044e\u044e\u0442\u044c \u0443 \u043a\u0440\u0430\u0457\u043d\u0430\u0445, \u0432\u0438\u0437\u043d\u0430\u043d\u0438\u0445 \u0432\u043e\u0440\u043e\u0436\u0438\u043c\u0438 (\u0434\u0438\u0432. <i>\u0421\u0443\u0432\u043e\u0440\u0456 \u043a\u0440\u0430\u0457\u043d\u0438</i>), \u0449\u043e \u0434\u043e\u043f\u043e\u043c\u0430\u0433\u0430\u0454 \u043c\u0435\u0440\u0435\u0436\u0456 \u0442\u0430 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0443\u0454 \u043c\u0430\u0441\u043a\u0443\u0432\u0430\u043b\u044c\u043d\u0438\u0439 \u0442\u0440\u0430\u0444\u0456\u043a \u0434\u043b\u044f \u0431\u0443\u0434\u044c-\u044f\u043a\u0438\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432 \u0447\u0438 \u0441\u0435\u0440\u0432\u0435\u0440\u0456\u0432, \u0449\u043e \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c\u0441\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 I2P \u0447\u0435\u0440\u0435\u0437 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440.";
