    t[1619] = "\u0426\u0435\u0439 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0432\u0440\u0443\u0447\u043d\u0443 \u0432\u0438\u0431\u043e\u0440\u0443 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430, \u044f\u043a\u0438\u0439 I2P \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u044c \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 (\u044f\u043a\u0449\u043e \u043a\u043e\u043d\u0441\u043e\u043b\u044c <a href=/configservice#browseronstart>\u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439</a> \u0434\u043b\u044f \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430 \u0432 \u0437\u0430\u043f\u0443\u0441\u043a\u0443), \u043f\u0435\u0440\u0435\u0432\u0430\u0436\u0430\u044e\u0447\u0438 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u041e\u0421. \u0414\u043b\u044f \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043d\u044f \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u043e\u0457 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u0434\u0438\u0432. <a href=#alternative_browser>\u0432\u0432\u0435\u0434\u0435\u043d\u043d\u044f FAQ</a> \u0432\u0438\u0449\u0435.";
