    t[1652] = "This setting, when enabled, introduces a random pong delay of up to 50ms for all ping-enabled servers hosted by the router. Default is disabled. [Restart required]";
    t[1653] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f, \u043a\u043e\u043b\u0438 \u0430\u043a\u0442\u0438\u0432\u043e\u0432\u0430\u043d\u0435, \u0432\u0432\u043e\u0434\u0438\u0442\u044c \u0432\u0438\u043f\u0430\u0434\u043a\u043e\u0432\u0443 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0443 \u0432\u0456\u0434\u0433\u0443\u043a\u0443 \u0434\u043e 50 \u043c\u0441 \u0434\u043b\u044f \u0432\u0441\u0456\u0445 \u0441\u0435\u0440\u0432\u0435\u0440\u0456\u0432, \u043d\u0430 \u044f\u043a\u0456 \u0434\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u0456 \u043f\u0456\u043d\u0433\u0438, \u0445\u043e\u0441\u0442\u0438\u043d\u0433 \u044f\u043a\u0438\u0445 \u0437\u0434\u0456\u0439\u0441\u043d\u044e\u0454 \u0440\u043e\u0443\u0442\u0435\u0440. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043e. [\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a]";
    t[1658] = "Certs";
    t[1659] = "\u0421\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442\u0438";
