    t[1661] = "\u0414\u043e\u0441\u043b\u0456\u0434\u043d\u0438\u0446\u044c\u043a\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f \u0442\u0443\u043d\u0435\u043b\u044e \u0443\u0441\u043f\u0456\u0448\u043d\u043e \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0430.";
    t[1664] = "Unsupported type";
    t[1665] = "\u0422\u0438\u043f \u043d\u0435 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0454\u0442\u044c\u0441\u044f";
    t[1666] = "Average tunnel build success %";
    t[1667] = "\u0421\u0435\u0440\u0435\u0434\u043d\u044f \u0443\u0441\u043f\u0456\u0448\u043d\u0456\u0441\u0442\u044c \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u0430 \u0442\u0443\u043d\u0435\u043b\u044e %";
    t[1668] = "('MM' = month, 'dd' = day, 'HH' = hour, 'mm' = minute, 'ss' = second, 'SSS' = millisecond)";
    t[1669] = "('MM' = \u043c\u0456\u0441\u044f\u0446\u044c, 'dd' = \u0434\u0435\u043d\u044c, 'HH' = \u0433\u043e\u0434\u0438\u043d\u0430, 'mm' = \u0445\u0432\u0438\u043b\u0438\u043d\u0430, 'ss' = \u0441\u0435\u043a\u0443\u043d\u0434\u0430, 'SSS' = \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434\u0430)";
    t[1670] = "Invalid address";
    t[1671] = "\u041d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0456 \u0430\u0434\u0440\u0435\u0441\u0438";
    t[1672] = "Tunnel";
    t[1673] = "\u0422\u0443\u043d\u0435\u043b\u044c";
    t[1676] = "and any that end up in that file will get throttled in the future";
    t[1677] = "\u0456 \u0431\u0443\u0434\u044c-\u044f\u043a\u0456 \u0434\u0430\u043d\u0456, \u044f\u043a\u0456 \u043f\u043e\u0442\u0440\u0430\u043f\u043b\u044f\u0442\u044c \u0443 \u0446\u0435\u0439 \u0444\u0430\u0439\u043b, \u0443 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u044c\u043e\u043c\u0443 \u0431\u0443\u0434\u0443\u0442\u044c \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u0456";
    t[1684] = "News &amp; Reviews";
    t[1685] = "\u041d\u043e\u0432\u0438\u043d\u0438 \u0442\u0430 \u043e\u0433\u043b\u044f\u0434\u0438";
    t[1686] = "This is the number of peers your router has available for building your exploratory tunnels which are used to determine network performance. It is generally in the range 8-75. The fast peers are included in the high capacity tier. Your high capacity peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.highCapacityPeers'>[Enable graphing]</a>";
    t[1687] = "\u0426\u0435 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0440\u0456\u0432, \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0445 \u0432\u0430\u0448\u043e\u043c\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0443 \u0434\u043b\u044f \u0444\u043e\u0440\u043c\u0443\u0432\u0430\u043d\u043d\u044f \u0440\u043e\u0437\u0432\u0456\u0434\u0443\u0432\u0430\u043b\u044c\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u044f\u043a\u0456 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0456 \u043c\u0435\u0440\u0435\u0436\u0456. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0446\u0435 8-75. \u0428\u0432\u0438\u0434\u043a\u0456 \u043f\u0456\u0440\u0438 \u0432\u0445\u043e\u0434\u044f\u0442\u044c \u0434\u043e \u0432\u0435\u0440\u0445\u043d\u044c\u043e\u0433\u043e \u0442\u0438\u0440\u0443 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456. \u0412\u0430\u0448\u0456 \u043f\u0456\u0440\u0438 \u0432\u0435\u0440\u0445\u043d\u044c\u043e\u0433\u043e \u0442\u0438\u0440\u0443 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u0456 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/profiles'>\u041f\u0440\u043e\u0444\u0456\u043b\u0456\u0432</a>. <a href='/configstats#router.highCapacityPeers'>[\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0433\u0440\u0430\u0444\u0456\u043a\u0443]</a>";
