    t[1795] = "\u0412\u0435\u0431-\u0434\u043e\u0434\u0430\u0442\u043e\u043a \u043d\u0435 \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043e";
    t[1796] = "If you are stuck behind an ISP firewall or filter, you can use the following manual method (non-automated technical solution) to join the I2P network.";
    t[1797] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0435\u0441\u044c \u0437\u0430 \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u043e\u043c \u0430\u0431\u043e \u0444\u0456\u043b\u044c\u0442\u0440\u043e\u043c \u0406\u043d\u0442\u0435\u0440\u043d\u0435\u0442-\u043f\u0440\u043e\u0432\u0430\u0439\u0434\u0435\u0440\u0430, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0442\u0430\u043a\u0438\u0439 \u0440\u0443\u0447\u043d\u0438\u0439 \u043c\u0435\u0442\u043e\u0434 (\u043d\u0435\u043c\u0430\u0454 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0437\u0430\u0446\u0456\u0457 \u0442\u0435\u0445\u043d\u0456\u0447\u043d\u043e\u0433\u043e \u0440\u0456\u0448\u0435\u043d\u043d\u044f), \u0449\u043e\u0431 \u043f\u0440\u0438\u0454\u0434\u043d\u0430\u0442\u0438\u0441\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 I2P:";
    t[1800] = "Configure tunnel options";
    t[1801] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u0442\u0443\u043d\u0435\u043b\u044e";
    t[1802] = "This setting (in seconds) allows you to manually configure the amount of time to wait before an attempt to refresh a router is determined to have failed. [The default is 20 seconds]";
    t[1803] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f (\u0432 \u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445) \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0432\u0440\u0443\u0447\u043d\u0443 \u0441\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0443\u0432\u0430\u0442\u0438 \u0447\u0430\u0441 \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e \u0432\u0438\u0437\u043d\u0430\u043d\u043d\u044f \u0441\u043f\u0440\u043e\u0431\u0438 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0430 \u043d\u0435\u0432\u0434\u0430\u043b\u043e\u044e. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 20 \u0441\u0435\u043a\u0443\u043d\u0434]";
    t[1804] = "Router is configured to reject all transit tunnel requests";
    t[1805] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0432\u0456\u0434\u0445\u0438\u043b\u0435\u043d\u043d\u044f \u0432\u0441\u0456\u0445 \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u043d\u0430 \u0442\u0443\u043d\u0435\u043b\u044c, \u0449\u043e \u0431\u0435\u0440\u0443\u0442\u044c \u0443\u0447\u0430\u0441\u0442\u044c";
