    t[1852] = "Inbound UDP to the <a href=/confignet#udpconfig>port</a> noted on the Network Configuration page from arbitrary locations (optional, but recommended).";
    t[1853] = "\u0412\u0445\u0456\u0434\u043d\u0435 UDP \u0434\u043e <a href=/confignet#udpconfig>\u043f\u043e\u0440\u0442\u0443</a>, \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u043e\u0433\u043e \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0435\u0440\u0435\u0436\u0456, \u0437 \u0434\u043e\u0432\u0456\u043b\u044c\u043d\u0438\u0445 \u043b\u043e\u043a\u0430\u0446\u0456\u0439 (\u043e\u043f\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e, \u0430\u043b\u0435 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u043e\u0432\u0430\u043d\u043e).";
    t[1860] = "Hidden mode is automatically enabled for added protection in certain countries.";
