    t[2135] = "\u041a\u043b\u044e\u0447\u043e\u0432\u0435 \u043a\u0456\u043b\u044c\u0446\u0435 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0440\u043e\u0437\u0448\u0438\u0444\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u0445 LeaseSets.";
    t[2146] = "Lifestyle magazine";
    t[2147] = "\u0416\u0443\u0440\u043d\u0430\u043b Lifestyle";
    t[2156] = "Saved order of sections.";
    t[2157] = "\u041f\u043e\u0440\u044f\u0434\u043e\u043a \u0441\u0435\u043a\u0446\u0456\u0439 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u043e.";
    t[2158] = "I'm missing lots of hosts in my addressbook. What are some good subscription links?";
    t[2159] = "\u0423 \u043c\u043e\u0457\u0439 \u0430\u0434\u0440\u0435\u0441\u043d\u0456\u0439 \u043a\u043d\u0438\u0437\u0456 \u0431\u0440\u0430\u043a\u0443\u0454 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u0445\u043e\u0441\u0442\u0456\u0432. \u042f\u043a\u0456 \u043a\u043e\u0440\u0438\u0441\u043d\u0456 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u0434\u043b\u044f \u043f\u0456\u0434\u043f\u0438\u0441\u043a\u0438?";
    t[2160] = "Application tunnels";
    t[2161] = "\u0422\u0443\u043d\u0435\u043b\u0456 \u0434\u043e\u0434\u0430\u0442\u043a\u0456\u0432";
    t[2170] = "Local Router";
    t[2171] = "\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0439 \u0440\u043e\u0443\u0442\u0435\u0440";
    t[2172] = "Bandwidth";
    t[2173] = "\u041f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0430 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c";
    t[2184] = "Help with reseeding";
    t[2185] = "\u0414\u043e\u043f\u043e\u043c\u043e\u0433\u0430 \u0437 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u0438\u043c \u043f\u043e\u0441\u0456\u0432\u043e\u043c";
    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "\u041d\u0430\u0441\u0442\u0443\u043f\u043d\u0435 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043f\u043e\u0440\u043e\u0433\u0443 <i class=example>180/60</i> \u043e\u0437\u043d\u0430\u0447\u0430\u0454, \u0449\u043e \u0442\u0430 \u0441\u0430\u043c\u0430 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0430 \u0446\u0456\u043b\u044c \u043c\u043e\u0436\u0435 \u0437\u0434\u0456\u0439\u0441\u043d\u0438\u0442\u0438 179 \u0441\u043f\u0440\u043e\u0431 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c 60-\u0441\u0435\u043a\u0443\u043d\u0434\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443. \u042f\u043a\u0449\u043e \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0442\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 \u0432\u043e\u043d\u0430 \u0437\u0434\u0456\u0439\u0441\u043d\u0438\u0442\u044c \u0449\u0435 \u043e\u0434\u043d\u0443 \u0441\u043f\u0440\u043e\u0431\u0443, \u0431\u0443\u0434\u0435 \u043f\u043e\u0440\u0443\u0448\u0435\u043d\u043e \u043f\u043e\u0440\u0456\u0433, \u0456 \u043f\u043e\u0434\u0430\u043b\u044c\u0448\u0456 \u0441\u043f\u0440\u043e\u0431\u0438 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0456\u0434\u0445\u0438\u043b\u044f\u0442\u0438\u0441\u044f \u0434\u043e \u043a\u0456\u043d\u0446\u044f \u043f\u0435\u0440\u0456\u043e\u0434\u0443:";
    t[2190] = "config home";
    t[2191] = "\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f \u0434\u043e\u0434\u043e\u043c\u0443";
    t[2192] = "Restore defaults";
    t[2193] = "\u0412\u0456\u0434\u043d\u043e\u0432\u0438\u0442\u0438 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f";
    t[2196] = "Abridged I2P FAQ";
    t[2197] = "\u0421\u043a\u043e\u0440\u043e\u0447\u0435\u043d\u0430 \u0432\u0435\u0440\u0441\u0456\u044f I2P FAQ";
    t[2206] = "Version";
    t[2207] = "\u0412\u0435\u0440\u0441\u0456\u044f";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P \u0432\u0438\u0431\u0438\u0440\u0430\u0454 \u0432\u0438\u043f\u0430\u0434\u043a\u043e\u0432\u0438\u0439 \u043f\u043e\u0440\u0442 \u043c\u0456\u0436 9000 \u0456 31000 \u0434\u043b\u044f \u043a\u043e\u043c\u0443\u043d\u0456\u043a\u0430\u0446\u0456\u0457 \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438 \u043f\u0440\u0438 \u043f\u0435\u0440\u0448\u043e\u043c\u0443 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0438 \u0430\u0431\u043e \u043a\u043e\u043b\u0438 \u0437\u043c\u0456\u043d\u044e\u0454\u0442\u044c\u0441\u044f \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u044f IP-\u0430\u0434\u0440\u0435\u0441\u0430 \u043f\u0440\u0438 \u0440\u043e\u0431\u043e\u0442\u0456 \u0432 \u0440\u0435\u0436\u0438\u043c\u0456 <a href=/confignet#ipchange>Laptop</a>. <a href=/confignet#udpconfig>\u041e\u0431\u0440\u0430\u043d\u0438\u0439 \u043f\u043e\u0440\u0442</a> \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href=/confignet>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0435\u0440\u0435\u0436\u0456</a>.";
    t[2212] = "Message send rate (B/s)";
    t[2213] = "\u0428\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u043d\u0430\u0434\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f (B/s)";
    t[2214] = "Update or check already in progress";
    t[2215] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0430\u0431\u043e \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0430 \u0432\u0436\u0435 \u0442\u0440\u0438\u0432\u0430\u0454";
    t[2218] = "Log date format";
    t[2219] = "\u0424\u043e\u0440\u043c\u0430\u0442 \u0434\u0430\u0442\u0438 \u0436\u0443\u0440\u043d\u0430\u043b\u0443";
    t[2226] = "Less than 256MB allocated to the JVM";
    t[2227] = "\u0414\u043b\u044f JVM \u0432\u0438\u0434\u0456\u043b\u0435\u043d\u043e \u043c\u0435\u043d\u0448\u0435 256 \u041c\u0411";
    t[2230] = "Average closest floodfill distance";
    t[2231] = "\u0421\u0435\u0440\u0435\u0434\u043d\u044f \u043d\u0430\u0439\u0431\u043b\u0438\u0436\u0447\u0430 \u0432\u0456\u0434\u0441\u0442\u0430\u043d\u044c \u0434\u043e \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d\u043d\u044f";
    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "\u0412\u0430\u0448\u043e\u043c\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0443 \u0437\u043d\u0430\u0434\u043e\u0431\u0438\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u043d\u0430\u0439\u043c\u043d\u0456 10 \u0445\u0432\u0438\u043b\u0438\u043d \u0432\u0456\u0434 \u043c\u043e\u043c\u0435\u043d\u0442\u0443 \u0437\u0430\u043f\u0443\u0441\u043a\u0443, \u0449\u043e\u0431 \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438 \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u043e \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0443\u0447\u0430\u0441\u0442\u0456, \u0430\u0431\u0438 \u0433\u0430\u0440\u0430\u043d\u0442\u0443\u0432\u0430\u0442\u0438 \u0439\u043e\u0433\u043e \u0441\u0442\u0430\u0431\u0456\u043b\u044c\u043d\u0456\u0441\u0442\u044c \u0456 \u0443\u0441\u043f\u0456\u0448\u043d\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[2234] = "Last Heard From";
    t[2235] = "\u0412\u043e\u0441\u0442\u0430\u043d\u043d\u0454 \u0447\u0443\u0432";
    t[2236] = "midnight";
    t[2237] = "\u043e\u043f\u0456\u0432\u043d\u043e\u0447\u0456";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "\u041a\u043e\u0440\u043e\u0442\u043a\u0438\u0439 \u0432\u0441\u0442\u0443\u043f \u0434\u043e I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "\u041d\u0430 \u044f\u043a\u0438\u0439 \u0447\u0430\u0441 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u0447\u0435\u043a\u0430\u044e\u0442\u044c \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u043d\u044f. \u0427\u0435\u0440\u0433\u0430 \u0437\u0430\u0432\u0434\u0430\u043d\u044c \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u0430 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/jobs'>\u0417\u0430\u0432\u0434\u0430\u043d\u044c</a>. \u041d\u0430 \u0436\u0430\u043b\u044c, \u0432 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456 \u0454 \u0439 \u0456\u043d\u0448\u0456 \u0447\u0435\u0440\u0433\u0438 \u0437\u0430\u0432\u0434\u0430\u043d\u044c, \u0449\u043e \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u0456, \u0430 \u0457\u0445\u043d\u0456\u0439 \u0441\u0442\u0430\u0442\u0443\u0441 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u043d\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0430 \u0437\u0430\u0432\u0434\u0430\u043d\u044c \u043f\u043e\u0432\u0438\u043d\u043d\u0430 \u0434\u043e\u0440\u0456\u0432\u043d\u044e\u0432\u0430\u0442\u0438 \u043d\u0443\u043b\u044e. \u042f\u043a\u0449\u043e \u0432\u043e\u043d\u0430 \u043f\u043e\u0441\u0442\u0456\u0439\u043d\u043e \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0454 500 \u043c\u0441, \u0432\u0430\u0448 \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440 \u0434\u0443\u0436\u0435 \u043f\u043e\u0432\u0456\u043b\u044c\u043d\u0438\u0439, \u043c\u0435\u0440\u0435\u0436\u0430 \u0432\u0438\u043f\u0430\u0434\u043a\u043e\u0432\u043e \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u0430\u0431\u043e \u0432 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456 \u0454 \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u0456 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0438. <a href='/configstats#jobQueue.jobLag'>[\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0433\u0440\u0430\u0444\u0456\u043a\u0443]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "\u041f\u0435\u0440\u0448 \u043d\u0456\u0436 \u0440\u043e\u0437\u043f\u043e\u0432\u0441\u044e\u0434\u0436\u0443\u0432\u0430\u0442\u0438 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043f\u0440\u043e \u0432\u0430\u0448 \u043d\u043e\u0432\u0438\u0439 \u0441\u0430\u0439\u0442, \u0432\u0438 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0434\u043e\u0434\u0430\u0442\u0438 \u044f\u043a\u0438\u0439\u0441\u044c \u043a\u043e\u043d\u0442\u0435\u043d\u0442. \u041f\u0435\u0440\u0435\u0439\u0434\u0456\u0442\u044c \u0434\u043e \u043a\u043e\u0440\u0435\u043d\u0435\u0432\u043e\u0433\u043e \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0443 \u0441\u0435\u0440\u0432\u0435\u0440\u0430 <a href=#rootdir>\u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u043e\u0433\u043e \u0432\u0438\u0449\u0435</a> \u0456 \u0437\u0430\u043c\u0456\u043d\u0456\u0442\u044c \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 \u043f\u0435\u0440\u0435\u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044f <i>index.html</i> \u043d\u0430 \u0432\u043b\u0430\u0441\u043d\u0438\u0439 \u043a\u043e\u043d\u0442\u0435\u043d\u0442. \u042f\u043a\u0449\u043e \u0432\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u0435\u043d \u0448\u0430\u0431\u043b\u043e\u043d \u0434\u043b\u044f \u0431\u0430\u0437\u043e\u0432\u043e\u0433\u043e \u0441\u0430\u0439\u0442\u0443, \u0432\u0456\u0434\u043a\u0440\u0438\u0439\u0442\u0435 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 <a href=http://127.0.0.1:7658/help/pagetemplate.html>\u0446\u044e</a>. \u042f\u043a\u0449\u043e \u043f\u0456\u0441\u043b\u044f \u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043e\u043d\u0442\u0435\u043d\u0442\u0443 \u0432\u0438 \u043f\u043e\u0432\u0435\u0440\u0442\u0430\u0454\u0442\u0435\u0441\u044c \u043d\u0430 \u0446\u044e \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443, \u0441\u043f\u0440\u043e\u0431\u0443\u0439\u0442\u0435 \u043e\u0447\u0438\u0441\u0442\u0438\u0442\u0438 \u043a\u0435\u0448 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430.";
    t[2260] = "Disable I2P service";
    t[2261] = "\u0412\u0438\u043c\u043a\u043d\u0443\u0442\u0438 \u0441\u043b\u0443\u0436\u0431\u0443 I2P";
