    t[2294] = "The <i class=example>default</i> threshold applies to any remote destination not explicitly listed in the definition or in any of the referenced files. To set a default threshold use the keyword <i class=example>default</i>.";
    t[2295] = "\u0422\u0438\u043f\u043e\u0432\u0438\u0439 \u043f\u043e\u0440\u0456\u0433 <i class=example>default</i> \u0437\u0430\u0441\u0442\u043e\u0441\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043e \u0431\u0443\u0434\u044c-\u044f\u043a\u043e\u0457 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u043e\u0457 \u0446\u0456\u043b\u0456, \u044f\u043a\u0430 \u044f\u0432\u043d\u043e \u043d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u0430 \u0443 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u0456 \u0430\u0431\u043e \u0443 \u0431\u0443\u0434\u044c-\u044f\u043a\u043e\u043c\u0443 \u0456\u0437 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u0438\u0445 \u0444\u0430\u0439\u043b\u0456\u0432. \u0429\u043e\u0431 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0442\u0438\u043f\u043e\u0432\u0438\u0439 \u043f\u043e\u0440\u0456\u0433, \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 \u043a\u043b\u044e\u0447\u043e\u0432\u0435 \u0441\u043b\u043e\u0432\u043e <i class=example>default</i>.";
    t[2306] = "Estimated total leasesets";
    t[2307] = "\u0420\u043e\u0437\u0440\u0430\u0445\u0443\u043d\u043a\u043e\u0432\u0430 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u0441\u0443\u043c\u0430 \u043e\u0440\u0435\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0445 \u043d\u0430\u0431\u043e\u0440\u0456\u0432";
    t[2308] = "Building tunnels";
    t[2309] = "\u041f\u043e\u0431\u0443\u0434\u043e\u0432\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432";
    t[2310] = "Send on";
    t[2311] = "\u041d\u0430\u0434\u0456\u0441\u043b\u0430\u0442\u0438";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "\u042f\u043a\u0449\u043e \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 \u0440\u043e\u0443\u0442\u0435\u0440\u0456 10 \u0456 \u0431\u0456\u043b\u044c\u0448\u0435 \u0430\u043a\u0442\u0438\u0432\u043d\u0438\u0445 \u043f\u0456\u0440\u0456\u0432, \u0432\u0441\u0435 \u0432 \u043f\u043e\u0440\u044f\u0434\u043a\u0443. \u0420\u043e\u0443\u0442\u0435\u0440 \u043f\u043e\u0432\u0438\u043d\u0435\u043d \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u0442\u0438 \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0437 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u043c\u0430 \u043f\u0456\u0440\u0430\u043c\u0438 \u043f\u043e\u0441\u0442\u0456\u0439\u043d\u043e. \u041d\u0430\u0439\u043a\u0440\u0430\u0449\u0438\u0439 \u0441\u043f\u043e\u0441\u0456\u0431 \u0431\u0443\u0442\u0438 \"\u043a\u0440\u0430\u0449\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u043c\" \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 - <a href=/config>\u0432\u0438\u0434\u0456\u043b\u044f\u0442\u0438 \u0431\u0456\u043b\u044c\u0448\u0435 \u0441\u043c\u0443\u0433\u0438 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u0430\u043d\u043d\u044f</a>.";
    t[2320] = "Not enough shared bandwidth to build transit tunnels.";
    t[2321] = "\u041d\u0435\u0434\u043e\u0441\u0442\u0430\u0442\u043d\u044c\u043e \u0441\u043f\u0456\u043b\u044c\u043d\u043e\u0457 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0434\u043b\u044f \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u0430 \u0442\u0440\u0430\u043d\u0437\u0438\u0442\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432.";
