    t[2338] = "You must enter a key";
    t[2339] = "\u0412\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0432\u043a\u0430\u0437\u0430\u0442\u0438 \u043a\u043b\u044e\u0447";
    t[2342] = "SymmetricNAT";
    t[2343] = "\u0421\u0438\u043c\u0435\u0442\u0440\u0438\u0447\u043d\u0438\u0439 \u041d\u0430\u0442";
    t[2364] = "Some basic indications of router overload:";
    t[2365] = "\u0414\u0435\u044f\u043a\u0456 \u0431\u0430\u0437\u043e\u0432\u0456 \u043e\u0437\u043d\u0430\u043a\u0438 \u043f\u0435\u0440\u0435\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430:";
    t[2370] = "Glossary";
    t[2371] = "\u0413\u043b\u043e\u0441\u0430\u0440\u0456\u0439";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "\u0429\u043e\u0431 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0432\u043b\u0430\u0441\u043d\u0443 \u0434\u043e\u043c\u0435\u043d\u043d\u0443 \u043d\u0430\u0437\u0432\u0443, \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0442\u043e\u0440\u0438 \u0434\u043e\u043c\u0435\u043d\u0456\u0432 I2P, \u0442\u0430\u043a\u0456 \u044f\u043a <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> \u0447\u0438 <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a>, \u043d\u0430\u0434\u0430\u044e\u0442\u044c \u0441\u0435\u0440\u0432\u0456\u0441\u0438 \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457, \u0449\u043e \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u044e\u0442\u044c \u0437\u0430\u0440\u0435\u0454\u0441\u0442\u0440\u0443\u0432\u0430\u0442\u0438 \u0442\u0430 \u043a\u0435\u0440\u0443\u0432\u0430\u0442\u0438 \u0434\u043e\u043c\u0435\u043d\u043e\u043c \u0447\u0438 \u0441\u0443\u0431\u0434\u043e\u043c\u0435\u043d\u043e\u043c .i2p, \u044f\u043a\u0456 \u043f\u043e\u0442\u0456\u043c \u043f\u043e\u0448\u0438\u0440\u044e\u044e\u0442\u044c\u0441\u044f \u043f\u043e \u0432\u0441\u0456\u0439 \u043c\u0435\u0440\u0435\u0436\u0456. \u0414\u0435\u044f\u043a\u0456 \u0441\u0430\u0439\u0442\u0438 \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457 \u043c\u043e\u0436\u0443\u0442\u044c \u0432\u0438\u043c\u0430\u0433\u0430\u0442\u0438 <i>B64 \u0430\u0434\u0440\u0435\u0441\u0438 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f</i> \u0434\u043b\u044f \u0442\u0443\u043d\u0435\u043b\u044e/\u0441\u0435\u0440\u0432\u0456\u0441\u0443, \u044f\u043a\u0438\u0439 \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0430\u0441\u043e\u0446\u0456\u044e\u0432\u0430\u0442\u0438 \u0437 \u0434\u043e\u043c\u0435\u043d\u043d\u043e\u044e \u043d\u0430\u0437\u0432\u043e\u044e. \u0407\u0457 \u0441\u043b\u0456\u0434 \u0441\u043a\u043e\u043f\u0456\u044e\u0432\u0430\u0442\u0438 \u0437 \u0440\u043e\u0437\u0434\u0456\u043b\u0443 <i>\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0430 \u0430\u0434\u0440\u0435\u0441\u0430</i> \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>.";
