    t[2427] = "\u041d\u0435 \u0440\u043e\u0437\u043c\u0456\u0449\u0443\u0439\u0442\u0435 \u0444\u0430\u0439\u043b \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u043e \u0430\u0431\u043e \u043d\u0435 \u043f\u0435\u0440\u0435\u0434\u0430\u0432\u0430\u0439\u0442\u0435 \u0446\u0456 \u0444\u0430\u0439\u043b\u0438 \u0434\u0440\u0443\u0433\u0443 \u0434\u0440\u0443\u0433\u0430!";
