    t[2459] = "\u041c\u0430\u043f\u0430 \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432 \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445 \u043c\u0435\u0440\u0435\u0436\u0456";
