    t[2471] = "\u0420\u0443\u0447\u043d\u0438\u0439 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0439 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "\u0426\u0435 \u0432\u043a\u0430\u0437\u0443\u0454 \u043e\u0431\u0441\u044f\u0433 \u043e\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0457 \u043f\u0430\u043c'\u044f\u0442\u0456, \u044f\u043a\u0438\u0439 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454 I2P, \u0442\u0430 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u043e\u0431\u0441\u044f\u0433, \u0432\u0438\u0434\u0456\u043b\u0435\u043d\u0438\u0439 Java. \u042f\u043a\u0449\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u043f\u043e\u0441\u0442\u0456\u0439\u043d\u043e \u0432\u0438\u0441\u043e\u043a\u0435 \u0432\u0456\u0434\u043d\u043e\u0441\u043d\u043e \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0457 RAM, \u0446\u0435 \u043c\u043e\u0436\u0435 \u0441\u0432\u0456\u0434\u0447\u0438\u0442\u0438 \u043f\u0440\u043e \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0456\u0441\u0442\u044c \u0437\u0431\u0456\u043b\u044c\u0448\u0435\u043d\u043d\u044f \u043e\u0431\u0441\u044f\u0433\u0443 \u043f\u0430\u043c'\u044f\u0442\u0456, \u0432\u0438\u0434\u0456\u043b\u0435\u043d\u043e\u0457 JVM. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u0434\u0456\u043b\u0438\u0442\u0438 \u0431\u0456\u043b\u044c\u0448\u0435 \u043f\u0430\u043c'\u044f\u0442\u0456, \u0440\u0435\u0434\u0430\u0433\u0443\u044e\u0447\u0438 \u0444\u0430\u0439\u043b <code>wrapper.config</code>, \u044f\u043a\u0438\u0439, \u044f\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0437\u0456 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043a\u0443 I2P. \u0412\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0431\u0443\u0434\u0435 \u0432\u0456\u0434\u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440 <code>wrapper.java.maxmemory</code>, \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0439 \u0443 256(\u041c\u0411) \u0434\u043b\u044f I2P \u0430\u0431\u043e 384 \u0434\u043b\u044f I2P+. \u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u044f\u043a\u0449\u043e \u0432\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e \u043f\u0430\u043c'\u044f\u0442\u043a\u043e\u0432\u0443 \u0441\u043c\u0443\u0433\u0443, \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0437\u0430\u043f\u0438\u0441\u0443 \u043f\u0440\u043e \u043f\u0430\u043c'\u044f\u0442\u044c \u0443 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0431\u0443\u0434\u0435 \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u043e.";
