    t[2537] = "\u0423 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 <i>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043f\u0440\u043e\u043a\u0441\u0456-\u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0406\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0443</i> \u0432\u0438\u0431\u0435\u0440\u0456\u0442\u044c \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440 <i>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043a\u0441\u0456-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0432\u0440\u0443\u0447\u043d\u0443</i>.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "\u0414\u043b\u044f \u043e\u0431\u0441\u043b\u0443\u0433\u043e\u0432\u0443\u0432\u0430\u043d\u043d\u044f \u0441\u0432\u043e\u0433\u043e \u0441\u0442\u0430\u0442\u0438\u0447\u043d\u043e\u0433\u043e \u043a\u043e\u043d\u0442\u0435\u043d\u0442\u0443 \u0434\u043e\u0441\u0442\u0430\u0442\u043d\u044c\u043e \u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u0430\u0431\u043e \u0437\u0430\u043c\u0456\u043d\u044e\u0432\u0430\u0442\u0438 \u0444\u0430\u0439\u043b\u0438 \u0432 \u043a\u043e\u0440\u0435\u043d\u0435\u0432\u043e\u043c\u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0437\u0456 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u0456 \u0441\u0430\u0439\u0442 \u0441\u0442\u0430\u043d\u0435 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u043c \u0443 \u043c\u0435\u0440\u0435\u0436\u0456 I2P \u043f\u0456\u0441\u043b\u044f \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u043d\u044f \u043d\u0438\u0436\u0447\u0435\u043d\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u0445 \u0456\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0456\u0439. \u041a\u0440\u0456\u043c \u0442\u043e\u0433\u043e, \u0441\u043a\u0440\u0438\u043f\u0442\u0438 cgi \u0456 python \u043c\u043e\u0436\u043d\u0430 \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0442\u0438 \u0437 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0443 <code>cgi-bin</code> \u0431\u0435\u0437\u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e \u043d\u0430\u0434 <code>docroot</code> \u0437\u0430 \u0443\u043c\u043e\u0432\u0438 \u043d\u0430\u044f\u0432\u043d\u043e\u0441\u0442\u0456 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0445 <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> \u0442\u0430 <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a>.";
