    t[2579] = "\u0411\u0430\u0433\u0430\u0442\u043e \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u0447\u043d\u0438\u0445 \u0434\u0430\u043d\u0438\u0445 \u0443 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 <a href='/configstats'>\u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0456</a> \u0434\u043b\u044f <a href='/graphs'>\u0433\u0440\u0430\u0444\u0456\u0447\u043d\u043e\u0433\u043e</a> \u0430\u043d\u0430\u043b\u0456\u0437\u0443. \u0412\u0438 \u0442\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u0435\u0442\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0440\u043e\u0437\u0434\u0456\u043b\u0438, \u0449\u043e \u0437'\u044f\u0432\u043b\u044f\u044e\u0442\u044c\u0441\u044f \u0432 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 \u0442\u0430 \u0457\u0445 \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u043d\u044f \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/configsidebar'>\u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0431\u0456\u0447\u043d\u043e\u0457 \u043f\u0430\u043d\u0435\u043b\u0456</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f, \u0441\u043f\u0435\u0446\u0438\u0444\u0456\u0447\u043d\u0435 \u0434\u043b\u044f \u0442\u0443\u043d\u0435\u043b\u044e, \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0430\u043a\u0442\u0438\u0432\u0443\u0432\u0430\u0442\u0438 \u0430\u0431\u043e \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456 \u043d\u0430 \u043f\u0456\u043d\u0433\u0438, \u044f\u043a\u0456 \u043d\u0430\u0434\u0441\u0438\u043b\u0430\u044e\u0442\u044c\u0441\u044f \u043d\u0430 \u0441\u0435\u0440\u0432\u0435\u0440\u0438, \u0445\u043e\u0441\u0442\u0438\u043d\u0433 \u044f\u043a\u0438\u0445 \u0437\u0434\u0456\u0439\u0441\u043d\u044e\u0454 \u0440\u043e\u0443\u0442\u0435\u0440. \u0429\u043e\u0431 \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438 \u043f\u0456\u043d\u0433\u0438, \u0432\u0430\u043c \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u0434\u043e\u0434\u0430\u0442\u0438 \u0440\u044f\u0434\u043e\u043a <code>i2p.streaming.answerPings=false</code> \u0434\u043e \u0440\u043e\u0437\u0434\u0456\u043b\u0443 <i>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f</i> \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0432 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432.";
    t[2592] = "Max";
    t[2593] = "\u041c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0435";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0456 (.zip) \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f I2P, \u0446\u0435 \u0441\u043b\u0456\u0434 \u0434\u043e\u0434\u0430\u0442\u0438 \u0434\u043e \u0432\u0430\u0448\u043e\u0433\u043e \u0444\u0430\u0439\u043b\u0430 <code>router.config</code>, \u044f\u043a\u0449\u043e \u0432\u0438 \u0449\u0435 \u043d\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043b\u0438 <code>routerconsole.advanced=true</code>, \u0432 \u0442\u0430\u043a\u043e\u043c\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443 \u0446\u044f \u043e\u043f\u0446\u0456\u044f \u0432\u0436\u0435 \u043f\u0435\u0440\u0435\u0434\u0431\u0430\u0447\u0435\u043d\u0430. \u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430: \u043f\u043e\u0447\u0438\u043d\u0430\u044e\u0447\u0438 \u0437 \u0432\u0435\u0440\u0441\u0456\u0457 I2P+ 0.9.48+, \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f <a href=/configupdate#i2pupdates>\u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0445 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u044c</a> \u0454 \u0430\u043a\u0442\u0438\u0432\u043e\u0432\u0430\u043d\u0438\u043c \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c.";
    t[2600] = "Plugin {0} installed";
    t[2601] = "\u041f\u043b\u0430\u0433\u0456\u043d {0} \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e";
    t[2604] = "I2P requires at least 12KBps to enable sharing. ";
    t[2605] = "I2P \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u0449\u043e\u043d\u0430\u0439\u043c\u0435\u043d\u0448\u0435 12 \u041a\u0431\u0456\u0442/\u0441, \u0449\u043e\u0431 \u0443\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0441\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f. ";
    t[2608] = "The current external IP address reported by UPnP is {0}";
    t[2609] = "\u0422\u0435\u043f\u0435\u0440\u0456\u0448\u043d\u044f \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u044f IP-\u0430\u0434\u0440\u0435\u0441\u0430, \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u0430 UPnP: {0}";
    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0437\u043d\u0430\u0454\u0442\u0435 \u0456 \u0434\u043e\u0432\u0456\u0440\u044f\u0454\u0442\u0435 \u043a\u043e\u043c\u0443\u0441\u044c, \u0445\u0442\u043e \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0454\u0442\u044c\u0441\u044f I2P, \u043f\u043e\u043f\u0440\u043e\u0441\u0456\u0442\u044c \u0457\u0445 \u043d\u0430\u0434\u0456\u0441\u043b\u0430\u0442\u0438 \u0432\u0430\u043c \u0444\u0430\u0439\u043b \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f, \u0437\u0433\u0435\u043d\u0435\u0440\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u0446\u0456\u0439 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u0432 \u0457\u0445\u043d\u0456\u0439 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430. \u041f\u043e\u0442\u0456\u043c \u043e\u0431\u0435\u0440\u0456\u0442\u044c \u043e\u043f\u0446\u0456\u044e <i>\u041f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u0437 \u0444\u0430\u0439\u043b\u0443</i> \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 {0}, \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0447\u0438 \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u0438\u0439 \u0444\u0430\u0439\u043b.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[2621] = "\u0429\u043e\u0431 \u0443\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u043b\u0438\u0448\u0435 \u0441\u0435\u0430\u043d\u0441\u043e\u0432\u0456 \u0437\u043c\u0456\u043d\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u0430\u043a\u0442\u0438\u0432\u0443\u0439\u0442\u0435 <a href=\"/help/advancedsettings\">\u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0439 \u0440\u0435\u0436\u0438\u043c</a> \u043a\u043e\u043d\u0441\u043e\u043b\u0456.";
    t[2624] = "Standard Java installation";
    t[2625] = "\u0422\u0438\u043f\u043e\u0432\u0430 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f Java";
    t[2632] = "graph";
    t[2633] = "\u0433\u0440\u0430\u0444\u0456\u043a";
    t[2634] = "I2P Client Protocol port";
    t[2635] = "\u041f\u043e\u0440\u0442 \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b\u0443 \u043a\u043b\u0456\u0454\u043d\u0442\u0430 I2P";
    t[2638] = "Recent I2P+ Changes";
    t[2639] = "\u041e\u0441\u0442\u0430\u043d\u043d\u0456 \u0437\u043c\u0456\u043d\u0438 \u0432 I2P+";
    t[2642] = "Bandwidth Graph";
    t[2643] = "\u0413\u0440\u0430\u0444\u0456\u043a \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456";
    t[2654] = "Manage your I2P hosts file here (I2P domain name resolution)";
    t[2655] = "\u041a\u0435\u0440\u0443\u0439\u0442\u0435 \u0444\u0430\u0439\u043b\u043e\u043c \u0445\u043e\u0441\u0442\u0456\u0432 I2P \u0442\u0443\u0442 (\u0440\u043e\u0437\u0434\u0456\u043b\u0435\u043d\u043d\u044f \u0456\u043c\u0435\u043d\u0456 \u0434\u043e\u043c\u0435\u043d\u0443 I2P)";
    t[2656] = "Estimated total floodfills";
    t[2657] = "\u0420\u043e\u0437\u0440\u0430\u0445\u0443\u043d\u043a\u043e\u0432\u0456 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0456 \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d\u043d\u044f";
    t[2658] = "Show systray icon";
    t[2659] = "\u041f\u043e\u043a\u0430\u0437\u0430\u0442\u0438 \u0437\u043d\u0430\u0447\u043e\u043a \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u043e\u0457 \u043f\u0430\u043d\u0435\u043b\u0456";
    t[2660] = "Exploratory";
    t[2661] = "\u0414\u043e\u0441\u043b\u0456\u0434\u043d\u0438\u0446\u044c\u043a\u0438\u0439";
    t[2664] = "Same IPv6 /48 as us";
    t[2665] = "\u0422\u043e\u0439 \u0441\u0430\u043c\u0438\u0439 IPv6 /48, \u0449\u043e \u0439 \u0443 \u043d\u0430\u0441";
    t[2670] = "Or to deny all unspecified destinations:";
    t[2671] = "\u0410\u0431\u043e \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u0438\u0442\u0438 \u0432\u0441\u0456 \u043d\u0435\u0432\u043a\u0430\u0437\u0430\u043d\u0456 \u0446\u0456\u043b\u0456:";
    t[2672] = "Peers we've been talking to in the last minute / last hour";
    t[2673] = "\u041a\u043e\u043b\u0435\u0433\u0438, \u0437 \u044f\u043a\u0438\u043c\u0438 \u043c\u0438 \u0441\u043f\u0456\u043b\u043a\u0443\u0432\u0430\u043b\u0438\u0441\u044f \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u043e\u0441\u0442\u0430\u043d\u043d\u0456\u0445 \u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0445\u0432\u0438\u043b\u0438\u043d/\u043e\u0441\u0442\u0430\u043d\u043d\u044c\u043e\u0457 \u0433\u043e\u0434\u0438\u043d\u0438";
    t[2676] = "Open console on startup";
    t[2677] = "\u0412\u0456\u0434\u043a\u0440\u0438\u0442\u0438 \u043a\u043e\u043d\u0441\u043e\u043b\u044c \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443";
    t[2680] = "Review possible sybils in network database";
    t[2681] = "\u041f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u044c\u0442\u0435 \u043c\u043e\u0436\u043b\u0438\u0432\u0456 \u0441\u0438\u0432\u0456\u043b\u0438 \u0432 \u0431\u0430\u0437\u0456 \u0434\u0430\u043d\u0438\u0445 \u043c\u0435\u0440\u0435\u0436\u0456";
    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f WAN Ethernet";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f (\u0432 \u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445) \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u043f\u0435\u0440\u0435\u043f\u0438\u0441\u0430\u0442\u0438 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0443 \u043c\u0456\u0436 \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u043d\u044f\u043c\u0438 \u0417\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u0434\u043e\u0441\u043b\u0456\u0434\u0436\u0435\u043d\u043d\u044f \u043f\u0456\u0440\u0456\u0432, \u044f\u043a\u0435 \u043d\u0430\u043c\u0430\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0438\u044f\u0432\u0438\u0442\u0438 \u043d\u043e\u0432\u0438\u0445 \u043f\u0456\u0440\u0456\u0432 \u0434\u043b\u044f \u0434\u043e\u0434\u0430\u0432\u0430\u043d\u043d\u044f \u0432 NetDb. \u0417\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u0431\u0443\u0434\u0435 \u0432\u0438\u043a\u043e\u043d\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u043a\u043e\u0436\u043d\u0456 80 \u0441\u0435\u043a\u0443\u043d\u0434 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u0430\u0431\u043e \u043a\u043e\u0436\u043d\u0456 3 \u0445\u0432\u0438\u043b\u0438\u043d\u0438, \u044f\u043a\u0449\u043e \u0440\u043e\u0443\u0442\u0435\u0440 \u0432\u0456\u0434\u0447\u0443\u0432\u0430\u0454 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0438 \u0437\u0430\u0432\u0434\u0430\u043d\u044c \u0430\u0431\u043e \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c. \u042f\u043a\u0449\u043e \u0440\u043e\u0437\u043c\u0456\u0440 NetDb \u0434\u043e\u0441\u044f\u0433\u043d\u0435 4000 \u043f\u0456\u0440\u0456\u0432, \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0430 \u0437\u0431\u0456\u043b\u044c\u0448\u0438\u0442\u044c\u0441\u044f \u0434\u043e 15 \u0445\u0432\u0438\u043b\u0438\u043d. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u0445\u043e\u0442\u0456\u0442\u0438 \u0437\u0431\u0456\u043b\u044c\u0448\u0438\u0442\u0438 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0443, \u044f\u043a\u0449\u043e \u0432\u0430\u0448 NetDb \u043d\u0430\u0441\u0438\u0447\u0435\u043d\u0438\u0439 (\u043f\u043e\u043d\u0430\u0434 2000 \u043f\u0456\u0440\u0456\u0432), \u0430\u0431\u043e \u044f\u043a\u0449\u043e \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0437\u043c\u0435\u043d\u0448\u0438\u0442\u0438 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456. \u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u0434\u043b\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432-\u0437\u0430\u043f\u043e\u0432\u043d\u044e\u0432\u0430\u0447\u0456\u0432 \u043f\u0430\u0432\u0443\u0442\u0438\u043d\u0438 \u0446\u0435 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u043d\u0435 \u0432\u0438\u043a\u043e\u043d\u0443\u0454\u0442\u044c\u0441\u044f.";
    t[2698] = "Current";
    t[2699] = "\u041f\u043e\u0442\u043e\u0447\u043d\u0438\u0439";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "\u0412\u0435\u0431-\u0441\u0430\u0439\u0442, \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u0438\u0439 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u0432\u0456\u043d \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0442\u0430 \u043f\u0440\u0430\u0446\u044e\u0454 \u043d\u0430 <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>\u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0456 Jetty</a> \u043d\u0430 <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "\u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u0438\u0439 \u0430\u0431\u043e \u0437\u043c\u0456\u043d\u0435\u043d\u0438\u0439 \u0432 <a href=/i2ptunnelmgr>\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>. \u0422\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u043c \u043d\u0430 \u043f\u0440\u0438\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0434\u043e \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0443 \u0430\u0431\u043e \u0432\u0441\u0456\u0445 \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0456\u0432.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "\u0421\u043b\u0443\u0436\u0431\u0430 I2P \u0442\u0435\u043f\u0435\u0440 \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u0430 \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0441\u0438\u0441\u0442\u0435\u043c\u0438";
    t[2748] = "Computer related news aggregation";
    t[2749] = "\u0410\u0433\u0440\u0435\u0433\u0430\u0446\u0456\u044f \u043d\u043e\u0432\u0438\u043d, \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0438\u0445 \u0437 \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440\u043e\u043c";
    t[2752] = "Same IP as us";
    t[2753] = "\u0422\u0430\u043a\u0438\u0439 \u0436\u0435 IP, \u0449\u043e \u0439 \u0443 \u043d\u0430\u0441";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "\u0422\u0443\u0442 \u043c\u043e\u0436\u043d\u0430 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u043d\u043e\u0432\u0435 \u0441\u0456\u043c\u0435\u0439\u0441\u0442\u0432\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432. \u041f\u0456\u0441\u043b\u044f \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u0441\u0456\u043c\u0435\u0439\u0441\u0442\u0432\u0430 \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443\u0432\u0430\u0442\u0438 \u0444\u0430\u0439\u043b \u0441\u0456\u043c\u0435\u0439\u043d\u043e\u0433\u043e \u043a\u043b\u044e\u0447\u0430 \u0442\u0430 \u043f\u043e\u0434\u0456\u043b\u0438\u0442\u0438\u0441\u044f \u043d\u0438\u043c \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438 \u0443 \u0432\u0430\u0448\u043e\u043c\u0443 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043e\u043c\u0443 \u0441\u0456\u043c\u0435\u0439\u0441\u0442\u0432\u0456.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "\u041e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u0456 \u043f\u043e\u0433\u043e\u0434\u0438\u0432\u0441\u044f \u0432\u0437\u044f\u0442\u0438 \u0443\u0447\u0430\u0441\u0442\u044c";
    t[2758] = "Advanced Lookup";
    t[2759] = "\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0439 \u043f\u043e\u0448\u0443\u043a";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "\u0414\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0434\u043e \u0441\u0430\u0439\u0442\u0456\u0432, \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u0438\u0445 \u043d\u0430 I2P, \u0442\u0430 \u043e\u043f\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0442\u0440\u0430\u043d\u0437\u0438\u0442\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u043a\u0441\u0456 \u0434\u043b\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u0441\u0430\u0439\u0442\u0456\u0432 \u043d\u0430 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0456\u0439 \u043c\u0435\u0440\u0435\u0436\u0456, \u0432\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0432\u0430\u0448 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f I2P HTTP-\u043f\u0440\u043e\u043a\u0441\u0456, \u044f\u043a\u0438\u0439 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043f\u0440\u0430\u0446\u044e\u0454 \u043d\u0430 <code>127.0.0.1 \u043f\u043e\u0440\u0442 4444</code>. \u0411\u0456\u043b\u044c\u0448\u0456\u0441\u0442\u044c \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0456\u0432 \u043f\u0440\u043e\u043f\u043e\u043d\u0443\u044e\u0442\u044c \u043e\u043f\u0446\u0456\u044e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043a\u0441\u0456; \u0432 \u0446\u044c\u043e\u043c\u0443 \u043a\u043e\u0440\u043e\u0442\u043a\u043e\u043c\u0443 \u0442\u0443\u0442\u043e\u0440\u0456\u0430\u043b\u0456 \u043c\u0438 \u0437\u043e\u0441\u0435\u0440\u0435\u0434\u0438\u043c\u043e\u0441\u044f \u043d\u0430 Firefox.";
    t[2776] = "Close to us";
    t[2777] = "\u0411\u043b\u0438\u0437\u044c\u043a\u043e \u0434\u043e \u043d\u0430\u0441";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "\u041a\u0430\u0440\u0442\u0430 \u0441\u0430\u0439\u0442\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "\u0417\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u0430 \u0432\u0435\u0440\u0441\u0456\u044f \u043f\u043b\u0430\u0433\u0456\u043d\u0430 {0} \u0441\u0442\u0430\u0440\u0456\u0448\u0430 \u0437\u0430 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0443";
    t[2796] = "Streaming radio service";
    t[2797] = "\u0421\u0435\u0440\u0432\u0456\u0441 \u043f\u043e\u0442\u043e\u043a\u043e\u0432\u043e\u0433\u043e \u0440\u0430\u0434\u0456\u043e";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u0435 \u043f\u0440\u0430\u0446\u044e\u0454, \u043a\u043e\u043b\u0438 \u0432\u0438 \u0437\u043c\u043e\u0436\u0435\u0442\u0435 \u0442\u043e\u0447\u043d\u043e \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0437\u0438\u0442\u0438 \u0448\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u043e\u0433\u043e \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0443 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 <a href=/config>\u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456</a>. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c I2P+ \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0434\u0435\u0449\u043e \u043a\u043e\u043d\u0441\u0435\u0440\u0432\u0430\u0442\u0438\u0432\u043d\u043e, \u0449\u043e \u043d\u0435 \u043f\u0456\u0434\u0456\u0439\u0434\u0435 \u0434\u043b\u044f \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u0432\u0438\u043f\u0430\u0434\u043a\u0456\u0432 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f, \u0442\u043e\u0436 \u0432\u0430\u0440\u0442\u043e \u043f\u0440\u0438\u0434\u0456\u043b\u0438\u0442\u0438 \u0447\u0430\u0441 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434\u0443 \u0446\u0438\u0445 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c \u0442\u0430 \u0432\u0438\u043f\u0440\u0430\u0432\u0438\u0442\u0438 \u0437\u0430 \u043f\u043e\u0442\u0440\u0435\u0431\u0438. \u0427\u0438\u043c \u0431\u0456\u043b\u044c\u0448\u0435 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0432\u0438 \u0432\u0438\u0434\u0456\u043b\u0438\u0442\u0435, <i>\u0441\u0430\u043c\u0435</i> \u0432\u0438\u0441\u0445\u0456\u0434\u043d\u0443 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0443 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c, \u0442\u0438\u043c \u0431\u0456\u043b\u044c\u0448\u0435 \u0432\u0438\u0433\u043e\u0434\u0438 \u0432\u0438 \u043e\u0442\u0440\u0438\u043c\u0430\u0454\u0442\u0435 \u0432\u0456\u0434 \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[2810] = "Transit by Peer";
