    t[2839] = "\u041a\u043e\u043d\u0441\u043e\u043b\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0442\u0430 \u043c\u043e\u0432\u0430 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f WebApps";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "\u0429\u043e \u0440\u043e\u0431\u0438\u0442\u0438 \u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443, \u044f\u043a\u0449\u043e I2P+ \u043d\u0435 \u043f\u0440\u0430\u0446\u044e\u0454";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "\u041f\u041e\u041f\u0415\u0420\u0415\u0414\u0416\u0415\u041d\u041d\u042f \u0410\u041d\u041e\u041d\u0406\u041c\u041d\u041e\u0421\u0422\u0406: \u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u0456 \u0437 \u043e\u0434\u043d\u0438\u043c \u0445\u043e\u043f\u043e\u043c.";
    t[2858] = "I2P IRC Network";
    t[2859] = "\u041c\u0435\u0440\u0435\u0436\u0430 IRC I2P";
    t[2864] = "pixels wide";
    t[2865] = "\u0448\u0438\u0440\u0438\u043d\u0430 \u043f\u0456\u043a\u0441\u0435\u043b\u0456\u0432";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "\u041f\u0440\u043e\u0442\u043e\u043a\u043e\u043b \u043c\u0435\u0440\u0435\u0436\u0456 I2P (I2NP) \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0454 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u0454\u044e \u0442\u0430 \u043f\u0435\u0440\u0435\u043c\u0456\u0448\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c \u043c\u0456\u0436 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0432\u0438\u0431\u043e\u0440\u043e\u043c \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0443 (\u044f\u043a\u0449\u043e \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u0432\u0430\u0440\u0456\u0430\u043d\u0442\u0456\u0432) \u043f\u0440\u0438 \u0441\u043f\u0456\u043b\u043a\u0443\u0432\u0430\u043d\u043d\u0456 \u0437 \u043f\u0456\u0440\u043e\u043c. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u0432 <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>\u043e\u043d\u043b\u0430\u0439\u043d-\u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u0457</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "\u0422\u0435\u0440\u043c\u0456\u043d \u0434\u0456\u0457 \u043c\u0438\u043d\u0443\u0432 {0} \u0442\u043e\u043c\u0443";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "\u0421\u0442\u0430\u0442\u0443\u0441 \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0449\u043e\u0434\u043e \u043f\u0440\u0438\u0439\u043d\u044f\u0442\u0442\u044f \u0430\u0431\u043e \u0432\u0456\u0434\u0445\u0438\u043b\u0435\u043d\u043d\u044f \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u0432\u0456\u0434 \u0456\u043d\u0448\u0438\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432 \u043d\u0430 \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u043e \u0442\u0443\u043d\u0435\u043b\u044e \u0443\u0447\u0430\u0441\u0442\u0456 \u0447\u0435\u0440\u0435\u0437 \u0432\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440. \u0412\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043c\u043e\u0436\u0435 \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438 \u0432\u0441\u0456 \u0437\u0430\u043f\u0438\u0442\u0438, \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438 \u0430\u0431\u043e \u0432\u0456\u0434\u0445\u0438\u043b\u044f\u0442\u0438 \u043f\u0435\u0432\u043d\u0438\u0439 \u0432\u0456\u0434\u0441\u043e\u0442\u043e\u043a \u0437\u0430\u043f\u0438\u0442\u0456\u0432, \u0430\u0431\u043e \u0432\u0456\u0434\u0445\u0438\u043b\u044f\u0442\u0438 \u0432\u0441\u0456 \u0437\u0430\u043f\u0438\u0442\u0438 \u0437 \u043f\u0435\u0432\u043d\u0438\u0445 \u043f\u0440\u0438\u0447\u0438\u043d, \u0449\u043e\u0431 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044e\u0432\u0430\u0442\u0438 \u043f\u043e\u0442\u0440\u0435\u0431\u0438 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0441\u043c\u0443\u0433\u0438 \u0442\u0430 \u043f\u0440\u043e\u0446\u0435\u0441\u043e\u0440\u0430, \u0456 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u0442\u0438 \u043f\u043e\u0442\u0443\u0436\u043d\u0456\u0441\u0442\u044c \u0434\u043b\u044f \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432. <b>\u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0437\u0432'\u044f\u0436\u0456\u0442\u044c\u0441\u044f \u0437 \u0434\u043e\u0432\u0456\u0440\u0435\u043d\u0438\u043c \u0434\u0440\u0443\u0433\u043e\u043c, \u0443 \u044f\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0446\u044e\u0454 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 I2P, \u0442\u0430 \u043f\u043e\u043f\u0440\u043e\u0441\u0456\u0442\u044c \u0457\u0445 \u043f\u0440\u043e \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0443 \u0437 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f\u043c \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P. \u041f\u043e\u043f\u0440\u043e\u0441\u0456\u0442\u044c \u0457\u0445 \u043d\u0430\u0434\u0456\u0441\u043b\u0430\u0442\u0438 \u0432\u0430\u043c \u0444\u0430\u0439\u043b \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f, \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0437 \u0457\u0445\u043d\u044c\u043e\u0433\u043e \u043f\u0440\u0430\u0446\u044e\u044e\u0447\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P. \u0414\u0443\u0436\u0435 \u0432\u0430\u0436\u043b\u0438\u0432\u043e, \u0449\u043e\u0431 \u0444\u0430\u0439\u043b \u043e\u0431\u043c\u0456\u043d\u044e\u0432\u0430\u0432\u0441\u044f \u043f\u043e \u0437\u0430\u0445\u0438\u0449\u0435\u043d\u043e\u043c\u0443 \u043a\u0430\u043d\u0430\u043b\u0443, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u0431\u0443\u0432 \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u0439 \u0434\u043b\u044f \u0443\u043d\u0438\u043a\u043d\u0435\u043d\u043d\u044f \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u044c\u043e\u0433\u043e \u0432\u0442\u0440\u0443\u0447\u0430\u043d\u043d\u044f (\u043f\u0456\u0434\u043f\u0438\u0441 PGP, \u0448\u0438\u0444\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0430 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0430 \u0434\u043e\u0432\u0456\u0440\u0435\u043d\u043e\u044e \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0438\u043c \u043a\u043b\u044e\u0447\u0435\u043c). \u0421\u0430\u043c \u0444\u0430\u0439\u043b \u043d\u0435 \u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0439, \u0442\u043e\u0436 \u0431\u0435\u0440\u0456\u0442\u044c \u0444\u0430\u0439\u043b\u0438 \u0442\u0456\u043b\u044c\u043a\u0438 \u0432\u0456\u0434 \u0434\u043e\u0432\u0456\u0440\u0435\u043d\u0438\u0445 \u0434\u0440\u0443\u0437\u0456\u0432. \u041d\u0456\u043a\u043e\u043b\u0438 \u043d\u0435 \u0456\u043c\u043f\u043e\u0440\u0442\u0443\u0439\u0442\u0435 \u0444\u0430\u0439\u043b \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f, \u044f\u043a\u0449\u043e \u0432\u0438 \u043d\u0435 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u0438 \u0439\u043e\u0433\u043e \u0434\u0436\u0435\u0440\u0435\u043b\u043e.";
    t[2916] = "Last Good Send";
    t[2917] = "\u041e\u0441\u0442\u0430\u043d\u043d\u0454 \u0432\u0434\u0430\u043b\u0435 \u043d\u0430\u0434\u0441\u0438\u043b\u0430\u043d\u043d\u044f";
    t[2918] = "Delete this value to disable";
    t[2919] = "\u0412\u0438\u0434\u0430\u043b\u0456\u0442\u044c \u0446\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u0449\u043e\u0431 \u0432\u0438\u043c\u043a\u043d\u0443\u0442\u0438";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "\u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0442\u043e\u0440 \u0432 \u043e\u0434\u043d\u043e\u043c\u0443 \u0442\u0443\u043d\u0435\u043b\u0456, \u044f\u043a\u0438\u0439 \u0437\u0430\u043f\u0438\u0441\u0443\u0454 \u0444\u0430\u0439\u043b, \u044f\u043a\u0438\u0439 \u0456\u043d\u0448\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0430\u0431\u043e \u043a\u0456\u043b\u044c\u043a\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u043c\u043e\u0436\u0443\u0442\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0434\u043b\u044f \u0440\u0435\u0433\u0443\u043b\u044e\u0432\u0430\u043d\u043d\u044f. \u0426\u0456 \u0444\u0430\u0439\u043b\u0438 \u0442\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u043d\u0430 \u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u0432\u0440\u0443\u0447\u043d\u0443.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043f\u0440\u0430\u0446\u044e\u0454 \u043f\u0456\u0434 \u043a\u0435\u0440\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043d\u0435\u0440\u0456\u0434\u043d\u043e\u0457 \u0432\u0435\u0440\u0441\u0456\u0457 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u043a\u0438 Java BigInteger, \u0435\u043c\u0443\u043b\u044c\u043e\u0432\u0430\u043d\u043e\u0457 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043d\u0438\u043c \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0435\u043d\u043d\u044f\u043c";
    t[2928] = "Country";
    t[2929] = "\u041a\u0440\u0430\u0457\u043d\u0430";
    t[2934] = "Peer's clockskew relative to our clock";
    t[2935] = "Clockskew Peer's \u0432\u0456\u0434\u043d\u043e\u0441\u043d\u043e \u043d\u0430\u0448\u043e\u0433\u043e \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u0430";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "\u041f\u043e\u0440\u043e\u0433\u043e\u0432\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u044f\u043a\u0435, \u044f\u043a\u0449\u043e \u0439\u043e\u0433\u043e \u0431\u0443\u0434\u0435 \u043f\u043e\u0440\u0443\u0448\u0435\u043d\u043e, \u0441\u043f\u0440\u0438\u0447\u0438\u043d\u0438\u0442\u044c \u0437\u0430\u043f\u0438\u0441 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u043e\u0433\u043e \u043f\u0443\u043d\u043a\u0442\u0443 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0443 \u0432\u043a\u0430\u0437\u0430\u043d\u0438\u0439 \u0444\u0430\u0439\u043b";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "\u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0446\u0435 \u0432\u0438\u043a\u043b\u0438\u043a\u0430\u0454\u0442\u044c\u0441\u044f \u043a\u043e\u043d\u0444\u043b\u0456\u043a\u0442\u043e\u043c \u043f\u043e\u0440\u0442\u0443 7654. \u041f\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435 \u0436\u0443\u0440\u043d\u0430\u043b\u0438 \u0434\u043b\u044f \u043f\u0456\u0434\u0442\u0432\u0435\u0440\u0434\u0436\u0435\u043d\u043d\u044f.";
    t[2940] = "Disabling inbound TCP";
    t[2941] = "\u0412\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0432\u0445\u0456\u0434\u043d\u043e\u0433\u043e TCP";
    t[2944] = "Keyring";
    t[2945] = "\u0412\u2019\u044f\u0437\u043a\u0430 \u043a\u043b\u044e\u0447\u0456\u0432";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "\u041f\u0435\u0440\u0435\u0432\u0456\u0440\u0435\u043d\u0435 \u0441\u0456\u043c\u0435\u0439\u0441\u0442\u0432\u043e (\u0441\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442 \u043f\u0456\u0434\u043f\u0438\u0441\u0443 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0442\u0430 \u0434\u0456\u0439\u0441\u043d\u0438\u0439)";
    t[2954] = "Router info not available";
    t[2955] = "\u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0430";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "\u0412\u0435\u0431 -\u0434\u043e\u0434\u0430\u0442\u043a\u0438 Java, \u043f\u0435\u0440\u0435\u043b\u0456\u0447\u0435\u043d\u0456 \u043d\u0438\u0436\u0447\u0435, \u0437\u0430\u043f\u0443\u0449\u0435\u043d\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u043e\u043c WebConsole \u0456 \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u044e\u0442\u044c\u0441\u044f \u0432 \u0442\u043e\u043c\u0443 \u0436 JVM, \u0449\u043e \u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0432\u043e\u043d\u0438 \u0454 \u0432\u0435\u0431 -\u0434\u043e\u0434\u0430\u0442\u043a\u0430\u043c\u0438, \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u043c\u0438 \u0447\u0435\u0440\u0435\u0437 \u043a\u043e\u043d\u0441\u043e\u043b\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430. \u0412\u043e\u043d\u0438 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u043f\u043e\u0432\u043d\u0438\u043c\u0438 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0430\u043c\u0438 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, i2psnark), \u043f\u0435\u0440\u0435\u0434\u043d\u0456\u043c\u0438 \u0434\u043e \u0456\u043d\u0448\u043e\u0433\u043e \u043a\u043b\u0456\u0454\u043d\u0442\u0430 \u0430\u0431\u043e \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0438, \u044f\u043a\u0456 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0431\u0443\u0442\u0438 \u0432\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, SusiDNS, I2PTunnel) \u0430\u0431\u043e \u0432\u0437\u0430\u0433\u0430\u043b\u0456 \u043d\u0435 \u043c\u0430\u0442\u0438 \u0432\u0435\u0431-\u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0443 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u0430\u0434\u0440\u0435\u0441\u0430).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "\u041f\u041e\u041f\u0415\u0420\u0415\u0414\u0416\u0415\u041d\u041d\u042f. \u0412\u0445\u0456\u0434\u043d\u0456 \u0442\u0443\u043d\u0435\u043b\u0456 \u0437 \u043d\u0443\u043b\u044c\u043e\u0432\u0438\u043c \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u043e\u043c \u043d\u0435 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0438\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432.";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP \u043f\u0440\u043e\u043a\u0441\u0456";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "\u0426\u0435 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0440\u0456\u0432, \u0449\u043e \u0432\u0456\u0434\u043e\u043c\u0456 \u0432\u0430\u0448\u043e\u043c\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0443. \u0412\u043e\u043d\u0438 \u043f\u0435\u0440\u0435\u043b\u0456\u0447\u0435\u043d\u0456 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/netdb'>\u041c\u0435\u0440\u0435\u0436\u0435\u0432\u043e\u0457 \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445</a>. \u0426\u0435 \u043c\u043e\u0436\u0435 \u043a\u043e\u043b\u0438\u0432\u0430\u0442\u0438\u0441\u044f \u0432\u0456\u0434 \u043c\u0435\u043d\u0448\u0435 100 \u0434\u043e 1000 \u0430\u0431\u043e \u0431\u0456\u043b\u044c\u0448\u0435. \u0426\u0435 \u0447\u0438\u0441\u043b\u043e \u043d\u0435 \u0454 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u043c \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c \u043c\u0435\u0440\u0435\u0436\u0456; \u0432\u043e\u043d\u043e \u043c\u043e\u0436\u0435 \u0441\u0443\u0442\u0442\u0454\u0432\u043e \u0432\u0456\u0434\u0440\u0456\u0437\u043d\u044f\u0442\u0438\u0441\u044f \u0432 \u0437\u0430\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0456 \u0432\u0456\u0434 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u043e\u0457 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456, \u0441\u043f\u0456\u043b\u044c\u043d\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u043d\u043e\u0457 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0442\u0430 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0440\u0430\u0444\u0456\u043a\u0443. I2P \u043d\u0435 \u0432\u0438\u043c\u0430\u0433\u0430\u0454, \u0449\u043e\u0431 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0437\u043d\u0430\u0432 \u043a\u043e\u0436\u0435\u043d \u0456\u043d\u0448\u0438\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456.";
