    t[3059] = "\u041d\u0430\u0439\u0448\u0432\u0438\u0434\u0448\u0456 \u0442\u0440\u0430\u043d\u0437\u0438\u0442\u043d\u0456 \u0442\u0443\u043d\u0435\u043b\u0456";
    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "\u041c\u043e\u0436\u043d\u0430 \u043f\u0435\u0440\u0435override\u0438\u0442\u0438 <a href=http://127.0.0.1:7658/help/images/>\u0442\u0438\u043f\u043e\u0432\u0438\u0439 \u0432\u0438\u0433\u043b\u044f\u0434</a> \u0441\u043f\u0438\u0441\u043a\u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456\u0432, \u043d\u0430\u0434\u0430\u0432\u0448\u0438 \u0432\u0456\u0434\u0440\u0435\u0434\u0430\u0433\u043e\u0432\u0430\u043d\u0438\u0439 \u0444\u0430\u0439\u043b <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> \u0434\u043b\u044f \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0433\u043b\u043e\u0431\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u0438\u0433\u043b\u044f\u0434\u0443. \u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u0446\u0435\u0439 \u0444\u0430\u0439\u043b \u043d\u0435 \u0431\u0443\u0434\u0435 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0442\u0438\u0441\u044c \u0443 \u0441\u043f\u0438\u0441\u043a\u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456\u0432 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0430. \u0424\u0430\u0439\u043b\u0438 \u0442\u0430 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0438 \u0437 \u043f\u0440\u0435\u0444\u0456\u043a\u0441\u043e\u043c ., \u0430 \u0442\u0430\u043a\u043e\u0436 \u0444\u0430\u0439\u043b\u0438 \u0437 \u0456\u043c\u0435\u043d\u0430\u043c\u0438 favicon.ico \u0447\u0438 \u0437 \u043a\u0456\u043d\u0446\u0456\u0432\u043a\u0430\u043c\u0438 ~ \u0430\u0431\u043e .bak \u0447\u0438 .old \u0442\u0430\u043a\u043e\u0436 \u0431\u0443\u0434\u0443\u0442\u044c \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0456 (\u0430\u043b\u0435 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456). \u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u0414\u043b\u044f \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0438\u0445 \u0444\u0430\u0439\u043b\u0456\u0432 \u0437 \u043f\u0440\u0435\u0444\u0456\u043a\u0441\u043e\u043c . \u0432 Windows \u0434\u043e\u0434\u0430\u0439\u0442\u0435 \u043a\u0440\u0430\u043f\u043a\u0443 \u0432 \u043a\u0456\u043d\u0446\u0456 \u0456\u043c\u0435\u043d\u0456 \u0444\u0430\u0439\u043b\u0430 \u0447\u0438 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0443, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 <code>.hidden.</code>; \u043f\u0440\u0438 \u0446\u044c\u043e\u043c\u0443 Windows Explorer \u0437\u0431\u0435\u0440\u0435\u0436\u0435 \u0444\u0430\u0439\u043b \u0437 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0438\u043c \u0456\u043c'\u044f\u043c, \u0432\u0438\u0434\u0430\u043b\u044f\u044e\u0447\u0438 \u043a\u0456\u043d\u0446\u0435\u0432\u0443 \u043a\u0440\u0430\u043f\u043a\u0443.";
