    t[3093] = "\u0426\u0435 \u043c\u043e\u0436\u043d\u0430 \u0437\u0440\u043e\u0431\u0438\u0442\u0438 \u0448\u043b\u044f\u0445\u043e\u043c \u0437\u043d\u044f\u0442\u0442\u044f \u043f\u043e\u0437\u043d\u0430\u0447\u043a\u0438 \u0437 \u043e\u043f\u0446\u0456\u0457 <i>\u041f\u043e\u0434\u0456\u043b\u044f\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u0456 \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u043c\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0430\u043c\u0438</i>, \u044f\u043a\u0430 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454\u0442\u044c\u0441\u044f \u0443 \u0432\u043a\u043b\u0430\u0434\u0446\u0456 <i>\u0421\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u043a\u043b\u0456\u0454\u043d\u0442</i> \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u043e\u0433\u043e \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0456\u0441\u0443, \u043f\u0456\u0441\u043b\u044f \u0447\u043e\u0433\u043e \u0432\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0431\u0443\u0434\u0435 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u0446\u0435\u0439 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0439 \u0441\u0435\u0440\u0432\u0456\u0441 \u0437\u0456 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 <a href=/i2ptunnelmgr>\u0456\u043d\u0434\u0435\u043a\u0441\u0443 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>.";
