    t[3122] = "These keys are used to validate official router updates, signed development builds and the official news feed";
    t[3123] = "\u0426\u0456 \u043a\u043b\u044e\u0447\u0456 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0438 \u043e\u0444\u0456\u0446\u0456\u0439\u043d\u0438\u0445 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430, \u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0445 \u0437\u0431\u0456\u0440\u043e\u043a \u0440\u043e\u0437\u0440\u043e\u0431\u043a\u0438 \u0442\u0430 \u043e\u0444\u0456\u0446\u0456\u0439\u043d\u043e\u0457 \u0441\u0442\u0440\u0456\u0447\u043a\u0438 \u043d\u043e\u0432\u0438\u043d";
