    t[3157] = "\u0423\u0447\u0430\u0441\u043d\u0438\u043a\u0438";
    t[3160] = "This is a shortened version of the official FAQ. For the full version, please visit <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> or <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a>.";
    t[3161] = "\u0426\u0435 \u0441\u043a\u043e\u0440\u043e\u0447\u0435\u043d\u0430 \u0432\u0435\u0440\u0441\u0456\u044f \u043e\u0444\u0456\u0446\u0456\u0439\u043d\u043e\u0433\u043e FAQ. \u0414\u043b\u044f \u043f\u043e\u0432\u043d\u043e\u0457 \u0432\u0435\u0440\u0441\u0456\u0457 \u0431\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430 \u0432\u0456\u0434\u0432\u0456\u0434\u0430\u0439\u0442\u0435 <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> \u0430\u0431\u043e <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a>";
    t[3166] = "Total number of tunnels in use";
    t[3167] = "\u0417\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432";
    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "\u042f\u043a\u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0432 True, \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0430 \u0444\u0443\u043d\u043a\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0456\u0441\u0442\u044c \u0431\u0443\u0434\u0435 \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u0430 \u043d\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0456, \u0456 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447 \u0437\u043c\u043e\u0436\u0435 \u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0431\u0435\u0437\u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e \u043d\u0430 <a href=/configadvanced> \u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 </a>. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0456 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u043d\u0430\u0432\u0435\u0434\u0435\u043d\u0456 \u0432 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 <a href=/netdb>\u041c\u0435\u0440\u0435\u0436\u0435\u0432\u0430 \u0431\u0430\u0437\u0430 \u0434\u0430\u043d\u0438\u0445</a>, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0447\u0438 <a href='/netdb?f=3'>\u0406\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442 \u0430\u043d\u0430\u043b\u0456\u0437\u0443 Sybil</a>, \u0456 \u0454 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f \u041f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 <a href=/configclients>\u0421\u0442\u043e\u0440\u0456\u043d\u043a\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432</a>. \u0426\u0435 \u0442\u0430\u043a\u043e\u0436 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0456 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f, \u0432\u0440\u0443\u0447\u043d\u0443 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044e URL -\u0430\u0434\u0440\u0435\u0441\u0438 \u043d\u043e\u0432\u0438\u043d \u0442\u0430 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0456 \u0440\u043e\u0437\u0434\u0456\u043b\u0438 \u043d\u0430 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456.";
