    t[3200] = "Leave blank for DH, will be generated automatically";
    t[3201] = "\u0417\u0430\u043b\u0438\u0448\u0442\u0435 \u043f\u043e\u0440\u043e\u0436\u043d\u0456\u043c \u0434\u043b\u044f \u0426\u0422, \u0431\u0443\u0434\u0435 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043e \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e";
    t[3202] = "The following filter definition applies some throttling by default, no throttling for destinations in the file <i class=example>friends.txt</i>, forbids any connections from destinations in the file <i class=example>enemies.txt</i>, and logs any aggressive behavior in a file called <i class=example>suspicious.txt</i>:";
    t[3203] = "\u041d\u0430\u0441\u0442\u0443\u043f\u043d\u0435 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0444\u0456\u043b\u044c\u0442\u0440\u0443 \u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0434\u0435\u044f\u043a\u0435 \u0433\u0430\u043b\u044c\u043c\u0443\u0432\u0430\u043d\u043d\u044f \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u043d\u0435 \u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0433\u0430\u043b\u044c\u043c\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043b\u044f \u0446\u0456\u043b\u0435\u0439 \u0443 \u0444\u0430\u0439\u043b\u0456 <i class=example>friends.txt</i>, \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u044f\u0454 \u0431\u0443\u0434\u044c-\u044f\u043a\u0456 \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0437 \u0446\u0456\u043b\u0435\u0439 \u0443 \u0444\u0430\u0439\u043b\u0456 <i class=example>enemies.txt</i>, \u0456 \u0444\u0456\u043a\u0441\u0443\u0454 \u0431\u0443\u0434\u044c-\u044f\u043a\u0443 \u0430\u0433\u0440\u0435\u0441\u0438\u0432\u043d\u0443 \u043f\u043e\u0432\u0435\u0434\u0456\u043d\u043a\u0443 \u0443 \u0444\u0430\u0439\u043b\u0456 \u043f\u0456\u0434 \u043d\u0430\u0437\u0432\u043e\u044e <i class=example>suspicious.txt</i>:";
    t[3206] = "Router is currently using the configured maximum share bandwidth";
    t[3207] = "\u0420\u043e\u0443\u0442\u0435\u0440 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u043e\u0431\u0441\u044f\u0433 \u0441\u043f\u0456\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u0430\u043d\u0430\u043b\u0443";
