    t[3226] = "Packets retransmitted to peer";
    t[3227] = "\u041f\u0430\u043a\u0435\u0442\u0438 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u043e \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u043e\u043c\u0443 \u0432\u0443\u0437\u043b\u0443";
    t[3228] = "This setting determines whether a router acting as a floodfill will explore the NetDb to learn about new peers. [Default is false, restart required]";
    t[3229] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454, \u0447\u0438 \u0431\u0443\u0434\u0435 \u0440\u043e\u0443\u0442\u0435\u0440, \u044f\u043a\u0438\u0439 \u0434\u0456\u0454 \u044f\u043a \u0437\u0430\u043f\u043e\u0432\u043d\u044e\u0432\u0430\u0447 \u043f\u0430\u0432\u0443\u0442\u0438\u043d\u0438, \u0434\u043e\u0441\u043b\u0456\u0434\u0436\u0443\u0432\u0430\u0442\u0438 NetDb \u0434\u043b\u044f \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043d\u044f \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u043f\u0440\u043e \u043d\u043e\u0432\u0438\u0445 \u043f\u0456\u0440\u0456\u0432. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c false, \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a]";
    t[3230] = "Jar File Dump";
    t[3231] = "\u0414\u0430\u043c\u043f \u0444\u0430\u0439\u043b\u0443 Jar";
    t[3234] = "The keyring may contain keys for local or remote encrypted destinations.";
    t[3235] = "\u041a\u043b\u044e\u0447\u043e\u0432\u0435 \u043a\u0456\u043b\u044c\u0446\u0435 \u043c\u043e\u0436\u0435 \u043c\u0456\u0441\u0442\u0438\u0442\u0438 \u043a\u043b\u044e\u0447\u0456 \u0434\u043b\u044f \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0445 \u0430\u0431\u043e \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u0445 \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u0445 \u043f\u0443\u043d\u043a\u0442\u0456\u0432 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f.";
    t[3240] = "The first router in a tunnel. For inbound tunnels, this is the one mentioned in the <i>LeaseSet</i> published in the <i>Network Database</i>. For outbound tunnels, the gateway is the originating router.";
    t[3241] = "\u041f\u0435\u0440\u0448\u0438\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0432 \u0442\u0443\u043d\u0435\u043b\u0456. \u0414\u043b\u044f \u0432\u0445\u0456\u0434\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0446\u0435 \u0442\u043e\u0439, \u0449\u043e \u0437\u0433\u0430\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u0432 <i>LeaseSet</i>, \u043e\u043f\u0443\u0431\u043b\u0456\u043a\u043e\u0432\u0430\u043d\u043e\u043c\u0443 \u0432 <i>\u0411\u0430\u0437\u0456 \u0434\u0430\u043d\u0438\u0445 \u043c\u0435\u0440\u0435\u0436\u0456</i>. \u0414\u043b\u044f \u0432\u0438\u0445\u0456\u0434\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0448\u043b\u044e\u0437\u043e\u043c \u0454 \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u0438\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440.";
    t[3260] = "Multiple firewall/routers in the internet connection path";
