    t[3302] = "This is an experimental network database tool for debugging and analysis. Do not panic even if you see warnings indicated. Possible \"threats\" are summarized, however these are unlikely to be real threats. If you see anything you would like to discuss with the devs, contact us on IRC #i2p-dev.";
    t[3303] = "\u0426\u0435 \u0435\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0438\u0439 \u0456\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442 \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445 \u043c\u0435\u0440\u0435\u0436\u0456 \u0434\u043b\u044f \u043d\u0430\u043b\u0430\u0433\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0442\u0430 \u0430\u043d\u0430\u043b\u0456\u0437\u0443. \u041d\u0435 \u043f\u0430\u043d\u0456\u043a\u0443\u0439\u0442\u0435, \u043d\u0430\u0432\u0456\u0442\u044c \u044f\u043a\u0449\u043e \u0432\u0438 \u0431\u0430\u0447\u0438\u0442\u0435 \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0456 \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u0436\u0435\u043d\u043d\u044f. \u041c\u043e\u0436\u043b\u0438\u0432\u0456 \"\u0437\u0430\u0433\u0440\u043e\u0437\u0438\" \u0443\u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0435\u043d\u0456, \u043e\u0434\u043d\u0430\u043a \u0432\u043e\u043d\u0438 \u043d\u0430\u0432\u0440\u044f\u0434 \u0447\u0438 \u0441\u0442\u0430\u043d\u0443\u0442\u044c \u0440\u0435\u0430\u043b\u044c\u043d\u0438\u043c\u0438 \u0437\u0430\u0433\u0440\u043e\u0437\u0430\u043c\u0438. \u042f\u043a\u0449\u043e \u0432\u0438 \u0431\u0430\u0447\u0438\u0442\u0435 \u0449\u043e\u0441\u044c, \u0449\u043e \u0432\u0438 \u0445\u043e\u0442\u0456\u043b\u0438 \u0431 \u043e\u0431\u0433\u043e\u0432\u043e\u0440\u0438\u0442\u0438 \u0437 \u0440\u043e\u0437\u0440\u043e\u0431\u043d\u0438\u043a\u0430\u043c\u0438, \u0437\u0432\u2019\u044f\u0436\u0456\u0442\u044c\u0441\u044f \u0437 \u043d\u0430\u043c\u0438 \u043d\u0430 IRC #i2p-dev \u0430\u0431\u043e #saltR.";
