    t[3319] = "\u044f\u043a\u0449\u043e \u0443 \u043d\u0430\u0441 \u043d\u0435\u043c\u0430\u0454 \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440\u0430";
    t[3322] = "A <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> link (which always ends with .b32.i2p) is a hash of a <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a> destination. For services on the network, the Base64 hash is often mapped to an .i2p domain in the addressbook.";
    t[3323] = "\u041f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>\u0411\u0430\u0437\u0430 32</a> (\u044f\u043a\u0435 \u0437\u0430\u0432\u0436\u0434\u0438 \u0437\u0430\u043a\u0456\u043d\u0447\u0443\u0454\u0442\u044c\u0441\u044f \u043d\u0430 .b32.i2p) - \u0446\u0435 \u0445\u0435\u0448 <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>\u0411\u0430\u0437\u0438 64</a> \u0446\u0456\u043b\u044c\u043e\u0432\u043e\u0433\u043e \u043e\u0431'\u0454\u043a\u0442\u0443. \u0414\u043b\u044f \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 \u0445\u0435\u0448 \u0411\u0430\u0437\u0438 64 \u0447\u0430\u0441\u0442\u043e \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u0434\u043e\u043c\u0435\u043d .i2p \u0432 \u043a\u043d\u0438\u0437\u0456 \u0430\u0434\u0440\u0435\u0441.";
    t[3326] = "Please enable sharing (participating in tunnels) by configuring more bandwidth. ";
    t[3327] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0456\u0442\u044c \u0441\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f (\u0443\u0447\u0430\u0441\u0442\u044c \u0443 \u0442\u0443\u043d\u0435\u043b\u044f\u0445), \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0432\u0448\u0438 \u0431\u0456\u043b\u044c\u0448\u0443 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0443 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c. ";
