    t[3341] = "\u0421\u0435\u0440\u0435\u0434\u043d\u044f \u0432\u0456\u0434\u0441\u0442\u0430\u043d\u044c (\u0431\u0456\u0442)";
    t[3346] = "If you specify the wrong IP address, or do not properly configure your NAT or firewall, your network performance will degrade substantially.";
