    t[3396] = "A fork of the <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent client</a> refactored for use on the I2P network. Usually supplied as part of the default suite of applications with Java I2P, and also available as a <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>standalone Java application</a>.";
    t[3397] = "\u0420\u043e\u0437\u0433\u0430\u043b\u0443\u0436\u0435\u043d\u043d\u044f <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>\u043a\u043b\u0456\u0454\u043d\u0442\u0430 Snark BitTorrent</a> \u043f\u0435\u0440\u0435\u0440\u043e\u0431\u043b\u0435\u043d\u043e \u0434\u043b\u044f \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u043f\u043e\u0441\u0442\u0430\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u044f\u043a \u0447\u0430\u0441\u0442\u0438\u043d\u0430 \u043d\u0430\u0431\u043e\u0440\u0443 \u043f\u0440\u043e\u0433\u0440\u0430\u043c \u0437\u0430 \u0443\u043c\u043e\u0432\u0447\u0430\u043d\u043d\u044f\u043c \u0456\u0437 Java I2P, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0430 \u044f\u043a <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>\u043e\u043a\u0440\u0435\u043c\u0430 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0430 Java</a> .";
    t[3400] = "Shutdown imminent";
    t[3401] = "\u0417\u0443\u043f\u0438\u043d\u043a\u0430 \u043d\u0435\u043c\u0438\u043d\u0443\u0447\u0430";
    t[3402] = "UDP for SAM bridge";
    t[3403] = "UDP \u0434\u043b\u044f \u043c\u043e\u0441\u0442\u0443 SAM";
    t[3410] = "Hiding {0} older profile.";
    t[3411] = new java.lang.String[] { "\u041f\u0440\u0438\u0445\u043e\u0432\u0443\u0432\u0430\u043d\u043d\u044f {0} \u0421\u0442\u0430\u0440\u0456\u0448\u0438\u0439 \u043f\u0440\u043e\u0444\u0456\u043b\u044c.", "\u041f\u0440\u0438\u0445\u043e\u0432\u0443\u0432\u0430\u043d\u043d\u044f {0} \u0421\u0442\u0430\u0440\u0456\u0448\u0456 \u043f\u0440\u043e\u0444\u0456\u043b\u0456.", "\u041f\u0440\u0438\u0445\u043e\u0432\u0443\u0432\u0430\u043d\u043d\u044f {0} \u0421\u0442\u0430\u0440\u0456\u0448\u0456 \u043f\u0440\u043e\u0444\u0456\u043b\u0456." };
    t[3416] = "If you are running the Tor Browser, you may use its Tor instance by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9150</code>.";
    t[3417] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435 Tor Browser, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u0442\u0438 \u0439\u043e\u0433\u043e \u0435\u043a\u0437\u0435\u043c\u043f\u043b\u044f\u0440 Tor, \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0432\u0448\u0438 I2P: <i>\u0422\u0438\u043f \u043f\u0440\u043e\u043a\u0441\u0456:</i> <code>SOCKS 5</code> <i>\u0425\u043e\u0441\u0442:</i> <code>127.0.0.1</code> <i>\u041f\u043e\u0440\u0442:</i> <code>9150</code>.";
    t[3428] = "Use IPv6 only (disable IPv4)";
    t[3429] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043b\u0438\u0448\u0435 IPv6 (\u0432\u0438\u043c\u043a\u043d\u0443\u0442\u0438 IPv4)";
    t[3432] = "If set to true, this option will place an icon in the system tray / notification area, with basic service control options. [Disabled by default]";
    t[3433] = "\u042f\u043a\u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 true, \u0446\u044f \u043e\u043f\u0446\u0456\u044f \u0440\u043e\u0437\u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043f\u0456\u043a\u0442\u043e\u0433\u0440\u0430\u043c\u0443 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u043e\u043c\u0443 \u043b\u043e\u0442\u043a\u0443 / \u043e\u0431\u043b\u0430\u0441\u0442\u0456 \u0441\u043f\u043e\u0432\u0456\u0449\u0435\u043d\u044c \u0437 \u0431\u0430\u0437\u043e\u0432\u0438\u043c\u0438 \u043e\u043f\u0446\u0456\u044f\u043c\u0438 \u043a\u0435\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u0441\u0435\u0440\u0432\u0456\u0441\u043e\u043c. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u043e]";
    t[3440] = "Windows";
    t[3441] = "Windows";
    t[3444] = "Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
