    t[3452] = "Sort by packets received more than once";
    t[3453] = "\u0421\u043e\u0440\u0442\u0443\u0432\u0430\u0442\u0438 \u0437\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044e \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u0438\u0445 \u043f\u0430\u043a\u0435\u0442\u0456\u0432 \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u0438\u0445 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u0440\u0430\u0437\u0456\u0432";
