    t[3460] = "INTERNET FACING PORTS";
    t[3461] = "\u041f\u041e\u0420\u0422\u0418 \u0417 \u0406\u041d\u0422\u0415\u0420\u041d\u0415\u0422\u0423";
    t[3462] = "Config Dir";
    t[3463] = "\u041a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0439\u043d\u0438\u0439 \u043a\u0430\u0442\u0430\u043b\u043e\u0433";
    t[3464] = "This setting configures the initial size of the outbound message queue. [Default is 64]";
    t[3465] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0443\u0454 \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u0438\u0439 \u0440\u043e\u0437\u043c\u0456\u0440 \u0447\u0435\u0440\u0433\u0438 \u0432\u0438\u0445\u0456\u0434\u043d\u0438\u0445 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 64]";
    t[3466] = "Larger interval";
    t[3467] = "\u0411\u0456\u043b\u044c\u0448\u0438\u0439 \u0456\u043d\u0442\u0435\u0440\u0432\u0430\u043b";
    t[3468] = "You must first update to version {0}";
    t[3469] = "\u0421\u043f\u043e\u0441\u0430\u0442\u043a\u0443 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u043e\u043d\u043e\u0432\u0438\u0442\u0438 \u0434\u043e \u0432\u0435\u0440\u0441\u0456\u0457 {0}";
    t[3472] = "ago";
    t[3473] = "\u043d\u0430\u0437\u0430\u0434";
    t[3476] = "Threads dumped to {0}";
    t[3477] = "\u0414\u0430\u043c\u043f \u043f\u043e\u0442\u043e\u043a\u0456\u0432 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u043e \u0434\u043e {0}";
    t[3480] = "Bandwidth in/out";
    t[3481] = "\u0412\u0445\u0456\u0434/\u0432\u0438\u0445\u0456\u0434 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456";
    t[3482] = "This setting determines whether stats about our router are sporadically published to the NetDb. [Default is false]";
    t[3483] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454, \u0447\u0438 \u0431\u0443\u0434\u0443\u0442\u044c \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u0447\u043d\u0456 \u0434\u0430\u043d\u0456 \u043f\u0440\u043e \u043d\u0430\u0448 \u0440\u043e\u0443\u0442\u0435\u0440 \u0435\u043f\u0456\u0437\u043e\u0434\u0438\u0447\u043d\u043e \u043f\u0443\u0431\u043b\u0456\u043a\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u0432 NetDb. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c false]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "\u0426\u0435 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0440\u0456\u0432, \u044f\u043a\u0456 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0432\u0430\u0448\u043e\u043c\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0443 \u0434\u043b\u044f \u0444\u043e\u0440\u043c\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0446\u0435 8-30. \u0412\u0430\u0448\u0456 \u0448\u0432\u0438\u0434\u043a\u0456 \u043f\u0456\u0440\u0438 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u0456 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/profiles'>\u041f\u0440\u043e\u0444\u0456\u043b\u0456\u0432</a>. <a href='/configstats#router.fastPeers'>[\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0433\u0440\u0430\u0444\u0456\u043a\u0443]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "\u041d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u043a\u043d\u043e\u043f\u043a\u0443 <i>\u041f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u0437 \u0444\u0430\u0439\u043b\u0443</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "\u0420\u0456\u0437\u043d\u043e\u0432\u0438\u0434 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u0457 \u0446\u0438\u0431\u0443\u043b\u0438\u043d, \u0449\u043e \u0448\u0438\u0444\u0440\u0443\u0454 \u043a\u0456\u043b\u044c\u043a\u0430 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c \u0440\u0430\u0437\u043e\u043c \u0434\u043b\u044f \u0443\u0441\u043a\u043b\u0430\u0434\u043d\u0435\u043d\u043d\u044f \u043f\u0435\u0440\u0435\u0445\u043e\u043f\u043b\u0435\u043d\u043d\u044f \u0442\u0440\u0430\u0444\u0456\u043a\u0443 \u0456 \u043f\u0440\u0438\u0441\u043a\u043e\u0440\u0435\u043d\u043d\u044f \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0456 \u0434\u0430\u043d\u0438\u0445. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u0432 <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>\u043e\u043d\u043b\u0430\u0439\u043d-\u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u0457</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "\u042f\u043a \u0443\u0449\u0456\u043b\u044c\u043d\u0438\u0442\u0438 \u0432\u0430\u0448 \u0441\u0430\u0439\u0442 WordPress";
    t[3496] = "I2P Internals";
    t[3497] = "\u0412\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u0456 \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u0457 I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c I2P \u043e\u0441\u043d\u0430\u0449\u0435\u043d\u0438\u0439 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u043e\u043c \u0434\u043b\u044f \u0445\u043e\u0441\u0442\u0438\u043d\u0433\u0443 \u0432\u0430\u0448\u043e\u0433\u043e \u0432\u043b\u0430\u0441\u043d\u043e\u0433\u043e \u0430\u043d\u043e\u043d\u0456\u043c\u0456\u0437\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0441\u0430\u0439\u0442\u0443 (\u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0439\u043d\u043e \u0437\u0432\u0430\u043d\u043e\u0433\u043e <i>eepsite</i>). \u0406 \u0441\u0430\u0439\u0442, \u0456 \u043a\u043e\u043d\u0441\u043e\u043b\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P \u043f\u0440\u0430\u0446\u044e\u044e\u0442\u044c \u043d\u0430 \u0441\u043f\u0440\u043e\u0449\u0435\u043d\u0456\u0439 \u0432\u0435\u0440\u0441\u0456\u0457 <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink externalJetty</a>, \u0430\u0434\u0430\u043f\u0442\u043e\u0432\u0430\u043d\u0456\u0439 \u0434\u043b\u044f I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u0430\u0454 \u0437\u043c\u043e\u0433\u0443 \u0432\u0438\u043a\u043b\u044e\u0447\u0430\u0442\u0438 \u0437 \u0432\u0430\u0448\u043e\u0433\u043e NetDb \u0441\u0442\u0430\u0440\u0456 \u0440\u043e\u0443\u0442\u0435\u0440\u0438. \u0420\u043e\u0443\u0442\u0435\u0440\u0438, \u0441\u0442\u0430\u0440\u0448\u0456 \u0437\u0430 \u0442\u0438\u043f\u043e\u0432\u0435 \u0430\u0431\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0435 \u0432\u0430\u043c\u0438 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0438\u0434\u0430\u043b\u0435\u043d\u0456 \u0437 NetDb \u0442\u0430 \u0437\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u0456 \u043d\u0430 \u0447\u0430\u0441 \u0440\u043e\u0431\u043e\u0442\u0438 \u0440\u043e\u0443\u0442\u0435\u0440\u0430. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0432\u0438\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c\u0441\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0438, \u0441\u0442\u0430\u0440\u0448\u0456 \u0437\u0430 0.9.20. \u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u043f\u043e\u0447\u0438\u043d\u0430\u044e\u0447\u0438 \u0437 \u0432\u0435\u0440\u0441\u0456\u0457 I2P+ 0.9.46+, \u0434\u043b\u044f \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0438 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u043b\u0438\u0448\u0435 \u0440\u043e\u0443\u0442\u0435\u0440\u0438, \u0449\u043e \u043f\u0440\u0430\u0446\u044e\u044e\u0442\u044c \u043d\u0430 \u0434\u0443\u0436\u0435 \u0441\u0432\u0456\u0436\u0438\u0445 \u0432\u0435\u0440\u0441\u0456\u044f\u0445. [\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a]";
    t[3508] = "HackerNews";
    t[3509] = "HackerNews";
    t[3510] = "Registering an I2P Domain";
    t[3511] = "\u0420\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u044f \u0434\u043e\u043c\u0435\u043d\u0443 I2P";
