    t[3514] = "Router Console Language";
    t[3515] = "\u041c\u043e\u0432\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
