    t[3525] = "\u0416\u0443\u0440\u043d\u0430\u043b \u0441\u0435\u0440\u0432\u0456\u0441\u0443 (\u043e\u0431\u0433\u043e\u0440\u0442\u043a\u0430)";
    t[3528] = "Floodfill enabled";
    t[3529] = "Floodfill \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e";
    t[3538] = "Changelog";
    t[3539] = "\u0416\u0443\u0440\u043d\u0430\u043b \u0437\u043c\u0456\u043d";
    t[3542] = "Internal Error";
    t[3543] = "\u0412\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u044f \u043f\u043e\u043c\u0438\u043b\u043a\u0430";
    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "\u0426\u0435\u0439 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440, \u0432 \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445, \u0437\u0430\u043c\u0456\u043d\u044e\u0454 \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u043d\u044f \u0447\u0430\u0441\u0443 \u043e\u0431\u0440\u043e\u0431\u043a\u0438 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c (\u0432\u043a\u0430\u0437\u0430\u043d\u0435 \u044f\u043a <i>\u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0430 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f</i> \u0443 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 \u0431\u0456\u0447\u043d\u043e\u0457 \u043f\u0430\u043d\u0435\u043b\u0456 \u0437\u0430\u0442\u043e\u0440\u0456\u0432), \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0431\u0443\u0434\u0435 \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454\u0442\u044c\u0441\u044f, \u0430 \u0437\u0430\u043f\u0438\u0442\u0438 \u043d\u0430 \u0442\u0443\u043d\u0435\u043b\u044c \u0442\u0440\u0430\u043d\u0437\u0438\u0442\u0443 \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0456\u0434\u0445\u0438\u043b\u0435\u043d\u0456. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 750 \u043c\u0441 \u0430\u0431\u043e 1500 \u043c\u0441, \u044f\u043a\u0449\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043f\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0439 \u044f\u043a \u043f\u043e\u0432\u0456\u043b\u044c\u043d\u0438\u0439]";
    t[3550] = "No lifetime events";
    t[3551] = "\u0416\u043e\u0434\u043d\u0438\u0445 \u0436\u0438\u0442\u0442\u0454\u0432\u0438\u0445 \u043f\u043e\u0434\u0456\u0439";
    t[3556] = "No stored analysis";
    t[3557] = "\u041d\u0435\u043c\u0430\u0454 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u043e\u0433\u043e \u0430\u043d\u0430\u043b\u0456\u0437\u0443";
    t[3560] = "To update with unsigned I2P+ release builds: <code>http://skank.i2p/i2pupdate.zip</code> or for the latest unsigned development builds: <code>http://skank.i2p/dev/i2pupdate.zip</code>";
    t[3561] = "\u0429\u043e\u0431 \u043e\u043d\u043e\u0432\u0438\u0442\u0438 \u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0456 \u0437\u0431\u0456\u0440\u043a\u0438 \u0432\u0438\u043f\u0443\u0441\u043a\u0443 I2P+: <code>http://skank.i2p/i2pupdate.zip</code> \u0430\u0431\u043e \u0434\u043b\u044f \u043e\u0441\u0442\u0430\u043d\u043d\u0456\u0445 \u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0445 \u0437\u0431\u0456\u0440\u043e\u043a \u0440\u043e\u0437\u0440\u043e\u0431\u043a\u0438: <code>http://skank.i2p/dev/i2pupdate</code>";
    t[3564] = "Invalid form submission, probably because you used the 'back' or 'reload' button on your browser. Please resubmit.";
    t[3565] = "\u041d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u0430 \u0444\u043e\u0440\u043c\u0430, \u043c\u043e\u0436\u043b\u0438\u0432\u043e \u0432\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435 \u0434\u0456\u044e \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430 \"\u043d\u0430\u0437\u0430\u0434\" \u0430\u0431\u043e \"\u043e\u043d\u043e\u0432\u0438\u0442\u0438\". \u0411\u0443\u0434\u044c-\u043b\u0430\u0441\u043a\u0430 \u043f\u043e\u0432\u0442\u043e\u0440\u0456\u0442\u044c \u0441\u043f\u0440\u043e\u0431\u0443.";
    t[3566] = "Restart Status";
    t[3567] = "\u0421\u0442\u0430\u0442\u0443\u0441 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443";
    t[3568] = "IPv6 Configuration";
    t[3569] = "\u041a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f IPv6";
    t[3578] = "Peak throughput (bytes per second) over a 1 minute period that the peer has sustained in a single tunnel.";
    t[3579] = "\u041f\u0456\u043a\u043e\u0432\u0430 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0430 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c (\u0431\u0430\u0439\u0442\u0456\u0432 \u043d\u0430 \u0441\u0435\u043a\u0443\u043d\u0434\u0443) \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c 1 \u0445\u0432\u0438\u043b\u0438\u043d\u0438, \u044f\u043a\u0443 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0439 \u043f\u0440\u0438\u0441\u0442\u0440\u0456\u0439 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u0432 \u0432 \u043e\u0434\u043d\u043e\u043c\u0443 \u0442\u0443\u043d\u0435\u043b\u0456.";
    t[3582] = "Known high capacity peers";
    t[3583] = "\u0412\u0456\u0434\u043e\u043c\u0456 \u0432\u0438\u0441\u043e\u043a\u043e\u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u0456 \u0430\u043d\u0430\u043b\u043e\u0433\u0438";
    t[3586] = "Proxy to connect to I2P's anonymized IRC chat network";
    t[3587] = "\u041f\u0440\u043e\u043a\u0441\u0456 \u0434\u043b\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u043e\u0457 \u043c\u0435\u0440\u0435\u0436\u0456 \u0447\u0430\u0442\u0443 IRC I2P";
    t[3588] = "After reporting, please restart your router";
    t[3589] = "\u041f\u0456\u0441\u043b\u044f \u0437\u0432\u0456\u0442\u0443 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440";
    t[3598] = "No longer be a member of the family {0}.";
    t[3599] = "\u0431\u0456\u043b\u044c\u0448\u0435 \u043d\u0435 \u0431\u0443\u0442\u0438 \u0447\u043b\u0435\u043d\u043e\u043c \u0441\u0456\u043c\u2019\u0457 {0}.";
    t[3600] = "No password entered";
    t[3601] = "\u041f\u0430\u0440\u043e\u043b\u044c \u043d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u043e";
    t[3604] = "Enabling this mode will prevent participating traffic";
    t[3605] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043d\u044f \u0446\u044c\u043e\u0433\u043e \u0440\u0435\u0436\u0438\u043c\u0443 \u0437\u0430\u043f\u043e\u0431\u0456\u0433\u0430\u0454 \u0443\u0447\u0430\u0441\u0442\u0456 \u0442\u0440\u0430\u0444\u0456\u043a\u0443";
    t[3618] = "ERR - Clock Skew";
    t[3619] = "\u041f\u041e\u041c\u0418\u041b\u041a\u0410 - \u0412\u0456\u0434\u0445\u0438\u043b\u0435\u043d\u043d\u044f \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u0430";
    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "\u0426\u0435\u0439 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440 \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454, \u0447\u0438 \u0441\u043b\u0456\u0434 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043d\u0430\u0434\u0430\u043d\u0438\u0439 \u0444\u0430\u0439\u043b <i> blocklist.txt </i> \u0442\u0430 \u0431\u0443\u0434\u044c -\u044f\u043a\u0456 \u0441\u043f\u0438\u0441\u043a\u0438, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0456 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0435\u043c, \u0449\u043e\u0431 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u0438 \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u0445\u0435\u0448 \u0430\u0431\u043e IP+ -\u0430\u0434\u0440\u0435\u0441\u0438. \u0414\u0456\u0430\u043f\u0430\u0437\u043e\u043d\u0438 \u0442\u0430 \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u0456 \u043c\u0430\u0441\u043a\u0438 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043b\u044f IPv4, \u0430\u043b\u0435 \u043d\u0435 IPv6. \u0414\u043b\u044f \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043d\u044f \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u043e\u0457 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u0434\u0438\u0432. [\u0423\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e]";
