    t[3639] = "\u0412\u0438\u0445\u0456\u0434\u043d\u0435 UDP \u043d\u0430 \u043f\u043e\u0440\u0442\u0456 123, \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u044e\u0447\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456: \u0446\u0435 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0435 \u0434\u043b\u044f \u0432\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u044c\u043e\u0457 \u0441\u0438\u043d\u0445\u0440\u043e\u043d\u0456\u0437\u0430\u0446\u0456\u0457 \u0447\u0430\u0441\u0443 I2P (\u0447\u0435\u0440\u0435\u0437 SNTP - \u0437\u0430\u043f\u0438\u0442 \u0432\u0438\u043f\u0430\u0434\u043a\u043e\u0432\u043e\u0433\u043e \u0445\u043e\u0441\u0442\u0430 SNTP \u0432 <code>pool.ntp.org</code> \u0430\u0431\u043e <a href=/help/advancedsettings#ntpserverconfig>\u0456\u043d\u0448\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u0432\u043a\u0430\u0437\u0430\u043d\u043e\u0433\u043e \u0412\u0430\u043c\u0438</a>).";
