    t[3655] = "\u041a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432, \u043f\u043e\u0434\u0456\u0431\u043d\u0438\u0445 \u0434\u043e XChat, \u043c\u043e\u0436\u0443\u0442\u044c \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u043d\u043e\u0432\u0443 \u043c\u0435\u0440\u0435\u0436\u0443 \u0437\u0456 \u0441\u0435\u0440\u0432\u0435\u0440\u043e\u043c <code>127.0.0.1/6668</code> (\u043d\u0435 \u0437\u0430\u0431\u0443\u0434\u044c\u0442\u0435 \u0432\u0456\u0434\u0437\u043d\u0430\u0447\u0438\u0442\u0438 \u043f\u0440\u0430\u043f\u043e\u0440\u0435\u0446\u044c <i>\u041e\u0431\u0456\u0439\u0442\u0438 \u043f\u0440\u043e\u043a\u0441\u0456-\u0441\u0435\u0440\u0432\u0435\u0440</i> \u044f\u043a\u0449\u043e \u0432\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043b\u0438 \u043f\u0440\u043e\u043a\u0441\u0456-\u0441\u0435\u0440\u0432\u0435\u0440), \u0430\u0431\u043e \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438\u0441\u044f \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u044e <code>/server 127.0.0.1 6668</code>. \u0421\u0438\u043d\u0442\u0430\u043a\u0441\u0438\u0441 \u043c\u043e\u0436\u0435 \u0432\u0456\u0434\u0440\u0456\u0437\u043d\u044f\u0442\u0438\u0441\u044f \u0443 \u0440\u0456\u0437\u043d\u0438\u0445 IRC-\u043a\u043b\u0456\u0454\u043d\u0442\u0430\u0445.";
