    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "\u041f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430, \u043f\u0435\u0440\u0435\u043b\u0456\u0447\u0435\u043d\u0456 \u043d\u0438\u0436\u0447\u0435, \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0432 \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0456 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430, \u044f\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u0442\u043e\u043c\u0443, \u0449\u043e \u0432\u043e\u043d\u0438 \u0440\u0456\u0434\u043a\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0430\u0431\u043e \u043d\u0430\u0434\u0430\u044e\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0445 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c, \u044f\u043a\u0456 \u0431\u0456\u043b\u044c\u0448\u043e\u0441\u0442\u0456 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456\u0432 \u043d\u0435 \u0437\u043d\u0430\u0434\u043e\u0431\u043b\u044f\u0442\u044c\u0441\u044f. \u0426\u0435 \u043d\u0435 \u0432\u0438\u0447\u0435\u0440\u043f\u043d\u0438\u0439 \u0441\u043f\u0438\u0441\u043e\u043a. \u0414\u0435\u044f\u043a\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0432\u0430\u0442\u0438\u043c\u0443\u0442\u044c \u043f\u0435\u0440\u0435\u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430. \u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u0432\u0441\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0447\u0443\u0442\u043b\u0438\u0432\u0456 \u0434\u043e \u0440\u0435\u0433\u0456\u0441\u0442\u0440\u0443. \u0412\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0431\u0443\u0434\u0435 \u0432\u0456\u0434\u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u0441\u0432\u0456\u0439 \u0444\u0430\u0439\u043b <code>router.config</code>, \u0449\u043e\u0431 \u0434\u043e\u0434\u0430\u0442\u0438 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438, \u0430\u0431\u043e, \u044f\u043a \u0442\u0456\u043b\u044c\u043a\u0438 \u0432\u0438 \u0434\u043e\u0434\u0430\u0454\u0442\u0435 <code>routerconsole.advanced=true</code> \u0434\u043e \u0444\u0430\u0439\u043b\u0443 router.config, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0423 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043d\u0430 <a href=/configadvanced>\u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430 \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u043e\u0457 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457</a>.";
