    t[3941] = "\u041f\u0435\u0440\u0435\u0439\u0442\u0438 \u0432\u043d\u0438\u0437";
    t[3944] = "Router Information (advanced)";
    t[3945] = "\u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 (\u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0439)";
    t[3950] = "Maximum transmission unit";
    t[3951] = "\u041c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0438\u0439 \u0431\u043b\u043e\u043a \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0456";
    t[3954] = "NTCP [IPv6] &amp; SSU";
    t[3955] = "NTCP [IPv6] &amp; SSU";
    t[3958] = "I2P requires your computer's time be accurate.";
    t[3959] = "I2P \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u0442\u043e\u0447\u043d\u043e\u0433\u043e \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440\u043d\u043e\u0433\u043e \u0447\u0430\u0441\u0443.";
    t[3960] = "Just finished jobs";
    t[3961] = "\u0429\u043e\u0439\u043d\u043e \u0437\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u0456 \u0440\u043e\u0431\u043e\u0442\u0438";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "\u0414\u0435\u044f\u043a\u0456 IRC-\u043a\u043b\u0456\u0454\u043d\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0456 \u043d\u0430 \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0432\u0456\u0434 \u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u044f\u043a\u0449\u043e \u043d\u0435 \u0431\u0443\u043b\u043e \u0437\u0432'\u044f\u0437\u043a\u0443 \u0437 \u0441\u0435\u0440\u0432\u0435\u0440\u043e\u043c \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u043f\u0435\u0432\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 \u0447\u0430\u0441\u0443, \u0449\u043e \u0456\u043d\u043a\u043e\u043b\u0438 \u043c\u043e\u0436\u0435 \u0432\u0438\u043a\u043b\u0438\u043a\u0430\u0442\u0438 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0438 \u0434\u043b\u044f IRC \u0432 I2P, \u044f\u043a\u0449\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f <i>\u0442\u0430\u0439\u043c-\u0430\u0443\u0442\u0443 ping</i> \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0437\u0430\u043d\u0430\u0434\u0442\u043e \u043d\u0438\u0437\u044c\u043a\u043e. \u0412\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0432\u0438\u0441\u043e\u043a\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0442\u0430\u0439\u043c-\u0430\u0443\u0442\u0443 ping \u0443 \u0432\u0430\u0448\u043e\u043c\u0443 \u043a\u043b\u0456\u0454\u043d\u0442\u0456 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 320 \u0441\u0435\u043a\u0443\u043d\u0434) \u0447\u0430\u0441\u0442\u043e \u043f\u0440\u0438\u0437\u0432\u0435\u0434\u0435 \u0434\u043e \u0431\u0456\u043b\u044c\u0448 \u0441\u0442\u0430\u0431\u0456\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456. \u0423 HexChat \u0446\u0435 \u043c\u043e\u0436\u043d\u0430 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u044e <code>/set net_ping_timeout 320</code>. \u0426\u0435 \u0437\u0430\u043f\u0438\u0448\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u0432\u0430\u0448\u043e\u0433\u043e \u0444\u0430\u0439\u043b\u0443 <code>hexchat.conf</code>.";
    t[3964] = "Run at Startup?";
    t[3965] = "\u0417\u0430\u043f\u0443\u0441\u043a\u0430\u0442\u0438 \u043f\u0456\u0434 \u0447\u0430\u0441 \u0441\u0442\u0430\u0440\u0442\u0443 \u0441\u0438\u0441\u0442\u0435\u043c\u0438?";
    t[3972] = "Never";
    t[3973] = "\u041d\u0456\u043a\u043e\u043b\u0438";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f <a href=/confignet#ipchange>\u043d\u0435\u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u043e\u0432\u043e\u0457 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457</a>, \u0449\u043e \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0437\u043c\u0456\u043d\u044e\u0454 \u0432\u0430\u0448\u0443 <a href=/netdb?r=.>\u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430</a> \u0456 <a href=/confignet#udpconfig>\u0437\u043e\u0432\u043d\u0456\u0448\u043d\u0456\u0439 \u043f\u043e\u0440\u0442</a> \u043f\u0440\u0438 \u0437\u043c\u0456\u043d\u0456 \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u043e\u0457 IP-\u0430\u0434\u0440\u0435\u0441\u0438, \u043d\u0430 \u044f\u043a\u0456\u0439 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u0432\u0430\u0448\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0430. \u0426\u0435 \u043c\u043e\u0436\u0435 \u0437\u0430\u043f\u043e\u0431\u0456\u0433\u0442\u0438 \u043a\u043e\u0440\u0435\u043b\u044f\u0446\u0456\u0457 \u0456\u0434\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0442\u043e\u0440\u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0456 IP-\u0430\u0434\u0440\u0435\u0441\u0438 \u043f\u0440\u043e\u0442\u0438\u0432\u043d\u0438\u043a\u043e\u043c \u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0430\u0445, \u043a\u043e\u043b\u0438 \u0432\u0430\u0448\u0430 IP-\u0430\u0434\u0440\u0435\u0441\u0430 \u043c\u043e\u0436\u0435 \u0437\u043c\u0456\u043d\u044e\u0432\u0430\u0442\u0438\u0441\u044f \u0447\u0430\u0441\u0442\u043e, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u043a\u043e\u043b\u0438 \u0432\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435 I2P \u043d\u0430 \u043d\u043e\u0443\u0442\u0431\u0443\u0446\u0456 \u0437 \u0440\u0456\u0437\u043d\u0438\u0445 \u043c\u0456\u0441\u0446\u044c.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043d\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0446\u0456\u044e \u0441\u0432\u043e\u0454\u0457 \u0430\u0434\u0440\u0435\u0441\u0438, \u0442\u043e\u043c\u0443 \u0432\u0456\u043d \u043d\u0435 \u043e\u0447\u0456\u043a\u0443\u0454 \u0432\u0445\u0456\u0434\u043d\u0438\u0445 \u0437'\u0454\u0434\u043d\u0430\u043d\u044c.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "\u041a\u043e\u043c\u0430\u043d\u0434\u043d\u0438\u0439 \u0440\u044f\u0434\u043a\u043e\u0432\u0438\u0439 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043e\u043a, \u043f\u043e\u0441\u0442\u0430\u0447\u0435\u043d\u0438\u0439 \u0440\u0430\u0437\u043e\u043c \u0437 I2P+ (Linux/MacOS), \u044f\u043a\u0438\u0439 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u043d\u044f \u0437\u0430\u043f\u0438\u0442\u0443 <code>head</code> \u043d\u0430 \u043f\u0435\u0432\u043d\u043e\u043c\u0443 http-\u0440\u0435\u0441\u0443\u0440\u0441\u0456 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456, \u043f\u043e\u0432\u0435\u0440\u0442\u0430\u044e\u0447\u0438 \u0440\u0456\u0437\u043d\u0456 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0456\u0432 \u0432\u0456\u0434 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c eephead \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454 HTTP-\u043f\u0440\u043e\u043a\u0441\u0456 \u043d\u0430 <code>127.0.0.1:4444</code>.";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
    t[4011] = "IPv6 NTCP, SSU, \u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u0438\u043a\u0438";
    t[4016] = "Console language saved.";
    t[4017] = "\u041c\u043e\u0432\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0430.";
    t[4022] = "Rebuilding";
    t[4023] = "\u0412\u0456\u0434\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f";
    t[4024] = "Known";
    t[4025] = "\u0412\u0456\u0434\u043e\u043c\u0456";
    t[4026] = "This setting permits a custom text prefix to be set for the page title on router console pages, potentially useful when you have multiple consoles open on browser tabs and want an easy method to differentiate between them.";
    t[4027] = "\u0426\u044f \u043d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0430 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0432\u043b\u0430\u0441\u043d\u0438\u0439 \u043f\u0440\u0435\u0444\u0456\u043a\u0441 \u0442\u0435\u043a\u0441\u0442\u0443 \u0434\u043b\u044f \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430\u0445 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u0440\u043e\u0443\u0442\u0435\u0440\u0430, \u0449\u043e \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u043a\u043e\u0440\u0438\u0441\u043d\u0438\u043c, \u043a\u043e\u043b\u0438 \u0443 \u0432\u0430\u0441 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u043e \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0435\u0439 \u043d\u0430 \u0432\u043a\u043b\u0430\u0434\u043a\u0430\u0445 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430, \u0456 \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u043f\u0440\u043e\u0441\u0442\u0438\u0439 \u0441\u043f\u043e\u0441\u0456\u0431 \u0440\u043e\u0437\u0440\u0456\u0437\u043d\u0438\u0442\u0438 \u0457\u0445.";
    t[4034] = "Please enter a search query";
    t[4035] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430 \u0432\u0432\u0435\u0434\u0456\u0442\u044c \u0437\u0430\u043f\u0438\u0442 \u043f\u043e\u0448\u0443\u043a\u0443";
    t[4040] = "How do I connect to IRC within I2P?";
    t[4041] = "\u042f\u043a \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438\u0441\u044f \u0434\u043e IRC \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P?";
    t[4042] = "Bandwidth Test in progress";
    t[4043] = "\u0412\u0438\u043a\u043e\u043d\u0443\u0454\u0442\u044c\u0441\u044f \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0430 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456";
    t[4046] = "Receive on";
    t[4047] = "\u041e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0434\u0430\u043b\u0456";
    t[4048] = "I2P Router Console (Web interface)";
    t[4049] = "\u0412\u0435\u0431-\u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P";
    t[4050] = "Launch console at startup";
    t[4051] = "\u0417\u0430\u043f\u0443\u0441\u043a\u0430\u0442\u0438 \u043a\u043e\u043d\u0441\u043e\u043b\u044c \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443";
    t[4052] = "Job Statistics (excluding single-shot jobs)";
    t[4053] = "\u0421\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0430 \u0440\u043e\u0431\u043e\u0442\u0438 (\u0437\u0430 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u043c \u043e\u0434\u043d\u043e\u0440\u0430\u0437\u043e\u0432\u0438\u0445 \u0440\u043e\u0431\u0456\u0442)";
    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "\u0429\u043e\u0431 \u043c\u0430\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0441\u0430\u0439\u0442\u0456\u0432, \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u0438\u0445 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P, \u0456 \u043e\u043f\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u044c \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0434\u043b\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u0441\u0430\u0439\u0442\u0456\u0432 \u0432 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u043e\u043c\u0443 \u0456\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0456, \u0432\u0430\u043c \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0432\u0430\u0448 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u0434\u043b\u044f \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043a\u0441\u0456 <b>HTTP</b> \u0432\u0456\u0434 I2P+, \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0432\u0456\u043d \u043f\u0440\u0430\u0446\u044e\u0454 \u043d\u0430 \u0430\u0434\u0440\u0435\u0441\u0456 <code> 127.0.0.1 \u043f\u043e\u0440\u0442 4444</code>. \u0414\u043b\u044f \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u043e\u0457 \u0434\u043e\u0432\u0456\u0434\u043a\u0438 \u043e\u0437\u043d\u0430\u0439\u043e\u043c\u0442\u0435\u0441\u044c \u0437 <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>\u043f\u043e\u0441\u0456\u0431\u043d\u0438\u043a\u043e\u043c \u0437 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c</a>, \u0430\u0431\u043e <a href=/help/configuration#browserconfig>\u043c\u0456\u043d\u0456-\u043f\u043e\u0441\u0456\u0431\u043d\u0438\u043a\u043e\u043c \u0434\u043b\u044f Firefox</a>.";
    t[4056] = "Postman's Tracker";
    t[4057] = "\u0412\u0456\u0434\u0441\u0442\u0435\u0436\u0435\u043d\u043d\u044f \u043b\u0438\u0441\u0442\u043e\u043d\u043e\u0448";
    t[4058] = "Number of sent messages awaiting acknowledgement";
    t[4059] = "\u041a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043d\u0430\u0434\u0456\u0441\u043b\u0430\u043d\u0438\u0445 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c, \u044f\u043a\u0456 \u043e\u0447\u0456\u043a\u0443\u044e\u0442\u044c \u043f\u0456\u0434\u0442\u0432\u0435\u0440\u0434\u0436\u0435\u043d\u043d\u044f";
    t[4060] = "Use all auto-detect methods";
    t[4061] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 \u0432\u0441\u0456 \u043c\u0435\u0442\u043e\u0434\u0438 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e\u0433\u043e \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u043d\u044f";
    t[4062] = "Updating refresh frequency to {0}";
    t[4063] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0447\u0430\u0441\u0442\u043e\u0442\u0438 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043d\u0430 {0}";
    t[4066] = "The number of participating tunnels you route for others, divided by the total number of hops in all your exploratory and client tunnels. A number greater than 1.00 means you are contributing more tunnels to the network than you are using.";
    t[4067] = "\u041a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0443\u0447\u0430\u0441\u0442\u0456, \u044f\u043a\u0456 \u0432\u0438 \u043f\u0440\u043e\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u0435 \u0434\u043b\u044f \u0456\u043d\u0448\u0438\u0445, \u043f\u043e\u0434\u0456\u043b\u0435\u043d\u0430 \u043d\u0430 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u043c\u0456\u0436\u043a\u0456\u0432 \u0443 \u0432\u0441\u0456\u0445 \u0432\u0430\u0448\u0438\u0445 \u0440\u043e\u0437\u0432\u0456\u0434\u0443\u0432\u0430\u043b\u044c\u043d\u0438\u0445 \u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u044f\u0445. \u0427\u0438\u0441\u043b\u043e \u0431\u0456\u043b\u044c\u0448\u0435 1,00 \u043e\u0437\u043d\u0430\u0447\u0430\u0454, \u0449\u043e \u0432\u0438 \u043d\u0430\u0434\u0430\u0454\u0442\u0435 \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 \u0431\u0456\u043b\u044c\u0448\u0435 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u043d\u0456\u0436 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435.";
    t[4068] = "View router workload and stats";
    t[4069] = "\u041f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u044c\u0442\u0435 \u0440\u043e\u0431\u043e\u0447\u0435 \u043d\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u0442\u0430 \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[4072] = "Error deleting plugin {0}";
    t[4073] = "\u041f\u043e\u043c\u0438\u043b\u043a\u0430 \u043f\u0440\u0438 \u0432\u0438\u0434\u0430\u043b\u0435\u043d\u043d\u0456 \u043f\u043b\u0430\u0491\u0456\u043d\u0430 {0}";
