    t[4092] = "Updating update URLs.";
    t[4093] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f URL-\u0430\u0434\u0440\u0435\u0441 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f.";
