    t[4095] = "\u041f\u043e\u0432\u0442\u043e\u0440\u043d\u043e \u0432\u0432\u0435\u0434\u0456\u0442\u044c \u0456 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c";
    t[4096] = "Last Good Lookup";
    t[4097] = "\u041e\u0441\u0442\u0430\u043d\u043d\u0456\u0439 \u0432\u0434\u0430\u043b\u0438\u0439 \u043f\u043e\u0448\u0443\u043a";
    t[4098] = "After restarting, you may export the family key.";
    t[4099] = "\u041f\u0456\u0441\u043b\u044f \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043c\u043e\u0436\u043d\u0430 \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443\u0432\u0430\u0442\u0438 \u0441\u0456\u043c\u0435\u0439\u043d\u0438\u0439 \u043a\u043b\u044e\u0447.";
    t[4104] = "Router is currently hosting the configured maximum number of transit tunnels";
    t[4105] = "\u0420\u043e\u0443\u0442\u0435\u0440 \u0432 \u0434\u0430\u043d\u0438\u0439 \u0447\u0430\u0441 \u043e\u0431\u0441\u043b\u0443\u0433\u043e\u0432\u0443\u0454 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0435 \u0447\u0438\u0441\u043b\u043e \u0442\u0440\u0430\u043d\u0437\u0438\u0442\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432";
    t[4106] = "Please supply a valid plugin file";
    t[4107] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u043d\u0430\u0434\u0430\u0439\u0442\u0435 \u0434\u0456\u0439\u0441\u043d\u0438\u0439 \u0444\u0430\u0439\u043b \u043f\u043b\u0430\u0433\u0456\u043d\u0430";
    t[4122] = "Same IPv4 /16 as us";
    t[4123] = "\u0422\u043e\u0439 \u0436\u0435 IPv4 /16, \u0449\u043e \u0439 \u0443 \u043d\u0430\u0441";
    t[4126] = "Updating after restart";
    t[4127] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u0456\u0441\u043b\u044f \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443";
    t[4130] = "I2P+ will now test your internet connection to identify the optimal speed settings.";
    t[4131] = "I2P \u0442\u0435\u043f\u0435\u0440 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u044c \u0432\u0430\u0448\u0435 \u0456\u043d\u0442\u0435\u0440\u043d\u0435\u0442-\u0437\u2019\u0454\u0434\u043d\u0430\u043d\u043d\u044f, \u0449\u043e\u0431 \u0432\u0438\u0437\u043d\u0430\u0447\u0438\u0442\u0438 \u043e\u043f\u0442\u0438\u043c\u0430\u043b\u044c\u043d\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0448\u0432\u0438\u0434\u043a\u043e\u0441\u0442\u0456.";
    t[4136] = "To change client options, edit the file: {0}";
    t[4137] = "\u0429\u043e\u0431 \u0437\u043c\u0456\u043d\u0438\u0442\u0438 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0430, \u0432\u0456\u0434\u0440\u0435\u0434\u0430\u0433\u0443\u0439\u0442\u0435 \u0444\u0430\u0439\u043b: {0}";
    t[4138] = "Installed I2P+ system service";
    t[4139] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u200b\u200b\u0441\u0438\u0441\u0442\u0435\u043c\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 I2P";
    t[4142] = "An address containing an encrypted LeaseSet is informally referred to as a b33 address, an extension of a base32 address with the host's public key and signature type encoded into the address instead of a lookup hash. This address type is required for blinded Leasesets. More information: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>B33 Specification</a>";
    t[4143] = "\u0410\u0434\u0440\u0435\u0441\u0443, \u0449\u043e \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430\u0431\u0456\u0440 \u043e\u0440\u0435\u043d\u0434\u0438, \u043d\u0435\u043e\u0444\u0456\u0446\u0456\u0439\u043d\u043e \u043d\u0430\u0437\u0438\u0432\u0430\u044e\u0442\u044c \u0430\u0434\u0440\u0435\u0441\u043e\u044e b33, \u0446\u0435 \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u043d\u044f \u0431\u0430\u0437\u0438 32 \u0430\u0434\u0440\u0435\u0441\u0438 \u0437 \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u0438\u043c \u043a\u043b\u044e\u0447\u0435\u043c \u0442\u0430 \u0442\u0438\u043f\u043e\u043c \u043f\u0456\u0434\u043f\u0438\u0441\u0443 \u0445\u043e\u0441\u0442\u0430, \u0432\u043a\u043e\u0434\u043e\u0432\u0430\u043d\u0438\u043c\u0438 \u0432 \u0430\u0434\u0440\u0435\u0441\u0443 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u0445\u0435\u0448\u0443 \u043f\u043e\u0448\u0443\u043a\u0443. \u0426\u0435\u0439 \u0442\u0438\u043f \u0430\u0434\u0440\u0435\u0441\u0438 \u0454 \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u043e\u0432\u0438\u043c \u0434\u043b\u044f \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0438\u0445 \u043d\u0430\u0431\u043e\u0440\u0456\u0432 \u043e\u0440\u0435\u043d\u0434\u0438. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0430 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>\u0421\u043f\u0435\u0446\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u044f B33</a>";
    t[4146] = "Bandwidth test was not running";
    t[4147] = "\u0442\u0435\u0441\u0442 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u043d\u0435 \u0437\u0430\u043f\u0443\u0449\u0435\u043d\u043e";
    t[4154] = "Participant";
    t[4155] = "\u0423\u0447\u0430\u0441\u043d\u0438\u043a";
    t[4156] = "NTCP &amp; SSU";
    t[4157] = "NTCP \u0456 SSU";
    t[4158] = "Local Router Family Certificate";
    t[4159] = "\u0421\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442 \u0440\u043e\u0434\u0438\u043d\u0438 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432";
    t[4160] = "Then click the <i>Save changes</i> button to confirm the proxy configuration and then the <i>Reseed now</i> button to initiate the reseed process.";
    t[4161] = "\u041f\u043e\u0442\u0456\u043c \u043d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u043a\u043d\u043e\u043f\u043a\u0443 <i>\u0417\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u0437\u043c\u0456\u043d\u0438</i>, \u0449\u043e\u0431 \u043f\u0456\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043a\u0441\u0456, \u0442\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 <i>\u041f\u0435\u0440\u0435\u043d\u0430\u0441\u0438\u0442\u0438 \u0437\u0430\u0440\u0430\u0437</i>, \u0449\u043e\u0431 \u0456\u043d\u0456\u0446\u0456\u044e\u0432\u0430\u0442\u0438 \u043f\u0440\u043e\u0446\u0435\u0441 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f.";
    t[4168] = "How do I reseed manually?";
    t[4169] = "\u042f\u043a \u0437\u0440\u043e\u0431\u0438\u0442\u0438 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u0432\u0440\u0443\u0447\u043d\u0443?";
    t[4178] = "View router logs";
