    t[4296] = "To log all unique remote destinations connecting to a server, and also log aggressive connection attempts:";
    t[4297] = "\u0429\u043e\u0431 \u0440\u0435\u0454\u0441\u0442\u0440\u0443\u0432\u0430\u0442\u0438 \u0432\u0441\u0456 \u0443\u043d\u0456\u043a\u0430\u043b\u044c\u043d\u0456 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0456 \u043f\u0443\u043d\u043a\u0442\u0438 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u044f\u043a\u0456 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c\u0441\u044f \u0434\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0440\u0435\u0454\u0441\u0442\u0440\u0443\u0432\u0430\u0442\u0438 \u0430\u0433\u0440\u0435\u0441\u0438\u0432\u043d\u0456 \u0441\u043f\u0440\u043e\u0431\u0438 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f:";
