    t[4327] = "\u0414\u043e\u043f\u043e\u043c\u043e\u0433\u0430 i2p \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0442\u0430 \u043f\u043e\u0448\u0438\u0440\u0435\u043d\u0456 \u0437\u0430\u043f\u0438\u0442\u0430\u043d\u043d\u044f";
    t[4328] = "Indicates how quickly outbound messages to other I2P routers are sent";
    t[4329] = "\u0432\u043a\u0430\u0437\u0443\u0454, \u044f\u043a \u0448\u0432\u0438\u0434\u043a\u043e \u043d\u0430\u0434\u0441\u0438\u043b\u0430\u044e\u0442\u044c\u0441\u044f \u0432\u0438\u0445\u0456\u0434\u043d\u0456 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f \u043d\u0430 \u0456\u043d\u0448\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438 I2P";
    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "\u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u0432\u0430\u0436\u043b\u0438\u0432\u0438\u043c \u0454 \u043f\u043e\u0440\u044f\u0434\u043e\u043a \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0456\u0439. \u041f\u0435\u0440\u0448\u0430 \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0456\u044f \u043f\u043e\u0440\u043e\u0433\u0443 \u0434\u043b\u044f \u043f\u0435\u0432\u043d\u043e\u0457 \u0446\u0456\u043b\u0456 (\u044f\u0432\u043d\u043e \u0432\u043a\u0430\u0437\u0430\u043d\u0430 \u0430\u0431\u043e \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0430 \u0443 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043e\u043c\u0443 \u0444\u0430\u0439\u043b\u0456) \u043f\u0435\u0440\u0435\u0432\u0430\u0436\u0430\u0454 \u0431\u0443\u0434\u044c-\u044f\u043a\u0456 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u0456 \u043f\u043e\u0440\u043e\u0433\u0438 \u0434\u043b\u044f \u0442\u0456\u0454\u0457 \u0441\u0430\u043c\u043e\u0457 \u0446\u0456\u043b\u0456, \u0447\u0438 \u0442\u043e \u044f\u0432\u043d\u043e \u0432\u043a\u0430\u0437\u0430\u043d\u0456, \u0447\u0438 \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0456 \u0443 \u0444\u0430\u0439\u043b\u0456. \u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u0434\u043b\u044f \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u043d\u043d\u044f \u043d\u043e\u0432\u043e\u0433\u043e \u0444\u0430\u0439\u043b\u0443 \u0444\u0456\u043b\u044c\u0442\u0440\u0443, \u043f\u0456\u0441\u043b\u044f \u0432\u043a\u0430\u0437\u0456\u0432\u043a\u0438 \u0439\u043e\u0433\u043e \u043c\u0456\u0441\u0446\u0435\u0437\u043d\u0430\u0445\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0432 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u0442\u0443\u043d\u0435\u043b\u044c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438. \u041e\u0434\u043d\u043e\u0440\u0430\u0437\u043e\u0432\u043e \u0441\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u043e\u0432\u0430\u043d\u0438\u0439 \u0444\u0430\u0439\u043b \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u044c \u043c\u043e\u0436\u043d\u0430 \u043e\u043d\u043e\u0432\u043b\u044e\u0432\u0430\u0442\u0438 \u0431\u0435\u0437 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0446\u0456\u043b\u044c\u043e\u0432\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e, \u043f\u0440\u043e\u0442\u0435 \u0431\u043b\u043e\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0446\u0456\u043b\u0435\u0439 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0442\u0438\u043c\u0435\u0442\u044c\u0441\u044f \u0434\u043e \u0439\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443.";
    t[4344] = "Test server location";
    t[4345] = "\u0420\u043e\u0437\u0442\u0430\u0448\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0435\u0441\u0442\u043e\u0432\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430";
