    t[4644] = "The reseed status will be indicated on the sidebar. You can also check the {0} for the following message: <code>Reseed got 100 router infos from file with 0 errors</code>";
    t[4645] = "\u0421\u0442\u0430\u0442\u0443\u0441 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u0431\u0443\u0434\u0435 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u0438\u0439 \u0443 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456. \u0412\u0438 \u0442\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u0438 {0} \u043d\u0430 \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u0435 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f: <code>\u041f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u043e\u0442\u0440\u0438\u043c\u0430\u043b\u043e 100 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0439 \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432 \u0456\u0437 \u0444\u0430\u0439\u043b\u0443 \u0437 0 \u043f\u043e\u043c\u0438\u043b\u043a\u0430\u043c\u0438</code>";
