    t[4663] = "\u0421\u043e\u0440\u0442\u0443\u0432\u0430\u0442\u0438 \u0437\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044e \u0440\u0435\u0442\u0440\u0430\u043d\u0441\u043b\u044c\u043e\u0432\u0430\u043d\u0438\u0445 \u043f\u0430\u043a\u0435\u0442\u0456\u0432";
    t[4666] = "I2P+ requires a web browser configured to use the resident HTTP proxy in order to browse websites on the I2P network.";
    t[4667] = "I2P \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u0432\u0435\u0431-\u0431\u0440\u0430\u0443\u0437\u0435\u0440, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043d\u043e\u0433\u043e HTTP-\u043f\u0440\u043e\u043a\u0441\u0456, \u0449\u043e\u0431 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434\u0430\u0442\u0438 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0438 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P.";
    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "\u0412\u0435\u0440\u0441\u0456\u044f \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043d\u043e\u0433\u043e \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0435\u043d\u043d\u044f I2P, \u044f\u043a\u0435 \u0432\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435. \u042f\u043a\u0449\u043e \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0430 \u043d\u043e\u0432\u0430 \u0432\u0435\u0440\u0441\u0456\u044f, \u0432\u0438 \u043e\u0442\u0440\u0438\u043c\u0430\u0454\u0442\u0435 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f \u0432 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456. \u0420\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u043c \u0434\u043b\u044f \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0435\u043d\u043d\u044f \u043e\u043f\u0442\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0457 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0456 \u0442\u0430 \u0431\u0435\u0437\u043f\u0435\u043a\u0438. \u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432, \u044f\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u0441\u0442\u0430\u044e\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u043c\u0438 \u0432 \u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u043c\u0443 \u043a\u043e\u0436\u043d\u0456 2-3 \u043c\u0456\u0441\u044f\u0446\u0456.";
    t[4684] = "Router Statistics";
