    t[4688] = "Add detected sybils to banlist";
    t[4689] = "\u0414\u043e\u0434\u0430\u0442\u0438 \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u0456 \u0441\u0438\u0432\u0456\u043b\u0438 \u0434\u043e \u0441\u043f\u0438\u0441\u043a\u0443 \u0437\u0430\u0431\u043e\u0440\u043e\u043d";
    t[4696] = "Prefer IPv4 over IPv6";
    t[4697] = "\u041d\u0430\u0434\u0430\u0432\u0430\u0439\u0442\u0435 \u043f\u0435\u0440\u0435\u0432\u0430\u0433\u0443 IPv4 \u043d\u0430\u0434 IPv6";
    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (TCP \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0456 NIO) \u0456 NTCP2 - \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0438 \u043c\u0435\u0440\u0435\u0436\u0456 \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0456 TCP, \u044f\u043a\u0456 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c \u0440\u0435\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044e TCP \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0456 Java NIO (\u041d\u043e\u0432\u0438\u0439 \u0432\u0445\u0456\u0434/\u0432\u0438\u0432\u0456\u0434) \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0430\u0432\u043a\u0438 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c I2NP \u043c\u0456\u0436 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456. NTCP2 \u043f\u043e\u043a\u0440\u0430\u0449\u0443\u0454 \u0441\u0442\u0456\u0439\u043a\u0456\u0441\u0442\u044c NTCP \u0434\u043e \u0440\u0456\u0437\u043d\u0438\u0445 \u0430\u0442\u0430\u043a \u0456 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0437\u043e\u0432\u0430\u043d\u0438\u0445 \u043c\u0435\u0442\u043e\u0434\u0456\u0432 \u0456\u0434\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0457 \u0442\u0440\u0430\u0444\u0456\u043a\u0443. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u043d\u0430 <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>\u0430\u043d\u0433\u043b\u043e\u043c\u043e\u0432\u043d\u0456\u0439 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u0457</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "\u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0437\u0430\u043f\u0438\u0441\u0443\u0432\u0430\u0447 \u0434\u043b\u044f \u0444\u0456\u043a\u0441\u0430\u0446\u0456\u0457 \u0446\u0456\u043b\u0435\u0439 \u0430\u0433\u0440\u0435\u0441\u0438\u0432\u043d\u0438\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432 \u0443 \u043f\u0435\u0432\u043d\u0438\u0439 \u0444\u0430\u0439\u043b, \u0430 \u043f\u043e\u0442\u0456\u043c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0446\u0435\u0439 \u0441\u0430\u043c\u0438\u0439 \u0444\u0430\u0439\u043b \u0434\u043b\u044f \u0457\u0445 \u0433\u0430\u043b\u044c\u043c\u0443\u0432\u0430\u043d\u043d\u044f. \u041d\u0430\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442 \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u0444\u0456\u043b\u044c\u0442\u0440, \u044f\u043a\u0438\u0439 \u0441\u043f\u043e\u0447\u0430\u0442\u043a\u0443 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0432\u0441\u0456 \u0437\u0430\u043f\u0438\u0442\u0438 \u043d\u0430 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f, \u0430\u043b\u0435 \u044f\u043a\u0449\u043e \u0431\u0443\u0434\u044c-\u044f\u043a\u0430 \u043e\u043a\u0440\u0435\u043c\u0430 \u0446\u0456\u043b\u044c \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0454 180 \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u0437\u0430 60 \u0441\u0435\u043a\u0443\u043d\u0434, \u0457\u0457 \u0433\u0430\u043b\u044c\u043c\u0443\u044e\u0442\u044c \u0434\u043e 30 \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u043a\u043e\u0436\u043d\u0456 60 \u0441\u0435\u043a\u0443\u043d\u0434:";
