    t[4810] = "Smart &amp; fearless journalism";
    t[4811] = "\u0420\u043e\u0437\u0443\u043c\u043d\u0430 \u0442\u0430 \u0431\u0435\u0437\u0441\u0442\u0440\u0430\u0448\u043d\u0430 \u0436\u0443\u0440\u043d\u0430\u043b\u0456\u0441\u0442\u0438\u043a\u0430";
    t[4820] = "Plugin not installed - signer is untrusted";
    t[4821] = "\u041f\u043b\u0430\u0433\u0456\u043d \u043d\u0435 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e: \u043d\u0435 \u0434\u043e\u0432\u0456\u0440\u044f\u0454\u043c\u043e \u043f\u0456\u0434\u043f\u0438\u0441\u043d\u0438\u043a\u0443";
    t[4822] = "Be aware that a poorly configured webserver or web appplication can leak information such as your real IP address or server details that may reduce your anonymity or assist a hacker. If using an alternative platform, be sure to secure it before putting it online. If in doubt, consult online guides about web server and web application hardening, for example:";
    t[4823] = "\u0411\u0443\u0434\u044c\u0442\u0435 \u043e\u0431\u0456\u0437\u043d\u0430\u043d\u0456, \u0449\u043e \u043f\u043e\u0433\u0430\u043d\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 \u0430\u0431\u043e \u0432\u0435\u0431-\u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043e\u043a \u043c\u043e\u0436\u0443\u0442\u044c \u043f\u0440\u0438\u0437\u0432\u0435\u0441\u0442\u0438 \u0434\u043e \u0432\u0438\u0442\u043e\u043a\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457, \u0442\u0430\u043a\u043e\u0457 \u044f\u043a \u0432\u0430\u0448\u0430 \u0440\u0435\u0430\u043b\u044c\u043d\u0430 IP-\u0430\u0434\u0440\u0435\u0441\u0430 \u0430\u0431\u043e \u0434\u0430\u043d\u0456 \u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u0449\u043e \u043c\u043e\u0436\u0435 \u0437\u043c\u0435\u043d\u0448\u0438\u0442\u0438 \u0432\u0430\u0448\u0443 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c \u0447\u0438 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0442\u0438 \u0445\u0430\u043a\u0435\u0440\u0443. \u042f\u043a\u0449\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435 \u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0443 \u043f\u043b\u0430\u0442\u0444\u043e\u0440\u043c\u0443, \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u043e\u0432\u043e \u0457\u0457 \u0437\u0430\u0445\u0438\u0449\u0456\u0442\u044c \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u043f\u0443\u0431\u043b\u0456\u043a\u0443\u0432\u0430\u0442\u0438 \u043e\u043d\u043b\u0430\u0439\u043d. \u0423 \u0440\u0430\u0437\u0456 \u0441\u0443\u043c\u043d\u0456\u0432\u0456\u0432, \u043e\u0437\u043d\u0430\u0439\u043e\u043c\u0442\u0435\u0441\u044c \u0437 \u043e\u043d\u043b\u0430\u0439\u043d-\u043f\u043e\u0441\u0456\u0431\u043d\u0438\u043a\u0430\u043c\u0438 \u0437 \u0443\u0449\u0456\u043b\u044c\u043d\u0435\u043d\u043d\u044f \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0456\u0432 \u0442\u0430 \u0432\u0435\u0431-\u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043a\u0456\u0432, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434:";
    t[4824] = "Please visit the {0}config clients page{1} to start it.";
    t[4825] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0432\u0456\u0434\u0432\u0456\u0434\u0430\u0439\u0442\u0435 {0}\u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432{1}, \u0449\u043e\u0431 \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u0439\u043e\u0433\u043e.";
    t[4826] = "Technology news aggregator";
    t[4827] = "\u0410\u0433\u0440\u0435\u0433\u0430\u0442\u043e\u0440 \u043d\u043e\u0432\u0438\u043d \u043f\u0440\u043e \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0456\u0457";
    t[4830] = "Requires hostname, destination, or blinded Base32";
    t[4831] = "\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0435 \u0456\u043c\u2019\u044f \u0445\u043e\u0441\u0442\u0430, \u0430\u0434\u0440\u0435\u0441\u0430\u0442 \u0430\u0431\u043e \u0437\u0430\u043a\u0440\u0438\u0442\u0438\u0439 Base32";
    t[4834] = "The ratio of tunnel hops we provide to tunnel hops we use - a value greater than 1.00 indicates a positive contribution to the network";
    t[4835] = "\u0421\u043f\u0456\u0432\u0432\u0456\u0434\u043d\u043e\u0448\u0435\u043d\u043d\u044f \u0442\u0443\u043d\u0435\u043b\u044c\u043d\u0438\u0445 \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0456\u0432, \u044f\u043a\u0456 \u043c\u0438 \u043d\u0430\u0434\u0430\u0454\u043c\u043e, \u0434\u043e \u0442\u0443\u043d\u0435\u043b\u044c\u043d\u0438\u0445 \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0456\u0432, \u044f\u043a\u0456 \u043c\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u043c\u043e \u2013 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0431\u0456\u043b\u044c\u0448\u0435 1,00 \u0432\u043a\u0430\u0437\u0443\u0454 \u043d\u0430 \u043f\u043e\u0437\u0438\u0442\u0438\u0432\u043d\u0438\u0439 \u0432\u043d\u0435\u0441\u043e\u043a \u0443 \u043c\u0435\u0440\u0435\u0436\u0443";
    t[4836] = "Average delay before scheduled jobs are run";
    t[4837] = "\u0421\u0435\u0440\u0435\u0434\u043d\u044f \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0430 \u043f\u0435\u0440\u0435\u0434 \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u043d\u044f\u043c \u0437\u0430\u043f\u043b\u0430\u043d\u043e\u0432\u0430\u043d\u0438\u0445 \u0437\u0430\u0432\u0434\u0430\u043d\u044c";
    t[4838] = "For available plugins, visit {0}.";
    t[4839] = "\u0414\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0445 \u043f\u043b\u0430\u0433\u0456\u043d\u0456\u0432 \u0432\u0456\u0434\u0432\u0456\u0434\u0430\u0439\u0442\u0435 {0}.";
    t[4840] = "Where are my I2P configuration files stored?";
    t[4841] = "\u0414\u0435 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0444\u0430\u0439\u043b\u0438 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 I2P?";
    t[4850] = "Update with signed development builds";
    t[4851] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0437 \u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u043c\u0438 \u0440\u043e\u0437\u0440\u043e\u0431\u043d\u0438\u043c\u0438 \u0437\u0431\u0456\u0440\u043a\u0430\u043c\u0438";
    t[4854] = "Outbound UDP from the <a href=/confignet#udpconfig>random port</a> noted on the Network Configuration page to arbitrary remote UDP ports, allowing replies.";
    t[4855] = "\u0412\u0438\u0445\u0456\u0434\u043d\u0435 UDP \u0437 <a href=/confignet#udpconfig>\u0432\u0438\u043f\u0430\u0434\u043a\u043e\u0432\u043e\u0433\u043e \u043f\u043e\u0440\u0442\u0443</a>, \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u043e\u0433\u043e \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0435\u0440\u0435\u0436\u0456, \u0434\u043e \u0434\u043e\u0432\u0456\u043b\u044c\u043d\u0438\u0445 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u0445 UDP-\u043f\u043e\u0440\u0442\u0456\u0432, \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u044e\u0447\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0456.";
    t[4856] = "No log messages";
    t[4857] = "\u041d\u0435\u043c\u0430\u0454 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c \u0436\u0443\u0440\u043d\u0430\u043b\u0443";
    t[4860] = "Clearnet";
    t[4861] = "\u0412\u0456\u0434\u043a\u0440\u0438\u0442\u0430 \u043c\u0435\u0440\u0435\u0436\u0430";
    t[4862] = "UPnP SSDP UDP search response listener";
    t[4863] = "\u0421\u043b\u0443\u0445\u0430\u0447 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0435\u0439 \u043d\u0430 \u043f\u043e\u0448\u0443\u043a SSDP UDP \u0434\u043b\u044f UPnP";
    t[4864] = "A web application supplied with the router that permits creation and configuration of client and server tunnels. Also referred to as the <i>Hidden Services Manager</i>.";
    t[4865] = "\u0412\u0435\u0431-\u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043e\u043a, \u0449\u043e \u043f\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0440\u0430\u0437\u043e\u043c \u0437 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u043c \u0456 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0441\u0442\u0432\u043e\u0440\u044e\u0432\u0430\u0442\u0438 \u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0456 \u0442\u0430 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u0456 \u0442\u0443\u043d\u0435\u043b\u0456. \u0422\u0430\u043a\u043e\u0436 \u0437\u0433\u0430\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u044f\u043a <i>\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0438\u0445 \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432</i>.";
    t[4870] = "Cross-network micro-blogging &amp; forums &amp; wiki";
    t[4871] = "\u041c\u0456\u043a\u0440\u043e\u043c\u0435\u0440\u0435\u0436\u0435\u0432\u0435 \u0432\u0435\u0434\u0435\u043d\u043d\u044f \u0431\u043b\u043e\u0433\u0456\u0432";
    t[4884] = "Profile for peer";
    t[4885] = "\u041f\u0440\u043e\u0444\u0456\u043b\u044c \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0430";
    t[4890] = "Start or stop Router clients";
    t[4891] = "\u0417\u0430\u043f\u0443\u0441\u043a \u0430\u0431\u043e \u0437\u0443\u043f\u0438\u043d\u043a\u0430 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[4894] = "UPnP support is beta, and may not work for any number of reasons";
    t[4895] = "\u041f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0430 UPnP \u0454 \u0431\u0435\u0442\u0430-\u0432\u0435\u0440\u0441\u0456\u0454\u044e \u0456 \u043c\u043e\u0436\u0435 \u043d\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438 \u0437 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u043f\u0440\u0438\u0447\u0438\u043d";
    t[4900] = "reseed help";
    t[4901] = "\u043f\u043e\u0432\u0442\u043e\u0440\u043d\u0430 \u0434\u043e\u0432\u0456\u0434\u043a\u0430";
    t[4914] = "Save settings and redraw graphs";
    t[4915] = "\u0417\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0456 \u043f\u0435\u0440\u0435\u043c\u0430\u043b\u044e\u0432\u0430\u0442\u0438 \u0433\u0440\u0430\u0444\u0456\u043a\u0438";
    t[4920] = "Configure update URLs and policy";
    t[4921] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 URL-\u0430\u0434\u0440\u0435\u0441\u0438 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0442\u0430 \u043f\u043e\u043b\u0456\u0442\u0438\u043a\u0443";
    t[4922] = "Participating";
    t[4923] = "\u0411\u0435\u0440\u0443 \u0443\u0447\u0430\u0441\u0442\u044c";
    t[4924] = "The current external IP address is not available.";
    t[4925] = "\u0422\u0435\u043f\u0435\u0440\u0456\u0448\u043d\u044f \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u044f IP-\u0430\u0434\u0440\u0435\u0441\u0430 \u043d\u0435 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0430.";
    t[4926] = "Update link";
    t[4927] = "\u0410\u0434\u0440\u0435\u0441\u0430 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f";
    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "\u0426\u0435\u0439 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u0448\u043b\u044f\u0445\u0443, \u0449\u043e \u0432\u043a\u0430\u0437\u0443\u0454 \u043d\u0430 \u0434\u0456\u0439\u0441\u043d\u0438\u0439 \u0441\u043f\u0438\u0441\u043e\u043a \u0431\u043b\u043e\u043a\u0456\u0432, \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0443\u0432\u0430\u0442\u0438 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0438\u0439, \u0437\u0430\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0439 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0435\u043c \u0441\u043f\u0438\u0441\u043e\u043a \u0431\u043b\u043e\u043a\u0456\u0432 \u043f\u0440\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430. [\u0412\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043e \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0454 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0446\u044c\u043a\u0456 \u043f\u0435\u0440\u0435\u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0442\u0435\u043c \u0434\u043b\u044f \u043a\u043e\u043d\u0441\u043e\u043b\u0456, \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, I2PSnark, SusiDNS \u0442\u0430 Susimail, \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u044e\u0447\u0438 \u0432\u043d\u043e\u0441\u0438\u0442\u0438 \u0437\u043c\u0456\u043d\u0438 \u0434\u043e \u0442\u0435\u043c, \u044f\u043a\u0456 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u043f\u0456\u0441\u043b\u044f \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u044c. \u0429\u043e\u0431 \u0430\u043a\u0442\u0438\u0432\u0443\u0432\u0430\u0442\u0438 \u043f\u0435\u0440\u0435\u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u0441\u0442\u0432\u043e\u0440\u0456\u0442\u044c css-\u0444\u0430\u0439\u043b \u043f\u0456\u0434 \u043d\u0430\u0437\u0432\u043e\u044e <code>override.css</code> \u0437 \u0432\u0430\u0448\u0438\u043c\u0438 \u0437\u043c\u0456\u043d\u0430\u043c\u0438 \u0442\u0435\u043c\u0438 \u0456 \u043f\u043e\u043c\u0456\u0441\u0442\u0456\u0442\u044c \u0439\u043e\u0433\u043e \u0443 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0443 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0456\u044e \u0442\u0435\u043c\u0438 \u0442\u0456\u0454\u0457 \u0442\u0435\u043c\u0438, \u044f\u043a\u0443 \u0432\u0438 \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0437\u043c\u0456\u043d\u0438\u0442\u0438, \u0430\u0431\u043e \u043f\u0435\u0440\u0435\u0439\u043c\u0435\u043d\u0443\u0439\u0442\u0435 \u043e\u0434\u0438\u043d \u0456\u0437 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043e\u0432\u0438\u0445 \u0444\u0430\u0439\u043b\u0456\u0432, \u0456 \u043f\u043e\u0442\u0456\u043c \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u0431\u0440\u0430\u0443\u0437\u0435\u0440. \u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0442\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c \u0442\u043e\u0439 \u0441\u0430\u043c\u0438\u0439 override.css. \u0429\u043e\u0431 \u0434\u0435\u0430\u043a\u0442\u0438\u0432\u0443\u0432\u0430\u0442\u0438 \u043f\u0435\u0440\u0435\u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u0432\u0438\u0434\u0430\u043b\u0456\u0442\u044c \u0447\u0438 \u043f\u0435\u0440\u0435\u0439\u043c\u0435\u043d\u0443\u0439\u0442\u0435 \u0444\u0430\u0439\u043b <code>override.css</code> \u0456 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u0431\u0440\u0430\u0443\u0437\u0435\u0440 (\u0437\u0430\u0437\u0432\u0438\u0447\u0430\u0439 Control+Shift+R).";
    t[4942] = "Aborted startup";
