    t[4982] = "They offered to introduce us (help peers traverse our firewall)";
    t[4983] = "\u0412\u043e\u043d\u0438 \u0437\u0430\u043f\u0440\u043e\u043f\u043e\u043d\u0443\u0432\u0430\u043b\u0438 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0438 \u043d\u0430\u0441 (\u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0442\u0438 \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0430\u043c \u043f\u0440\u043e\u0439\u0442\u0438 \u043d\u0430\u0448 \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440)";
