    t[5034] = "A router in a tunnel not designated as a gateway or endpoint.";
    t[5035] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0432 \u0442\u0443\u043d\u0435\u043b\u0456, \u044f\u043a\u0438\u0439 \u043d\u0435 \u043f\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0439 \u044f\u043a \u0432\u0445\u0456\u0434\u043d\u0438\u0439 \u0448\u043b\u044e\u0437 \u0430\u0431\u043e \u043a\u0456\u043d\u0446\u0435\u0432\u0430 \u0442\u043e\u0447\u043a\u0430.";
    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "\u042f\u043a\u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0432 True, \u0446\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0437\u0432\u043e\u0440\u043e\u0442\u043d\u0438\u043c \u043f\u043e\u0448\u0443\u043a\u043e\u043c DNS \u0434\u043b\u044f \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0456\u0432, \u0441\u043f\u0440\u0430\u0446\u044c\u043e\u0432\u0443\u0432\u0430\u043d\u0438\u0445 \u043f\u0440\u0438 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u0456 \u043f\u0440\u0430\u043f\u043e\u0440 \u043a\u0440\u0430\u0457\u043d\u0438 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u043e\u0433\u043e \u0430\u0431\u043e \u043a\u043e\u043b\u0438 \u0456\u043c'\u044f \u0445\u043e\u0441\u0442\u0430 \u0430\u0431\u043e \u0434\u043e\u043c\u0435\u043d \u044f\u0432\u043d\u043e \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0456, \u0430\u0431\u043e \u043a\u043e\u043b\u0438 \u043c\u0430\u0440\u0443\u0442\u0435\u0440\u0456\u043d\u0444\u043e \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u043e\u0433\u043e \u0437\u0430\u043f\u0438\u0441\u0443 \u0437\u0430\u043f\u0438\u0441\u0443\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u0434\u0438\u0441\u043a. \u0414\u043b\u044f \u0442\u043e\u0433\u043e, \u0449\u043e\u0431 \u0443\u043d\u0438\u043a\u043d\u0443\u0442\u0438 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u0438\u0445 \u043f\u043e\u0448\u0443\u043a\u0456\u0432, \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0449\u0435\u0434\u0440\u0443 \u043f\u043e\u043b\u0456\u0442\u0438\u043a\u0443 \u043a\u0435\u0448\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043b\u044f \u043f\u043e\u0448\u0443\u043a\u0443 DNS 10 \u0445\u0432\u0438\u043b\u0438\u043d \u0456 \u0431\u0456\u043b\u044c\u0448\u0435 \u0442\u0430 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043a\u043e\u043d\u0444\u0456\u0434\u0435\u043d\u0446\u0456\u0439\u043d\u0456\u0441\u0442\u044c, \u0449\u043e \u0441\u0442\u043e\u0441\u0443\u0454\u0442\u044c\u0441\u044f \u0441\u0435\u0440\u0432\u0435\u0440\u0430 DNS \u0443 \u0432\u0430\u0448\u0456\u0439 \u043e\u043f\u0435\u0440\u0430\u0446\u0456\u0439\u043d\u0456\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u0456. [\u0412\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043e \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e]";
