    t[5058] = "No";
    t[5059] = "\u041d\u0456";
    t[5080] = "Banned Peers";
    t[5081] = "\u0417\u0430\u0431\u0430\u043d\u0435\u043d\u0456 \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0438";
