    t[5083] = "\u0441\u0432\u0456\u0442\u043b\u0430";
    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0445\u043e\u0441\u0442\u0438\u0442\u0435 \u0434\u0438\u043d\u0430\u043c\u0456\u0447\u043d\u0438\u0439 \u0441\u0430\u0439\u0442 \u0437 \u0432\u0435\u043b\u0438\u043a\u043e\u044e \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044e \u043e\u0434\u043d\u043e\u0447\u0430\u0441\u043d\u0438\u0445 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456\u0432, \u0447\u0430\u0441\u0442\u043e \u043a\u0435\u0448\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043e\u043d\u0442\u0435\u043d\u0442\u0443 \u043c\u043e\u0436\u0435 \u043f\u043e\u043b\u0456\u043f\u0448\u0438\u0442\u0438 \u0447\u0430\u0441 \u0434\u043e\u0441\u0442\u0430\u0432\u043a\u0438 \u0441\u0442\u043e\u0440\u0456\u043d\u043e\u043a. \u0414\u043b\u044f \u0448\u0432\u0438\u0434\u043a\u043e \u043c\u0456\u043d\u043b\u0438\u0432\u043e\u0433\u043e \u043a\u043e\u043d\u0442\u0435\u043d\u0442\u0443, \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0456\u044f <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>\u043c\u0456\u043a\u0440\u043e-\u043a\u0435\u0448\u0443\u0432\u0430\u043d\u043d\u044f</a> \u043c\u043e\u0436\u0435 \u043f\u0440\u0438\u043d\u0435\u0441\u0442\u0438 \u0434\u0435\u044f\u043a\u0456 \u043f\u0435\u0440\u0435\u0432\u0430\u0433\u0438. \u0412\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx</a> \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u0443 \u043f\u0456\u0434\u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u043a\u0435\u0448\u0443\u0432\u0430\u043d\u043d\u044f, \u0430\u0431\u043e \u0434\u043b\u044f \u0431\u0456\u043b\u044c\u0448 \u043f\u043e\u0442\u0443\u0436\u043d\u043e\u0433\u043e \u0440\u0456\u0448\u0435\u043d\u043d\u044f, \u043f\u043e\u0434\u0438\u0432\u0456\u0442\u044c\u0441\u044f <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
