    t[5313] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454, \u0447\u0438 \u0431\u0443\u0434\u0443\u0442\u044c \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u044f\u0442\u0438\u0441\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0438, \u043a\u043b\u0430\u0441\u0438\u0444\u0456\u043a\u043e\u0432\u0430\u043d\u0456 \u044f\u043a \u043d\u0435\u0446\u0456\u043a\u0430\u0432\u0456 (\u0440\u0456\u0432\u043d\u0456 K \u0430\u0431\u043e L, \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0430\u0431\u043e \u0441\u0442\u0430\u0440\u0448\u0456 \u0437\u0430 0.9.50), \u043f\u0456\u0434 \u0447\u0430\u0441 \u043f\u0440\u043e\u0446\u0435\u0441\u0443 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432 \u043f\u0456\u0441\u043b\u044f 1 \u0433\u043e\u0434\u0438\u043d\u0438 \u0440\u043e\u0431\u043e\u0442\u0438. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c false]";
    t[5318] = "Configure router networking options";
    t[5319] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0438 \u043c\u0435\u0440\u0435\u0436\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[5324] = "Plugins";
    t[5325] = "\u041c\u043e\u0434\u0443\u043b\u0456";
    t[5330] = "The default subscription is to <code>http://i2p-projekt.i2p/hosts.txt</code> which is seldom updated. If you don't have another subscription, you may often have to use \"jump\" links which is much slower but ensures that your addressbook is only populated by sites you use (in addition to the default subscription addresses). To speed up browsing on I2P, it's a good idea to add some addressbook subscriptions.";
    t[5331] = "\u0422\u0438\u043f\u043e\u0432\u043e\u044e \u0454 \u043f\u0456\u0434\u043f\u0438\u0441\u043a\u0430 \u043d\u0430 <code>http://i2p-projekt.i2p/hosts.txt</code>, \u044f\u043a\u0430 \u0440\u0456\u0434\u043a\u043e \u043e\u043d\u043e\u0432\u043b\u044e\u0454\u0442\u044c\u0441\u044f. \u042f\u043a\u0449\u043e \u0432\u0438 \u043d\u0435 \u043c\u0430\u0454\u0442\u0435 \u0456\u043d\u0448\u0438\u0445 \u043f\u0456\u0434\u043f\u0438\u0441\u043e\u043a, \u0432\u0430\u043c \u0434\u043e\u0432\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u0447\u0430\u0441\u0442\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \"\u0441\u0442\u0440\u0438\u0431\u043a\u0456\u0432\", \u0449\u043e \u0437\u043d\u0430\u0447\u043d\u043e \u0441\u043f\u043e\u0432\u0456\u043b\u044c\u043d\u044e\u0454 \u0440\u043e\u0431\u043e\u0442\u0443, \u043f\u0440\u043e\u0442\u0435 \u0433\u0430\u0440\u0430\u043d\u0442\u0443\u0454, \u0449\u043e \u0432\u0430\u0448\u0430 \u0430\u0434\u0440\u0435\u0441\u043d\u0430 \u043a\u043d\u0438\u0433\u0430 \u0431\u0443\u0434\u0435 \u0437\u0430\u043f\u043e\u0432\u043d\u0435\u043d\u0430 \u043b\u0438\u0448\u0435 \u0430\u0434\u0440\u0435\u0441\u0430\u043c\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u043d\u0438\u0445 \u0441\u0430\u0439\u0442\u0456\u0432 (\u0440\u0430\u0437\u043e\u043c \u0456\u0437 \u0442\u0438\u043f\u043e\u0432\u0438\u043c\u0438 \u0430\u0434\u0440\u0435\u0441\u0430\u043c\u0438). \u0429\u043e\u0431 \u043f\u0440\u0438\u0441\u043a\u043e\u0440\u0438\u0442\u0438 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434 \u0432 I2P, \u0434\u043e\u0446\u0456\u043b\u044c\u043d\u043e \u0434\u043e\u0434\u0430\u0442\u0438 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u0430\u0434\u0440\u0435\u0441\u043d\u0438\u0445 \u043f\u0456\u0434\u043f\u0438\u0441\u043e\u043a.";
    t[5336] = "Sort by connection uptime";
