    t[5409] = "\u0427\u0438 \u0441\u0432\u043e\u0454\u0447\u0430\u0441\u043d\u043e \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043e\u043a \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0454 \u043d\u0430 \u0442\u0435\u0441\u0442\u0438? \u0429\u043e\u0431 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0447\u0430\u0441\u0443 \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f: <code>router.peerTestTimeout={n}</code> (\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434\u0438, \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 1000 \u043c\u0441)";
