    t[5503] = "BOB";
    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "\u042f\u043a\u0449\u043e \u0447\u0435\u0440\u0435\u0437 \u043a\u0456\u043b\u044c\u043a\u0430 \u0445\u0432\u0438\u043b\u0438\u043d \u0440\u043e\u0431\u043e\u0442\u0438 \u0432\u0430\u0448 \u0440\u043e\u0443\u0442\u0435\u0440 \u043f\u043e\u043a\u0430\u0437\u0443\u0454 0 \u0430\u043a\u0442\u0438\u0432\u043d\u0438\u0445 \u043f\u0456\u0440\u0456\u0432 \u0456 0 \u0432\u0456\u0434\u043e\u043c\u0438\u0445 \u043f\u0456\u0440\u0456\u0432, \u0437 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f\u043c \u0443 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 \u043f\u0440\u043e \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0456\u0441\u0442\u044c \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0438 \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u043e\u0433\u043e \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f, \u043f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0439\u0442\u0435\u0441\u044c, \u0449\u043e \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0456\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0443. \u042f\u043a\u0449\u043e \u0432\u0430\u0448\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 \u0444\u0443\u043d\u043a\u0446\u0456\u043e\u043d\u0443\u0454, \u0432\u0430\u043c \u043c\u043e\u0436\u0435 \u0437\u043d\u0430\u0434\u043e\u0431\u0438\u0442\u0438\u0441\u044f \u0440\u043e\u0437\u0431\u043b\u043e\u043a\u0443\u0432\u0430\u0442\u0438 Java \u0443 \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440\u0456. \u0412 \u0456\u043d\u0448\u043e\u043c\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443, \u043c\u043e\u0436\u043b\u0438\u0432\u043e, \u0432\u0430\u043c \u0437\u043d\u0430\u0434\u043e\u0431\u0438\u0442\u044c\u0441\u044f \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0442\u0440\u043e\u0457\u0442\u0438 \u0440\u043e\u0443\u0442\u0435\u0440 I2P. \u0412\u0456\u0434\u0432\u0456\u0434\u0430\u0439\u0442\u0435 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 <a href=/configreseed#reseedconfig>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0442\u0440\u043e\u044e\u0432\u0430\u043d\u043d\u044f</a> \u0442\u0430 \u043d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u043a\u043d\u043e\u043f\u043a\u0443 <i>\u0417\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u0437\u043c\u0456\u043d\u0438 \u0456 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0442\u0440\u043e\u0457\u0442\u0438 \u0437\u0430\u0440\u0430\u0437</i>. \u0414\u043b\u044f \u0431\u0456\u043b\u044c\u0448 \u0434\u0435\u0442\u0430\u043b\u044c\u043d\u043e\u0457 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u0434\u0438\u0432\u0456\u0442\u044c\u0441\u044f \u0440\u043e\u0437\u0434\u0456\u043b <a href=#reseedhelp>\u0414\u043e\u043f\u043e\u043c\u043e\u0433\u0430 \u0449\u043e\u0434\u043e \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0442\u0440\u043e\u044e\u0432\u0430\u043d\u043d\u044f</a> \u0432\u0438\u0449\u0435.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "\u0412\u0438\u0449\u0438\u0439 \u0440\u0456\u0432\u0435\u043d\u044c API \u0441\u043e\u043a\u0435\u0442\u0456\u0432 \u0434\u043b\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432. \u0412\u0456\u0434\u043a\u0440\u0438\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u043b\u0438\u0448\u0435 \u043a\u043e\u043b\u0438 \u043a\u043b\u0456\u0454\u043d\u0442 SAM V3 \u0437\u0430\u043f\u0438\u0442\u0443\u0454 UDP-\u0441\u0435\u0441\u0456\u044e. \u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e/\u0432\u0438\u043c\u043a\u043d\u0435\u043d\u043e \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href=/configclients>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432</a>. \u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0437\u043c\u0456\u043d\u0435\u043d\u0438\u0439 \u0443 \u0444\u0430\u0439\u043b\u0456 <code>clients.config</code> \u0437 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\u043c \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0430 \u0440\u044f\u0434\u043a\u0430 \u043a\u043e\u043c\u0430\u043d\u0434 SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435, \u0449\u043e\u0431 \u0432\u0430\u0448 \u0441\u0430\u0439\u0442 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0432 \u0448\u0432\u0438\u0434\u043a\u043e, \u0441\u0442\u0438\u0441\u043d\u0435\u043d\u043d\u044f \u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u044c \u0454 \u043a\u043b\u044e\u0447\u043e\u0432\u0438\u043c, \u043a\u043e\u043b\u0438 \u0445\u043e\u0441\u0442\u0438\u0442\u0435 \u0432\u0435\u043b\u0438\u043a\u0456 \u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f. \u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0441\u0435\u0440\u0432\u0456\u0441\u0443 \u043d\u0430 \u043a\u0448\u0442\u0430\u043b\u0442 <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> \u0434\u043b\u044f \u0441\u0442\u0438\u0441\u043d\u0435\u043d\u043d\u044f \u0432\u0430\u0448\u0438\u0445 png \u0442\u0430 jpeg \u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u044c \u0447\u0430\u0441\u0442\u043e \u043f\u0440\u0438\u0437\u0432\u0435\u0434\u0435 \u0434\u043e \u0444\u0430\u0439\u043b\u0456\u0432 \u0437\u043d\u0430\u0447\u043d\u043e \u043c\u0435\u043d\u0448\u043e\u0433\u043e \u0440\u043e\u0437\u043c\u0456\u0440\u0443 \u0437 \u043c\u0456\u043d\u0456\u043c\u0430\u043b\u044c\u043d\u043e\u044e \u0432\u0442\u0440\u0430\u0442\u043e\u044e \u044f\u043a\u043e\u0441\u0442\u0456. \u0423 \u0434\u0435\u044f\u043a\u0438\u0445 \u0432\u0438\u043f\u0430\u0434\u043a\u0430\u0445 \u0444\u043e\u0440\u043c\u0430\u0442 webp \u043a\u0440\u0430\u0449\u0435 jpeg, \u0433\u0435\u043d\u0435\u0440\u0443\u044e\u0447\u0438 \u0444\u0430\u0439\u043b\u0438 \u043c\u0435\u043d\u0448\u043e\u0433\u043e \u0440\u043e\u0437\u043c\u0456\u0440\u0443 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e \u0437 \u0442\u0456\u0454\u044e \u0441\u0430\u043c\u043e\u044e \u0430\u0431\u043e \u043a\u0440\u0430\u0449\u043e\u044e \u0432\u0456\u0437\u0443\u0430\u043b\u044c\u043d\u043e\u044e \u0442\u043e\u0447\u043d\u0456\u0441\u0442\u044e, \u0456 \u043c\u0430\u0454 \u0448\u0438\u0440\u043e\u043a\u0443 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0443 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0456\u0432. \u0422\u0430\u043a\u043e\u0436 \u0440\u043e\u0437\u0433\u043b\u044f\u043d\u044c\u0442\u0435 \u043c\u043e\u0436\u043b\u0438\u0432\u0456\u0441\u0442\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f svg \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u0431\u0456\u0442\u043c\u0430\u043f \u0434\u043b\u044f \u0456\u043a\u043e\u043d\u043e\u043a \u0442\u0430 \u0456\u043b\u044e\u0441\u0442\u0440\u0430\u0446\u0456\u0439 - \u0432\u043e\u043d\u0438 \u0447\u0430\u0441\u0442\u043e \u043c\u0435\u043d\u0448\u0456 \u043d\u0456\u0436 \u0435\u043a\u0432\u0456\u0432\u0430\u043b\u0435\u043d\u0442\u043d\u0438\u0439 \u0431\u0456\u0442\u043c\u0430\u043f \u0444\u0430\u0439\u043b (\u043f\u0440\u043e\u0448\u0442\u043e\u0432\u0445\u0443\u0439\u0442\u0435 \u0457\u0445 \u0447\u0435\u0440\u0435\u0437 \u0441\u0435\u0440\u0432\u0456\u0441 \u043d\u0430 \u043a\u0448\u0442\u0430\u043b\u0442 <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> \u0434\u043b\u044f \u0432\u0438\u0434\u0430\u043b\u0435\u043d\u043d\u044f \u043d\u0435\u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e\u0433\u043e \u0441\u043c\u0456\u0442\u0442\u044f), \u043c\u0430\u0441\u0448\u0442\u0430\u0431\u0443\u044e\u0442\u044c\u0441\u044f \u0431\u0435\u0437 \u0432\u0442\u0440\u0430\u0442\u0438 \u044f\u043a\u043e\u0441\u0442\u0456, \u0456 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0441\u0442\u0438\u0441\u043d\u0443\u0442\u0456 \u0432\u0430\u0448\u0438\u043c \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u043e\u043c \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e gzip.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u043e \u043d\u0430 \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u0457";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0431\u0456\u043b\u044c\u0448\u0456\u0441\u0442\u044c \u0432\u0430\u0448\u0438\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0445 \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432 (\u043f\u043e\u0448\u0442\u0430, HTTP-\u043f\u0440\u043e\u043a\u0441\u0456, IRC) \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0442\u043e\u0439 \u0441\u0430\u043c\u0438\u0439 \u043d\u0430\u0431\u0456\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 (\u0437 \u043c\u0456\u0440\u043a\u0443\u0432\u0430\u043d\u044c \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0456) \u0442\u0430 \u0431\u0443\u0434\u0443\u0442\u044c \u043f\u0435\u0440\u0435\u0440\u0430\u0445\u043e\u0432\u0430\u043d\u0456 \u044f\u043a <i>Shared Clients</i> \u0442\u0430 <i>Shared Clients(DSA)</i> \u0432 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 \u0432 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 \u0422\u0443\u043d\u0435\u043b\u0456 \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432 \u0442\u0430 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href=/tunnels>\u0422\u0443\u043d\u0435\u043b\u0456</a>.";
    t[5538] = "Theme change saved.";
    t[5539] = "\u0417\u043c\u0456\u043d\u0430 \u0442\u0435\u043c\u0438 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0430.";
    t[5540] = "Performance Graph";
    t[5541] = "\u0413\u0440\u0430\u0444\u0456\u043a \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0456";
    t[5544] = "This section is not enabled by default unless <a href='/help/configuration#advancedconsole'>Advanced Console mode</a> is enabled. You may enable it on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[5545] = "\u0426\u0435\u0439 \u0440\u043e\u0437\u0434\u0456\u043b \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0435\u043d\u043d\u044f\u043c \u043d\u0435 \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0439, \u044f\u043a\u0449\u043e \u0440\u0435\u0436\u0438\u043c <a href='/help/configuration#advancedconsole'>\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u043e\u0457 \u043a\u043e\u043d\u0441\u043e\u043b\u0456</a> \u043d\u0435 \u0430\u043a\u0442\u0438\u0432\u043e\u0432\u0430\u043d\u0438\u0439. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0430\u043a\u0442\u0438\u0432\u0443\u0432\u0430\u0442\u0438 \u0439\u043e\u0433\u043e \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/configsidebar'>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0431\u043e\u043a\u043e\u0432\u043e\u0457 \u043f\u0430\u043d\u0435\u043b\u0456</a>.";
    t[5546] = "Move up";
    t[5547] = "\u0420\u0443\u0445 \u0432\u0433\u043e\u0440\u0443";
    t[5554] = "Firewalls, Modems &amp; Routers";
    t[5555] = "\u0424\u0430\u0439\u0440\u0432\u043e\u043b\u0438, \u043c\u043e\u0434\u0435\u043c\u0438 \u0442\u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438";
    t[5556] = "Also, some routers cannot correctly forward both TCP and UDP on a single port, or may have other limitations or bugs that prevent them from passing traffic through to I2P.";
    t[5557] = "\u041a\u0440\u0456\u043c \u0442\u043e\u0433\u043e, \u0434\u0435\u044f\u043a\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438 \u043d\u0435 \u043c\u043e\u0436\u0443\u0442\u044c \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e \u043f\u0435\u0440\u0435\u0434\u0430\u0432\u0430\u0442\u0438 TCP \u0456 UDP \u043f\u043e \u043e\u0434\u043d\u043e\u043c\u0443 \u043f\u043e\u0440\u0442\u0443 \u0430\u0431\u043e \u043c\u043e\u0436\u0443\u0442\u044c \u043c\u0430\u0442\u0438 \u0439 \u0456\u043d\u0448\u0456 \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u043d\u044f \u0447\u0438 \u043f\u043e\u043c\u0438\u043b\u043a\u0438, \u0449\u043e \u043f\u0435\u0440\u0435\u0448\u043a\u043e\u0434\u0436\u0430\u044e\u0442\u044c \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0456 \u0442\u0440\u0430\u0444\u0456\u043a\u0443 \u0434\u043e I2P.";
    t[5570] = "Invalid key";
    t[5571] = "\u041d\u0435\u0434\u0456\u0439\u0441\u043d\u0438\u0439 \u043a\u043b\u044e\u0447";
    t[5582] = "Retransmission timeout";
    t[5583] = "\u0427\u0430\u0441 \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0457 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0456";
    t[5586] = "Advanced Options";
    t[5587] = "\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0456 \u043e\u043f\u0446\u0456\u0457";
    t[5592] = "Restart imminent";
    t[5593] = "\u041f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a \u043d\u0435\u043c\u0438\u043d\u0443\u0447\u0438\u0439";
    t[5612] = "A <a href=https://geti2p.net/en/docs/tunnels/unidirectional class='sitelink external' target=_blank rel=noreferrer>unidirectional</a> encrypted communication pathway between a client or server on the I2P network. Similar to a circuit in Tor, except that Tor circuits are bidirectional.";
    t[5613] = "\u0417\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u0439 \u043a\u0430\u043d\u0430\u043b \u0437\u0432'\u044f\u0437\u043a\u0443 \u0432 \u043e\u0434\u043d\u043e\u043c\u0443 \u043d\u0430\u043f\u0440\u044f\u043c\u043a\u0443 \u043c\u0456\u0436 \u043a\u043b\u0456\u0454\u043d\u0442\u043e\u043c \u0430\u0431\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u043e\u043c \u0443 \u043c\u0435\u0440\u0435\u0436\u0456 I2P. \u041f\u043e\u0434\u0456\u0431\u043d\u043e \u0434\u043e \u0446\u0438\u0440\u043a\u0443\u0457\u0442\u0443 \u0432 Tor, \u0437\u0430 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u043c \u0442\u043e\u0433\u043e, \u0449\u043e \u0446\u0438\u0440\u043a\u0443\u0457\u0442\u0438 Tor \u043f\u0440\u0430\u0446\u044e\u044e\u0442\u044c \u0443 \u0434\u0432\u043e\u0445 \u043d\u0430\u043f\u0440\u044f\u043c\u043a\u0430\u0445.";
    t[5616] = "Create and download torrents";
    t[5617] = "\u0421\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u0442\u0430 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0456\u0432";
    t[5632] = "Router Console";
    t[5633] = "\u041a\u043e\u043d\u0441\u043e\u043b\u044c \u0440\u043e\u0443\u0442\u0435\u0440\u0430";
    t[5634] = "The total number of peers in our network database";
    t[5635] = "\u0417\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0440\u0456\u0432 \u0443 \u043d\u0430\u0448\u0456\u0439 \u0431\u0430\u0437\u0456 \u0434\u0430\u043d\u0438\u0445 \u043c\u0435\u0440\u0435\u0436\u0456";
    t[5636] = "To install a plugin, enter the download URL:";
    t[5637] = "\u0429\u043e\u0431 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043f\u043b\u0430\u0433\u0456\u043d, \u0432\u0432\u0435\u0434\u0456\u0442\u044c URL-\u0430\u0434\u0440\u0435\u0441\u0443 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f:";
    t[5638] = "When set to true, this enables plugin installation on the <a href=/configplugins>Plugin Configuration page</a>. [Enabled by default]";
    t[5639] = "\u042f\u043a\u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0432 True, \u0446\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043f\u043b\u0430\u0433\u0456\u043d \u043d\u0430 <a href=/configplugins>\u0421\u0442\u043e\u0440\u0456\u043d\u043a\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043f\u043b\u0430\u0433\u0456\u043d\u0430</a>. [\u0423\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c]";
    t[5644] = "Configure tunnels";
    t[5645] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u0456";
    t[5652] = "Lease";
    t[5653] = "\u041e\u0440\u0435\u043d\u0434\u0430";
    t[5658] = "WashingtonInstitute";
    t[5659] = "\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0441\u044c\u043a\u0438\u0439 \u0456\u043d\u0441\u0442\u0438\u0442\u0443\u0442";
    t[5660] = "Client tunnel changes are temporary and are not saved.";
    t[5661] = "\u0417\u043c\u0456\u043d\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e \u0454 \u0442\u0438\u043c\u0447\u0430\u0441\u043e\u0432\u0438\u043c\u0438 \u0442\u0430 \u043d\u0435 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f.";
    t[5664] = "View Router Logs";
    t[5665] = "\u041f\u0435\u0440\u0435\u0433\u043b\u044f\u0434 \u0436\u0443\u0440\u043d\u0430\u043b\u0456\u0432 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[5666] = "Help with configuring I2P to use a non-system default browser";
    t[5667] = "\u0414\u043e\u043f\u043e\u043c\u043e\u0433\u0430 \u0437 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f\u043c I2P \u0434\u043b\u044f \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u043d\u0435\u0441\u0438\u0441\u0442\u0435\u043c\u043d\u043e\u0433\u043e \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430 \u0437\u0430 \u0443\u043c\u043e\u0432\u0447\u0430\u043d\u043d\u044f\u043c";
    t[5674] = "classic";
    t[5675] = "\u043a\u043b\u0430\u0441\u0438\u0447\u043d\u0438\u0439";
    t[5680] = "Configure I2P system service";
    t[5681] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u0443 \u0441\u043b\u0443\u0436\u0431\u0443 I2P";
    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "\u041f\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435, \u0447\u0438 \u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454 \u043f\u043e\u0440\u0442 \u0456\u043d\u0448\u0430 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0430. \u042f\u043a\u0449\u043e \u0442\u0430\u043a, \u0437\u0443\u043f\u0438\u043d\u0456\u0442\u044c \u0446\u044e \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0443 \u0430\u0431\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 I2P \u043d\u0430 \u0456\u043d\u0448\u0438\u0439 \u043f\u043e\u0440\u0442.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "\u0420\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u0432\u0440\u0443\u0447\u043d\u0443 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0445 \u0432\u0443\u0437\u043b\u0456\u0432 \u0456 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434\u0430\u0442\u0438 \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u0435\u043d\u0456 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0456 \u0432\u0443\u0437\u043b\u0438 \u0442\u0430 \u0441\u043f\u0438\u0441\u043e\u043a \u0431\u043b\u043e\u043a\u0443\u0432\u0430\u043d\u044c";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "\u0411\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440 \u0456\u0437 \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u0438\u043c \u0432\u0445\u0456\u0434\u043d\u0438\u043c TCP";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "\u0412\u0456\u0434\u043a\u0440\u0438\u0439\u0442\u0435 <a href=/confignet#udpconfig>\u043f\u043e\u0440\u0442 I2P+</a> \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 \u043c\u043e\u0434\u0435\u043c\u0456, \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456 \u0442\u0430/\u0430\u0431\u043e \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u0430\u0445 \u0434\u043b\u044f \u043a\u0440\u0430\u0449\u043e\u0433\u043e \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f (\u0456\u0434\u0435\u0430\u043b\u044c\u043d\u043e \u044f\u043a UDP, \u0442\u0430\u043a \u0456 TCP). \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043f\u0440\u043e \u043f\u0440\u043e\u0431\u0438\u0432\u0430\u043d\u043d\u044f \u043f\u043e\u0440\u0442\u0456\u0432 \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u043d\u0430 <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, \u0430 \u0442\u0430\u043a\u043e\u0436 \u043d\u0430 \u043d\u0430\u0448\u0438\u0445 \u0444\u043e\u0440\u0443\u043c\u0430\u0445 \u0442\u0430 IRC-\u043a\u0430\u043d\u0430\u043b\u0430\u0445, \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0445 \u043d\u0438\u0436\u0447\u0435. \u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e I2P \u043d\u0435 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0454 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u0406\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0443 \u0447\u0435\u0440\u0435\u0437 http- \u0447\u0438 socks-\u043f\u0440\u043e\u043a\u0441\u0456 [\u0432\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u0432\u0438\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u044c \u0432\u0456\u0442\u0430\u044e\u0442\u044c\u0441\u044f!], \u0445\u043e\u0447\u0430 \u043f\u0456\u0441\u043b\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u0442\u0438\u0441\u044f \u0434\u043e \u043f\u0440\u043e\u043a\u0441\u0456 \u0447\u0435\u0440\u0435\u0437 \u0441\u0430\u043c I2P.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "\u0424\u0456\u043b\u044c\u0442\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u043c\u043e\u0436\u0435 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0438\u0442\u0438 \u0437\u0430\u0445\u0438\u0441\u0442 \u0432\u0456\u0434 \u0437\u0430\u0433\u0430\u043b\u044c\u043c\u0443\u0432\u0430\u043d\u044c \u043f\u043e\u0441\u043b\u0443\u0433\u0438 \u0430\u0442\u0430\u043a\u0430\u043c\u0438 DDoS, \u043d\u0435 \u043f\u0435\u0440\u0435\u0440\u0438\u0432\u0430\u044e\u0447\u0438 \u043f\u0440\u0438 \u0446\u044c\u043e\u043c\u0443 \u0440\u043e\u0431\u043e\u0442\u0443 \u0441\u0435\u0440\u0432\u0456\u0441\u0443 \u0434\u043b\u044f \u0441\u043f\u0440\u0430\u0432\u0436\u043d\u0456\u0445 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456\u0432, \u0447\u0438 \u0442\u043e \u0440\u0430\u0437\u043e\u043c \u0437 \u043e\u0431\u043c\u0435\u0436\u0443\u0432\u0430\u0447\u0435\u043c \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u0447\u0438 \u044f\u043a \u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0443 \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0456\u044e. \u0419\u043e\u0433\u043e \u0442\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0434\u043b\u044f \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457 \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0434\u043e \u0441\u0435\u0440\u0432\u0456\u0441\u0443 \u0437 \u043c\u0435\u0442\u043e\u044e \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u0447\u0438 \u0437\u0430\u0437\u043d\u0430\u0454 \u0441\u0435\u0440\u0432\u0435\u0440 \u0430\u0442\u0430\u043a\u0438, \u0430\u0431\u043e \u043f\u0440\u043e\u0441\u0442\u043e \u0434\u043b\u044f \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457 \u0432\u0441\u0456\u0445 \u0432\u0456\u0434\u0432\u0456\u0434\u0443\u0432\u0430\u0447\u0456\u0432 \u0437\u0430 \u0446\u0456\u043b\u044f\u043c\u0438 I2P. \u041a\u0440\u0456\u043c \u0442\u043e\u0433\u043e, \u0444\u0456\u043b\u044c\u0442\u0440 \u043c\u043e\u0436\u0435 \u043e\u0434\u043d\u043e\u0447\u0430\u0441\u043d\u043e \u0444\u0443\u043d\u043a\u0446\u0456\u043e\u043d\u0443\u0432\u0430\u0442\u0438 \u044f\u043a \u0431\u0456\u043b\u0438\u0439 \u0442\u0430 \u0447\u043e\u0440\u043d\u0438\u0439 \u0441\u043f\u0438\u0441\u043e\u043a, \u0449\u043e \u0440\u043e\u0431\u0438\u0442\u044c \u0439\u043e\u0433\u043e \u0431\u0456\u043b\u044c\u0448 \u0433\u043d\u0443\u0447\u043a\u0438\u043c, \u043d\u0456\u0436 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c \u0441\u043f\u0438\u0441\u043a\u0456\u0432 \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u043c\u043e\u0436\u0443\u0442\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043e\u0434\u0438\u043d \u0444\u0430\u0439\u043b \u0444\u0456\u043b\u044c\u0442\u0440\u0443, \u044f\u043a\u0449\u043e \u0432\u0438 \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0432\u043f\u0440\u043e\u0432\u0430\u0434\u0438\u0442\u0438 \u0433\u043b\u043e\u0431\u0430\u043b\u044c\u043d\u0438\u0439 \u0444\u0456\u043b\u044c\u0442\u0440.";
