    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f (\u0432 \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445) \u0434\u0430\u0454 \u0437\u043c\u043e\u0433\u0443 \u0432\u0440\u0443\u0447\u043d\u0443 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0443 \u043c\u0456\u0436 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f\u043c\u0438 \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432, \u0432\u0438\u043a\u043e\u043d\u0443\u0432\u0430\u043d\u0438\u043c\u0438 \u0417\u0430\u0432\u0434\u0430\u043d\u043d\u044f\u043c \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0430 \u043c\u0456\u0436 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f\u043c\u0438 \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u0440\u043e\u0437\u043c\u0456\u0440\u043e\u043c NetDb \u0442\u0430 \u0432\u0432\u043e\u0434\u0438\u0442\u044c \u0434\u0435\u044f\u043a\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u043e\u0432\u0456\u0441\u0442\u044c \u0443 \u043f\u043b\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043b\u044f \u043f\u043e\u0441\u043b\u0430\u0431\u043b\u0435\u043d\u043d\u044f \u0430\u043d\u0430\u043b\u0456\u0437\u0443 \u0442\u0440\u0430\u0444\u0456\u043a\u0443. \u0414\u043b\u044f \u0437\u043d\u0430\u0447\u0435\u043d\u044c \u043c\u0435\u043d\u0448\u0438\u0445 2000 \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u0437\u0431\u0456\u043b\u044c\u0448\u0438\u0442\u0438 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f <code>router.refreshTimeout</code>. \u0417\u0430\u0437\u043d\u0430\u0447\u0442\u0435, \u0449\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0446\u044c\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043d\u0438\u0436\u0447\u0435 2000 \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434 \u0437\u0431\u0456\u043b\u044c\u0448\u0438\u0442\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u043c\u0435\u0440\u0435\u0436\u0456 \u0442\u0430 \u043c\u043e\u0436\u0435 \u0441\u043f\u0440\u0438\u0447\u0438\u043d\u0438\u0442\u0438 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0438 \u0437\u0430\u0432\u0434\u0430\u043d\u044c, \u0456 \u043d\u0435 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0442\u0440\u0438\u0432\u0430\u043b\u043e\u0433\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "\u0421\u0435\u0440\u0432\u0435\u0440\u043d\u0456 \u0442\u0443\u043d\u0435\u043b\u0456, \u044f\u043a\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0432 <a href=/i2ptunnelmgr>\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>, \u043d\u0430\u0434\u0430\u044e\u0442\u044c \u043a\u0456\u043b\u044c\u043a\u0430 \u0441\u043f\u043e\u0441\u043e\u0431\u0456\u0432 \u043e\u0431\u043c\u0435\u0436\u0438\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0441\u0435\u0440\u0432\u0456\u0441\u0443, \u0449\u043e \u043f\u0440\u0438\u0439\u043c\u0430\u0454. \u0411\u0456\u043b\u0438\u0439 \u0442\u0430 \u0447\u043e\u0440\u043d\u0438\u0439 \u0441\u043f\u0438\u0441\u043e\u043a \u0446\u0456\u043b\u0435\u0439, \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u043d\u044f \u0437'\u0454\u0434\u043d\u0430\u043d\u044c \u0442\u0430 \u0444\u0456\u043b\u044c\u0442\u0440\u0430\u0446\u0456\u044f \u0442\u0443\u043d\u0435\u043b\u0456\u0432 - \u0446\u0435 \u043c\u0435\u0442\u043e\u0434\u0438, \u043f\u0435\u0440\u0435\u0434\u0431\u0430\u0447\u0435\u043d\u0456 \u0434\u043b\u044f \u0437\u043d\u0438\u0436\u0435\u043d\u043d\u044f \u0440\u0438\u0437\u0438\u043a\u0443 \u0437\u0430\u0433\u0430\u043b\u044c\u043c\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u043e\u0441\u043b\u0443\u0433\u0438 DDoS-\u0430\u0442\u0430\u043a\u0430\u043c\u0438, \u043d\u0430\u0434\u0430\u043d\u043d\u044f \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u0432\u043e\u0433\u043e \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0432\u0456\u0434\u043e\u043c\u0438\u043c \u0446\u0456\u043b\u044f\u043c I2P \u0442\u0430 \u043a\u0435\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0440\u0430\u0444\u0456\u043a\u043e\u043c \u0434\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430.";
