    t[6134] = "Never reveal your router identity to anyone, as it is uniquely linked to your IP address in the network database.";
    t[6135] = "\u041d\u0456\u043a\u043e\u043b\u0438 \u043d\u0456\u043a\u043e\u043c\u0443 \u043d\u0435 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u044f\u0439\u0442\u0435 \u043f\u0440\u043e \u0441\u0432\u0456\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0432\u0456\u043d \u043e\u0434\u043d\u043e\u0437\u043d\u0430\u0447\u043d\u043e \u043f\u043e\u0432\u2019\u044f\u0437\u0430\u043d\u0438\u0439 \u0456\u0437 \u0432\u0430\u0448\u043e\u044e IP-\u0430\u0434\u0440\u0435\u0441\u043e\u044e \u0432 \u0431\u0430\u0437\u0456 \u0434\u0430\u043d\u0438\u0445 \u043c\u0435\u0440\u0435\u0436\u0456.";
