    t[6168] = "Your UDP port does not appear to be firewalled.";
    t[6169] = "\u0412\u0430\u0448 UDP-\u043f\u043e\u0440\u0442, \u044f\u043a \u0432\u0438\u0434\u0430\u0454\u0442\u044c\u0441\u044f, \u043d\u0435 \u0437\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u0438\u0439 \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u043e\u043c.";
    t[6178] = "You appear to be firewalled on TCP, therefore your router cannot accept inbound connections.";
    t[6179] = "\u0412\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440, \u0441\u0445\u043e\u0436\u0435, \u0437\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u0438\u0439 \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u043e\u043c \u043f\u043e TCP, \u0442\u043e\u043c\u0443 \u0432\u0456\u043d \u043d\u0435 \u043c\u043e\u0436\u0435 \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438 \u0432\u0445\u0456\u0434\u043d\u0456 \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f.";
    t[6188] = "HTTP proxy";
    t[6189] = "HTTP-\u043f\u0440\u043e\u043a\u0441\u0456";
    t[6204] = "Combined bandwidth graph";
    t[6205] = "\u043a\u043e\u043c\u0431\u0456\u043d\u043e\u0432\u0430\u043d\u0438\u0439 \u0433\u0440\u0430\u0444\u0456\u043a \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456";
    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "\u041d\u0435 \u0440\u043e\u0437\u0433\u043e\u043b\u043e\u0448\u0443\u0439\u0442\u0435 \u0446\u0435\u0439 \u0444\u0430\u0439\u043b \u043d\u0435\u0432\u0456\u0434\u043e\u043c\u0438\u043c \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430\u043c, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0432\u0456\u043d \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043a\u043e\u043d\u0444\u0456\u0434\u0435\u043d\u0446\u0456\u0439\u043d\u0456 \u0434\u0430\u043d\u0456 (100 \u0444\u0430\u0439\u043b\u0456\u0432 RouterInfo) \u0437 \u0432\u0430\u0448\u043e\u0433\u043e \u0432\u043b\u0430\u0441\u043d\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P, \u044f\u043a\u0456 \u043f\u043e\u0442\u0435\u043d\u0446\u0456\u0439\u043d\u043e \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u0456 \u0441\u0443\u043f\u0440\u043e\u0442\u0438\u0432\u043d\u0438\u043a\u043e\u043c \u0434\u043b\u044f \u0440\u043e\u0437\u043a\u0440\u0438\u0442\u0442\u044f \u0432\u0430\u0448\u043e\u0457 \u043e\u0441\u043e\u0431\u0438\u0441\u0442\u043e\u0441\u0442\u0456. \u0429\u043e\u0431 \u0437\u0430\u0445\u0438\u0441\u0442\u0438\u0442\u0438 \u0441\u0432\u0456\u0439 \u0430\u043d\u043e\u043d\u0456\u043c\u0456\u0442\u0435\u0442: \u0432\u0430\u043c \u0432\u0430\u0440\u0442\u043e \u0437\u0430\u0447\u0435\u043a\u0430\u0442\u0438 \u043a\u0456\u043b\u044c\u043a\u0430 \u0433\u043e\u0434\u0438\u043d/\u0434\u043d\u0456\u0432 \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u043f\u043e\u0434\u0456\u043b\u0438\u0442\u0438\u0441\u044f \u0444\u0430\u0439\u043b\u043e\u043c \u0437\u0456 \u0441\u0432\u043e\u0457\u043c \u0434\u043e\u0432\u0456\u0440\u0435\u043d\u0438\u043c \u0434\u0440\u0443\u0433\u043e\u043c. \u0422\u0430\u043a\u043e\u0436 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u0440\u0456\u0434\u043a\u043e (\u043d\u0435 \u0447\u0430\u0441\u0442\u0456\u0448\u0435 \u043d\u0456\u0436 1 \u0440\u0430\u0437 \u043d\u0430 \u0442\u0438\u0436\u0434\u0435\u043d\u044c) \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0442\u0430\u043a\u0443 \u043f\u0440\u043e\u0446\u0435\u0434\u0443\u0440\u0443.";
    t[6218] = "Plugin {0} installed but failed to start";
    t[6219] = "\u041f\u043b\u0430\u0433\u0456\u043d {0} \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e, \u0430\u043b\u0435 \u043d\u0435 \u0432\u0434\u0430\u043b\u043e\u0441\u044f \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438";
