    t[6228] = "Web Hosting - I2P+";
    t[6229] = "\u0412\u0435\u0431-\u0445\u043e\u0441\u0442\u0438\u043d\u0433 - I2P+";
    t[6232] = "Configure";
    t[6233] = "\u041a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0443\u0432\u0430\u0442\u0438";
    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "\u0414\u0456\u044f \u0443\u0447\u0430\u0441\u0442\u0456 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 \u0448\u043b\u044f\u0445\u043e\u043c \u0434\u043e\u0437\u0432\u043e\u043b\u0443 \u0456\u043d\u0448\u0438\u043c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c \u0431\u0443\u0434\u0443\u0432\u0430\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u0456 \u0437 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\u043c \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0432 \u043b\u0430\u043d\u0446\u044e\u0436\u043a\u0443 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u0414\u043b\u044f \u0443\u0447\u0430\u0441\u0442\u0456 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0432\u0438\u0434\u0456\u043b\u0438\u0442\u0438 \u043f\u0440\u0438\u043d\u0430\u0439\u043c\u043d\u0456 12 \u041a\u0411/\u0441 \u0441\u043c\u0443\u0433\u0438 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u0430\u043d\u043d\u044f \u0432\u0433\u043e\u0440\u0443 (\u0440\u043e\u0437\u0434\u0456\u043b\u0443 \u043c\u0435\u0440\u0435\u0436\u0456). \u0417\u0430\u0437\u043d\u0430\u0447\u0442\u0435, \u0449\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438 \u0437\u0430 \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u043e\u043c \u0431\u0443\u0434\u0443\u0442\u044c \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u0456 \u0432 \u0441\u0442\u0443\u043f\u0435\u043d\u0456 \u0432\u043d\u0435\u0441\u043a\u0443 \u0432 \u0443\u0447\u0430\u0441\u0442\u044c, \u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440, \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0439 \u044f\u043a \u041f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0438\u0439, \u0432\u0437\u0430\u0433\u0430\u043b\u0456 \u043d\u0435 \u0431\u0440\u0430\u0442\u0438\u043c\u0435 \u0443\u0447\u0430\u0441\u0442\u0456.";
    t[6246] = "All Routers";
    t[6247] = "\u0412\u0441\u0456 \u0440\u043e\u0443\u0442\u0435\u0440\u0438";
    t[6250] = "TheMoscowTimes";
    t[6251] = "TheMoscowTimes";
    t[6252] = "DELAYED";
    t[6253] = "\u0417\u0410\u0422\u0420\u0418\u041c\u041a\u0410";
    t[6258] = "For best participation as a floodfill router, you should open your firewall.";
    t[6259] = "\u0414\u043b\u044f \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u043e\u0457 \u0443\u0447\u0430\u0441\u0442\u0456 \u044f\u043a \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u043f\u043e\u0432\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0441\u043b\u0456\u0434 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0438 \u0444\u0430\u0454\u0440\u0432\u043e\u043b.";
    t[6270] = "Determines the maximum number of participating tunnels the router can build. To disable participation completely, set to 0. [Default is 8000, or 2000 if running on Arm or Android]";
    t[6271] = "\u0412\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u0443 \u044f\u043a\u0438\u0445 \u0440\u043e\u0443\u0442\u0435\u0440 \u043c\u043e\u0436\u0435 \u0431\u0440\u0430\u0442\u0438 \u0443\u0447\u0430\u0441\u0442\u044c. \u0429\u043e\u0431 \u043f\u043e\u0432\u043d\u0456\u0441\u0442\u044e \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438 \u0443\u0447\u0430\u0441\u0442\u044c, \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c 0. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 8000 \u0430\u0431\u043e 2000, \u044f\u043a\u0449\u043e \u043f\u0440\u0430\u0446\u044e\u0454 \u043d\u0430 Arm \u0430\u0431\u043e Android]";
    t[6272] = "Updating unsigned update URL to {0}";
    t[6273] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f URL-\u0430\u0434\u0440\u0435\u0441\u0438 \u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0445 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u044c \u043d\u0430 {0}";
    t[6276] = "Proxy requires authorization";
    t[6277] = "\u041f\u0440\u043e\u043a\u0441\u0456 \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u0430\u0432\u0442\u043e\u0440\u0438\u0437\u0430\u0446\u0456\u0457";
    t[6280] = "I2P will work best if you configure your rates to match the speed of your internet connection.";
