    t[6311] = "\u041e\u0437\u043d\u0430\u0439\u043e\u043c\u0442\u0435\u0441\u044f \u0437 \u043f\u043e\u043b\u0456\u0442\u0438\u043a\u043e\u044e \u043a\u043e\u043d\u0444\u0456\u0434\u0435\u043d\u0446\u0456\u0439\u043d\u043e\u0441\u0442\u0456 M-Lab, \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u043d\u0430 \u044f\u043a\u0443 \u043d\u0430\u0432\u0435\u0434\u0435\u043d\u043e \u043d\u0438\u0436\u0447\u0435.";
    t[6312] = "Current console and webapp translation report";
    t[6313] = "\u041f\u043e\u0442\u043e\u0447\u043d\u0438\u0439 \u0437\u0432\u0456\u0442 \u043f\u0440\u043e \u043f\u0435\u0440\u0435\u043a\u043b\u0430\u0434 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u0442\u0430 \u0432\u0435\u0431-\u0434\u043e\u0434\u0430\u0442\u043a\u0443";
    t[6314] = "It improves your anonymity by creating cover traffic, and helps the network. ";
    t[6315] = "\u0426\u0435 \u043f\u043e\u043a\u0440\u0430\u0449\u0443\u0454 \u0432\u0430\u0448\u0443 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c, \u0441\u0442\u0432\u043e\u0440\u044e\u044e\u0447\u0438 \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0438\u0439 \u0442\u0440\u0430\u0444\u0456\u043a \u0456 \u0434\u043e\u043f\u043e\u043c\u0430\u0433\u0430\u044e\u0447\u0438 \u043c\u0435\u0440\u0435\u0436\u0456. ";
    t[6316] = "No transit tunnels are built when Hidden mode is active";
    t[6317] = "\u0416\u043e\u0434\u043d\u0456 \u0442\u0443\u043d\u0435\u043b\u0456-\u0443\u0447\u0430\u0441\u043d\u0438\u043a\u0438 \u043d\u0435 \u0431\u0443\u0434\u0443\u044e\u0442\u044c\u0441\u044f, \u043a\u043e\u043b\u0438 \u0430\u043a\u0442\u0438\u0432\u043d\u0438\u0439 \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u0438\u0439 \u0440\u0435\u0436\u0438\u043c";
    t[6322] = "Outbound to 32000 only, does not listen on this port. Starts at 31000 and will increment until 31999 looking for a free port. To change, see the <a href=https://wrapper.tanukisoftware.com/doc/english/prop-port.html target=_blank rel=noreferrer class='sitelink external'>wrapper documentation</a>.";
    t[6323] = "\u0412\u0438\u0445\u0456\u0434\u043d\u0435 \u043b\u0438\u0448\u0435 \u0434\u043e 32000, \u043d\u0435 \u043f\u0440\u043e\u0441\u043b\u0443\u0445\u043e\u0432\u0443\u0454 \u0446\u044c\u043e\u0433\u043e \u043f\u043e\u0440\u0442\u0443. \u041f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0437 31000 \u0456 \u0437\u0431\u0456\u043b\u044c\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043e 31999, \u0448\u0443\u043a\u0430\u044e\u0447\u0438 \u0432\u0456\u043b\u044c\u043d\u0438\u0439 \u043f\u043e\u0440\u0442. \u0429\u043e\u0431 \u0437\u043c\u0456\u043d\u0438\u0442\u0438, \u0434\u0438\u0432\u0456\u0442\u044c\u0441\u044f <a href=https://wrapper.tanukisoftware.com/doc/english/prop-port.html target=_blank rel=noreferrer class='sitelink external'>\u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u044e wrapper</a>.";
    t[6330] = "TheConversation";
    t[6331] = "TheConversation";
