    t[6335] = "\u0417\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0438\u0442\u0438 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f I2P";
    t[6342] = "Overview";
    t[6343] = "\u041e\u0433\u043b\u044f\u0434";
    t[6344] = "Total peers in our banlist";
    t[6345] = "\u0417\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0456\u0432 \u0443 \u043d\u0430\u0448\u043e\u043c\u0443 \u0431\u0430\u043d-\u043b\u0438\u0441\u0442\u0456";
    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0440\u0456\u0432, \u044f\u043a\u0456 \u0431\u0443\u0434\u0443\u0442\u044c \u0434\u043e\u0441\u043b\u0456\u0434\u0436\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u043f\u0430\u0440\u0430\u043b\u0435\u043b\u044c\u043d\u043e \u043f\u0440\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0417\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u0434\u043e\u0441\u043b\u0456\u0434\u0436\u0435\u043d\u043d\u044f \u043f\u0456\u0440\u0456\u0432 [\u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 1 \u043f\u0456\u0440 \u043e\u0434\u043d\u043e\u0447\u0430\u0441\u043d\u043e, \u043a\u043e\u043b\u0438 \u0432\u0456\u0434\u043e\u043c\u043e \u0431\u0456\u043b\u044c\u0448\u0435 3000 \u043f\u0456\u0440\u0456\u0432]. \u0417\u0430\u0437\u043d\u0430\u0447\u0442\u0435, \u0449\u043e \u0437\u0431\u0456\u043b\u044c\u0448\u0435\u043d\u043d\u044f \u0446\u044c\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u0431\u0456\u043b\u044c\u0448\u0438\u0442\u044c \u0432\u0438\u043c\u043e\u0433\u0438 \u0434\u043e \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0434\u043b\u044f \u0434\u043e\u0441\u043b\u0456\u0434\u0436\u0435\u043d\u043d\u044f, \u0430 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0439\u043e\u0433\u043e \u0437\u0430\u043d\u0430\u0434\u0442\u043e \u0432\u0438\u0441\u043e\u043a\u0438\u043c \u043c\u043e\u0436\u0435 \u043f\u0440\u0438\u0437\u0432\u0435\u0441\u0442\u0438 \u0434\u043e \u043d\u0430\u0434\u043c\u0456\u0440\u043d\u043e\u0457 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0438 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c \u0442\u0430 \u043f\u0435\u0440\u0435\u0448\u043a\u043e\u0434\u0436\u0430\u0442\u0438 \u0440\u043e\u0431\u043e\u0442\u0456 \u0456\u043d\u0448\u0438\u0445 \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432, \u0442\u043e\u043c\u0443 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 \u0437 \u043e\u0431\u0435\u0440\u0435\u0436\u043d\u0456\u0441\u0442\u044e!";
    t[6352] = "Secure filesharing service";
    t[6353] = "\u0421\u043b\u0443\u0436\u0431\u0430 \u0431\u0435\u0437\u043f\u0435\u0447\u043d\u043e\u0433\u043e \u043e\u0431\u043c\u0456\u043d\u0443 \u0444\u0430\u0439\u043b\u0430\u043c\u0438";
