    t[6355] = "\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0456 \u0456\u043d\u0442\u0440\u043e\u0434\u0443\u0446\u0435\u043d\u0442\u0438 SSU";
    t[6356] = "Stopped webapp {0}";
    t[6357] = "\u0417\u0443\u043f\u0438\u043d\u0435\u043d\u043e \u0432\u0435\u0431-\u0434\u043e\u0434\u0430\u0442\u043e\u043a {0}";
    t[6360] = "seconds";
    t[6361] = "\u0441\u0435\u043a\u0443\u043d\u0434";
    t[6362] = "SAM bridge";
    t[6363] = "\u041c\u0456\u0441\u0442 SAM";
    t[6364] = "To allow all unspecified client destinations:";
    t[6365] = "\u0429\u043e\u0431 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u0438 \u0443\u0441\u0456 \u043d\u0435\u0432\u043a\u0430\u0437\u0430\u043d\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0456 \u0446\u0456\u043b\u0456:";
