    t[6373] = "\u041f\u0440\u043e\u0444\u0456\u043b\u0456";
    t[6376] = "If the skew is more than a few seconds, please correct the problem by adjusting your computer's time.";
    t[6377] = "\u042f\u043a\u0449\u043e \u0432\u0456\u0434\u0445\u0438\u043b\u0435\u043d\u043d\u044f \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u043a\u0456\u043b\u044c\u043a\u0430 \u0441\u0435\u043a\u0443\u043d\u0434, \u0431\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0432\u0438\u043f\u0440\u0430\u0432\u0442\u0435 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0443 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440\u043d\u043e\u0433\u043e \u0447\u0430\u0441\u0443.";
    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "\u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u0434\u043b\u044f \u043f\u043e\u0441\u0438\u043b\u0435\u043d\u043d\u044f \u0431\u0435\u0437\u043f\u0435\u043a\u0438 \u043f\u0440\u0438 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434\u0456 \u0441\u0430\u0439\u0442\u0456\u0432 .i2p \u0432\u0430\u0440\u0442\u043e \u0440\u043e\u0437\u0433\u043b\u044f\u043d\u0443\u0442\u0438 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0434\u043e\u0434\u0430\u0442\u043a\u0443, \u0449\u043e \u0431\u043b\u043e\u043a\u0443\u0454 JavaScript \u0443 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0456, \u044f\u043a, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, \u0445\u043e\u0447\u0430 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u0438 \u0430\u0434\u0440\u0435\u0441\u0456 \u043d\u0430 \u044f\u043a\u0456\u0439 \u043f\u0440\u0430\u0446\u044e\u0454 I2P+ \u0434\u043b\u044f \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043d\u044f \u0440\u0456\u0437\u043d\u0438\u0445 \u043c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u0435\u0439 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u0440\u043e\u0443\u0442\u0435\u0440\u0430. \u041a\u0440\u0456\u043c \u0442\u043e\u0433\u043e, \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043e\u0434\u0430\u0442\u043e\u043a, \u0449\u043e \u0431\u043b\u043e\u043a\u0443\u0454 \u0437\u0430\u043f\u0438\u0442\u0438 \u0434\u043e \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u0456\u0445 \u0440\u0435\u0441\u0443\u0440\u0441\u0456\u0432, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6386] = "Disable inbound IPv4 connections (firewalled)";
