    t[6665] = "\u0412\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0431\u0443\u0434\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0441\u0432\u0456\u0439 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043a\u0441\u0456-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 HTTP (\u0437\u0430 \u0443\u043c\u043e\u0432\u0447\u0430\u043d\u043d\u044f\u043c \u043d\u0430 \u0445\u043e\u0441\u0442\u0456: <code>127.0.0.1</code> \u043f\u043e\u0440\u0442: <code>4444</code>). \u0414\u0438\u0432\u0456\u0442\u044c\u0441\u044f <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>\u041f\u043e\u0441\u0456\u0431\u043d\u0438\u043a \u0456\u0437 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043a\u0441\u0456-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0432\u0435\u0431-\u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434\u0430\u0447\u0430</a>, \u0449\u043e\u0431 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0434\u043e\u043a\u043b\u0430\u0434\u043d\u0456\u0448\u0456 \u043f\u043e\u044f\u0441\u043d\u0435\u043d\u043d\u044f.";
    t[6666] = "Show all routers with this version in the NetDb";
