    t[6683] = "\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0439 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440";
    t[6684] = "For convenience you can maintain a list of destinations in a file and define a threshold for all of them in bulk:";
    t[6685] = "\u0414\u043b\u044f \u0437\u0440\u0443\u0447\u043d\u043e\u0441\u0442\u0456 \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0441\u043f\u0438\u0441\u043e\u043a \u0446\u0456\u043b\u0435\u0439 \u0443 \u0444\u0430\u0439\u043b\u0456 \u0442\u0430 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043f\u043e\u0440\u0456\u0433 \u0434\u043b\u044f \u043d\u0438\u0445 \u0443\u0441\u0456\u0445 \u043f\u0430\u0440\u0442\u0456\u044f\u043c\u0438:";
    t[6694] = "This setting, when set to true, will display a Peer Test Average readout in the Congestion section of the sidebar, calculated by adding the successful peer test average and the average excess time taken by failed tests. The average value may be used as a guide to determine the optimal <code>router.peerTestTimeout</code> value. [Default is false]";
    t[6695] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f, \u043a\u043e\u043b\u0438 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e true, \u0431\u0443\u0434\u0435 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0442\u0438 \u043f\u043e\u043a\u0430\u0437\u043d\u0438\u043a \u0421\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0457 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0438 \u0442\u0435\u0441\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0456\u0440\u0456\u0432 \u0443 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 \u041f\u0435\u0440\u0435\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u0431\u043e\u043a\u043e\u0432\u043e\u0457 \u043f\u0430\u043d\u0435\u043b\u0456, \u0440\u043e\u0437\u0440\u0430\u0445\u043e\u0432\u0430\u043d\u0438\u0439 \u0448\u043b\u044f\u0445\u043e\u043c \u0434\u043e\u0434\u0430\u0432\u0430\u043d\u043d\u044f \u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0433\u043e \u0443\u0441\u043f\u0456\u0448\u043d\u043e\u0433\u043e \u0442\u0435\u0441\u0442\u0443 \u0442\u0430 \u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0433\u043e \u043d\u0430\u0434\u043b\u0438\u0448\u043a\u043e\u0432\u043e\u0433\u043e \u0447\u0430\u0441\u0443 \u043d\u0435\u0432\u0434\u0430\u043b\u0438\u0445 \u0442\u0435\u0441\u0442\u0456\u0432. \u0421\u0435\u0440\u0435\u0434\u043d\u0454 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043c\u043e\u0436\u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u0442\u0438 \u0434\u043b\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043e\u043f\u0442\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f <code>router.peerTestTimeout</code>. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c false]";
