    t[6751] = "\u0414\u043e\u0434\u0430\u0442\u0438 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430";
    t[6758] = "Therefore your router cannot accept inbound connections.";
    t[6759] = "\u041e\u0442\u0436\u0435 \u0432\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043d\u0435 \u0437\u043c\u043e\u0436\u0435 \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438 \u0432\u0445\u0456\u0434\u043d\u0456 \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f.";
    t[6760] = "Click Restart to install";
    t[6761] = "\u041d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u041f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438, \u0449\u043e\u0431 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438";
    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ \u043c\u043e\u0436\u0435 \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u043e \u0456\u043d\u0442\u0435\u0433\u0440\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u0432 \u043c\u0435\u0440\u0435\u0436\u0443 \u043f\u043e\u0432\u0456\u043b\u044c\u043d\u043e \u043f\u0456\u0434 \u0447\u0430\u0441 \u043f\u0435\u0440\u0448\u043e\u0433\u043e \u0437\u0430\u043f\u0443\u0441\u043a\u0443, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0456\u043d\u0456\u0446\u0456\u044e\u0454 \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 \u0442\u0430 \u0437\u0431\u0438\u0440\u0430\u0454 \u0434\u0430\u043d\u0456 \u043f\u0440\u043e \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0438\u0445 \u043f\u0456\u0440\u0456\u0432. \u0427\u0438\u043c \u0434\u043e\u0432\u0448\u0435 \u043f\u0440\u0430\u0446\u044e\u0454 \u0432\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 I2P+, \u0442\u043e\u043c \u043a\u0440\u0430\u0449\u0435 \u0432\u0456\u043d \u0431\u0443\u0434\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438, \u0442\u043e\u0436 \u043d\u0430\u043c\u0430\u0433\u0430\u0439\u0442\u0435\u0441\u044f \u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0439\u043e\u0433\u043e \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u0438\u043c \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0443\u0441\u044c\u043e\u0433\u043e \u0434\u043d\u044f, \u044f\u043a\u0449\u043e \u0446\u0435 \u043c\u043e\u0436\u043b\u0438\u0432\u043e! \u042f\u043a\u0449\u043e, \u0447\u0435\u0440\u0435\u0437 30 \u0445\u0432\u0438\u043b\u0438\u043d, \u0432\u0430\u0448 \u043f\u0456\u0434\u0440\u0430\u0445\u0443\u043d\u043e\u043a <i>\u0410\u043a\u0442\u0438\u0432\u043d\u0438\u0439: [\u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0456/\u043e\u0441\u0442\u0430\u043d\u043d\u0456]</i> \u0432\u0441\u0435 \u0449\u0435 \u043c\u0435\u043d\u0448\u0435 10 \u043f\u0456\u0440\u0456\u0432 \u0430\u0431\u043e \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c <i>\u0406\u043d\u0442\u0435\u0433\u0440\u043e\u0432\u0430\u043d\u0438\u0445</i> \u043f\u0456\u0440\u0456\u0432 \u043c\u0435\u043d\u0448\u0435 5, \u0456\u0441\u043d\u0443\u0454 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u0441\u043f\u043e\u0441\u043e\u0431\u0456\u0432 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u0438 \u043d\u0430\u044f\u0432\u043d\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u0431\u043b\u0435\u043c:";
    t[6768] = "Error updating the configuration - please see the error logs";
