    t[6924] = "You have configured I2P to share more than 128KBps of bandwidth, but you are firewalled.";
    t[6925] = "\u0412\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043b\u0438 I2P \u0434\u0456\u043b\u0438\u0442\u0438\u0441\u044f \u0431\u0456\u043b\u044c\u0448\u0435 \u043d\u0456\u0436 128 \u041a\u0411/\u0441 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456, \u0430\u043b\u0435 \u043f\u0435\u0440\u0435\u0431\u0443\u0432\u0430\u0454\u0442\u0435 \u0437\u0430 \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u043e\u043c.";
    t[6928] = "Bugs in the device's UPnP implementation";
    t[6929] = "\u041f\u043e\u043c\u0438\u043b\u043a\u0438 \u0432 \u0440\u0435\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u0457 UPnP \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u044e";
    t[6942] = "High capacity";
    t[6943] = "\u0412\u0438\u0441\u043e\u043a\u0430 \u043c\u0456\u0441\u0442\u043a\u0456\u0441\u0442\u044c";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "\u0420\u0435\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0430 Tor \u0434\u043b\u044f Java, \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0430 \u044f\u043a \u043f\u043b\u0430\u0433\u0456\u043d I2P. \u041c\u043e\u0436\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u044f\u043a \u0442\u0443\u043d\u0435\u043b\u044c <i>outproxy</i> \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u044f\u043a\u0449\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u0439 SOCKS- \u0430\u0431\u043e HTTP-\u0442\u0443\u043d\u0435\u043b\u044c \u043a\u043b\u0456\u0454\u043d\u0442\u0430 \u0432 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 <i>Tunnel Manager</i>. \u0414\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u0437\u0430 \u0430\u0434\u0440\u0435\u0441\u043e\u044e <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. \u0412\u0438\u0445\u0456\u0434\u043d\u0438\u0439 \u043a\u043e\u0434 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u043d\u0430 <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "\u0410\u0434\u0440\u0435\u0441\u0438 IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "\u0426\u0435\u0439 \u0440\u043e\u0437\u0434\u0456\u043b \u043f\u043e\u043a\u0430\u0437\u0443\u0454 \u0441\u0435\u0440\u0435\u0434\u043d\u044e \u0448\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0442\u0430 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0439 \u043e\u0431\u0441\u044f\u0433 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0437\u0430 \u0441\u0435\u0430\u043d\u0441. \u0412\u0441\u0456 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043f\u043e\u0434\u0430\u043d\u0456 \u0432 \u0431\u0430\u0439\u0442\u0430\u0445 \u0437\u0430 \u0441\u0435\u043a\u0443\u043d\u0434\u0443. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u043c\u0456\u043d\u0438\u0442\u0438 \u043b\u0456\u043c\u0456\u0442\u0438 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/config'>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456</a>. \u0427\u0438\u043c \u0431\u0456\u043b\u044c\u0448\u0435 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0432\u0438 \u043d\u0430\u0434\u0430\u0432\u0430\u0442\u0438\u043c\u0435\u0442\u0435, \u0442\u0438\u043c \u0431\u0456\u043b\u044c\u0448\u0435 \u0432\u0438 \u0434\u043e\u043f\u043e\u043c\u0430\u0433\u0430\u0442\u0438\u043c\u0435\u0442\u0435 \u043c\u0435\u0440\u0435\u0436\u0456 \u0439 \u043f\u043e\u043a\u0440\u0430\u0449\u0443\u0432\u0430\u0442\u0438\u043c\u0435\u0442\u0435 \u0432\u043b\u0430\u0441\u043d\u0443 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c, \u0442\u043e\u043c\u0443 \u0431\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u043f\u0440\u0438\u0434\u0456\u043b\u0456\u0442\u044c \u0447\u0430\u0441 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u0434\u0443 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c. \u042f\u043a\u0449\u043e \u0432\u0438 \u043d\u0435 \u0432\u043f\u0435\u0432\u043d\u0435\u043d\u0456 \u0432 \u0448\u0432\u0438\u0434\u043a\u043e\u0441\u0442\u0456 \u0441\u0432\u043e\u0454\u0457 \u043c\u0435\u0440\u0435\u0436\u0456, \u0441\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u0439\u0442\u0435\u0441\u044f \u0441\u0435\u0440\u0432\u0456\u0441\u043e\u043c \u0442\u0438\u043f\u0443 <a href='http://speedtest.net/'>SpeedTest</a> \u0430\u0431\u043e \u0430\u043d\u0430\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u043c, \u0449\u043e\u0431 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0443\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u0440\u043e \u0441\u0432\u043e\u044e \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0443 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c. \u0412\u0430\u0448 \u043e\u0431\u0441\u044f\u0433 \u043f\u043e\u0434\u0456\u043b\u0443 \u0443 \u0432\u0438\u0441\u0445\u0456\u0434\u043d\u043e\u043c\u0443 \u043d\u0430\u043f\u0440\u044f\u043c\u043a\u0443 (\u041a\u0411\u043f\u0441 \u0412\u0438\u0445\u0456\u0434) \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0442\u0438\u043c\u0435 \u0432\u0430\u0448 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0439 \u0432\u043d\u0435\u0441\u043e\u043a \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456. \u041f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0443 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c <a href='/graphs'>\u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0438 \u0433\u0440\u0430\u0444\u0456\u043a\u0456\u0432</a> \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c.";
