    t[6988] = "Gracefully restarting into Hidden Router Mode";
    t[6989] = "\u0412\u0438\u0442\u043e\u043d\u0447\u0435\u043d\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a \u0443 \u0440\u0435\u0436\u0438\u043c \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[6994] = "Bad speed value";
    t[6995] = "\u041d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0448\u0432\u0438\u0434\u043a\u043e\u0441\u0442\u0456";
    t[6996] = "Please supply a valid reseed URL";
    t[6997] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u043d\u0430\u0434\u0430\u0439\u0442\u0435 \u0434\u0456\u0439\u0441\u043d\u0443 URL-\u0430\u0434\u0440\u0435\u0441\u0443 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f";
    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0441\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0443\u0432\u0430\u0442\u0438 \u043c\u0456\u043d\u0456\u043c\u0430\u043b\u044c\u043d\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0437 \u0443\u0447\u0430\u0441\u0442\u044e, \u044f\u043a\u0456 \u0445\u043e\u0441\u0442\u0438\u0442\u044c \u0440\u043e\u0443\u0442\u0435\u0440, \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u0440\u043e\u0443\u0442\u0435\u0440 \u043f\u043e\u0447\u043d\u0435 \u0432\u0456\u0434\u0445\u0438\u043b\u044f\u0442\u0438 \u0437\u0430\u043f\u0438\u0442\u0438 \u043d\u0430 \u0442\u0443\u043d\u0435\u043b\u0456 \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0456 \u043f\u0435\u0440\u0435\u0434\u0431\u0430\u0447\u0443\u0432\u0430\u043d\u0438\u0445 \u0432\u0438\u043c\u043e\u0433 \u0434\u043e \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 100, \u044f\u043a\u0449\u043e \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043f\u0440\u0430\u0446\u044e\u0454 \u043d\u0430 Android, 800 \u044f\u043a\u0449\u043e \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043f\u0440\u0430\u0446\u044e\u0454 \u043d\u0430 ARM \u0456 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u043c\u0435\u043d\u0448\u0435 4 \u044f\u0434\u0435\u0440, 1200 \u044f\u043a\u0449\u043e \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043f\u0440\u0430\u0446\u044e\u0454 \u043d\u0430 ARM \u0456 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 4 \u0456 \u0431\u0456\u043b\u044c\u0448\u0435 \u044f\u0434\u0435\u0440, \u0432 \u0456\u043d\u0448\u043e\u043c\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443 2500]";
    t[7012] = "Delete key";
    t[7013] = "\u0412\u0438\u0434\u0430\u043b\u0438\u0442\u0438 \u043a\u043b\u044e\u0447";
    t[7014] = "Please supply a password";
    t[7015] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0432\u0432\u0435\u0434\u0456\u0442\u044c \u043f\u0430\u0440\u043e\u043b\u044c";
    t[7022] = "This setting (in milliseconds) allows you to manually configure the queue delay target value for the CoDel queue management system. Default is 50ms. [Restart required]";
    t[7023] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f (\u0432 \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445) \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0432\u0440\u0443\u0447\u043d\u0443 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0446\u0456\u043b\u044c\u043e\u0432\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0438 \u0447\u0435\u0440\u0433\u0438 \u0434\u043b\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0438 \u0443\u043f\u0440\u0430\u0432\u043b\u0456\u043d\u043d\u044f \u0447\u0435\u0440\u0433\u0430\u043c\u0438 CoDel. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 50 \u043c\u0441. [\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "\u0414\u043b\u044f \u0442\u043e\u0433\u043e, \u0449\u043e\u0431 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u0442\u0438 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c, \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u043e\u043d\u043e\u0432\u0438\u0442\u0438 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u043f\u0440\u043e\u043a\u0441\u0456 -\u0441\u0435\u0440\u0432\u0435\u0440\u0430 I2P HTTP. \u042f\u043a\u0449\u043e \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043d\u043e\u0432\u0438\u043d \u0430\u0431\u043e i2p \u0431\u0443\u0434\u0435 \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u043e \u043d\u0430 i2p, \u0431\u0443\u0434\u0435 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0438\u043c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043a\u0441\u0456.";
    t[7054] = "A threshold to apply to remote destinations listed in a file";
    t[7055] = "\u041f\u043e\u0440\u043e\u0433\u043e\u0432\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0434\u043b\u044f \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u0445 \u043f\u0443\u043d\u043a\u0442\u0456\u0432 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u043f\u0435\u0440\u0435\u043b\u0456\u0447\u0435\u043d\u0438\u0445 \u0443 \u0444\u0430\u0439\u043b\u0456";
    t[7062] = "The su3 format is preferred, as it will be verified as signed by a trusted source.";
    t[7063] = "\u0424\u043e\u0440\u043c\u0430\u0442 su3 \u0454 \u043a\u0440\u0430\u0449\u0438\u043c, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0439\u043e\u0433\u043e \u043f\u0456\u0434\u043f\u0438\u0441 \u0431\u0443\u0434\u0435 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0435\u043d\u043e \u043d\u0430\u0434\u0456\u0439\u043d\u0438\u043c \u0434\u0436\u0435\u0440\u0435\u043b\u043e\u043c.";
    t[7064] = "Specify hostname or IP address";
    t[7065] = "\u0412\u043a\u0430\u0436\u0456\u0442\u044c \u0456\u043c '\u044f \u0445\u043e\u0441\u0442\u0443 \u0430\u0431\u043e IP-\u0430\u0434\u0440\u0435\u0441\u0443";
    t[7072] = "Strict Countries";
    t[7073] = "\u0421\u0443\u0432\u043e\u0440\u0456 \u043a\u0440\u0430\u0457\u043d\u0438";
    t[7076] = "However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels.";
    t[7077] = "\u041e\u0434\u043d\u0430\u043a, \u044f\u043a\u0449\u043e \u0432\u0438 \u043c\u0430\u0442\u0438\u043c\u0435\u0442\u0435 \u0432\u0456\u0434\u043c\u043e\u0432\u0443 \u0442\u0443\u043d\u0435\u043b\u044e, \u0432\u0441\u0456 \u0432\u0430\u0448\u0456 \u0441\u0435\u0440\u0432\u0456\u0441\u0438 \u0432\u0456\u0434\u0456\u0439\u0434\u0443\u0442\u044c \u043e\u0434\u043d\u043e\u0447\u0430\u0441\u043d\u043e, \u0442\u043e\u043c\u0443 \u0432 \u0434\u0435\u044f\u043a\u0438\u0445 \u0432\u0438\u043f\u0430\u0434\u043a\u0430\u0445 \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u0445\u043e\u0442\u0456\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0456 \u0441\u0435\u0440\u0432\u0456\u0441\u0438 \u043d\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0432\u043b\u0430\u0441\u043d\u0438\u0445 \u043d\u0430\u0431\u043e\u0440\u0456\u0432 \u0442\u0443\u043d\u0435\u043b\u0456\u0432.";
    t[7098] = "Network";
    t[7099] = "\u041c\u0435\u0440\u0435\u0436\u0430";
