    t[7103] = "\u0427\u0430\u0441 \u043f\u043e\u0457\u0437\u0434\u043a\u0438";
    t[7106] = "Delete selected";
    t[7107] = "\u0412\u0438\u0434\u0430\u043b\u0438\u0442\u0438 \u043e\u0431\u0440\u0430\u043d\u0435";
    t[7108] = "Job runners";
