    t[7116] = "Router homepage";
    t[7117] = "\u0414\u043e\u043c\u0430\u0448\u043d\u044f \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[7120] = "Outbound options";
    t[7121] = "\u0412\u0438\u0445\u0456\u0434\u043d\u0456 \u0432\u0430\u0440\u0456\u0430\u043d\u0442\u0438";
    t[7122] = "config i2cp";
    t[7123] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f I2CP";
    t[7126] = "Log level overrides";
    t[7127] = "\u041f\u0435\u0440\u0435\u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0440\u0456\u0432\u043d\u044f \u0436\u0443\u0440\u043d\u0430\u043b\u0443";
    t[7128] = "Deleted plugin {0}";
    t[7129] = "\u0412\u0438\u0434\u0430\u043b\u0435\u043d\u043e \u043f\u043b\u0430\u0433\u0456\u043d {0}";
    t[7130] = "Cannot create plugin directory {0}";
    t[7131] = "\u041d\u0435 \u043c\u043e\u0436\u0443 \u0441\u0442\u043c\u043e\u0440\u0438\u0442\u0438 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0456\u044e \u043f\u043b\u0430\u0433\u0456\u043d\u0430 {0}";
