    t[7138] = "Note: Dimensions are for graph only (excludes title, labels and legend).";
    t[7139] = "\u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430. \u0420\u043e\u0437\u043c\u0456\u0440\u0438 \u043d\u0430\u0432\u0435\u0434\u0435\u043d\u043e \u043b\u0438\u0448\u0435 \u0434\u043b\u044f \u0433\u0440\u0430\u0444\u0456\u043a\u0430 (\u0437\u0430 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u043c \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0430, \u043c\u0456\u0442\u043e\u043a \u0456 \u043b\u0435\u0433\u0435\u043d\u0434\u0438).";
    t[7142] = "config logging";
    t[7143] = "\u0432\u0435\u0434\u0435\u043d\u043d\u044f \u0436\u0443\u0440\u043d\u0430\u043b\u0443 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457";
    t[7148] = "Expires{0}";
    t[7149] = "\u0417\u0430\u043a\u0456\u043d\u0447\u0443\u0454\u0442\u044c\u0441\u044f{0}";
    t[7150] = "Critical error";
    t[7151] = "\u041a\u0440\u0438\u0442\u0438\u0447\u043d\u0430 \u043f\u043e\u043c\u0438\u043b\u043a\u0430";
    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "\u0417\u0430 \u0446\u0438\u043c \u0442\u0438\u043f\u043e\u043c \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u0443 I2P \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438\u043c\u0435 \u043f\u043e\u0433\u0430\u043d\u043e. \u0419\u043c\u043e\u0432\u0456\u0440\u043d\u043e, \u0432\u0438 \u043d\u0435 \u0437\u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438 \u0432\u0445\u0456\u0434\u043d\u0456 \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f, \u0449\u043e \u043e\u0431\u043c\u0435\u0436\u0438\u0442\u044c \u0432\u0430\u0448\u0443 \u0443\u0447\u0430\u0441\u0442\u044c \u0443 \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "\u041f\u0440\u043e\u0442\u043e\u043a\u043e\u043b I2P \u043a\u043b\u0456\u0454\u043d\u0442\u0430 (I2CP) \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u0456\u043c \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043a\u0430\u043c (\u043a\u043b\u0456\u0454\u043d\u0442\u0430\u043c) \u0441\u043f\u0456\u043b\u043a\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u0437 I2P \u0447\u0435\u0440\u0435\u0437 \u043e\u0434\u0438\u043d TCP-\u0441\u043e\u043a\u0435\u0442, \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0447\u0435\u0440\u0435\u0437 \u043f\u043e\u0440\u0442 7654. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u0432 <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>\u043e\u043d\u043b\u0430\u0439\u043d-\u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u0457</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "\u041f\u0456\u0434\u0441\u0443\u043c\u043a\u0438 \u0447\u0435\u0440\u0433\u0438";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u043f\u0440\u0456\u043e\u0440\u0438\u0442\u0435\u0442\u043d\u0438\u0439 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442 \u0434\u043b\u044f \u0441\u043f\u0456\u043b\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0437 \u043f\u0456\u0440\u0430\u043c\u0438. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043f\u0440\u0456\u043e\u0440\u0438\u0442\u0435\u0442 \u0432\u0456\u0434\u0434\u0430\u0454\u0442\u044c\u0441\u044f NTCP \u043f\u0435\u0440\u0435\u0434 UDP (SSU). \u0423\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0438 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f true, UDP \u0431\u0443\u0434\u0435 \u043f\u0440\u0456\u043e\u0440\u0438\u0442\u0435\u0442\u043d\u0438\u043c, \u044f\u043a\u0449\u043e \u043d\u0435 \u0456\u0441\u043d\u0443\u0454 \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0433\u043e \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f NTCP; \u043a\u043e\u043b\u0438 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e always, UDP \u0431\u0443\u0434\u0435 \u0437\u0430\u0432\u0436\u0434\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u043d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u043e \u0432\u0456\u0434 \u043d\u0430\u044f\u0432\u043d\u043e\u0441\u0442\u0456 \u043f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0433\u043e \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f NTCP. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c false]";
    t[7174] = "Translation Status";
    t[7175] = "\u0421\u0442\u0430\u0442\u0443\u0441 \u043f\u0435\u0440\u0435\u043a\u043b\u0430\u0434\u0443";
    t[7184] = "I2P Version and Running Environment";
    t[7185] = "I2P+ \u0432\u0435\u0440\u0441\u0456\u044f \u0442\u0430 \u0437\u0430\u043f\u0443\u0449\u0435\u043d\u043e\u0433\u043e \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0430";
    t[7188] = "Tunnel Filters";
    t[7189] = "\u0422\u0443\u043d\u0435\u043b\u044c\u043d\u0456 \u0444\u0456\u043b\u044c\u0442\u0440\u0438";
    t[7194] = "You have not configured inbound TCP with a hostname and port on the Network Configuration page, however you have disabled UDP.";
    t[7195] = "\u0412\u0438 \u043d\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043b\u0438 \u0432\u0445\u0456\u0434\u043d\u0438\u0439 TCP \u0437 \u0432\u043a\u0430\u0437\u0456\u0432\u043a\u043e\u044e \u0456\u043c\u0435\u043d\u0456 \u0445\u043e\u0441\u0442\u0430 \u0442\u0430 \u043f\u043e\u0440\u0442\u0443 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043c\u0435\u0440\u0435\u0436\u0456, \u043f\u0440\u043e\u0442\u0435 \u0432\u0438\u043c\u043a\u043d\u0443\u043b\u0438 UDP.";
    t[7200] = "Certificates are used to authenticate encrypted services running on the network, provision optional SSL for hosted services and the router console, or provide proof of ownership of a router family.";
    t[7201] = "\u0421\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0430\u0432\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0457 \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0438\u0445 \u0441\u043b\u0443\u0436\u0431, \u0449\u043e \u043f\u0440\u0430\u0446\u044e\u044e\u0442\u044c \u0443 \u043c\u0435\u0440\u0435\u0436\u0456, \u043d\u0430\u0434\u0430\u043d\u043d\u044f \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u043e\u0433\u043e SSL \u0434\u043b\u044f \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u0438\u0445 \u0441\u043b\u0443\u0436\u0431 \u0456 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0430\u0431\u043e \u043d\u0430\u0434\u0430\u043d\u043d\u044f \u043f\u0456\u0434\u0442\u0432\u0435\u0440\u0434\u0436\u0435\u043d\u043d\u044f \u043f\u0440\u0430\u0432\u0430 \u0432\u043b\u0430\u0441\u043d\u043e\u0441\u0442\u0456 \u043d\u0430 \u0441\u0456\u043c\u0435\u0439\u0441\u0442\u0432\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432.";
    t[7210] = "TheMarkup";
    t[7211] = "TheMarkup";
    t[7214] = "Sort by round trip time";
    t[7215] = "\u0421\u043e\u0440\u0442\u0443\u0432\u0430\u0442\u0438 \u0437\u0430 \u0447\u0430\u0441\u043e\u043c \u043f\u0440\u043e\u0445\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0441\u0438\u0433\u043d\u0430\u043b\u0443 \u0442\u0443\u0434\u0438 \u0456 \u043d\u0430\u0437\u0430\u0434";
    t[7220] = "Event";
    t[7221] = "\u041f\u043e\u0434\u0456\u044f";
    t[7226] = "Review stored analysis";
    t[7227] = "\u041f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u0443\u0442\u0438 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0438\u0439 \u0430\u043d\u0430\u043b\u0456\u0437";
    t[7244] = "Incoming mail from pop.postman.i2p";
    t[7245] = "\u0412\u0445\u0456\u0434\u043d\u0430 \u043f\u043e\u0448\u0442\u0430 \u0432\u0456\u0434 pop.postman.i2p";
    t[7248] = "Manually banned via {0}";
    t[7249] = "\u0417\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u0456 \u0432\u0440\u0443\u0447\u043d\u0443 \u0437\u0430\u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e {0}";
    t[7254] = "Network database search tool";
    t[7255] = "\u0406\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442 \u043f\u043e\u0448\u0443\u043a\u0443 \u0432 \u0431\u0430\u0437\u0456 \u0434\u0430\u043d\u0438\u0445 \u043c\u0435\u0440\u0435\u0436\u0456";
    t[7256] = "Warning: ECDSA is not available. Update your Java or OS";
    t[7257] = "\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u0436\u0435\u043d\u043d\u044f: ECDSA \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439. \u041e\u043d\u043e\u0432\u0456\u0442\u044c Java \u0430\u0431\u043e \u041e\u0421";
    t[7266] = "View information about router and running environment";
    t[7267] = "\u041f\u0435\u0440\u0435\u0433\u043b\u044f\u0434 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0456 \u0440\u043e\u0431\u043e\u0447\u0435 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0435";
    t[7268] = "A guide to some of the less-used configuration settings";
    t[7269] = "\u041f\u043e\u0441\u0456\u0431\u043d\u0438\u043a \u0449\u043e\u0434\u043e \u0434\u0435\u044f\u043a\u0438\u0445 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u0456\u0432 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457, \u044f\u043a\u0456 \u0440\u0456\u0434\u043a\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f";
    t[7278] = "Graceful shutdown cancelled";
    t[7279] = "\u041c\u2019\u044f\u043a\u0430 \u0437\u0443\u043f\u0438\u043d\u043a\u0430 \u0441\u043a\u0430\u0441\u043e\u0432\u0430\u043d\u0430";
    t[7282] = "Length";
    t[7283] = "\u0414\u043e\u0432\u0436\u0438\u043d\u0430";
    t[7284] = "The data gathered is quantized over a 1 minute period, so should just be used as an estimate.";
    t[7285] = "\u0417\u0456\u0431\u0440\u0430\u043d\u0456 \u0434\u0430\u043d\u0456 \u043a\u0432\u0430\u043d\u0442\u0443\u044e\u0442\u044c\u0441\u044f \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c 1 \u0445\u0432\u0438\u043b\u0438\u043d\u0438, \u0442\u043e\u043c\u0443 \u0457\u0445 \u0441\u043b\u0456\u0434 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043b\u0438\u0448\u0435 \u044f\u043a \u043e\u0446\u0456\u043d\u043a\u0443.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "\u041a\u043e\u043b\u0438 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e true, I2P \u043f\u0440\u0430\u0446\u044e\u0454 \u0431\u0435\u0437 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456, \u0449\u043e \u0434\u043e\u043f\u043e\u043c\u0430\u0433\u0430\u0454, \u044f\u043a\u0449\u043e \u0432\u0438 \u043f\u043e\u0441\u0442\u0456\u0439\u043d\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0454\u0442\u0435 \u0440\u043e\u0443\u0442\u0435\u0440 \u0434\u043b\u044f \u0442\u0435\u0441\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u044c \u043a\u043e\u0434\u0443, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0446\u0435 \u0437\u0430\u043f\u043e\u0431\u0456\u0433\u0430\u0454 \u0437\u0431\u043e\u044f\u043c \u0443 \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[7302] = "Updating IP address";
    t[7303] = "\u041e\u043d\u043e\u0432\u043b\u044e\u044e IP-\u0430\u0434\u0440\u0435\u0441\u0438";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 \u0442\u0456\u043b\u044c\u043a\u0438 SSU, \u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u0438\u043a\u0438";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (\u0417\u0430\u0445\u0438\u0449\u0435\u043d\u0438\u0439 \u043d\u0430\u043f\u0456\u0432\u043d\u0430\u0434\u0456\u0439\u043d\u0438\u0439 UDP) - \u0446\u0435 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442 \u043c\u0435\u0440\u0435\u0436\u0456 I2P, \u0449\u043e \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0443\u0454 \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0456, \u043e\u0440\u0456\u0454\u043d\u0442\u043e\u0432\u0430\u043d\u0456 \u043d\u0430 \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0442\u043e\u0447\u043a\u0430-\u0442\u043e\u0447\u043a\u0430 \u0437'\u0454\u0434\u043d\u0430\u043d\u043d\u044f, \u0430 \u0442\u0430\u043a\u043e\u0436 \u043f\u043e\u0441\u043b\u0443\u0433\u0438 \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u043d\u044f IP-\u0430\u0434\u0440\u0435\u0441 \u0456 \u043f\u0440\u043e\u043d\u0438\u043a\u043d\u0435\u043d\u043d\u044f \u0447\u0435\u0440\u0435\u0437 NAT. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u043d\u0430 <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>\u0430\u043d\u0433\u043b\u043e\u043c\u043e\u0432\u043d\u0456\u0439 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u0457</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Congestion window";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 \u043f\u0440\u043e\u043a\u0441\u0456 \u0434\u043b\u044f \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u0437\u0430\u043f\u043e\u0432\u043d\u0435\u043d\u043d\u044f";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "\u0414\u043e \u043f\u043e\u044f\u0432\u0438 \u0456\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0456\u0457 I2P \u0443 <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a> \u043d\u0435 \u0431\u0443\u043b\u043e \u043c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u0456 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0443\u0432\u0430\u0442\u0438 \u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0438, \u0449\u043e \u043d\u0435 \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u0456 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P. \u041e\u0434\u043d\u0430\u043a \u0442\u0435\u043f\u0435\u0440, \u043a\u043e\u043b\u0438 Vuze (\u0456 \u043f\u0456\u0437\u043d\u0456\u0448\u0435 <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u044e\u0442\u044c \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430\u043c \u043f\u043e\u0448\u0438\u0440\u044e\u0432\u0430\u0442\u0438 \u043d\u0435-I2P \u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0438 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P, \u043d\u0435-I2P \u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0438 \u043c\u043e\u0436\u043d\u0430 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0443\u0432\u0430\u0442\u0438 \u0447\u0435\u0440\u0435\u0437 I2P, \u044f\u043a\u0449\u043e \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456 Vuze/Bigly \u0432\u0438\u0440\u0456\u0448\u0438\u043b\u0438 \u043d\u0430\u0434\u0430\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0432\u043c\u0456\u0441\u0442\u0443 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P. \u041f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u0456 \u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0438 \u0437 \u0432\u0435\u043b\u0438\u043a\u043e\u044e \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044e \u043f\u0456\u0440\u0456\u0432 \u0439\u043c\u043e\u0432\u0456\u0440\u043d\u0456\u0448\u0435 \u0431\u0443\u0434\u0443\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0447\u0435\u0440\u0435\u0437 I2P; \u0449\u043e\u0431 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u0438, \u0447\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u043a\u043e\u043d\u0442\u0435\u043d\u0442, \u0434\u043e\u0434\u0430\u0439\u0442\u0435 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0430, magnet-\u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u0430\u0431\u043e infohash \u0434\u043e \u0441\u0432\u043e\u0433\u043e \u043a\u043b\u0456\u0454\u043d\u0442\u0430 \u0431\u0456\u0442\u043e\u0440\u0440\u0435\u043d\u0442, \u0449\u043e \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0454 I2P.";
