    t[7415] = "\u041a\u0435\u0440\u0443\u0439\u0442\u0435 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u0438\u043c\u0438 \u0442\u0430 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u043c\u0438 \u0442\u0443\u043d\u0435\u043b\u044f\u043c\u0438";
    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f (\u0432 \u0433\u043e\u0434\u0438\u043d\u0430\u0445) \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454, \u044f\u043a \u0441\u0442\u0430\u0440\u0438\u043c \u0454 RouterInfo \u0432 NetDb (\u043e\u0441\u0442\u0430\u043d\u043d\u044f \u0432\u0456\u0434\u043e\u043c\u0430 \u0434\u0430\u0442\u0430 \u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0446\u0456\u0457), \u043f\u0435\u0440\u0448 \u043d\u0456\u0436 \u0432\u043e\u043d\u043e \u0431\u0443\u0434\u0435 \u043a\u043b\u0430\u0441\u0438\u0444\u0456\u043a\u043e\u0432\u0430\u043d\u043e \u044f\u043a \u0437\u0430\u0441\u0442\u0430\u0440\u0456\u043b\u0435 \u0456 \u0432\u0438\u0434\u0430\u043b\u0435\u043d\u0435. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 28 \u0433\u043e\u0434\u0438\u043d, \u044f\u043a\u0449\u043e \u0440\u043e\u0443\u0442\u0435\u0440 \u043d\u0435 \u0454 \u0437\u0430\u043f\u043e\u0432\u043d\u044e\u0432\u0430\u0447\u0435\u043c \u043f\u0430\u0432\u0443\u0442\u0438\u043d\u0438, \u0443 \u0442\u043e\u043c\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 8 \u0433\u043e\u0434\u0438\u043d]";
