    t[7441] = "\u0424\u0430\u0439\u043b \u0436\u0443\u0440\u043d\u0430\u043b\u0443";
    t[7442] = "Router Help and FAQ";
    t[7443] = "\u0414\u043e\u0432\u0456\u0434\u043a\u0430 \u0442\u0430 \u043f\u043e\u0448\u0438\u0440\u0435\u043d\u0456 \u0437\u0430\u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0449\u043e\u0434\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "\u042f\u043a\u0449\u043e \u0437\u0430\u043f\u0438\u0442\u0443\u044e\u0442\u044c <i>\u0421\u0442\u0440\u043e\u043a\u0443 \u0430\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0457 \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457</i>, \u0457\u0457 \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>\u0410\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u044f \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457</a>, \u0434\u043e \u044f\u043a\u043e\u0457 \u0454 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u0437\u0456 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>. \u0410\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u044f \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457 \u0433\u0430\u0440\u0430\u043d\u0442\u0443\u0454, \u0449\u043e \u043b\u0438\u0448\u0435 \u0432\u043b\u0430\u0441\u043d\u0438\u043a \u0437\u043c\u043e\u0436\u0435 \u0437\u0430\u0440\u0435\u0454\u0441\u0442\u0440\u0443\u0432\u0430\u0442\u0438 \u0447\u0438 \u043a\u0435\u0440\u0443\u0432\u0430\u0442\u0438 \u0434\u043e\u043c\u0435\u043d\u043d\u043e\u044e \u043d\u0430\u0437\u0432\u043e\u044e, \u0456 \u0432\u0438\u043c\u0430\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430 stats.i2p \u0442\u0430 reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "\u041d\u043e\u0432\u0438\u043d\u0438 &amp; \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] \u042f\u043a\u0449\u043e \u0432\u0438 \u043d\u0435 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0437 <code>i2p/i2prouter start</code>, \u0441\u043f\u0440\u043e\u0431\u0443\u0439\u0442\u0435 \u0441\u043a\u0440\u0438\u043f\u0442 <code>runplain.sh</code> \u0432 \u0442\u0456\u0439 \u0441\u0430\u043c\u0456\u0439 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0456\u0457. \u041f\u0440\u0430\u0432\u0430 root \u043d\u0456\u043a\u043e\u043b\u0438 \u043d\u0435 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u0456 \u0434\u043b\u044f \u0440\u043e\u0431\u043e\u0442\u0438 I2P+. \u042f\u043a\u0449\u043e \u0432\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0441\u043a\u043e\u043c\u043f\u0456\u043b\u044e\u0432\u0430\u0442\u0438 <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>\u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u043a\u0443 jBigi</a> (\u0449\u043e \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0440\u0456\u0434\u043a\u043e), \u043e\u0437\u043d\u0430\u0439\u043e\u043c\u0442\u0435\u0441\u044c \u0437 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u0454\u044e, \u0432\u0456\u0434\u0432\u0456\u0434\u0430\u0439\u0442\u0435 \u0444\u043e\u0440\u0443\u043c\u0438, \u0430\u0431\u043e \u0437\u0432\u0435\u0440\u043d\u0456\u0442\u044c\u0441\u044f \u043d\u0430 <a href=irc://127.0.0.1:6668/saltR class=chatlink>\u043a\u0430\u043d\u0430\u043b I2P+</a> \u0447\u0438 <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC-\u043a\u0430\u043d\u0430\u043b \u0440\u043e\u0437\u0440\u043e\u0431\u043d\u0438\u043a\u0456\u0432</a>.";
