    t[7683] = "\u041f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "\u0420\u043e\u0437\u043f\u043e\u0434\u0456\u043b\u0435\u043d\u0430 \u0431\u0430\u0437\u0430 \u0434\u0430\u043d\u0438\u0445, \u0449\u043e \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043a\u043e\u043d\u0442\u0430\u043a\u0442\u043d\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432 (RouterInfos) \u0442\u0430 \u043a\u043e\u043d\u0442\u0430\u043a\u0442\u043d\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u044c (LeaseSets). \u041e\u043a\u0440\u0435\u043c\u0438\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0454 \u0441\u0432\u043e\u044e (\u0447\u0430\u0441\u0442\u043a\u043e\u0432\u0443) \u0431\u0430\u0437\u0443 \u0434\u0430\u043d\u0438\u0445 \u0434\u043b\u044f \u0441\u043f\u0456\u043b\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456; \u0436\u043e\u0434\u0435\u043d \u043e\u0434\u0438\u043d\u0438\u0447\u043d\u0438\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043d\u0435 \u0431\u0443\u0434\u0435 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u0442\u0438 \u0441\u043f\u0438\u0441\u043e\u043a \u0432\u0441\u0456\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432. RouterInfos \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u043d\u0430 \u0434\u0438\u0441\u043a\u0443 \u0456 \u0437\u0447\u0438\u0442\u0443\u044e\u0442\u044c\u0441\u044f \u0432 \u043e\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u0443 \u043f\u0430\u043c'\u044f\u0442\u044c \u043f\u0440\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0430\u0431\u043e \u043f\u0440\u0438 \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043d\u0456 \u043d\u043e\u0432\u0438\u0445 RouterInfos. \u0422\u0430\u043a\u043e\u0436 \u0437\u0433\u0430\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u044f\u043a <i>NetDb</i>. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u043d\u0430 <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>\u0430\u043d\u0433\u043b\u043e\u043c\u043e\u0432\u043d\u0456\u0439 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u0457</a>.";
    t[7692] = "Address";
    t[7693] = "\u0410\u0434\u0440\u0435\u0441\u0430";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "\u041f\u043e\u0440\u0456\u0433 - \u0446\u0435 \u0447\u0438\u0441\u043b\u043e \u0441\u043f\u0440\u043e\u0431 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u044c, \u044f\u043a\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0456\u0439 \u0446\u0456\u043b\u0456 \u0437\u0434\u0456\u0439\u0441\u043d\u0438\u0442\u0438 \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u043f\u0435\u0432\u043d\u043e\u0457 \u043a\u0456\u043b\u044c\u043a\u043e\u0441\u0442\u0456 \u0441\u0435\u043a\u0443\u043d\u0434 \u0434\u043e \u0442\u043e\u0433\u043e, \u044f\u043a \u0441\u0442\u0430\u043d\u0435\u0442\u044c\u0441\u044f \"\u043f\u043e\u0440\u0443\u0448\u0435\u043d\u043d\u044f\".";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "\u0412\u0456\u0434\u043a\u0440\u0438\u0442\u0430 \u043c\u0435\u0440\u0435\u0436\u0430 \u0437\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u043f\u043e\u0437\u043d\u0430\u0447\u0430\u0454 \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u043e \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 Internet, \u043d\u0430 \u0432\u0456\u0434\u043c\u0456\u043d\u0443 \u0432\u0456\u0434 \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u043e\u0457 \u043c\u0435\u0440\u0435\u0436\u0456, \u044f\u043a\u0430 \u043e\u043f\u0438\u0441\u0443\u0454 \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u0456 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456 \u0441\u0435\u0440\u0432\u0456\u0441\u0438, \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0456 \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0456 I2P, Tor \u0442\u043e\u0449\u043e. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0430 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043d\u0430\u0432\u0435\u0434\u0435\u043d\u0430 \u0432 <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>\u0441\u0442\u0430\u0442\u0442\u0456 \u0412\u0456\u043a\u0456\u043f\u0435\u0434\u0456\u0457</a>.";
    t[7712] = "Restore minimal default";
    t[7713] = "\u0412\u0456\u0434\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043c\u0456\u043d\u0456\u043c\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c";
    t[7716] = "I2P Plugins";
    t[7717] = "\u041f\u043b\u0430\u0433\u0456\u043d\u0438 I2P";
    t[7718] = "Routers";
    t[7719] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438";
    t[7722] = "Downstream";
    t[7723] = "\u041d\u0438\u0437\u0445\u0456\u0434\u043d\u0438\u0439 \u043a\u0430\u043d\u0430\u043b";
    t[7724] = "To enable the configuration of reseed urls, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[7725] = "\u0429\u043e\u0431 \u0443\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044e URL-\u0430\u0434\u0440\u0435\u0441 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u0437\u0430\u043f\u043e\u0432\u043d\u0435\u043d\u043d\u044f, \u0430\u043a\u0442\u0438\u0432\u0443\u0439\u0442\u0435 <a href=\"/help/advancedsettings\">\u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0439 \u0440\u0435\u0436\u0438\u043c</a> \u043a\u043e\u043d\u0441\u043e\u043b\u0456.";
    t[7728] = "(DEBUG and INFO are not recommended defaults, as they will drastically slow down your router)";
    t[7729] = "(\u041d\u0410\u041b\u0410\u0413\u041e\u0414\u0416\u0415\u041d\u041d\u042f \u0442\u0430 \u0406\u041d\u0424\u041e\u0420\u041c\u0410\u0426\u0406\u042f \u043d\u0435 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u044e\u0442\u044c\u0441\u044f \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0432\u043e\u043d\u0438 \u0440\u0456\u0437\u043a\u043e \u0441\u043f\u043e\u0432\u0456\u043b\u044c\u043d\u044f\u0442\u044c \u0440\u043e\u0431\u043e\u0442\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430)";
    t[7732] = "I2P Forum";
    t[7733] = "\u0424\u043e\u0440\u0443\u043c I2P";
    t[7736] = "Router information including transport addresses and UPnP scan";
    t[7737] = "\u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0447\u0438 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u043d\u0456 \u0430\u0434\u0440\u0435\u0441\u0438 \u0442\u0430 \u0441\u043a\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f UPnP";
    t[7738] = "Troubleshooting";
    t[7739] = "\u0412\u0438\u0440\u0456\u0448\u0435\u043d\u043d\u044f \u043f\u0440\u043e\u0431\u043b\u0435\u043c";
    t[7750] = "Customize sidebar";
    t[7751] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 \u0431\u0456\u0447\u043d\u0443 \u043f\u0430\u043d\u0435\u043b\u044c";
    t[7756] = "Unable to connect to update server ";
    t[7757] = "\u041d\u0435 \u0432\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438\u0441\u044f \u0434\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f ";
    t[7774] = "Independent &amp; impartial news for Hong Kong";
    t[7775] = "\u041d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u0456 \u0442\u0430 \u043d\u0435\u0443\u043f\u0435\u0440\u0435\u0434\u0436\u0435\u043d\u0456 \u043d\u043e\u0432\u0438\u043d\u0438 \u0434\u043b\u044f \u0413\u043e\u043d\u043a\u043e\u043d\u0433\u0443";
    t[7784] = "Slow start threshold";
    t[7785] = "\u041f\u043e\u0432\u0456\u043b\u044c\u043d\u0438\u0439 \u043f\u043e\u0440\u0456\u0433 \u0437\u0430\u043f\u0443\u0441\u043a\u0443";
    t[7792] = "Reachability change";
    t[7793] = "\u0417\u043c\u0456\u043d\u0430 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u0456";
    t[7794] = "Endpoint";
    t[7795] = "\u041a\u0456\u043d\u0446\u0435\u0432\u0430 \u0442\u043e\u0447\u043a\u0430";
    t[7796] = "My IRC client keeps disconnecting from the network, is there anything I can do?";
    t[7797] = "\u041c\u0456\u0439 IRC-\u043a\u043b\u0456\u0454\u043d\u0442 \u043f\u043e\u0441\u0442\u0456\u0439\u043d\u043e \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0456\u0434 \u043c\u0435\u0440\u0435\u0436\u0456, \u0449\u043e \u044f \u043c\u043e\u0436\u0443 \u0437\u0440\u043e\u0431\u0438\u0442\u0438?";
    t[7798] = "Save WebApp Configuration";
    t[7799] = "\u0417\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044e \u0432\u0435\u0431-\u0434\u043e\u0434\u0430\u0442\u043a\u0443";
    t[7804] = "Network Configuration";
    t[7805] = "\u041a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f \u043c\u0435\u0440\u0435\u0436\u0456";
    t[7808] = "UPnP may be enabled or disabled on the Network Configuration page, but a change requires a router restart to take effect.";
    t[7809] = "UPnP \u043c\u043e\u0436\u043d\u0430 \u0432\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0430\u0431\u043e \u0432\u0438\u043c\u043a\u043d\u0443\u0442\u0438 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u043c\u0435\u0440\u0435\u0436\u0456, \u0430\u043b\u0435 \u0434\u043b\u044f \u0432\u0441\u0442\u0443\u043f\u0443 \u0432 \u0441\u0438\u043b\u0443 \u0437\u043c\u0456\u043d\u0430 \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430.";
    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "\u0412\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0430\u0440\u0430\u043b\u0435\u043b\u044c\u043d\u0438\u0445 <a href=/jobs>\u0437\u0430\u0432\u0434\u0430\u043d\u044c</a>, \u044f\u043a\u0456 \u043c\u043e\u0436\u0443\u0442\u044c \u0432\u0438\u043a\u043e\u043d\u0443\u0432\u0430\u0442\u0438\u0441\u044f. \u0417\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044e \u043f\u0430\u043c'\u044f\u0442\u0456, \u0432\u0438\u0434\u0456\u043b\u0435\u043d\u043e\u0457 JVM \u0447\u0435\u0440\u0435\u0437 <code>wrapper.config</code>, \u0456 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u044e\u0454\u0442\u044c\u0441\u044f \u0432 3 \u0434\u043b\u044f \u043c\u0435\u043d\u0448 \u043d\u0456\u0436 64MB, 4 \u0434\u043b\u044f \u043c\u0435\u043d\u0448 \u043d\u0456\u0436 256M \u0430\u0431\u043e 5 \u0434\u043b\u044f \u0431\u0456\u043b\u044c\u0448 \u043d\u0456\u0436 256MB. \u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430: \u0437\u043c\u0456\u043d\u0430 \u0446\u044c\u043e\u0433\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0454 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0440\u043e\u0443\u0442\u0435\u0440\u0430.";
    t[7820] = "Update verified";
    t[7821] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0435\u043d\u043e";
    t[7822] = "Base32 (B32) / Base64 (B64)";
    t[7823] = "\u0411\u0430\u0437\u0430 32 (B32) / \u0411\u0430\u0437\u0430 64 (B64)";
    t[7826] = "Internals";
    t[7827] = "\u0412\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u0456 \u043e\u0440\u0433\u0430\u043d\u0438";
