    t[8155] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438, \u0431\u043b\u0438\u0437\u044c\u043a\u0456 \u0434\u043e \u043d\u0430\u0448\u043e\u0433\u043e IP";
    t[8156] = "Reseed";
    t[8157] = "\u041f\u0435\u0440\u0435\u0441\u0456\u044f\u0442\u0438";
    t[8158] = "is the peer banned, or unreachable, or failing tunnel tests?";
    t[8159] = "\u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0439 \u0432\u0443\u0437\u043e\u043b \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u0435\u043d\u0438\u0439, \u0447\u0438 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439, \u0447\u0438 \u043d\u0435 \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u044c\u043d\u0456 \u0442\u0435\u0441\u0442\u0438?";
    t[8162] = "Disable inbound (firewalled)";
    t[8163] = "\u0412\u0438\u043c\u043a\u043d\u0443\u0442\u0438 \u0432\u0445\u0456\u0434\u043d\u0438\u0439 (\u043c\u0435\u0440\u0435\u0436\u0435\u0432\u0438\u0439 \u0435\u043a\u0440\u0430\u043d)";
    t[8164] = "Launch I2P Router Console in web browser when I2P starts.";
    t[8165] = "\u0417\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u043a\u043e\u043d\u0441\u043e\u043b\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P \u0443 \u0432\u0435\u0431-\u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0456 \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 I2P.";
    t[8174] = "Average job delay / maximum delay";
    t[8175] = "\u0421\u0435\u0440\u0435\u0434\u043d\u044f \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0430 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f / \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0430";
