    t[8179] = "\u0421\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0430";
    t[8188] = "Use alternative display font in console and webapps";
    t[8189] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 \u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0438\u0439 \u0448\u0440\u0438\u0444\u0442 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0432 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u0442\u0430 \u0432\u0435\u0431-\u0434\u043e\u0434\u0430\u0442\u043a\u0430\u0445";
    t[8194] = "Reseeding Your Router";
    t[8195] = "\u0420\u0435\u0437\u0435\u0440\u0432\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[8206] = "Started";
    t[8207] = "\u0420\u043e\u0437\u043f\u043e\u0447\u0430\u0442\u043e";
    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "\u0423 \u0432\u0441\u0456\u0445 \u043c\u043e\u0436\u043b\u0438\u0432\u0438\u0445 \u0432\u0438\u043f\u0430\u0434\u043a\u0430\u0445, \u0440\u0435\u0441\u0443\u0440\u0441\u0438 \u044f\u043a\u0456 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 \u0441\u0430\u0439\u0442\u0456 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0443\u0432\u0430\u0442\u0438\u0441\u044c \u0437 \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u044c\u043e\u0433\u043e \u0444\u0430\u0439\u043b\u0443, \u0430 \u043d\u0435 \u0431\u0443\u0442\u0438 \u0432\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0438\u043c\u0438. \u042f\u043a\u0449\u043e \u0432\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435 \u0442\u043e\u0439 \u0441\u0430\u043c\u0438\u0439 CSS \u043d\u0430 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430\u0445, \u0441\u0442\u0432\u043e\u0440\u0456\u0442\u044c \u043e\u043a\u0440\u0435\u043c\u0438\u0439 CSS \u0444\u0430\u0439\u043b \u0456 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0443\u0439\u0442\u0435 \u0439\u043e\u0433\u043e \u0432 \u0440\u043e\u0437\u0434\u0456\u043b <code>&lt;head&gt;</code> \u0432\u0430\u0448\u0438\u0445 \u0441\u0442\u043e\u0440\u0456\u043d\u043e\u043a. \u0426\u0435 \u043f\u043e\u043b\u0435\u0433\u0448\u0438\u0442\u044c \u043a\u0435\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u0441\u0442\u0438\u043b\u0456\u0441\u0442\u0438\u043a\u043e\u044e \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 \u0441\u0430\u0439\u0442\u0456, \u0456 \u0442\u0430\u043a\u043e\u0436 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c \u0444\u0430\u0439\u043b\u0443 \u0431\u0443\u0442\u0438 \u0441\u043a\u0435\u0448\u043e\u0432\u0430\u043d\u0438\u043c \u0432 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0456 \u0432\u0456\u0434\u0432\u0456\u0434\u0443\u0432\u0430\u0447\u0430, \u0449\u043e \u043f\u0440\u0438\u0437\u0432\u0435\u0434\u0435 \u0434\u043e \u043c\u0435\u043d\u0448\u043e\u0457 \u043d\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u043d\u0430 \u0432\u0430\u0448 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 \u0456 \u0448\u0432\u0438\u0434\u0448\u0438\u0445 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u044c \u0441\u0442\u043e\u0440\u0456\u043d\u043e\u043a \u0434\u043b\u044f \u0432\u0456\u0434\u0432\u0456\u0434\u0443\u0432\u0430\u0447\u0456\u0432.";
