    t[8217] = "\u0414\u043e\u0434\u0430\u0439\u0442\u0435 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0456 \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0438 \u0436\u0443\u0440\u043d\u0430\u043b\u044e\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0449\u0435 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, {0}).";
    t[8222] = "Create Family";
    t[8223] = "\u0421\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u0441\u0456\u043c '\u044e";
    t[8224] = "Total session-only bans";
    t[8225] = "\u041f\u043e\u0432\u043d\u0430 \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u0430 \u043b\u0438\u0448\u0435 \u043d\u0430 \u0441\u0435\u0441\u0456\u0457";
    t[8230] = "Save";
    t[8231] = "\u0417\u0431\u0435\u0440\u0435\u0433\u0442\u0438";
    t[8234] = "Floodfills Close to Our Destinations";
    t[8235] = "\u0417\u0430\u0442\u043e\u043f\u043b\u0435\u043d\u043d\u044f \u043f\u043e\u0431\u043b\u0438\u0437\u0443 \u043d\u0430\u0448\u0438\u0445 \u043c\u0456\u0441\u0446\u044c \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[8236] = "Start";
    t[8237] = "\u0421\u0442\u0430\u0440\u0442";
    t[8240] = "Hide legend";
    t[8241] = "\u041f\u0440\u0438\u0445\u043e\u0432\u0430\u0442\u0438 \u043b\u0435\u0433\u0435\u043d\u0434\u0443";
    t[8244] = "Details";
    t[8245] = "\u0414\u0435\u0442\u0430\u043b\u0456";
    t[8252] = "Help Section";
    t[8253] = "\u0414\u041e\u041f\u041e\u041c\u041e\u0413\u0410 \u0420\u041e\u0417\u0414\u0406\u041b";
    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f I2P+: \u041c\u0435\u0440\u0435\u0436\u0430, Firefox, Tunnel Manager";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0434\u0443\u043c\u0430\u0454\u0442\u0435, \u0449\u043e \u0432\u0456\u0434\u043a\u0440\u0438\u043b\u0438 \u0444\u0430\u0454\u0440\u0432\u043e\u043b \u0456 I2P \u0432\u0441\u0435 \u043e\u0434\u043d\u043e \u0432\u0432\u0430\u0436\u0430\u0454, \u0449\u043e \u0432\u0438 \u0437\u0430 \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u043e\u043c, \u043f\u0440\u0438\u0433\u0430\u0434\u0430\u0439\u0442\u0435, \u0449\u043e \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043c\u0430\u0442\u0438 \u043a\u0456\u043b\u044c\u043a\u0430 \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u0456\u0432, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u044f\u043a \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043d\u0456 \u043f\u0430\u043a\u0435\u0442\u0438, \u0442\u0430\u043a \u0456 \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u0456 \u0430\u043f\u0430\u0440\u0430\u0442\u043d\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "\u041a\u043b\u044e\u0447\u043e\u0432\u0435 \u0441\u043b\u043e\u0432\u043e <i class=example>deny</i>. \u0426\u0435\u0439 \u043f\u043e\u0440\u0456\u0433 \u0437\u0430\u0432\u0436\u0434\u0438 \u043f\u043e\u0440\u0443\u0448\u0443\u0454\u0442\u044c\u0441\u044f, \u0442\u043e\u0431\u0442\u043e \u0436\u043e\u0434\u043d\u0456 \u0441\u043f\u0440\u043e\u0431\u0438 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u043d\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0442\u044c\u0441\u044f.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "\u0440\u0435\u0454\u0441\u0442\u0440\u0443\u0439\u0442\u0435 \u0432\u0456\u0434\u0432\u0456\u0434\u0443\u0432\u0430\u0447\u0456\u0432, \u044f\u043a\u0456 \u0437\u0434\u0456\u0439\u0441\u043d\u044e\u044e\u0442\u044c 90 \u0430\u0431\u043e \u0431\u0456\u043b\u044c\u0448\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u044c \u0437\u0430 \u0445\u0432\u0438\u043b\u0438\u043d\u0443";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "\u0412\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043b\u0438 \u0432\u0445\u0456\u0434\u043d\u0438\u0439 TCP, \u043f\u0440\u043e\u0442\u0435 \u0432\u0430\u0448 UDP-\u043f\u043e\u0440\u0442 \u0437\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u0438\u0439 \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u043e\u043c, \u0442\u043e\u043c\u0443 \u0439\u043c\u043e\u0432\u0456\u0440\u043d\u043e \u0444\u0430\u0454\u0440\u0432\u043e\u043b \u0442\u0430\u043a\u043e\u0436 \u0437\u0430\u0431\u043b\u043e\u043a\u0443\u0454 TCP-\u043f\u043e\u0440\u0442.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "\u0426\u0435 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043f\u0456\u0440\u0456\u0432, \u044f\u043a\u0456 \u0431\u0443\u0434\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0432\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0434\u043b\u044f \u0437\u0430\u043f\u0438\u0442\u0456\u0432 \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u043e\u0457 \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445. \u0426\u0435, \u044f\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438 <i>\u0440\u043e\u0437\u043b\u0438\u0432\u0430\u043b\u044c\u043d\u0438\u043a\u0438</i>, \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u043b\u044c\u043d\u0456 \u0437\u0430 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0443 \u0446\u0456\u043b\u0456\u0441\u043d\u043e\u0441\u0442\u0456 \u043c\u0435\u0440\u0435\u0436\u0456. \u0412\u0430\u0448\u0456 \u0434\u043e\u0431\u0440\u0435 \u0456\u043d\u0442\u0435\u0433\u0440\u043e\u0432\u0430\u043d\u0456 \u043f\u0456\u0440\u0438 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u0456 \u0437\u043d\u0438\u0437\u0443 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/profiles'>\u041f\u0440\u043e\u0444\u0456\u043b\u0456\u0432</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "\u041a\u0435\u0440\u0443\u0439\u0442\u0435 \u0432\u0435\u0431-\u0434\u043e\u0434\u0430\u0442\u043a\u0430\u043c\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "\u0412\u0438\u0445\u0456\u0434\u043d\u0435 TCP \u0437 \u0432\u0438\u043f\u0430\u0434\u043a\u043e\u0432\u0438\u0445 \u0432\u0438\u0441\u043e\u043a\u0438\u0445 \u043f\u043e\u0440\u0442\u0456\u0432 \u0434\u043e \u0434\u043e\u0432\u0456\u043b\u044c\u043d\u0438\u0445 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u0445 TCP-\u043f\u043e\u0440\u0442\u0456\u0432.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "\u041a\u043e\u043b\u0438 \u0432\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0454\u0442\u0435 I2P+, \u043c\u043e\u0436\u0435 \u0437\u043d\u0430\u0434\u043e\u0431\u0438\u0442\u0438\u0441\u044f \u043a\u0456\u043b\u044c\u043a\u0430 \u0445\u0432\u0438\u043b\u0438\u043d \u0434\u043b\u044f \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f (\u0456\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0456\u0457) \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0432 \u043c\u0435\u0440\u0435\u0436\u0443 \u0442\u0430 \u043f\u043e\u0448\u0443\u043a\u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0438\u0445 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0445 \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u0457\u0432, \u0442\u043e\u043c\u0443 \u0437\u0430\u043f\u0430\u0441\u0456\u0442\u044c\u0441\u044f \u0442\u0435\u0440\u043f\u0456\u043d\u043d\u044f\u043c.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "\u0424\u0430\u0439\u043b \u043d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u043e. ";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
    t[8321] = "\u0423\u0432\u0456\u043c\u043a\u043d\u0456\u0442\u044c Universal Plug and Play (UPnP)";
    t[8322] = "Unknown Wizard page";
    t[8323] = "\u041d\u0435\u0432\u0456\u0434\u043e\u043c\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430 \u043c\u0430\u0439\u0441\u0442\u0440\u0430";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "IPv6 \u0442\u0456\u043b\u044c\u043a\u0438 NTCP, SSU, \u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u0438\u043a\u0438";
    t[8332] = "Messages sent to peer";
    t[8333] = "\u041f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f, \u043d\u0430\u0434\u0456\u0441\u043b\u0430\u043d\u0456 \u043a\u043e\u043b\u0435\u0433\u0430\u043c";
    t[8334] = "Function";
    t[8335] = "\u0424\u0443\u043d\u043a\u0446\u0456\u044f";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "\u0423 \u043c\u0435\u0440\u0435\u0436\u0456 I2P \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u043e \u0445\u043e\u0441\u0442\u043e\u0432\u0430\u043d\u0456 \u0441\u0435\u0440\u0432\u0456\u0441\u0438 \u043c\u043e\u0436\u043d\u0430 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u0430\u0434\u0440\u0435\u0441\u0438 <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> \u0449\u043e \u0437\u0430\u043a\u0456\u043d\u0447\u0443\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \".b32.i2p\", <i>destination</i> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043e\u0457 \u044f\u043a \u0434\u043e\u0432\u0433\u0438\u0439 <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> \u0440\u044f\u0434\u043e\u043a, \u0430\u0431\u043e \u0437\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u0434\u043e\u043c\u0435\u043d\u0443 .i2p. Destination - \u0446\u0435 \u0430\u043d\u0430\u043b\u043e\u0433 \u0430\u0434\u0440\u0435\u0441\u0438 IP \u0432 I2P, \u0457\u0457 \u043c\u043e\u0436\u043d\u0430 \u043f\u043e\u0431\u0430\u0447\u0438\u0442\u0438 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/i2ptunnel/edit?tunnel=3'>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430</a>. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u043e\u0434\u0456\u043b\u0438\u0442\u0438\u0441\u044f \u0441\u0432\u043e\u0454\u044e \u0430\u0434\u0440\u0435\u0441\u043e\u044e b32.i2p, \u0449\u043e\u0431 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u0438 \u0456\u043d\u0448\u0438\u043c \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0432\u0430\u0448\u043e\u0433\u043e \u0441\u0430\u0439\u0442\u0443 \u0434\u043e \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457 \u0432\u043b\u0430\u0441\u043d\u043e\u0433\u043e \u0434\u043e\u043c\u0435\u043d\u0443 .i2p.";
    t[8340] = "Computing-related tutorials";
    t[8341] = "\u041d\u0430\u0432\u0447\u0430\u043b\u044c\u043d\u0456 \u043f\u043e\u0441\u0456\u0431\u043d\u0438\u043a\u0438 \u0437 \u043e\u0431\u0447\u0438\u0441\u043b\u044e\u0432\u0430\u043b\u044c\u043d\u043e\u0457 \u0442\u0435\u0445\u043d\u0456\u043a\u0438";
    t[8342] = "Error {0}";
    t[8343] = "\u041f\u043e\u043c\u0438\u043b\u043a\u0430 {0}";
    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "\u0412\u0432\u0435\u0434\u0456\u0442\u044c \u0456\u043c'\u044f \u0456 \u0432\u0441\u0442\u0430\u0432\u0442\u0435 destination \u0434\u043e \u0441\u0432\u043e\u0454\u0457 <a href='/dns?book=router&amp;filter=none'>\u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438</a>. \u041d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c <i>\u0414\u043e\u0434\u0430\u0442\u0438</i> \u0449\u043e\u0431 \u0437\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u043d\u043e\u0432\u0438\u0439 \u0437\u0430\u043f\u0438\u0441.";
    t[8358] = "Stats";
    t[8359] = "\u0421\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0430";
    t[8360] = "Maximum number of concurrent messages to send";
    t[8361] = "\u041c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u043e\u0434\u043d\u043e\u0447\u0430\u0441\u043d\u0438\u0445 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u044c \u0434\u043b\u044f \u043d\u0430\u0434\u0441\u0438\u043b\u0430\u043d\u043d\u044f";
    t[8364] = "Recorders keep track of connection attempts made by a remote destination, and if that breaches the defined threshold, the destination gets logged in the specified file. Multiple recorders can be specified:";
    t[8365] = "\u0417\u0430\u043f\u0438\u0441\u0443\u0432\u0430\u0447\u0456 \u0432\u0456\u0434\u0441\u0442\u0435\u0436\u0443\u044e\u0442\u044c \u0441\u043f\u0440\u043e\u0431\u0438 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f, \u0437\u0440\u043e\u0431\u043b\u0435\u043d\u0456 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u043e\u044e \u0446\u0456\u043b\u043b\u044e, \u0456 \u044f\u043a\u0449\u043e \u0446\u0435 \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0454 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0439 \u043f\u043e\u0440\u0456\u0433, \u0446\u0456\u043b\u044c \u0437\u0430\u043f\u0438\u0441\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043e \u0432\u043a\u0430\u0437\u0430\u043d\u043e\u0433\u043e \u0444\u0430\u0439\u043b\u0443. \u041c\u043e\u0436\u043d\u0430 \u0432\u043a\u0430\u0437\u0430\u0442\u0438 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u0437\u0430\u043f\u0438\u0441\u0443\u0432\u0430\u0447\u0456\u0432:";
    t[8368] = "(the symbol '@' will be replaced during log rotation)";
    t[8369] = "(\u0421\u0438\u043c\u0432\u043e\u043b '@' \u0431\u0443\u0434\u0435 \u0437\u0430\u043c\u0456\u043d\u0435\u043d\u0438\u0439 \u043f\u0456\u0434 \u0447\u0430\u0441 \u043e\u0431\u0435\u0440\u0442\u0430\u043d\u043d\u044f \u0436\u0443\u0440\u043d\u0430\u043b\u0443)";
    t[8376] = "Updated settings for all pools.";
    t[8377] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043b\u044f \u0432\u0441\u0456\u0445 \u043f\u0443\u043b\u0456\u0432.";
    t[8382] = "Capabilities in the NetDb, not used to determine profiles";
    t[8383] = "\u041c\u043e\u0436\u043b\u0438\u0432\u043e\u0441\u0442\u0456 \u0432 NetDb, \u044f\u043a\u0456 \u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043f\u0440\u043e\u0444\u0456\u043b\u0456\u0432";
    t[8384] = "Configure peer";
    t[8385] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u043e\u0433\u043e \u0432\u0443\u0437\u043b\u0430";
    t[8388] = "How long ago connection was established";
    t[8389] = "\u042f\u043a \u0434\u0430\u0432\u043d\u043e \u0431\u0443\u043b\u043e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0437\u0432\u2019\u044f\u0437\u043e\u043a";
    t[8396] = "Local SSL Certificates";
    t[8397] = "\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0456 \u0441\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442\u0438 SSL";
    t[8408] = "Delete Sybil Blocklist";
    t[8409] = "\u0412\u0438\u0434\u0430\u043b\u0438\u0442\u0438 \u0431\u043b\u043e\u043a-\u043b\u0438\u0441\u0442 Sybil";
    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "\u0429\u043e\u0431 \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438 \u0441\u043f\u0438\u0441\u043a\u0438 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456\u0432, \u0437\u043d\u0430\u0439\u0434\u0456\u0442\u044c \u0437\u0430\u043f\u0438\u0441 \u0434\u043b\u044f <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> \u0443 \u0444\u0430\u0439\u043b\u0456 <code>base-context.xml</code>, \u0449\u043e \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0437\u0456 <code>eepsite/contexts</code> (\u0431\u0435\u0437\u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e \u043d\u0430\u0434 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u043e\u043c docroot), \u0456 \u0437\u043c\u0456\u043d\u0456\u0442\u044c 'true' \u043d\u0430 'false' \u043d\u0438\u0436\u0447\u0435. \u0429\u043e\u0431 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u0442\u0438 \u0437\u043c\u0456\u043d\u0438 \u043d\u0435\u0433\u0430\u0439\u043d\u043e, \u0437\u0443\u043f\u0438\u043d\u0456\u0442\u044c \u0456 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c \u043a\u043b\u0456\u0454\u043d\u0442 <i>I2P Webserver</i> \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href=/configclients>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432</a>. \u0422\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u043d\u0430 \u0434\u043e\u0434\u0430\u0442\u0438 \u043f\u043e\u0440\u043e\u0436\u043d\u0456\u0439 \u0444\u0430\u0439\u043b <code>index.html</code> \u0434\u043e \u0431\u0443\u0434\u044c-\u044f\u043a\u043e\u0433\u043e \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u043e\u0433\u043e \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0443 \u0434\u043b\u044f \u043f\u0440\u0438\u0445\u043e\u0432\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u043d\u044c\u043e\u043c\u0443 \u0441\u043f\u0438\u0441\u043a\u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456\u0432.";
    t[8414] = "Same IPv6 /64 as us";
    t[8415] = "\u0422\u043e\u0439 \u0441\u0430\u043c\u0438\u0439 IPv6 /64, \u0449\u043e \u0439 \u0443 \u043d\u0430\u0441";
    t[8418] = "DuckDuckGo Search Engine (no javascript)";
    t[8419] = "\u041f\u043e\u0448\u0443\u043a\u043e\u0432\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0430 DuckDuckGo (\u0431\u0435\u0437 javascript)";
    t[8420] = "Personal I2P Webserver (eepsite)";
    t[8421] = "\u041f\u0435\u0440\u0441\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 I2P (eepsite)";
    t[8422] = "Cancel restart";
    t[8423] = "\u0421\u043a\u0430\u0441\u0443\u0432\u0430\u0442\u0438 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a";
    t[8424] = "Messages received from peer";
    t[8425] = "\u041f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f, \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u0456 \u0432\u0456\u0434 \u043a\u043e\u043b\u0435\u0433\u0438";
    t[8426] = "peer profiles";
    t[8427] = "\u043f\u0440\u043e\u0444\u0456\u043b\u0456 \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0456\u0432";
    t[8428] = "Update with unsigned development builds";
    t[8429] = "\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0437 \u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u043c\u0438 \u0437\u0431\u0456\u0440\u043a\u0430\u043c\u0438 \u0440\u043e\u0437\u0440\u043e\u0431\u043a\u0438";
    t[8438] = "Configure I2P Stat Collection";
    t[8439] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0437\u0431\u043e\u0440\u0443 \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0438 I2P";
    t[8444] = "Moderate";
    t[8445] = "\u0421\u0435\u0440\u0435\u0434\u043d\u0456\u0439";
    t[8448] = "Update available, click button on left to download";
    t[8449] = "\u0414\u043e\u0441\u0442\u0443\u043f\u043d\u0435 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f, \u043d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u043a\u043d\u043e\u043f\u043a\u0443 \u043b\u0456\u0432\u043e\u0440\u0443\u0447, \u0449\u043e\u0431 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0438\u0442\u0438";
    t[8458] = "High Capacity";
    t[8459] = "\u0412\u0438\u0441\u043e\u043a\u0430 \u043c\u0456\u0441\u0442\u043a\u0456\u0441\u0442\u044c";
    t[8460] = "by default there are no limits";
    t[8461] = "\u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u044c \u043d\u0435\u043c\u0430\u0454";
    t[8462] = "System Tray Integration";
    t[8463] = "\u0406\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0456\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u043e\u0433\u043e \u043b\u043e\u0442\u043a\u0430";
    t[8466] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[8467] = "\u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u0438\u0439 \u0443 \u0444\u0430\u0439\u043b\u0456 <code>clients.config</code>. \u0422\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u043c \u043d\u0430 \u043f\u0440\u0438\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0434\u043e \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0443 \u0430\u0431\u043e \u0432\u0441\u0456\u0445 \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0456\u0432. \u042f\u043a\u0449\u043e \u0412\u0438 \u0440\u043e\u0431\u0438\u0442\u0435 \u043a\u043e\u043d\u0441\u043e\u043b\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u044e \u0447\u0435\u0440\u0435\u0437 \u043c\u0435\u0440\u0435\u0436\u0443, \u0412\u0430\u043c \u043c\u043e\u0436\u0435 \u0437\u0430\u0445\u043e\u0442\u0456\u0442\u0438\u0441\u044f <a href=/configui#passwordheading>\u0432\u0438\u043c\u0430\u0433\u0430\u0442\u0438 \u043f\u0430\u0440\u043e\u043b\u044c \u0434\u043e\u0441\u0442\u0443\u043f\u0443</a> \u0434\u043b\u044f \u0437\u0430\u043f\u043e\u0431\u0456\u0433\u0430\u043d\u043d\u044f \u043d\u0435\u0441\u0430\u043d\u043a\u0446\u0456\u043e\u043d\u043e\u0432\u0430\u043d\u043e\u043c\u0443 \u0434\u043e\u0441\u0442\u0443\u043f\u0443.";
    t[8470] = "Show Legend";
    t[8471] = "\u041f\u043e\u043a\u0430\u0437\u0430\u0442\u0438 \u043b\u0435\u0433\u0435\u043d\u0434\u0443";
    t[8474] = "Profile";
    t[8475] = "\u041f\u0440\u043e\u0444\u0456\u043b\u044c";
    t[8490] = "A group of tunnel entry points (leases) for a <i>destination</i>. Note: A 0-hop server tunnel will only have one lease, regardless of the number of tunnels configured.";
    t[8491] = "\u0413\u0440\u0443\u043f\u0430 \u0442\u043e\u0447\u043e\u043a \u0432\u0445\u043e\u0434\u0443 \u0442\u0443\u043d\u0435\u043b\u044e (\u043b\u0456\u0437\u0438\u043d\u0433\u0456\u0432) \u0434\u043b\u044f <i>\u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f</i>. \u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430: \u0423 \u0442\u0443\u043d\u0435\u043b\u0456 \u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0437 \u043d\u0443\u043b\u044c\u043e\u0432\u0438\u043c \u0447\u0438\u0441\u043b\u043e\u043c \u0441\u0442\u0440\u0438\u0431\u043a\u0456\u0432 \u0431\u0443\u0434\u0435 \u043b\u0438\u0448\u0435 \u043e\u0434\u0438\u043d \u043b\u0456\u0437\u0438\u043d\u0433, \u043d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u043e \u0432\u0456\u0434 \u043a\u0456\u043b\u044c\u043a\u043e\u0441\u0442\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432.";
    t[8494] = "Tunnels";
    t[8495] = "\u0422\u0443\u043d\u0435\u043b\u0456";
    t[8504] = "This router is not currently a floodfill participant.";
    t[8505] = "\u0426\u0435\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043d\u0430\u0440\u0430\u0437\u0456 \u043d\u0435 \u0454 \u0443\u0447\u0430\u0441\u043d\u0438\u043a\u043e\u043c \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d\u043d\u044f.";
    t[8508] = "Restart immediately";
    t[8509] = "\u041f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u043d\u0435\u0433\u0430\u0439\u043d\u043e";
    t[8516] = "Configure the status of the I2P service at system startup. If disabled, the service can be launched manually.";
    t[8517] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 \u0441\u0442\u0430\u0442\u0443\u0441 \u0441\u043b\u0443\u0436\u0431\u0438 I2P \u043f\u0456\u0434 \u0447\u0430\u0441 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0441\u0438\u0441\u0442\u0435\u043c\u0438. \u042f\u043a\u0449\u043e \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u043e, \u0441\u043b\u0443\u0436\u0431\u0443 \u043c\u043e\u0436\u043d\u0430 \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u0432\u0440\u0443\u0447\u043d\u0443.";
    t[8524] = "torrents";
    t[8525] = "\u0442\u043e\u0440\u0440\u0435\u043d\u0442\u0456\u0432";
    t[8536] = "Job Queue";
    t[8537] = "\u0427\u0435\u0440\u0433\u0430 \u0437\u0430\u0432\u0434\u0430\u043d\u044c";
    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435 IE, \u0446\u0456\u043b\u043a\u043e\u043c \u0439\u043c\u043e\u0432\u0456\u0440\u043d\u043e, \u0449\u043e \u0432\u0430\u0448 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u043f\u0440\u0438\u043a\u0438\u0434\u0430\u0454\u0442\u044c\u0441\u044f IE; \u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0439\u0442\u0435 \u0441\u0432\u0456\u0439 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 (\u0430\u0431\u043e \u043f\u0440\u043e\u043a\u0441\u0456), \u0449\u043e\u0431 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0456\u043d\u0448\u0438\u0439 \u0440\u044f\u0434\u043e\u043a \u0430\u0433\u0435\u043d\u0442\u0430 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430, \u044f\u043a\u0449\u043e \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0442\u0435\u043c\u0430\u0442\u0438\u043a\u0438 \u043a\u043e\u043d\u0441\u043e\u043b\u0456.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "\u041f\u043e\u0448\u0443\u043a\u043e\u0432\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0430 Clearnet, \u043e\u0440\u0456\u0454\u043d\u0442\u043e\u0432\u0430\u043d\u0430 \u043d\u0430 \u043a\u043e\u043d\u0444\u0456\u0434\u0435\u043d\u0446\u0456\u0439\u043d\u0456\u0441\u0442\u044c";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>\u0416\u0443\u0440\u043d\u0430\u043b\u0438</a> \u043c\u043e\u0436\u0443\u0442\u044c \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0442\u0438 \u0432\u0438\u0440\u0456\u0448\u0438\u0442\u0438 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0443. \u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u0445\u043e\u0442\u0456\u0442\u0438 \u0432\u0441\u0442\u0430\u0432\u0438\u0442\u0438 \u0443\u0440\u0438\u0432\u043a\u0438 \u043d\u0430 <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>\u0444\u043e\u0440\u0443\u043c\u0456</a> \u0449\u043e\u0431 \u043e\u0442\u0440\u0438\u043c\u0430\u0442\u0438 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0443, \u0430\u0431\u043e, \u043c\u043e\u0436\u043b\u0438\u0432\u043e, <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>\u0441\u043a\u043e\u043f\u0456\u044e\u0432\u0430\u0442\u0438</a> \u0437\u0432\u0456\u0434\u0442\u0438 \u0442\u0430 \u0434\u0430\u0442\u0438 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f \u043d\u0430 IRC \u0434\u043b\u044f \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043d\u044f \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0438.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "\u041f\u043b\u0430\u0433\u0456\u043d\u0438, \u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0456 \u0437 \u043a\u0440\u0438\u043f\u0442\u043e\u0433\u0440\u0430\u0444\u0456\u0447\u043d\u0438\u043c \u043a\u043b\u044e\u0447\u0435\u043c \u0440\u043e\u0437\u0440\u043e\u0431\u043d\u0438\u043a\u0430, \u0454 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u043c \u0444\u043e\u0440\u043c\u0430\u0442\u043e\u043c, \u0430\u043b\u0435 \u044f\u043a\u0449\u043e \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0456 \u043f\u043b\u0430\u0433\u0456\u043d\u0438 (.zip), \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0446\u0435 \u043d\u0430 True. \u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u0432\u0438 \u0432\u0441\u0435 \u0449\u0435 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0456\u0442\u043a\u043d\u0443\u0442\u0438\u0441\u044f \u0437 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0430\u043c\u0438, \u044f\u043a\u0456 \u043d\u0430\u043c\u0430\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043d\u0435\u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0439 \u043f\u043b\u0430\u0433\u0456\u043d, \u044f\u043a\u0449\u043e \u0440\u043e\u0437\u0440\u043e\u0431\u043d\u0438\u043a \u0432\u043a\u043b\u044e\u0447\u0438\u0432 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0456 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0438 \u043f\u0440\u043e\u0446\u0435\u0441\u0443 \u0437\u0431\u0456\u0440\u043a\u0438 \u043f\u043b\u0430\u0433\u0456\u043d\u0430.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u043b\u0438 \u043e\u043a\u0440\u0435\u043c\u0438\u0439 \u0435\u043a\u0437\u0435\u043c\u043f\u043b\u044f\u0440 Tor \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u043e, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u0442\u0438 \u0439\u043e\u0433\u043e, \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0432\u0448\u0438 I2P: <i>\u0422\u0438\u043f \u043f\u0440\u043e\u043a\u0441\u0456:</i> <code>SOCKS 5</code> <i>\u0425\u043e\u0441\u0442:</i> <code>127.0.0.1</code> <i>\u041f\u043e\u0440\u0442:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "\u0412\u0438\u0431\u0435\u0440\u0456\u0442\u044c \u043c\u043e\u0432\u0443, \u044f\u043a\u0430 \u0431\u0443\u0434\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u0434\u043b\u044f \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0442\u0430 \u0432\u0435\u0431-\u0434\u043e\u0434\u0430\u0442\u043a\u0456\u0432 (<a href=/webmail target=_blank rel=noreferrer>\u0432\u0435\u0431-\u043f\u043e\u0448\u0442\u0430</a>, <a href=/torrents target=_blank rel=noreferrer>\u0442\u043e\u0440\u0435\u043d\u0442\u0438</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>\u043a\u0435\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0443\u043d\u0435\u043b\u044f\u043c\u0438</a> \u0442\u043e\u0449\u043e). \u042f\u043a\u0449\u043e \u0432\u0438 \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0437\u043c\u0456\u043d\u0438\u0442\u0438 \u043c\u043e\u0432\u0443 \u0443 \u043c\u0430\u0439\u0431\u0443\u0442\u043d\u044c\u043e\u043c\u0443, \u0437\u043c\u0456\u043d\u0438\u0442\u0438 \u0442\u0435\u043c\u0443 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0430\u0431\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043f\u0430\u0440\u043e\u043b\u044c \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0434\u043e \u043a\u043e\u043d\u0441\u043e\u043b\u0456, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0440\u043e\u0431\u0438\u0442\u0438 \u0446\u0435 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f <a href=/configui target=_blank rel=noreferrer>\u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0443 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430</a>.";
