    t[8654] = "If you can, please poke a hole in your firewall to allow unsolicited UDP and TCP packets to reach you.";
    t[8655] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435, \u0431\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u043f\u0440\u043e\u0442\u043a\u043d\u0456\u0442\u044c \u0434\u0456\u0440\u043a\u0443 \u0443 \u0432\u0430\u0448\u043e\u043c\u0443 \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440\u0456, \u0449\u043e\u0431 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u0438 \u043d\u0435\u0431\u0430\u0436\u0430\u043d\u0438\u043c \u043f\u0430\u043a\u0435\u0442\u0430\u043c UDP \u0456 TCP \u0434\u0456\u0441\u0442\u0430\u0442\u0438\u0441\u044f \u0434\u043e \u0432\u0430\u0441.";
