    t[8667] = "\u0417\u0430\u0433\u0430\u043b\u044c\u043d\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0437\u0430\u0431\u0430\u043d\u0435\u043d\u0438\u0445 \u043e\u0434\u043d\u043e\u043b\u0456\u0442\u043a\u0456\u0432";
