    t[9032] = "Peers not profiled as high capacity (lower build rate than average peer).";
    t[9033] = "\u041e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0456 \u0432\u0443\u0437\u043b\u0438 \u043d\u0435 \u043c\u0430\u044e\u0442\u044c \u0432\u0438\u0441\u043e\u043a\u043e\u0457 \u043f\u043e\u0442\u0443\u0436\u043d\u043e\u0441\u0442\u0456 (\u043d\u0438\u0436\u0447\u0438\u0439 \u0440\u0456\u0432\u0435\u043d\u044c \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f, \u043d\u0456\u0436 \u0441\u0435\u0440\u0435\u0434\u043d\u0456\u0439 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0439).";
    t[9034] = "Narrower";
    t[9035] = "\u0412\u0443\u0436\u0447\u0435";
