    t[9039] = "\u042f\u043a\u0449\u043e I2P \u043d\u0435 \u043c\u043e\u0436\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438\u0441\u044f \u0434\u043e \u0406\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0443, \u043c\u043e\u0436\u0435 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0442\u0438\u0441\u044f \u043f\u043e\u043a\u0430\u0437\u043d\u0438\u043a 0 \u043c\u0441.";
    t[9046] = "on the {0}Advanced Configuration page{1}.";
    t[9047] = "\u043d\u0430 {0}\u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u043e\u0457 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457{1}.";
    t[9050] = "ended {0} ago";
    t[9051] = "\u0437\u0430\u043a\u0456\u043d\u0447\u0438\u0432\u0441\u044f {0} \u0442\u043e\u043c\u0443";
    t[9052] = "Ready";
    t[9053] = "\u0413\u043e\u0442\u043e\u0432\u043e";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "\u0426\u0435 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0456 \u043f\u043e\u0441\u043b\u0443\u0433\u0438, \u043d\u0430\u0434\u0430\u043d\u0456 \u0432\u0430\u0448\u0438\u043c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u043c. \u0426\u0435 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0438 \u0437\u0430\u043f\u0443\u0449\u0435\u043d\u0456 \u0447\u0435\u0440\u0435\u0437 <a href='/i2ptunnelmgr'>\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a> \u0430\u0431\u043e \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u0456 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0438, \u0449\u043e \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c\u0441\u044f \u0447\u0435\u0440\u0435\u0437 SAM, BOB \u0430\u0431\u043e \u0431\u0435\u0437\u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e \u0434\u043e I2CP. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u0431\u0456\u043b\u044c\u0448\u0456\u0441\u0442\u044c \u0432\u0430\u0448\u0438\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0445 \u043f\u043e\u0441\u043b\u0443\u0433 (\u043f\u043e\u0448\u0442\u0430, HTTP-\u043f\u0440\u043e\u043a\u0441\u0456, IRC) \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0442\u043e\u0439 \u0441\u0430\u043c\u0438\u0439 \u043d\u0430\u0431\u0456\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0456 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0442\u0438\u043c\u0443\u0442\u044c\u0441\u044f \u044f\u043a <i>\u0421\u043f\u0456\u043b\u044c\u043d\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0438</i> \u0442\u0430 <i>\u0421\u043f\u0456\u043b\u044c\u043d\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0438(DSA)</i>, \u0449\u043e \u043f\u043e\u043a\u0440\u0430\u0449\u0443\u0454 \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u0456\u0441\u0442\u044c \u0448\u043b\u044f\u0445\u043e\u043c \u0437\u043c\u0456\u0448\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0440\u0430\u0444\u0456\u043a\u0443 \u0437 \u0443\u0441\u0456\u0445 \u0441\u043f\u0456\u043b\u044c\u043d\u0438\u0445 \u043f\u043e\u0441\u043b\u0443\u0433 \u0456 \u0437\u043d\u0438\u0436\u0443\u0454 \u043d\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f, \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0435 \u0434\u043b\u044f \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0438 \u0442\u0430 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0438 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u041f\u0440\u043e\u0442\u0435, \u044f\u043a\u0449\u043e \u0432\u0438 \u043f\u043e\u043c\u0456\u0442\u0438\u0442\u0435 \u0432\u0456\u0434\u043c\u043e\u0432\u0443 \u0442\u0443\u043d\u0435\u043b\u044e, \u0443\u0441\u0456 \u0432\u0430\u0448\u0456 \u043f\u043e\u0441\u043b\u0443\u0433\u0438 \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u0442\u044c\u0441\u044f \u043e\u0434\u043d\u043e\u0447\u0430\u0441\u043d\u043e. \u0422\u043e\u043c\u0443 \u0432 \u0434\u0435\u044f\u043a\u0438\u0445 \u0441\u0446\u0435\u043d\u0430\u0440\u0456\u044f\u0445 \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u0445\u043e\u0442\u0456\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0456 \u043f\u043e\u0441\u043b\u0443\u0433\u0438 \u0442\u0430\u043a, \u0449\u043e\u0431 \u0432\u043e\u043d\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u043b\u0438 \u0432\u043b\u0430\u0441\u043d\u0438\u0439 \u043d\u0430\u0431\u0456\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u0426\u0435 \u043c\u043e\u0436\u043d\u0430 \u0437\u0440\u043e\u0431\u0438\u0442\u0438 \u0443\u043d\u0435\u043c\u043e\u0436\u043b\u0438\u0432\u0438\u0432\u0448\u0438 \u043e\u043f\u0446\u0456\u044e <i>\u041f\u043e\u0434\u0456\u043b\u044f\u0442\u0438 \u0442\u0443\u043d\u0435\u043b\u0456 \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0430\u043c\u0438&hellip;</i> \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u043e\u0457 \u043f\u043e\u0441\u043b\u0443\u0433\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0430 \u0432 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u043f\u0456\u0441\u043b\u044f \u0447\u043e\u0433\u043e \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u0431\u0443\u0434\u0435 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u043f\u043e\u0441\u043b\u0443\u0433\u0443 \u043a\u043b\u0456\u0454\u043d\u0442\u0430 \u0437 \u0433\u043e\u043b\u043e\u0432\u043d\u043e\u0457 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 <a href='/i2ptunnelmgr'>\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0443 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>.";
