    t[9095] = "\u0422\u0430\u043a\u043e\u0436 <b>\u043d\u0435 \u0432\u0432\u043e\u0434\u044c\u0442\u0435 \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u0443 IP-\u0430\u0434\u0440\u0435\u0441\u0443</b>, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 127.0.0.1 \u0430\u0431\u043e 192.168.1.1.";
