    t[9137] = "\u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f";
    t[9138] = "If you'd like to report a bug, please file a ticket on <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. For developer-related discussions, please visit <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>zzz's developer forums</a> or come and visit the <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>developer channel</a> on I2P's IRC network.";
    t[9139] = "\u042f\u043a\u0449\u043e \u0432\u0438 \u0445\u043e\u0447\u0435\u0442\u0435 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u0438\u0442\u0438 \u043f\u0440\u043e \u043f\u043e\u043c\u0438\u043b\u043a\u0443, \u0431\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0437\u0430\u0440\u0435\u0454\u0441\u0442\u0440\u0443\u0439\u0442\u0435 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u0439 \u043a\u0432\u0438\u0442\u043e\u043a \u043d\u0430 <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. \u0414\u043b\u044f \u043e\u0431\u0433\u043e\u0432\u043e\u0440\u0435\u043d\u044c \u0440\u043e\u0437\u0440\u043e\u0431\u043d\u0438\u043a\u0456\u0432 \u0432\u0456\u0434\u0432\u0456\u0434\u0430\u0439\u0442\u0435, \u0431\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>\u0444\u043e\u0440\u0443\u043c \u0440\u043e\u0437\u0440\u043e\u0431\u043d\u0438\u043a\u0456\u0432 zzz</a> \u0430\u0431\u043e \u0437\u0430\u0439\u0434\u0456\u0442\u044c \u043d\u0430 <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>\u043a\u0430\u043d\u0430\u043b \u0440\u043e\u0437\u0440\u043e\u0431\u043d\u0438\u043a\u0456\u0432</a> \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 IRC I2P.";
    t[9146] = "Reseeding Help";
    t[9147] = "\u0414\u043e\u0432\u0456\u0434\u043a\u0430 \u0449\u043e\u0434\u043e \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u0437\u0430\u043f\u043e\u0432\u043d\u0435\u043d\u043d\u044f";
