    t[9172] = "Expires in {0}";
    t[9173] = "\u0422\u0435\u0440\u043c\u0456\u043d \u0434\u0456\u0457 \u0437\u0430\u043a\u0456\u043d\u0447\u0443\u0454\u0442\u044c\u0441\u044f \u0447\u0435\u0440\u0435\u0437 {0}";
    t[9178] = "Show all routers for this family in NetDb";
    t[9179] = "\u041f\u043e\u043a\u0430\u0437\u0430\u0442\u0438 \u0432\u0441\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438 \u0434\u043b\u044f \u0446\u044c\u043e\u0433\u043e \u0441\u0456\u043c\u0435\u0439\u0441\u0442\u0432\u0430 \u0432 NetDb";
    t[9188] = "Join Existing Router Family";
    t[9189] = "\u041f\u0440\u0438\u0454\u0434\u043d\u0430\u0442\u0438\u0441\u044f \u0434\u043e \u0456\u0441\u043d\u0443\u044e\u0447\u043e\u0433\u043e \u0441\u0456\u043c\u0435\u0439\u0441\u0442\u0432\u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432";
    t[9194] = "Inbound";
    t[9195] = "\u0432\u0445\u0456\u0434\u043d\u043e";
    t[9200] = "The themes directory is located in the I2P application directory under <code>docs/themes</code>. There are example override files in the console and I2PSnark theme sub-directories.";
    t[9201] = "\u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0456\u044f \u0437 \u0442\u0435\u043c\u0430\u043c\u0438 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0430 \u0443 \u043a\u0430\u0442\u0430\u043b\u043e\u0437\u0456 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043a\u0443 I2P \u043f\u0456\u0434 <code>docs/themes</code>. \u0404 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043e\u0432\u0456 \u0444\u0430\u0439\u043b\u0438 \u043f\u0435\u0440\u0435\u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u044c \u0443 \u043f\u0456\u0434\u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0430\u0445 \u0442\u0435\u043c \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u0442\u0430 I2PSnark.";
    t[9202] = "Note: Most of the options in the Tunnel Manager have tooltips; be sure to check those before you change settings you don't fully understand!";
    t[9203] = "\u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u0431\u0456\u043b\u044c\u0448\u0456\u0441\u0442\u044c \u043e\u043f\u0446\u0456\u0439 \u0443 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u043c\u0430\u044e\u0442\u044c \u043f\u0456\u0434\u043a\u0430\u0437\u043a\u0438; \u043e\u0431\u043e\u0432'\u044f\u0437\u043a\u043e\u0432\u043e \u0457\u0445 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435 \u043f\u0435\u0440\u0435\u0434 \u0437\u043c\u0456\u043d\u043e\u044e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c, \u044f\u043a\u0456 \u0432\u0438 \u043d\u0435 \u043f\u043e\u0432\u043d\u0456\u0441\u0442\u044e \u0440\u043e\u0437\u0443\u043c\u0456\u0454\u0442\u0435!";
    t[9204] = "Events";
    t[9205] = "\u041f\u043e\u0434\u0456\u0457";
    t[9208] = "Project Website";
    t[9209] = "\u0412\u0435\u0431-\u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0435\u043a\u0442\u0443";
    t[9210] = "External IP";
    t[9211] = "\u0417\u043e\u0432\u043d\u0456\u0448\u043d\u0456\u0439 IP";
    t[9218] = "Soft restart";
    t[9219] = "\u041c\u2019\u044f\u043a\u0438\u0439 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a";
    t[9234] = "router information";
    t[9235] = "\u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440";
    t[9238] = "UPnP SSDP UDP multicast listener";
    t[9239] = "\u041f\u0440\u0438\u0439\u043c\u0430\u0447 \u0431\u0430\u0433\u0430\u0442\u043e\u043a\u0430\u043d\u0430\u043b\u044c\u043d\u0438\u0445 UDP-\u0437'\u0454\u0434\u043d\u0430\u043d\u044c SSDP \u0434\u043b\u044f UPnP";
    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "\u041f\u0440\u043e\u0441\u0442\u0438\u0439 \u0432\u0435\u0431-\u0437\u0430\u0441\u0442\u043e\u0441\u0443\u043d\u043e\u043a CGI, \u044f\u043a\u0438\u0439 \u043e\u0442\u0440\u0438\u043c\u0443\u0454 \u0456\u043c'\u044f \u0445\u043e\u0441\u0442\u0430 \u044f\u043a \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440 \u0456 \u043f\u043e\u0432\u0435\u0440\u0442\u0430\u0454 \u043f\u0435\u0440\u0435\u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044f 301 \u0434\u043e \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e\u0457 \u0430\u0434\u0440\u0435\u0441\u0438 \u0437 \u0434\u043e\u0434\u0430\u043d\u0438\u043c \u0440\u044f\u0434\u043a\u043e\u043c <code>?i2paddresshelper=key</code>. HTTP-\u043f\u0440\u043e\u043a\u0441\u0456 \u0456\u043d\u0442\u0435\u0440\u043f\u0440\u0435\u0442\u0443\u0432\u0430\u0442\u0438\u043c\u0435 \u0434\u043e\u0434\u0430\u043d\u0438\u0439 \u0440\u044f\u0434\u043e\u043a \u0456 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438\u043c\u0435 \u043a\u043b\u044e\u0447 \u044f\u043a \u0444\u0430\u043a\u0442\u0438\u0447\u043d\u0443 \u0430\u0434\u0440\u0435\u0441\u0443 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f. \u041a\u0440\u0456\u043c \u0442\u043e\u0433\u043e, \u043f\u0440\u043e\u043a\u0441\u0456 \u0431\u0443\u0434\u0435 \u043a\u0435\u0448\u0443\u0432\u0430\u0442\u0438 \u043a\u043b\u044e\u0447, \u0449\u043e\u0431 \u0434\u043e\u043f\u043e\u043c\u0456\u0433\u043d\u0438\u043a \u0430\u0434\u0440\u0435\u0441\u0438 \u043d\u0435 \u0431\u0443\u0432 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0438\u043c \u0434\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443, \u0456 \u043f\u0440\u043e\u043f\u043e\u043d\u0443\u0432\u0430\u0442\u0438\u043c\u0435 \u043e\u043f\u0446\u0456\u044e \u0434\u043e\u0434\u0430\u0432\u0430\u043d\u043d\u044f \u0440\u043e\u0437\u0432'\u044f\u0437\u0430\u043d\u043e\u0457 \u0430\u0434\u0440\u0435\u0441\u0438 \u0434\u043e \u041a\u043d\u0438\u0433\u0438 \u0430\u0434\u0440\u0435\u0441.";
    t[9244] = "Temporary ban expiring in {0}";
    t[9245] = "\u0422\u0438\u043c\u0447\u0430\u0441\u043e\u0432\u0438\u0439 \u0431\u0430\u043d \u0437\u0430\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0447\u0435\u0440\u0435\u0437 {0}";
    t[9256] = "Full garbage collection requested";
    t[9257] = "\u041f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u043f\u043e\u0432\u043d\u0435 \u0437\u0431\u0438\u0440\u0430\u043d\u043d\u044f \u0441\u043c\u0456\u0442\u0442\u044f";
    t[9270] = "Building";
    t[9271] = "\u041f\u043e\u0431\u0443\u0434\u043e\u0432\u0430";
    t[9272] = "New Install Wizard";
    t[9273] = "\u041c\u0430\u0439\u0441\u0442\u0435\u0440 \u043d\u043e\u0432\u043e\u0457 \u0456\u043d\u0441\u0442\u0430\u043b\u044f\u0446\u0456\u0457";
    t[9278] = "Used";
    t[9279] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043e";
    t[9284] = "New override";
    t[9285] = "\u041d\u043e\u0432\u0435 \u043f\u0435\u0440\u0435\u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f";
    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f (\u0432 \u0445\u0432\u0438\u043b\u0438\u043d\u0430\u0445) \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0432\u0440\u0443\u0447\u043d\u0443 \u0441\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0443\u0432\u0430\u0442\u0438 \u0447\u0430\u0441 \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0456\u0441\u043b\u044f \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0434\u043e \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0438 \u0434\u0456\u0439\u0441\u043d\u043e\u0441\u0442\u0456 RouterInfos \u0443 NetDb, \u043f\u0456\u0441\u043b\u044f \u0447\u043e\u0433\u043e \u0431\u0443\u0434\u0443\u0442\u044c \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438\u0441\u044f \u043b\u0438\u0448\u0435 \u0434\u0456\u0439\u0441\u043d\u0456 \u0440\u043e\u0443\u0442\u0435\u0440\u0438. \u041f\u0440\u0438 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0446\u0456 \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0438\u0434\u0430\u043b\u0435\u043d\u0456 \u0437 NetDb \u0437\u0430\u0441\u0442\u0430\u0440\u0456\u043b\u0456 RouterInfos \u0442\u0430 \u043d\u0435\u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u043f\u0456\u0440\u0438, \u0434\u043e \u044f\u043a\u0438\u0445 \u043c\u043e\u0436\u043d\u0430 \u0434\u0456\u0441\u0442\u0430\u0442\u0438\u0441\u044f \u043b\u0438\u0448\u0435 \u0447\u0435\u0440\u0435\u0437 SSU. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 60 \u0445\u0432\u0438\u043b\u0438\u043d] \u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u0446\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043d\u0435 \u0441\u0442\u043e\u0441\u0443\u0454\u0442\u044c\u0441\u044f \u0441\u0442\u0430\u0440\u0438\u0445 \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432 (\u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0441\u0442\u0430\u0440\u0448\u0438\u0445 0.9.29), \u044f\u043a\u0456 \u0432\u0438\u0434\u0430\u043b\u044f\u044e\u0442\u044c\u0441\u044f \u0437 NetDb \u0456 \u0431\u043b\u043e\u043a\u0443\u044e\u0442\u044c\u0441\u044f \u043d\u0430 \u0447\u0430\u0441 \u0441\u0435\u0441\u0456\u0457 \u0440\u043e\u0443\u0442\u0435\u0440\u0430 \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u043f\u0456\u0441\u043b\u044f \u0441\u043f\u0440\u043e\u0431\u0438 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u043d\u044f NetDb.";
    t[9294] = "Linux";
    t[9295] = "Linux";
    t[9296] = "How many bytes can be sent without acknowledgement";
    t[9297] = "\u0421\u043a\u0456\u043b\u044c\u043a\u0438 \u0431\u0430\u0439\u0442 \u043c\u043e\u0436\u043d\u0430 \u043d\u0430\u0434\u0456\u0441\u043b\u0430\u0442\u0438 \u0431\u0435\u0437 \u043f\u0456\u0434\u0442\u0432\u0435\u0440\u0434\u0436\u0435\u043d\u043d\u044f";
    t[9300] = "Network Database Router Map";
    t[9301] = "\u041c\u0435\u0440\u0435\u0436\u0435\u0432\u0430 \u0431\u0430\u0437\u0430 \u0434\u0430\u043d\u0438\u0445 \u043c\u0430\u043f \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432";
    t[9316] = "Please include your I2P version and running environment information in bug reports";
    t[9317] = "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0456\u0442\u044c \u0432\u0430\u0448\u0443 \u0432\u0435\u0440\u0441\u0456\u044e I2P \u0442\u0430 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043f\u0440\u043e \u0440\u043e\u0431\u043e\u0447\u0435 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0435 \u0443 \u0437\u0432\u0456\u0442\u0438 \u043f\u0440\u043e \u043f\u043e\u043c\u0438\u043b\u043a\u0438";
    t[9320] = "check sidebar for status.";
    t[9321] = "\u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u0438 \u0441\u0442\u0430\u0442\u0443\u0441 \u043d\u0430 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456.";
    t[9322] = "Configuration and bandwidth tester";
    t[9323] = "\u0422\u0435\u0441\u0442\u0435\u0440 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u0442\u0430 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456";
    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "\u0417\u043e\u0432\u043d\u0456\u0448\u043d\u0456\u0439 \u043f\u043e\u0440\u0442 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0443\u0454 \u0437\u0432'\u044f\u0437\u043e\u043a \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438. \u0420\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440 \u043d\u0430 \u0434\u043e\u0437\u0432\u0456\u043b \u0432\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u0442\u0430 \u0432\u0438\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u0442\u0440\u0430\u0444\u0456\u043a\u0443 \u043d\u0430 \u0446\u044c\u043e\u043c\u0443 \u043f\u043e\u0440\u0442\u0443, \u0449\u043e\u0431 \u043e\u043f\u0442\u0438\u043c\u0456\u0437\u0443\u0432\u0430\u0442\u0438 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u0456\u0441\u0442\u044c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[9328] = "Bulk Thresholds";
    t[9329] = "\u041f\u043e\u0440\u043e\u0433\u0438 \u043f\u0430\u0440\u0442\u0456\u044f\u043c\u0438";
    t[9334] = "If the problem persists, verify that you have cookies enabled in your browser.";
    t[9335] = "\u042f\u043a\u0449\u043e \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0430 \u043d\u0435 \u0443\u0441\u0443\u043d\u0443\u0442\u0430, \u043f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0439\u0442\u0435\u0441\u044f, \u0449\u043e cookies \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u0456 \u0443 \u0432\u0430\u0448\u043e\u043c\u0443 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0456.";
    t[9350] = "Good Lookups";
    t[9351] = "\u0425\u043e\u0440\u043e\u0448\u0456 \u043f\u043e\u0448\u0443\u043a\u0438";
    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "\u041f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f - \u0446\u0435 \u043f\u0440\u043e\u0446\u0435\u0441 \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u043e\u0433\u043e \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u0434\u043b\u044f \u043f\u043e\u0448\u0443\u043a\u0443 \u0456\u043d\u0448\u0438\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432 \u043f\u0440\u0438 \u043f\u0435\u0440\u0448\u043e\u043c\u0443 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u0456 I2P \u0430\u0431\u043e \u043a\u043e\u043b\u0438 \u0443 \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0437\u0430\u043b\u0438\u0448\u0438\u043b\u043e\u0441\u044c \u0437\u0430\u043d\u0430\u0434\u0442\u043e \u043c\u0430\u043b\u043e \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u044c \u043d\u0430 \u0456\u043d\u0448\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0441\u043f\u0440\u0430\u0446\u044e\u044e\u0442\u044c \u0434\u043b\u044f \u0431\u0456\u043b\u044c\u0448\u043e\u0441\u0442\u0456 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456\u0432. \u0417\u043c\u0456\u043d\u044e\u0439\u0442\u0435 \u0457\u0445 \u043b\u0438\u0448\u0435 \u044f\u043a\u0449\u043e HTTPS \u0431\u043b\u043e\u043a\u0443\u0454 \u0436\u043e\u0440\u0441\u0442\u043a\u0438\u0439 \u0444\u0430\u0439\u0440\u0432\u043e\u043b \u0456 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u043d\u0435 \u0432\u0434\u0430\u043b\u043e\u0441\u044c.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f, \u043a\u043e\u043b\u0438 \u0430\u043a\u0442\u0438\u0432\u043e\u0432\u0430\u043d\u0435, \u043c\u043e\u0434\u0438\u0444\u0456\u043a\u0443\u0454 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u043e\u0432\u0443 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0443 \u0432\u0456\u0434\u0433\u0443\u043a\u0443 \u0434\u043b\u044f \u0441\u0435\u0440\u0432\u0435\u0440\u0456\u0432, \u043d\u0430 \u044f\u043a\u0456 \u0434\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u0438\u0439 \u043f\u0456\u043d\u0433, \u044f\u043a\u0449\u043e \u0442\u0430\u043a\u043e\u0436 \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e <code>i2p.streaming.enablePongDelay</code>. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0431\u0443\u0434\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f 50 \u043c\u0441, \u044f\u043a\u0449\u043e \u043d\u0435 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u044f\u0432\u043d\u043e.";
