    t[9441] = "\u041f\u043e\u043c\u0438\u043b\u043a\u0430 \u043f\u0440\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043f\u043b\u0430\u0491\u0456\u043d\u0430 {0}";
    t[9446] = "Reseeding: fetching router info from seed URL ({0} successful, {1} errors).";
    t[9447] = "\u041f\u0440\u043e\u0432\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u0435 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f: \u043e\u0442\u0440\u0438\u043c\u0443\u0454\u043c\u043e \u0441\u043f\u0438\u0441\u043e\u043a \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432 \u0437 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456\u0432 URL ({0} \u0443\u0441\u043f\u0456\u0448\u043d\u043e, {1} \u043f\u043e\u043c\u0438\u043b\u043e\u043a).";
    t[9452] = "UDP port";
    t[9453] = "\u041f\u043e\u0440\u0442 UDP";
