    t[9455] = "\u0429\u043e \u0442\u0430\u043a\u0435 \u0435\u0435\u043f\u0441\u0430\u0439\u0442?";
    t[9458] = "Limited display to the {0} tunnels with the highest usage";
    t[9459] = "\u0412\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u043e {0} \u0442\u0443\u043d\u0435\u043b\u044f\u043c\u0438 \u0437 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0438\u043c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\u043c";
    t[9466] = "This may be a transient error, if the other program is no longer using the port.";
    t[9467] = "\u0426\u0435 \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0442\u0438\u043c\u0447\u0430\u0441\u043e\u0432\u0430 \u043f\u043e\u043c\u0438\u043b\u043a\u0430, \u044f\u043a\u0449\u043e \u0456\u043d\u0448\u0430 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0430 \u0431\u0456\u043b\u044c\u0448\u0435 \u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454 \u043f\u043e\u0440\u0442.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "\u0412\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 I2P+ \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0441\u043f\u0440\u0438\u044f\u0454 \u043c\u0435\u0440\u0435\u0436\u0456 \u0448\u043b\u044f\u0445\u043e\u043c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u0457 \u0432\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u044c\u043e\u0433\u043e, \u0437\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0437 \u043a\u0456\u043d\u0446\u044f \u0432 \u043a\u0456\u043d\u0435\u0446\u044c \u0442\u0440\u0430\u0444\u0456\u043a\u0443 \u0434\u043b\u044f \u0456\u043d\u0448\u0438\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432, \u0432\u0456\u0434\u043e\u043c\u043e\u0433\u043e \u044f\u043a <i>\u0443\u0447\u0430\u0441\u0442\u044c</i>. \u0423\u0447\u0430\u0441\u0442\u044c \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u043f\u0456\u0434\u0432\u0438\u0449\u0443\u0454 \u0440\u0456\u0432\u0435\u043d\u044c \u0430\u043d\u043e\u043d\u0456\u043c\u043d\u043e\u0441\u0442\u0456 \u0432\u0441\u0456\u0445 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456\u0432 \u043c\u0435\u0440\u0435\u0436\u0456 \u0442\u0430 \u043c\u0430\u043a\u0441\u0438\u043c\u0456\u0437\u0443\u0454 \u0448\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u0432\u0430\u0448\u043e\u0433\u043e \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0441\u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0443\u0432\u0430\u0442\u0438 \u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0456 \u0441\u0435\u0440\u0432\u0435\u0440\u0438 NTP, \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0456 \u0434\u043b\u044f \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0435\u043d\u043d\u044f \u0442\u043e\u0447\u043d\u043e\u0433\u043e \u0447\u0430\u0441\u0443 \u0440\u043e\u0431\u043e\u0442\u0438 \u0440\u043e\u0443\u0442\u0435\u0440\u0430. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
