    t[9489] = "\u0417\u0430\u0443\u0432\u0430\u0436\u0442\u0435, \u0449\u043e \u043f\u0440\u043e\u0444\u0430\u0439\u043b\u0435\u0440 \u043f\u043e\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u043f\u043e\u0441\u0442\u0456\u0439\u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0443\u043d\u0435\u043b\u044e \u0434\u043b\u044f \u0442\u043e\u0447\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0444\u0456\u043b\u044e\u0432\u0430\u043d\u043d\u044f \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0445 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456\u0432.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "\u042f\u043a\u0449\u043e \u0432\u0430\u043c \u0442\u0435\u0440\u043c\u0456\u043d\u043e\u0432\u043e \u0456 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u0430 \u0433\u043e\u0434\u0438\u043d \u0447\u0435\u043a\u0430\u0442\u0438 \u043d\u0435 \u043c\u043e\u0436\u043d\u0430, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u0438\u0442\u0438 \u043b\u044e\u0434\u0435\u0439 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u0441\u043b\u0443\u0436\u0431\u043e\u044e \u00ab\u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0443\u00bb \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0457 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u0438. \u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0446\u0435 \u0441\u043f\u0440\u0430\u0446\u044e\u0454 \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0445\u0432\u0438\u043b\u0438\u043d \u043f\u0456\u0441\u043b\u044f \u0440\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u0457 \u0432\u0430\u0448\u043e\u0457 \u0434\u043e\u043c\u0435\u043d\u043d\u043e\u0457 \u043d\u0430\u0437\u0432\u0438 \u043d\u0430 \u0442\u043e\u043c\u0443 \u0436 \u0441\u0430\u0439\u0442\u0456. \u0412\u0438\u043f\u0440\u043e\u0431\u0443\u0439\u0442\u0435 \u0446\u0435 \u0441\u0430\u043c\u0456, \u0432\u0432\u0435\u0434\u0448\u0438 <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>\u0432\u0430\u0448\u0430\u043e\u0431\u0440\u0430\u043d\u0430\u0434\u043e\u043c\u0435\u043d\u043d\u0430 \u043d\u0430\u0437\u0432\u0430.i2p</i></code> \u0443 \u0431\u0440\u0430\u0443\u0437\u0435\u0440. \u041a\u043e\u043b\u0438 \u0446\u0435 \u0441\u043f\u0440\u0430\u0446\u044e\u0454, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0441\u043a\u0430\u0437\u0430\u0442\u0438 \u0456\u043d\u0448\u0438\u043c \u0446\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438.";
