    t[9621] = "\u0412\u0456\u0434\u043e\u043c\u0456 \u0448\u0432\u0438\u0434\u043a\u0456\u0441\u043d\u0456 \u043f\u0456\u0440\u0438";
    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "\u0422\u0443\u043d\u0435\u043b\u0456, \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0456 \u0456\u043d\u0448\u0438\u043c\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438 \u0447\u0435\u0440\u0435\u0437 \u0432\u0430\u0448 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440. \u0426\u0435 \u043c\u043e\u0436\u0435 \u0437\u043d\u0430\u0447\u043d\u043e \u0432\u0456\u0434\u0440\u0456\u0437\u043d\u044f\u0442\u0438\u0441\u044f \u0437\u0430\u043b\u0435\u0436\u043d\u043e \u0432\u0456\u0434 \u043f\u043e\u043f\u0438\u0442\u0443 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456, \u0432\u0430\u0448\u043e\u0457 \u0441\u043f\u0456\u043b\u044c\u043d\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u043d\u043e\u0457 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u0442\u0430 \u043e\u0431\u0441\u044f\u0433\u0443 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u043e \u0433\u0435\u043d\u0435\u0440\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0442\u0440\u0430\u0444\u0456\u043a\u0443. \u0420\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0439 \u043c\u0435\u0442\u043e\u0434 \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u043d\u044f \u0443\u0447\u0430\u0441\u0442\u0456 \u0432 \u0442\u0443\u043d\u0435\u043b\u044f\u0445 - \u0437\u043c\u0456\u043d\u0430 \u0432\u0456\u0434\u0441\u043e\u0442\u043a\u043e\u0432\u043e\u0457 \u0447\u0430\u0441\u0442\u043a\u0438 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/config'>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456</a>. \u0412\u0438 \u0442\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0431\u043c\u0435\u0436\u0438\u0442\u0438 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c, \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0438 <code>router.maxParticipatingTunnels=nnn</code> \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/configadvanced'>\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f</a>. <a href='/configstats#tunnel.participatingTunnels'>[\u0423\u0432\u0456\u043c\u043a\u043d\u0443\u0442\u0438 \u0433\u0440\u0430\u0444\u0456\u043a\u0443]</a>.";
