    t[9690] = "In order to provide the best experience for visitors to your site, there are various additional steps you may wish to consider once your site is up and running:";
    t[9691] = "\u0429\u043e\u0431 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0438\u0442\u0438 \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u0438\u0439 \u0434\u043e\u0441\u0432\u0456\u0434 \u0432\u0456\u0434\u0432\u0456\u0434\u0443\u0432\u0430\u0447\u0430\u043c \u0432\u0430\u0448\u043e\u0433\u043e \u0441\u0430\u0439\u0442\u0443, \u0454 \u043a\u0456\u043b\u044c\u043a\u0430 \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0438\u0445 \u043a\u0440\u043e\u043a\u0456\u0432, \u044f\u043a\u0456 \u0432\u0430\u0440\u0442\u043e \u0440\u043e\u0437\u0433\u043b\u044f\u043d\u0443\u0442\u0438 \u043f\u0456\u0441\u043b\u044f \u0442\u043e\u0433\u043e \u044f\u043a \u0432\u0430\u0448 \u0441\u0430\u0439\u0442 \u0431\u0443\u0434\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438:";
