    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "\u0429\u043e\u0431 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0438\u0439 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 \u0434\u043b\u044f \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0432 I2P, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0430\u0431\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0456\u0441\u043d\u0443\u044e\u0447\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0456 <a href=/configclients>\u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438 \u0442\u043e\u0439, \u0449\u043e \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c</a> \u0432\u0456\u0434 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u043d\u043d\u044f, \u0430\u0431\u043e \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u043d\u043e\u0432\u0438\u0439 \u0442\u0443\u043d\u0435\u043b\u044c \u0441\u0435\u0440\u0432\u0435\u0440\u0430 HTTP \u0432 <a href=/i2ptunnelmgr>\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>. \u041f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0439\u0442\u0435\u0441\u044f, \u0449\u043e \u043f\u043e\u0440\u0442 \"\u043f\u0440\u043e\u0441\u043b\u0443\u0445\u043e\u0432\u0443\u0432\u0430\u043d\u043d\u044f\" \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0442\u0430\u043a\u043e\u0436 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0432 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f\u0445 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432. \u041d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, \u044f\u043a\u0449\u043e \u0432\u0430\u0448 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 \u043f\u0440\u043e\u0441\u043b\u0443\u0445\u043e\u0432\u0443\u0454 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0430\u0434\u0440\u0435\u0441\u0443 127.0.0.1 \u043f\u043e\u0440\u0442 80, \u0432\u0430\u043c \u0442\u0430\u043a\u043e\u0436 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0431\u0443\u0434\u0435 \u043f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0442\u0438\u0441\u044c, \u0449\u043e \u0446\u0456\u043b\u044c\u043e\u0432\u0438\u0439 \u043f\u043e\u0440\u0442 \u0432 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f\u0445 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 \u0441\u0435\u0440\u0432\u0456\u0441\u0443 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0442\u0430\u043a\u043e\u0436 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u043e\u0440\u0442 80.";
    t[10040] = "Torrents";
    t[10041] = "\u0422\u043e\u0440\u0440\u0435\u043d\u0442\u0438";
    t[10042] = "Data In";
    t[10043] = "\u0412\u0445\u0456\u0434 \u0434\u0430\u043d\u0438\u0445";
    t[10044] = "IRC proxy";
    t[10045] = "IRC-\u043f\u0440\u043e\u043a\u0441\u0456";
    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 I2P \u0437\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0454\u0442\u044c\u0441\u044f \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0438\u0442\u0438 \u043b\u0438\u0448\u0435 \u043e\u0434\u0438\u043d \u0440\u0430\u0437, \u0449\u043e\u0431 \u0432\u043f\u0435\u0440\u0448\u0435 \u043f\u0440\u0438\u0454\u0434\u043d\u0430\u0442\u0438\u0441\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456. \u041f\u0440\u043e\u0442\u0435, \u044f\u043a\u0449\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438\u043c\u0435 \u0434\u043e\u0432\u0433\u0438\u0439 \u0447\u0430\u0441 \u0431\u0435\u0437 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456, \u0439\u043e\u043c\u0443 \u0442\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u0435 \u0437\u043d\u0430\u0434\u043e\u0431\u0438\u0442\u0438\u0441\u044f \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f. \u041f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u043f\u043e\u043b\u044f\u0433\u0430\u0454 \u0443 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u0456 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0444\u0430\u0439\u043b\u0456\u0432 \u00abRouterInfo\u00bb (\u0443\u043f\u0430\u043a\u043e\u0432\u0430\u043d\u0438\u0445 \u0443 \u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0439 zip-\u0430\u0440\u0445\u0456\u0432) \u043f\u0440\u0438\u043d\u0430\u0439\u043c\u043d\u0456 \u0437 \u0434\u0432\u043e\u0445 \u0437\u0430\u0437\u0434\u0430\u043b\u0435\u0433\u0456\u0434\u044c \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0445 URL-\u0430\u0434\u0440\u0435\u0441 \u0441\u0435\u0440\u0432\u0435\u0440\u0456\u0432, \u0432\u0438\u0431\u0440\u0430\u043d\u0438\u0445 \u0456\u0437 \u0433\u0440\u0443\u043f\u0438 \u0434\u043e\u0431\u0440\u043e\u0432\u0456\u043b\u044c\u043d\u043e \u043a\u0435\u0440\u043e\u0432\u0430\u043d\u0438\u0445 \u0441\u0435\u0440\u0432\u0435\u0440\u0456\u0432 HTTPS \u0447\u0438\u0441\u0442\u043e\u0457 \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[10050] = "Are you sure you want to delete {0}?";
    t[10051] = "\u0412\u0438 \u0432\u043f\u0435\u0432\u043d\u0435\u043d\u0456, \u0449\u043e \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0432\u0438\u0434\u0430\u043b\u0438\u0442\u0438 {0}?";
    t[10054] = "Review recent updates to I2P";
    t[10055] = "\u041e\u0433\u043b\u044f\u043d\u044c\u0442\u0435 \u043e\u0441\u0442\u0430\u043d\u043d\u0456 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f I2P";
    t[10062] = "This setting determines the delay between peer test jobs, configured in milliseconds. [Default is 5000]";
    t[10063] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0443 \u043c\u0456\u0436 \u0437\u0430\u0432\u0434\u0430\u043d\u043d\u044f\u043c\u0438 \u0442\u0435\u0441\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0456\u0440\u0456\u0432, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0443 \u0432 \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 5000]";
    t[10072] = "A guide to reseeding the router";
    t[10073] = "\u041f\u043e\u0441\u0456\u0431\u043d\u0438\u043a \u0456\u0437 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "\u0421\u043f\u0438\u0441\u043e\u043a \u043a\u0440\u0430\u0457\u043d, \u0443\u0437\u044f\u0442\u0438\u0439 \u0437\u0456 <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>\u0417\u0432\u0456\u0442\u0443 \u043f\u0440\u043e \u0441\u0432\u043e\u0431\u043e\u0434\u0443 \u0443 \u0441\u0432\u0456\u0442\u0456</a>, \u0449\u043e \u043c\u0430\u044e\u0442\u044c \u0441\u043b\u0430\u0431\u043a\u0443 \u0440\u0435\u043f\u0443\u0442\u0430\u0446\u0456\u044e \u0443 \u0441\u0444\u0435\u0440\u0456 \u0433\u0440\u043e\u043c\u0430\u0434\u044f\u043d\u0441\u044c\u043a\u0438\u0445 \u0441\u0432\u043e\u0431\u043e\u0434. \u0426\u0435\u0439 \u0441\u043f\u0438\u0441\u043e\u043a \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u043f\u0435\u0440\u0435\u0432\u0435\u0434\u0435\u043d\u043d\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432, \u0449\u043e \u043f\u0440\u0430\u0446\u044e\u044e\u0442\u044c \u0443 \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0445 \u043a\u0440\u0430\u0457\u043d\u0430\u0445, \u0443 \u0440\u0435\u0436\u0438\u043c <i>\u041f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u043e\u0433\u043e</i> \u0434\u043b\u044f \u043f\u0456\u0434\u0432\u0438\u0449\u0435\u043d\u043d\u044f \u0431\u0435\u0437\u043f\u0435\u043a\u0438 \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0456\u0432. \u041d\u0430\u0441\u0442\u0443\u043f\u043d\u0456 \u043a\u0440\u0430\u0457\u043d\u0438 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u0456 \u044f\u043a \u0441\u0443\u0432\u043e\u0440\u0456: \u0410\u0444\u0433\u0430\u043d\u0456\u0441\u0442\u0430\u043d, \u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d, \u0411\u0430\u0445\u0440\u0435\u0439\u043d, \u0411\u0456\u043b\u043e\u0440\u0443\u0441\u044c, \u0411\u0440\u0443\u043d\u0435\u0439, \u0411\u0443\u0440\u0443\u043d\u0434\u0456, \u041a\u0430\u043c\u0435\u0440\u0443\u043d, \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u044c\u043a\u0430 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0456\u043a\u0430, \u0427\u0430\u0434, \u041a\u0438\u0442\u0430\u0439, \u041a\u0443\u0431\u0430, \u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u043d\u0430 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0456\u043a\u0430 \u041a\u043e\u043d\u0433\u043e, \u0404\u0433\u0438\u043f\u0435\u0442, \u0415\u043a\u0432\u0430\u0442\u043e\u0440\u0456\u0430\u043b\u044c\u043d\u0430 \u0413\u0432\u0456\u043d\u0435\u044f, \u0415\u0440\u0438\u0442\u0440\u0435\u044f, \u0415\u0444\u0456\u043e\u043f\u0456\u044f, \u0406\u0440\u0430\u043d, \u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d, \u041b\u0430\u043e\u0441, \u041b\u0456\u0432\u0456\u044f, \u041c'\u044f\u043d\u043c\u0430, \u041f\u0456\u0432\u043d\u0456\u0447\u043d\u0430 \u041a\u043e\u0440\u0435\u044f, \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u0456 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u0457, \u0420\u0443\u0430\u043d\u0434\u0430, \u0421\u0430\u0443\u0434\u0456\u0432\u0441\u044c\u043a\u0430 \u0410\u0440\u0430\u0432\u0456\u044f, \u0421\u043e\u043c\u0430\u043b\u0456, \u041f\u0456\u0432\u0434\u0435\u043d\u043d\u0438\u0439 \u0421\u0443\u0434\u0430\u043d, \u0421\u0443\u0434\u0430\u043d, \u0415\u0441\u0432\u0430\u0442\u0456\u043d\u0456 (\u0421\u0432\u0430\u0437\u0456\u043b\u0435\u043d\u0434), \u0421\u0438\u0440\u0456\u044f, \u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d, \u0422\u0430\u0457\u043b\u0430\u043d\u0434, \u0422\u0443\u0440\u0435\u0447\u0447\u0438\u043d\u0430, \u0422\u0443\u0440\u043a\u043c\u0435\u043d\u0456\u0441\u0442\u0430\u043d, \u0412\u0435\u043d\u0435\u0441\u0443\u0435\u043b\u0430, \u041e\u0431'\u0454\u0434\u043d\u0430\u043d\u0456 \u0410\u0440\u0430\u0431\u0441\u044c\u043a\u0456 \u0415\u043c\u0456\u0440\u0430\u0442\u0438, \u0423\u0437\u0431\u0435\u043a\u0438\u0441\u0442\u0430\u043d, \u0417\u0430\u0445\u0456\u0434\u043d\u0430 \u0421\u0430\u0445\u0430\u0440\u0430, \u0404\u043c\u0435\u043d.";
