    t[10295] = "\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u0438\u0439 \u0432\u0438\u0431\u0456\u0440 \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0438, \u044f\u043a\u0438\u0439 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0438\u0439 \u0434\u043b\u044f \u043c\u043e\u043d\u0456\u0442\u043e\u0440\u0438\u043d\u0433\u0443 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430. \u0422\u0443\u0442 \u043d\u0430\u0432\u0435\u0434\u0435\u043d\u043e \u043b\u0438\u0448\u0435 \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u0447\u043d\u0456 \u0434\u0430\u043d\u0456, \u044f\u043a\u0456 \u043c\u0430\u044e\u0442\u044c \u043d\u0435\u043e\u0431\u043e\u0432\u2019\u044f\u0437\u043a\u043e\u0432\u0438\u0439 \u0433\u0440\u0430\u0444\u0456\u043a; \u0449\u043e\u0431 \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u0443\u0442\u0438 \u043f\u043e\u0432\u043d\u0438\u0439 \u0441\u043f\u0438\u0441\u043e\u043a \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u043e\u0457 \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0438, \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u044c\u0442\u0435 <a href=\"/stats\">\u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0438</a>.";
