    t[10306] = "Once green stars are indicated next to your Local Tunnels, there is a wide variety of things you can do with I2P.";
    t[10307] = "\u041a\u043e\u043b\u0438 \u043f\u043e\u0440\u0443\u0447 \u0456\u0437 \u0432\u0430\u0448\u0438\u043c\u0438 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u043c\u0438 \u0442\u0443\u043d\u0435\u043b\u044f\u043c\u0438 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u044e\u0442\u044c\u0441\u044f \u0437\u0435\u043b\u0435\u043d\u0456 \u0437\u0456\u0440\u043e\u0447\u043a\u0438, \u0437 I2P+ \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0440\u043e\u0431\u0438\u0442\u0438 \u0431\u0430\u0433\u0430\u0442\u043e \u0440\u0435\u0447\u0435\u0439.";
    t[10312] = "Please wait for routing commitment to expire for {0} tunnel";
    t[10313] = new java.lang.String[] { "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0437\u0430\u0447\u0435\u043a\u0430\u0439\u0442\u0435, \u043f\u043e\u043a\u0438 \u0442\u0435\u0440\u043c\u0456\u043d \u0434\u0456\u0457 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u0457 \u0437\u0430\u043a\u0456\u043d\u0447\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0442\u0443\u043d\u0435\u043b\u044e {0}", "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0437\u0430\u0447\u0435\u043a\u0430\u0439\u0442\u0435, \u043f\u043e\u043a\u0438 \u0442\u0435\u0440\u043c\u0456\u043d \u0434\u0456\u0457 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u0457 \u0437\u0430\u043a\u0456\u043d\u0447\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f {0} \u0442\u0443\u043d\u0435\u043b\u0456\u0432", "\u0411\u0443\u0434\u044c \u043b\u0430\u0441\u043a\u0430, \u0437\u0430\u0447\u0435\u043a\u0430\u0439\u0442\u0435, \u043f\u043e\u043a\u0438 \u0442\u0435\u0440\u043c\u0456\u043d \u0434\u0456\u0457 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u0457 \u0437\u0430\u043a\u0456\u043d\u0447\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f {0} \u0442\u0443\u043d\u0435\u043b\u0456\u0432" };
    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "\u042f\u043a\u0449\u043e \u0446\u0435 \u043c\u043e\u0436\u043b\u0438\u0432\u043e, \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435, \u0449\u043e\u0431 I2P+/Java \u043c\u0430\u0432 \u0434\u0432\u043e\u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u043f\u043e\u0440\u0442\u0456\u0432 \u0447\u0435\u0440\u0435\u0437 \u0406\u043d\u0442\u0435\u0440\u043d\u0435\u0442, \u043d\u0430\u043b\u0435\u0436\u043d\u0438\u043c \u0447\u0438\u043d\u043e\u043c \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0432\u0448\u0438 \u043c\u043e\u0434\u0435\u043c, \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0430\u0431\u043e \u0444\u0430\u0439\u0440\u0432\u043e\u043b \u041f\u041a. \u042f\u043a\u0449\u043e \u0432\u0438 \u0437\u0430 \u0437\u0430\u0445\u0438\u0441\u043d\u0438\u043c \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u043e\u043c, \u0430\u043b\u0435 \u043c\u0430\u0454\u0442\u0435 \u043d\u0435\u043e\u0431\u043c\u0435\u0436\u0435\u043d\u0438\u0439 \u0432\u0438\u0445\u0456\u0434\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f, I2P+ \u0432\u0441\u0435 \u043e\u0434\u043d\u043e \u0437\u043c\u043e\u0436\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438; \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u043c\u043a\u043d\u0443\u0442\u0438 \u0432\u0445\u0456\u0434\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f \u0442\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>\u0432\u0438\u044f\u0432\u043b\u0435\u043d\u043d\u044f IP-\u0430\u0434\u0440\u0435\u0441\u0438 SSU</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>\u043f\u0440\u043e\u0431\u0438\u0432 \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u0443</a>) \u0434\u043b\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456, \u0430 \u0441\u0442\u0430\u0442\u0443\u0441 \u043c\u0435\u0440\u0435\u0436\u0456 \u0432 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 \u0431\u0443\u0434\u0435 \u043f\u043e\u043a\u0430\u0437\u0443\u0432\u0430\u0442\u0438 \"\u0421\u0442\u0430\u0442\u0443\u0441: \u0417\u0430 \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u043e\u043c\". \u0414\u043b\u044f \u043e\u043f\u0442\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0457 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0456 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435, \u0449\u043e\u0431 \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u0456\u0439 \u043f\u043e\u0440\u0442 I2P <a href=/confignet#udpconfig>\u0431\u0443\u0432 \u0432\u0438\u0434\u0438\u043c\u0438\u0439 \u0437 \u0406\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0443</a> (\u0434\u0438\u0432\u0456\u0442\u044c\u0441\u044f \u043d\u0438\u0436\u0447\u0435 \u0434\u043b\u044f \u0431\u0456\u043b\u044c\u0448\u043e\u0457 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457).";
