    t[10651] = "\u0414\u0443\u0431\u043b\u044e\u0432\u0430\u043d\u043d\u044f \u043f\u0430\u043a\u0435\u0442\u0456\u0432, \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u0438\u0445 \u0432\u0456\u0434 \u0432\u0443\u0437\u043b\u0430";
    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "\u0421\u0435\u0440\u0432\u0456\u0441\u0438 \u043c\u043e\u0436\u0443\u0442\u044c \u043e\u0431\u0441\u043b\u0443\u0433\u043e\u0432\u0443\u0432\u0430\u0442\u0438\u0441\u044f \u043e\u0434\u043d\u043e\u0447\u0430\u0441\u043d\u043e \u043d\u0430 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u0445 \u0448\u043b\u044f\u0445\u043e\u043c \u0441\u043f\u0456\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0442\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u0433\u043e \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u043e\u0433\u043e \u043a\u043b\u044e\u0447\u0430 \u0434\u043b\u044f \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f. \u0411\u0430\u0433\u0430\u0442\u043e\u0430\u0434\u0440\u0435\u0441\u043d\u0456\u0441\u0442\u044c \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u043e \u043c\u043e\u0436\u0435 \u043f\u0456\u0434\u0432\u0438\u0449\u0438\u0442\u0438 \u0431\u0435\u0437\u043f\u0435\u043a\u0443 \u0456 \u0441\u0442\u0456\u0439\u043a\u0456\u0441\u0442\u044c \u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0443\u044e\u0447\u0438 \u0440\u0435\u0437\u0435\u0440\u0432\u0443\u0432\u0430\u043d\u043d\u044f; \u044f\u043a\u0449\u043e \u0441\u0435\u0440\u0432\u0435\u0440 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0434\u043b\u044f \u0431\u0430\u0433\u0430\u0442\u043e\u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0441\u0442\u0456, \u043a\u043e\u043b\u0438 \u0432 \u043f\u0443\u043b\u0456 \u0441\u0435\u0440\u0432\u0435\u0440\u0456\u0432 \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u043e\u0434\u0438\u043d \u0441\u0435\u0440\u0432\u0435\u0440, \u043d\u0430\u0434\u0430\u043d\u0438\u0439 \u0441\u0435\u0440\u0432\u0456\u0441 \u0437\u0430\u043b\u0438\u0448\u0430\u0442\u0438\u043c\u0435\u0442\u044c\u0441\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u043c, \u0443\u0441\u043a\u043b\u0430\u0434\u043d\u044e\u044e\u0447\u0438 \u043a\u043e\u0440\u0435\u043b\u044f\u0446\u0456\u044e \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0437 \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f\u043c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430.";
    t[10672] = "Client Configuration";
    t[10673] = "\u041a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0430";
    t[10674] = "Ensure your Java is up to date. Version 1.8 or higher is required; version 11 or higher is recommended. Check your Java version at the top of <a href=/info>the router information page</a>.";
    t[10675] = "\u041f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0439\u0442\u0435\u0441\u044f, \u0449\u043e \u0432\u0430\u0448\u0430 Java \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u0430. \u0412\u0438\u043c\u0430\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u0440\u0441\u0456\u044f 1.8 \u0430\u0431\u043e \u0432\u0438\u0449\u0430; \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0454\u0442\u044c\u0441\u044f 11 \u0430\u0431\u043e \u0432\u0438\u0449\u0430. \u041f\u0435\u0440\u0435\u0432\u0456\u0440\u0442\u0435 \u0432\u0435\u0440\u0441\u0456\u044e Java \u043d\u0430 \u0432\u0435\u0440\u0445\u043d\u0456\u0439 \u0447\u0430\u0441\u0442\u0438\u043d\u0456 <a href=/info>\u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440</a>.";
