    t[10706] = "They offered to introduce us";
    t[10707] = "\u0412\u043e\u043d\u0438 \u043f\u0440\u043e\u043f\u043e\u043d\u0443\u044e\u0442\u044c \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0438 \u043d\u0430\u0441";
    t[10708] = "Performing a soft restart";
    t[10709] = "\u0412\u0438\u043a\u043e\u043d\u0430\u043d\u043d\u044f \u043c'\u044f\u043a\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443";
    t[10710] = "The process of acquiring router identities, normally via <i>clearnet</i> servers, to ensure your router can communicate and build tunnels with other routers on the network. When a router has no router identities for other peers (usually immediately after installation), the process of reseeding is also referred to as <i>bootstrapping</i>.";
    t[10711] = "\u041f\u0440\u043e\u0446\u0435\u0441 \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043d\u044f \u0456\u0434\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0442\u043e\u0440\u0456\u0432 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432, \u0437\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u0447\u0435\u0440\u0435\u0437 \u0441\u0435\u0440\u0432\u0435\u0440\u0438 <i>\u0432\u0456\u0434\u043a\u0440\u0438\u0442\u043e\u0457 \u043c\u0435\u0440\u0435\u0436\u0456</i>, \u0449\u043e\u0431 \u0433\u0430\u0440\u0430\u043d\u0442\u0443\u0432\u0430\u0442\u0438 \u043c\u043e\u0436\u043b\u0438\u0432\u0456\u0441\u0442\u044c \u043a\u043e\u043c\u0443\u043d\u0456\u043a\u0430\u0446\u0456\u0457 \u0442\u0430 \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0438 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456. \u041a\u043e\u043b\u0438 \u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u043d\u0435\u043c\u0430\u0454 \u0456\u0434\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0442\u043e\u0440\u0456\u0432 \u0456\u043d\u0448\u0438\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432 (\u0437\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u043e\u0434\u0440\u0430\u0437\u0443 \u043f\u0456\u0441\u043b\u044f \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f), \u043f\u0440\u043e\u0446\u0435\u0441 \u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u0456\u043d\u043d\u044f \u0442\u0430\u043a\u043e\u0436 \u043d\u0430\u0437\u0438\u0432\u0430\u044e\u0442\u044c <i>\u0437\u0430\u043f\u0443\u0441\u043a\u043e\u043c</i>.";
    t[10712] = "Direction/Introduction";
    t[10713] = "\u041d\u0430\u043f\u0440\u044f\u043c\u043e\u043a/\u0412\u0432\u0435\u0434\u0435\u043d\u043d\u044f";
    t[10718] = "NTCP";
    t[10719] = "NTCP";
