    t[10731] = "\u041f\u041e\u041f\u0415\u0420\u0415\u0414\u0416\u0415\u041d\u041d\u042f \u0410\u041d\u041e\u041d\u0406\u041c\u041d\u041e\u0421\u0422\u0406: \u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c \u0442\u0443\u043d\u0435\u043b\u0456 \u0431\u0435\u0437 \u0445\u043e\u043f\u0456\u0432.";
