    t[10738] = "TheAtlantic";
    t[10739] = "TheAtlantic";
    t[10740] = "Warning: could not set the I2P+ service to autostart";
    t[10741] = "\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u0436\u0435\u043d\u043d\u044f: \u043d\u0435 \u0432\u0434\u0430\u043b\u043e\u0441\u044f \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0430\u0432\u0442\u043e\u0437\u0430\u043f\u0443\u0441\u043a \u0441\u043b\u0443\u0436\u0431\u0438 I2P";
    t[10746] = "A tunnel used by the router for communicating with other routers to perform various \"housekeeping\" functions such as learning and publishing <i>leasesets</i>, testing client tunnels, and learning about and validating other routers in the network. These tunnels are normally low-bandwidth.";
    t[10747] = "\u0422\u0443\u043d\u0435\u043b\u044c, \u044f\u043a\u0438\u0439 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0434\u043b\u044f \u043a\u043e\u043c\u0443\u043d\u0456\u043a\u0430\u0446\u0456\u0457 \u0437 \u0456\u043d\u0448\u0438\u043c\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438 \u0434\u043b\u044f \u0432\u0438\u043a\u043e\u043d\u0430\u043d\u043d\u044f \u0440\u0456\u0437\u043d\u0438\u0445 \u0444\u0443\u043d\u043a\u0446\u0456\u0439 \u00ab\u0443\u043f\u0440\u0430\u0432\u043b\u0456\u043d\u043d\u044f \u0431\u0443\u0434\u0438\u043d\u043a\u043e\u043c\u00bb, \u0442\u0430\u043a\u0438\u0445 \u044f\u043a \u0432\u0438\u0432\u0447\u0435\u043d\u043d\u044f \u0442\u0430 \u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0446\u0456\u044f <i>\u043d\u0430\u0431\u043e\u0440\u0456\u0432 \u043e\u0440\u0435\u043d\u0434\u0438</i>, \u0442\u0435\u0441\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0456 \u0432\u0438\u0432\u0447\u0435\u043d\u043d\u044f \u0442\u0430 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0430 \u0456\u043d\u0448\u0438\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456. \u0426\u0456 \u0442\u0443\u043d\u0435\u043b\u0456, \u044f\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u043c\u0430\u044e\u0442\u044c \u043d\u0435\u0432\u0435\u043b\u0438\u043a\u0443 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u0443 \u0437\u0434\u0430\u0442\u043d\u0456\u0441\u0442\u044c.";
    t[10752] = "Debug";
    t[10753] = "\u041d\u0430\u043b\u0430\u0433\u043e\u0434\u0436\u0435\u043d\u043d\u044f";
    t[10760] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining.";
    t[10761] = "\u041f\u043e\u0432\u0442\u043e\u0440\u043d\u0435 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u2014 \u0446\u0435 \u043f\u0440\u043e\u0446\u0435\u0441 \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u043e\u0433\u043e \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f, \u044f\u043a\u0438\u0439 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u043f\u043e\u0448\u0443\u043a\u0443 \u0456\u043d\u0448\u0438\u0445 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456\u0432, \u043a\u043e\u043b\u0438 \u0432\u0438 \u0432\u043f\u0435\u0440\u0448\u0435 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u044e\u0454\u0442\u0435 I2P \u0430\u0431\u043e \u043a\u043e\u043b\u0438 \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456 \u0437\u0430\u043b\u0438\u0448\u0438\u043b\u043e\u0441\u044f \u0437\u0430\u043d\u0430\u0434\u0442\u043e \u043c\u0430\u043b\u043e \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u044c \u043d\u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440.";
    t[10766] = "An alternative implementation of an I2P router coded in C++. For more information, see <a href=https://i2pd.website/ class='sitelink external' target=_blank rel=noreferrer>https://i2pd.website/</a> Source code is available on <a href=https://github.com/PurpleI2P/i2pd class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[10767] = "\u0410\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0430 \u0440\u0435\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044f \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 I2P \u043d\u0430 \u043c\u043e\u0432\u0456 C++. \u0414\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u0443 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044e \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u043d\u0430 <a href=https://i2pd.website/ class='sitelink external' target=_blank rel=noreferrer>https://i2pd.website/</a> \u0412\u0438\u0445\u0456\u0434\u043d\u0438\u0439 \u043a\u043e\u0434 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0438\u0439 \u043d\u0430 <a href=https://github.com/PurpleI2P/i2pd class='sitelink external' target=_blank rel=noreferrer>github</a>.";
