    t[10773] = "\u0420\u043e\u0437\u0431\u0438\u0432\u0441\u044f";
    t[10786] = "Manage I2P client and server tunnels to access or provide network services";
    t[10787] = "\u041a\u0435\u0440\u0443\u0439\u0442\u0435 \u0442\u0443\u043d\u0435\u043b\u044f\u043c\u0438 \u043a\u043b\u0456\u0454\u043d\u0442\u0430 \u0442\u0430 \u0441\u0435\u0440\u0432\u0435\u0440\u0430 I2P \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0430\u0431\u043e \u043d\u0430\u0434\u0430\u043d\u043d\u044f \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u0438\u0445 \u043f\u043e\u0441\u043b\u0443\u0433";
    t[10790] = "Homepage Customization";
    t[10791] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0434\u043e\u043c\u0430\u0448\u043d\u044c\u043e\u0457 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438";
    t[10798] = "UPnP is used to communicate with Internet Gateway Devices (IGDs) to detect the external IP address and forward ports.";
    t[10799] = "UPnP \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043b\u044f \u0437\u0432\u2019\u044f\u0437\u043a\u0443 \u0437 \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u044f\u043c\u0438 \u0406\u043d\u0442\u0435\u0440\u043d\u0435\u0442-\u0448\u043b\u044e\u0437\u0443 (IGD) \u0434\u043b\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u044c\u043e\u0457 IP-\u0430\u0434\u0440\u0435\u0441\u0438 \u0442\u0430 \u043f\u043e\u0440\u0442\u0456\u0432 \u043f\u0435\u0440\u0435\u0430\u0434\u0440\u0435\u0441\u0430\u0446\u0456\u0457.";
    t[10810] = "(use 'd' = date, 'c' = class, 't' = thread, 'p' = priority, 'm' = message)";
    t[10811] = "(\u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439\u0442\u0435 'd' = \u0434\u0430\u0442\u0430, 'c' = \u043a\u043b\u0430\u0441, 't' = \u043f\u043e\u0442\u0456\u043a, 'p' = \u043f\u0440\u0456\u043e\u0440\u0438\u0442\u0435\u0442, 'm' = \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f)";
    t[10816] = "Open in new tab";
    t[10817] = "\u0412\u0456\u0434\u043a\u0440\u0438\u0442\u0438 \u0432 \u043d\u043e\u0432\u0456\u0439 \u0432\u043a\u043b\u0430\u0434\u0446\u0456";
    t[10818] = "As the firewall detection methods are not 100% reliable, this may occasionally be displayed in error.";
    t[10819] = "\u041e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u043c\u0435\u0442\u043e\u0434\u0438 \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u0456\u0432 \u043d\u0435 \u0454 100% \u043d\u0430\u0434\u0456\u0439\u043d\u0438\u043c\u0438, \u0446\u0435 \u043c\u043e\u0436\u0435 \u043f\u0440\u0438\u0439\u043e\u043c\u043d\u043e \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0442\u0438\u0441\u044f \u043f\u043e\u043c\u0438\u043b\u043a\u043e\u0432\u043e.";
