    t[11003] = "\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0430 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u044f";
    t[11006] = "Set password required to access this service";
    t[11007] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u043f\u0430\u0440\u043e\u043b\u044c, \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u0438\u0439 \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0434\u043e \u0446\u0456\u0454\u0457 \u0441\u043b\u0443\u0436\u0431\u0438";
    t[11008] = "Numeric definition of the number of connection attempts in the period specified (in seconds) e.g. <i class=example>15/5</i>, <i class=example>60/60</i> etc.";
    t[11009] = "\u0427\u0438\u0441\u043b\u043e\u0432\u0435 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043a\u0456\u043b\u044c\u043a\u043e\u0441\u0442\u0456 \u0441\u043f\u0440\u043e\u0431 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0437\u0430 \u0432\u043a\u0430\u0437\u0430\u043d\u0438\u0439 \u043f\u0435\u0440\u0456\u043e\u0434 (\u0432 \u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445), \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 <i class=example>15/5</i>, <i class=example>60/60</i> \u0442\u043e\u0449\u043e.";
    t[11018] = "32bit host OS running with less than 4 detected cores";
    t[11019] = "32-\u0440\u043e\u0437\u0440\u044f\u0434\u043d\u0430 \u0445\u043e\u0441\u0442-\u041e\u0421 \u043f\u0440\u0430\u0446\u044e\u0454 \u0437 \u043c\u0435\u043d\u0448 \u043d\u0456\u0436 4 \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u0438\u043c\u0438 \u044f\u0434\u0440\u0430\u043c\u0438";
    t[11020] = "Cannot copy plugin to directory {0}";
    t[11021] = "\u041d\u0435\u043c\u043e\u0436\u043b\u0438\u0432\u043e \u0441\u043a\u043e\u043f\u0456\u044e\u0432\u0430\u0442\u0438 \u043f\u043b\u0430\u0433\u0456\u043d \u0432 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0456\u044e {0}";
    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "\u0417\u0430 \u0442\u0438\u043f\u043e\u0432\u043e\u0433\u043e \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f I2P \u0431\u0443\u0434\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0431\u0440\u0430\u0443\u0437\u0435\u0440 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0439 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0456, \u0434\u043b\u044f \u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u043f\u0440\u0438 \u0441\u0442\u0430\u0440\u0442\u0456. \u042f\u043a\u0449\u043e \u0432\u0438 \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0432\u043a\u0430\u0437\u0430\u0442\u0438 \u0430\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0438\u0439 \u0431\u0440\u0430\u0443\u0437\u0435\u0440, \u0432\u0430\u043c \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e \u0431\u0443\u0434\u0435 \u0432\u0456\u0434\u0440\u0435\u0434\u0430\u0433\u0443\u0432\u0430\u0442\u0438 \u0444\u0430\u0439\u043b router.config (\u0430\u0431\u043e <a href=/configadvanced>\u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0443 \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0445 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c</a>, \u044f\u043a\u0449\u043e \u0432\u0438 \u0443\u0432\u0456\u043c\u043a\u043d\u0443\u043b\u0438 \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0438\u0439 \u0440\u0435\u0436\u0438\u043c \u043a\u043e\u043d\u0441\u043e\u043b\u0456) \u0442\u0430 \u0434\u043e\u0434\u0430\u0442\u0438 \u043d\u043e\u0432\u0443 \u0440\u044f\u0434\u043e\u043a \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 <code>routerconsole.browser=/\u0448\u043b\u044f\u0445/\u0434\u043e/\u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430</code> \u0430\u0431\u043e <code>routerconsole.browser=\\\u0448\u043b\u044f\u0445\\\u0434\u043e\\\u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430.exe</code> \u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443 Windows, \u0437\u0430\u043c\u0456\u043d\u0438\u0432\u0448\u0438 <code>\\\u0448\u043b\u044f\u0445\\\u0434\u043e\\\u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430</code> \u043d\u0430 \u0440\u043e\u0437\u0442\u0430\u0448\u0443\u0432\u0430\u043d\u043d\u044f \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430, \u044f\u043a\u0438\u0439 \u0432\u0438 \u0431\u0430\u0436\u0430\u0454\u0442\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438. \u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f: \u042f\u043a\u0449\u043e \u0448\u043b\u044f\u0445 \u0434\u043e \u043e\u0431\u0440\u0430\u043d\u043e\u0433\u043e \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430 \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043f\u0440\u043e\u0431\u0456\u043b\u0438, \u0432\u0430\u043c, \u043c\u043e\u0436\u043b\u0438\u0432\u043e, \u0437\u043d\u0430\u0434\u043e\u0431\u0438\u0442\u044c\u0441\u044f \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u0442\u0438 \u0448\u043b\u044f\u0445 \u0443 \u043b\u0430\u043f\u043a\u0438, \u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434 <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11028] = "Update check failed for plugin {0}";
    t[11029] = "\u041d\u0435\u043c\u043e\u0436\u043b\u0438\u0432\u043e \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u0438 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0434\u043b\u044f \u043f\u043b\u0430\u0433\u0456\u043d\u0430 {0}";
    t[11032] = "vanilla";
    t[11033] = "\u0432\u0430\u043d\u0456\u043b\u044c";
    t[11038] = "Manual Keyring Addition";
    t[11039] = "\u0414\u043e\u043f\u043e\u0432\u043d\u0435\u043d\u043d\u044f \u0431\u0440\u0435\u043b\u043e\u043a\u0430 \u0432\u0440\u0443\u0447\u043d\u0443";
    t[11054] = "Dir";
    t[11055] = "\u041d\u0430\u043f\u0440\u044f\u043c\u043e\u043a";
    t[11056] = "Install and manage router plugins";
    t[11057] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u043b\u0430\u0433\u0456\u043d\u0456\u0432 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0442\u0430 \u043a\u0435\u0440\u0443\u0432\u0430\u043d\u043d\u044f \u043d\u0438\u043c\u0438";
    t[11078] = "Home";
    t[11079] = "\u0414\u043e\u0434\u043e\u043c\u0443";
    t[11092] = "Retransmitted packets";
    t[11093] = "\u041f\u043e\u0432\u0442\u043e\u0440\u043d\u0456 \u043f\u0430\u043a\u0435\u0442\u0438\u043a\u0438";
    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f (\u0432 \u0433\u043e\u0434\u0438\u043d\u0430\u0445) \u0434\u0430\u0454 \u0437\u043c\u043e\u0433\u0443 \u0432\u0440\u0443\u0447\u043d\u0443 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u0442\u0438 \u0432\u0456\u043a RouterInfo \u0434\u043b\u044f \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0438 \u0417\u0430\u0432\u0434\u0430\u043d\u043d\u044f\u043c \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0432\u0456\u043a RouterInfo \u043f\u0435\u0440\u0435\u0434 \u0437\u0430\u043f\u0443\u0441\u043a\u043e\u043c \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0437\u043c\u0456\u043d\u044e\u0454\u0442\u044c\u0441\u044f \u0432 \u0437\u0430\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0456 \u0432\u0456\u0434 \u0440\u043e\u0437\u043c\u0456\u0440\u0443 NetDb, \u0437\u0431\u0456\u043b\u044c\u0448\u0443\u044e\u0447\u0438\u0441\u044c \u043f\u0440\u0438 \u0437\u0440\u043e\u0441\u0442\u0430\u043d\u043d\u0456 \u0440\u043e\u0437\u043c\u0456\u0440\u0443 NetDb. \u0417\u043d\u0430\u0447\u0435\u043d\u043d\u044f 0 \u043f\u0440\u0438\u043c\u0443\u0441\u0438\u0442\u044c \u0417\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u044f\u0442\u0438 \u043a\u043e\u0436\u0435\u043d \u0440\u043e\u0443\u0442\u0435\u0440 \u0443 NetDb, \u043d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u043e \u0432\u0456\u0434 \u0432\u0456\u043a\u0443.";
    t[11112] = "Show all members of the {0} family in NetDb";
    t[11113] = "\u041f\u043e\u043a\u0430\u0437\u0430\u0442\u0438 \u0432\u0441\u0456\u0445 \u0447\u043b\u0435\u043d\u0456\u0432 \u0440\u043e\u0434\u0438\u043d\u0438 {0} \u0443 NetDb";
    t[11120] = "Failed to install plugin in {0}";
    t[11121] = "\u041d\u0435\u043c\u043e\u0436\u043b\u0438\u0432\u043e \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438 \u043f\u043b\u0430\u0433\u0456\u043d \u0432 {0}";
    t[11124] = "Install from file failed";
    t[11125] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0437 \u0444\u0430\u0439\u043b\u0443 \u043d\u0435\u0432\u0434\u0430\u043b\u043e";
    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "\u0412\u0435\u0431-\u0434\u043e\u0434\u0430\u0442\u043e\u043a I2P, \u044f\u043a\u0435 \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0454 \u0446\u0456\u043b\u044c\u043e\u0432\u0438\u043c\u0438 \u043e\u0431'\u0454\u043a\u0442\u0430\u043c\u0438 \u0434\u043b\u044f \u043c\u0435\u0440\u0435\u0436\u0456, \u0437\u0456\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0447\u0438 \u0445\u0435\u0448\u0456 B64 \u0437 \u043b\u044e\u0434\u0441\u044c\u043a\u043e\u0437\u0440\u043e\u0437\u0443\u043c\u0456\u043b\u0438\u043c\u0438 \u0456\u043c\u0435\u043d\u0430\u043c\u0438. \u0426\u0456\u043b\u044c\u043e\u0432\u0456 \u043e\u0431'\u0454\u043a\u0442\u0438 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0434\u043e\u0434\u0430\u043d\u0456 \u0432\u0440\u0443\u0447\u043d\u0443 \u0430\u0431\u043e \u0447\u0435\u0440\u0435\u0437 \u043f\u0456\u0434\u043f\u0438\u0441\u043a\u0443 \u043d\u0430 \u0444\u0430\u0439\u043b\u0438 hosts.txt. \u0422\u0430\u043a\u043e\u0436 \u0432\u0456\u0434\u043e\u043c\u0438\u0439 \u044f\u043a SusiDNS. \u0414\u043b\u044f \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043d\u044f \u0434\u043e\u0434\u0430\u0442\u043a\u043e\u0432\u043e\u0457 \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457 \u0434\u0438\u0432\u0456\u0442\u044c\u0441\u044f <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>\u043e\u043d\u043b\u0430\u0439\u043d-\u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0456\u044e</a>.";
    t[11130] = "Events per period";
    t[11131] = "\u041f\u043e\u0434\u0456\u0457 \u0437\u0430 \u043f\u0435\u0440\u0456\u043e\u0434";
    t[11134] = "How long before peer gives up resending lost packet";
    t[11135] = "\u042f\u043a \u0434\u043e\u0432\u0433\u043e \u0434\u043e \u0442\u043e\u0433\u043e, \u044f\u043a peer \u0432\u0456\u0434\u043c\u043e\u0432\u0438\u0442\u044c\u0441\u044f \u0432\u0456\u0434 \u0432\u0442\u0440\u0430\u0442\u0438 \u0432\u0442\u0440\u0430\u0447\u0435\u043d\u043e\u0433\u043e \u043f\u0430\u043a\u0435\u0442\u0443";
    t[11140] = "Advanced configuration settings";
    t[11141] = "\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457";
    t[11142] = "Banning will prevent the participation of this peer in tunnels you create.";
    t[11143] = "\u0417\u0430\u0431\u043e\u0440\u043e\u043d\u0430 \u0437\u0430\u0431\u043e\u0440\u043e\u043d\u0438\u0442\u044c \u0443\u0447\u0430\u0441\u0442\u044c \u0446\u044c\u043e\u0433\u043e \u043f\u0430\u0440\u0442\u043d\u0435\u0440\u0430 \u0432 \u0442\u0443\u043d\u0435\u043b\u044f\u0445, \u044f\u043a\u0456 \u0432\u0438 \u0441\u0442\u0432\u043e\u0440\u044e\u0454\u0442\u0435.";
    t[11148] = "UDP Port In Use";
    t[11149] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u043f\u043e\u0440\u0442 UDP";
    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "\u041f\u0440\u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0446\u0456 I2P \u0441\u0442\u0432\u043e\u0440\u044e\u0454\u0442\u044c\u0441\u044f \u0442\u0443\u043d\u0435\u043b\u044c \u0434\u043e \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u0457 IRC-\u043c\u0435\u0440\u0435\u0436\u0456 \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 I2P - Irc2P (\u0434\u0438\u0432. <a href=/i2ptunnelmgr>\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>), \u0456 \u0432\u0456\u043d \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0454\u0442\u044c\u0441\u044f \u043f\u0440\u0438 \u0441\u0442\u0430\u0440\u0442\u0456 \u0440\u043e\u0443\u0442\u0435\u0440\u0430 I2P. \u0429\u043e\u0431 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438\u0441\u044f, \u043d\u0430\u043a\u0430\u0436\u0456\u0442\u044c \u0441\u0432\u043e\u0454\u043c\u0443 IRC-\u043a\u043b\u0456\u0454\u043d\u0442\u0443 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u0438\u0441\u044f \u0434\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0437\u0430 \u0430\u0434\u0440\u0435\u0441\u043e\u044e: <code>127.0.0.1</code> \u043f\u043e\u0440\u0442: <code>6668</code>.";
    t[11154] = "LeaseSet Key";
    t[11155] = "\u041a\u043b\u044e\u0447 LeaseSet";
    t[11160] = "Clock Skew";
    t[11161] = "\u041f\u0435\u0440\u0435\u043a\u0456\u0441 \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u0430";
    t[11166] = "UDP Port";
    t[11167] = "\u043f\u043e\u0440\u0442 UDP";
    t[11176] = "Enter zip or su3 URL";
    t[11177] = "\u0412\u0432\u0435\u0434\u0456\u0442\u044c URL-\u0430\u0434\u0440\u0435\u0441\u0443 zip \u0430\u0431\u043e su3";
    t[11180] = "Configuring I2P for optimal performance";
    t[11181] = "\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f I2P \u0434\u043b\u044f \u043e\u043f\u0442\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0457 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0456";
