    t[11281] = "\u0414\u043b\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u0430\u0442\u0440\u0438\u043c\u043a\u0438 \u043f\u0456\u0440\u0430 \u0446\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0438\u0439 \u0447\u0430\u0441, \u044f\u043a\u0438\u0439 \u043f\u043e\u0432\u0438\u043d\u0435\u043d \u0442\u0440\u0438\u0432\u0430\u0442\u0438 \u0442\u0435\u0441\u0442 \u043f\u0456\u0440\u0430 \u0434\u043e \u0439\u043e\u0433\u043e \u0432\u0438\u0437\u043d\u0430\u043d\u043d\u044f \u043d\u0435\u0432\u0434\u0430\u043b\u0438\u043c, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u0432 \u043c\u0456\u043b\u0456\u0441\u0435\u043a\u0443\u043d\u0434\u0430\u0445. \u0423 \u0440\u0430\u0437\u0456, \u044f\u043a\u0449\u043e \u0442\u0430\u0439\u043c-\u0430\u0443\u0442 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u043e \u043d\u0438\u0436\u0447\u0435, \u043d\u0456\u0436 \u0441\u0435\u0440\u0435\u0434\u043d\u0456\u0439 \u0443\u0441\u043f\u0456\u0448\u043d\u0438\u0439 \u0442\u0435\u0441\u0442, \u0431\u0443\u0434\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u0435 \u0441\u0435\u0440\u0435\u0434\u043d\u0454 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0443\u0441\u043f\u0456\u0448\u043d\u043e\u0433\u043e \u0442\u0435\u0441\u0442\u0443. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c 1000]";
