    t[11376] = "Removed";
    t[11377] = "\u0412\u0438\u0434\u0430\u043b\u0435\u043d\u043e";
    t[11384] = "Click the <i>Start</i> button for your webserver tunnel on the <a href=/i2ptunnelmgr/>main Tunnel Manager page</a>. You should now see it listed under <i>Service Tunnels</i> on the <a href=/>Router Console</a> sidebar. A green star displayed next to the tunnel name (<i>I2P Webserver</i> by default) indicates that your website is active on the I2P network.";
    t[11385] = "\u041d\u0430\u0442\u0438\u0441\u043d\u0456\u0442\u044c \u043a\u043d\u043e\u043f\u043a\u0443 <i>\u0417\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0438</i> \u0434\u043b\u044f \u0442\u0443\u043d\u0435\u043b\u044e \u0432\u0430\u0448\u043e\u0433\u043e \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u043d\u0430 <a href=/i2ptunnelmgr/>\u043e\u0441\u043d\u043e\u0432\u043d\u0456\u0439 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>. \u0422\u0435\u043f\u0435\u0440 \u0432\u0438 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u043f\u043e\u0431\u0430\u0447\u0438\u0442\u0438 \u0439\u043e\u0433\u043e \u0443 \u0440\u043e\u0437\u0434\u0456\u043b\u0456 <i>\u0421\u0435\u0440\u0432\u0456\u0441\u043d\u0456 \u0442\u0443\u043d\u0435\u043b\u0456</i> \u0432 \u0431\u043e\u043a\u043e\u0432\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 <a href=/>\u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430</a>. \u0417\u0435\u043b\u0435\u043d\u0430 \u0437\u0456\u0440\u043e\u0447\u043a\u0430 \u0431\u0456\u043b\u044f \u043d\u0430\u0437\u0432\u0438 \u0442\u0443\u043d\u0435\u043b\u044e (<i>I2P Webserver</i> \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c) \u043e\u0437\u043d\u0430\u0447\u0430\u0454, \u0449\u043e \u0432\u0430\u0448 \u0441\u0430\u0439\u0442 \u0430\u043a\u0442\u0438\u0432\u043d\u0438\u0439 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P.";
