    t[11509] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0442\u044c \u0441\u043b\u0443\u0436\u0431\u0443 I2P";
    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "\u0414\u043b\u044f \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0454\u0434\u0438\u043d\u043e\u0433\u043e \u043d\u0430\u0431\u043e\u0440\u0443 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0434\u043b\u044f \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432, \u043a\u043b\u0456\u0454\u043d\u0442\u0438 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0456 \u0432 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0456 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 <i>Tunnel Manager</i> \u0434\u043b\u044f \u0440\u043e\u0431\u043e\u0442\u0438 \u0432 \u0440\u0435\u0436\u0438\u043c\u0456 <i>\u0421\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u043a\u043b\u0456\u0454\u043d\u0442</i>. \u0426\u0435\u0439 \u0440\u0435\u0436\u0438\u043c \u0435\u043a\u043e\u043d\u043e\u043c\u0438\u0442\u044c \u0440\u0435\u0441\u0443\u0440\u0441\u0438 \u0442\u0430 \u043e\u0431'\u0454\u0434\u043d\u0443\u0454 \u0442\u0440\u0430\u0444\u0456\u043a \u0432\u0456\u0434 \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u043a\u043b\u0456\u0454\u043d\u0442\u0456\u0432 \u0432 \u0454\u0434\u0438\u043d\u0438\u0439 \u043d\u0430\u0431\u0456\u0440 \u0442\u0443\u043d\u0435\u043b\u0456\u0432, \u0443\u0441\u043a\u043b\u0430\u0434\u043d\u044e\u044e\u0447\u0438 \u0430\u043d\u0430\u043b\u0456\u0437 \u0442\u0440\u0430\u0444\u0456\u043a\u0443. \u041a\u043b\u0456\u0454\u043d\u0442\u0438, \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0456 \u044f\u043a \u0441\u043f\u0456\u043b\u044c\u043d\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0438, \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0442\u044c \u043e\u0434\u043d\u0430\u043a\u043e\u0432\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0443\u043d\u0435\u043b\u0456\u0432.";
