    t[11656] = "Recent code changes to I2P+";
    t[11657] = "\u041e\u0441\u0442\u0430\u043d\u043d\u0456 \u0437\u043c\u0456\u043d\u0438 \u043a\u043e\u0434\u0443 \u0434\u043e I2P+";
    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "\u0412\u0430\u0448 \u043c\u043e\u0434\u0435\u043c \u0430\u0431\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u043c\u043e\u0436\u0435 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u0442\u0438 <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), \u0449\u043e \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u0435 \u043f\u0440\u043e\u0431\u0438\u0432\u0430\u043d\u043d\u044f \u043f\u043e\u0440\u0442\u0456\u0432. \u041f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0439\u0442\u0435\u0441\u044f, \u0449\u043e \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u043a\u0430 UPnP \u0434\u043b\u044f I2P+ \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u0430 \u043d\u0430 <a href=/confignet>\u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457</a>, \u043f\u043e\u0442\u0456\u043c \u0441\u043f\u0440\u043e\u0431\u0443\u0439\u0442\u0435 \u0430\u043a\u0442\u0438\u0432\u0443\u0432\u0430\u0442\u0438 UPnP \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 \u043c\u043e\u0434\u0435\u043c\u0456/\u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0456, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0432\u0430\u0448\u043e\u043c\u0443 \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440\u0456. \u0422\u0435\u043f\u0435\u0440 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c <a href=/>\u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 I2P+</a>. \u042f\u043a\u0449\u043e \u0432\u0441\u0435 \u043f\u0440\u043e\u0439\u0448\u043b\u043e \u0443\u0441\u043f\u0456\u0448\u043d\u043e, I2P+ \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u0438\u0442\u044c \"\u0421\u0442\u0430\u0442\u0443\u0441: OK\" \u043d\u0430 \u0431\u0456\u0447\u043d\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 \u043f\u0456\u0441\u043b\u044f \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u044f \u043f\u043e\u0447\u0430\u0442\u043a\u043e\u0432\u0438\u0445 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043e\u043a \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f.";
