    t[11836] = "When set to true, the router will change its identity and UDP port when the router restarts and then delete the key from router.config to prevent further changes. [Default is false]";
    t[11837] = "\u041a\u043e\u043b\u0438 \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e true, \u0440\u043e\u0443\u0442\u0435\u0440 \u0437\u043c\u0456\u043d\u0438\u0442\u044c \u0441\u0432\u043e\u044e \u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c \u0456 UDP-\u043f\u043e\u0440\u0442 \u043f\u0440\u0438 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443 \u0440\u043e\u0443\u0442\u0435\u0440\u0430, \u0430 \u043f\u043e\u0442\u0456\u043c \u0432\u0438\u0434\u0430\u043b\u0438\u0442\u044c \u043a\u043b\u044e\u0447 \u0437 router.config, \u0449\u043e\u0431 \u0437\u0430\u043f\u043e\u0431\u0456\u0433\u0442\u0438 \u043f\u043e\u0434\u0430\u043b\u044c\u0448\u0438\u043c \u0437\u043c\u0456\u043d\u0430\u043c. [\u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c false]";
    t[11838] = "Direction";
