    t[11858] = "Highlight and copy the entire <i>Local destination</i> on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[11859] = "\u0412\u0438\u0434\u0456\u043b\u0456\u0442\u044c \u0456 \u0441\u043a\u043e\u043f\u0456\u044e\u0439\u0442\u0435 \u043f\u043e\u0432\u043d\u0443 <i>\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0443 \u0430\u0434\u0440\u0435\u0441\u0443</i> \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='/i2ptunnel/edit?tunnel=3'>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0442\u0443\u043d\u0435\u043b\u0456\u0432</a>.";
    t[11870] = "Tick the box marked <i>Use this proxy server for all protocols</i> to avoid requests escaping the proxy.";
