    t[11893] = "\u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u044c \u043d\u0435 \u0437\u0430\u0440\u0435\u0454\u0441\u0442\u0440\u043e\u0432\u0430\u043d\u0438\u0439, \u043d\u0435 \u043c\u043e\u0436\u0435 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u0438\u0442\u0438 \u043d\u0430\u044f\u0432\u043d\u0456\u0441\u0442\u044c \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u044c";
    t[11896] = "Runs";
    t[11897] = "\u0411\u0456\u0436\u0438\u0442\u044c";
    t[11898] = "addressbook";
    t[11899] = "\u0430\u0434\u0440\u0435\u0441\u043d\u0430 \u043a\u043d\u0438\u0433\u0430";
    t[11902] = "Error 404";
    t[11903] = "\u041f\u043e\u043c\u0438\u043b\u043a\u0430 404";
    t[11916] = "You must never advertise an unroutable IP address such as 127.0.0.1 or 192.168.1.1 as your external address.";
    t[11917] = "\u0412\u0438 \u043d\u0456\u043a\u043e\u043b\u0438 \u043d\u0435 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0440\u0435\u043a\u043b\u0430\u043c\u0443\u0432\u0430\u0442\u0438 \u043d\u0435\u0440\u043e\u0443\u0442\u0438\u043d\u0433\u043e\u0432\u0443 IP-\u0430\u0434\u0440\u0435\u0441\u0443, \u0442\u0430\u043a\u0443 \u044f\u043a 127.0.0.1 \u0430\u0431\u043e 192.168.1.1 \u044f\u043a \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u044e \u0430\u0434\u0440\u0435\u0441\u0443.";
    t[11930] = "This file will never contain your own router's identity or IP.";
    t[11931] = "\u0426\u0435\u0439 \u0444\u0430\u0439\u043b \u043d\u0456\u043a\u043e\u043b\u0438 \u043d\u0435 \u043c\u0456\u0441\u0442\u0438\u0442\u0438\u043c\u0435 \u0456\u0434\u0435\u043d\u0442\u0438\u0444\u0456\u043a\u0430\u0446\u0456\u0439\u043d\u0456 \u0434\u0430\u043d\u0456 \u0447\u0438 IP-\u0430\u0434\u0440\u0435\u0441\u0443 \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430.";
    t[11936] = "Advancing a balanced &amp; realistic understanding of American interests in the Middle East";
    t[11937] = "\u041f\u0440\u043e\u0441\u0443\u0432\u0430\u043d\u043d\u044f \u0437\u0431\u0430\u043b\u0430\u043d\u0441\u043e\u0432\u0430\u043d\u0435";
    t[11946] = "Error saving the configuration (applied but not saved) - please see the error logs";
    t[11947] = "\u041f\u043e\u043c\u0438\u043b\u043a\u0430 \u043f\u0440\u0438 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u043d\u0456 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u044c (\u0437\u0430\u0441\u0442\u043e\u0441\u043e\u0432\u0430\u043d\u043e, \u0430\u043b\u0435 \u043d\u0435 \u0437\u0431\u0435\u0440\u0435\u0435\u0436\u0435\u043d\u043e), \u043f\u0435\u0440\u0435\u0433\u043b\u044f\u043d\u044c\u0442\u0435 \u043b\u043e\u0433\u0438 \u043f\u043e\u043c\u0438\u043b\u043e\u043a";
    t[11950] = "F.A.Q.";
    t[11951] = "\u0427\u0430\u0441\u0442\u0456 \u0437\u0430\u043f\u0438\u0442\u0430\u043d\u043d\u044f";
    t[11962] = "Peers marked as high capacity that also meet or exceed speed average for all profiled peers.";
    t[11963] = "\u041e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0456 \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u0457, \u043f\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0456 \u044f\u043a \u0432\u0438\u0441\u043e\u043a\u043e\u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u0456, \u044f\u043a\u0456 \u0442\u0430\u043a\u043e\u0436 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u044e\u0442\u044c \u0430\u0431\u043e \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u044e\u0442\u044c \u0441\u0435\u0440\u0435\u0434\u043d\u044e \u0448\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u0434\u043b\u044f \u0432\u0441\u0456\u0445 \u043f\u0440\u043e\u0444\u0456\u043b\u044c\u043e\u0432\u0430\u043d\u0438\u0445 \u043e\u0434\u043d\u043e\u0440\u0430\u043d\u0433\u043e\u0432\u0438\u0445 \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u0457\u0432.";
    t[11964] = "Local connection to wrapper control channel port";
    t[11965] = "\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0435 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043f\u043e\u0440\u0442\u0443 \u043a\u0430\u043d\u0430\u043b\u0443 \u0443\u043f\u0440\u0430\u0432\u043b\u0456\u043d\u043d\u044f \u043e\u0431\u0433\u043e\u0440\u0442\u043a\u0438";
    t[11982] = "If your TCP port is firewalled with inbound TCP enabled, routers will not be able to contact you via TCP, which will hurt the network.";
    t[11983] = "\u042f\u043a\u0449\u043e \u0432\u0430\u0448 TCP-\u043f\u043e\u0440\u0442 \u0431\u0443\u0434\u0435 \u0437\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u0438\u0439 \u0444\u0430\u0454\u0440\u0432\u043e\u043b\u043e\u043c \u0437\u0430 \u043d\u0430\u044f\u0432\u043d\u043e\u0441\u0442\u0456 \u0432\u0445\u0456\u0434\u043d\u043e\u0433\u043e TCP, \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438 \u043d\u0435 \u0437\u043c\u043e\u0436\u0443\u0442\u044c \u0437\u0432'\u044f\u0437\u0430\u0442\u0438\u0441\u044f \u0437 \u0432\u0430\u043c\u0438 \u0447\u0435\u0440\u0435\u0437 TCP, \u0449\u043e \u0437\u0430\u0448\u043a\u043e\u0434\u0438\u0442\u044c \u043c\u0435\u0440\u0435\u0436\u0456.";
    t[11984] = "Local Identity";
    t[11985] = "\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0430 \u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "\u0425\u043e\u0447\u0430 I2P \u0434\u043e\u0431\u0440\u0435 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0442\u0438\u043c\u0435 \u0437\u0430 \u0431\u0456\u043b\u044c\u0448\u0456\u0441\u0442\u044e \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440\u0456\u0432, \u0432\u0430\u0448\u0430 \u0448\u0432\u0438\u0434\u043a\u0456\u0441\u0442\u044c \u0456 \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u0430 \u0456\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0456\u044f \u0437\u0430\u0433\u0430\u043b\u043e\u043c \u043f\u043e\u043a\u0440\u0430\u0449\u0430\u0442\u044c\u0441\u044f, \u044f\u043a\u0449\u043e \u043f\u043e\u0440\u0442 I2P \u0431\u0443\u0434\u0435 \u043f\u0435\u0440\u0435\u043d\u0430\u043f\u0440\u0430\u0432\u043b\u044f\u0442\u0438\u0441\u044f \u044f\u043a \u0434\u043b\u044f UDP, \u0442\u0430\u043a \u0456 \u0434\u043b\u044f TCP.";
    t[12002] = "Shared Clients";
    t[12003] = "\u0421\u043f\u0456\u043b\u044c\u043d\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0438";
    t[12006] = "Configuration files for the router, installed plugins, and router logs are stored in the following location:";
    t[12007] = "\u0424\u0430\u0439\u043b\u0438 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 \u0440\u043e\u0443\u0442\u0435\u0440\u0430, \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0445 \u043f\u043b\u0430\u0433\u0456\u043d\u0456\u0432 \u0442\u0430 \u0436\u0443\u0440\u043d\u0430\u043b\u0438 \u0440\u043e\u0443\u0442\u0435\u0440\u0430 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0443 \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456:";
    t[12008] = "Postman's POP3 Mail Server (pop3.postman.i2p)";
    t[12009] = "\u041f\u043e\u0448\u0442\u043e\u0432\u0438\u0439 \u0441\u0435\u0440\u0432\u0435\u0440 POP3 \u043b\u0438\u0441\u0442\u043e\u043d\u043e\u0448\u0456 (pop3.postman.i2p)";
    t[12014] = "Plugin update requires installed plugin version {0} or higher";
    t[12015] = "\u0414\u043b\u044f \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u043b\u0430\u0433\u0456\u043d\u0430 \u0432\u0456\u043d \u043c\u0430\u0454 \u0431\u0443\u0442\u0438 \u0432\u0435\u0440\u0441\u0456\u0457 {0} \u0430\u0431\u043e \u0432\u0438\u0449\u0435";
    t[12018] = "Permanently banned";
    t[12019] = "\u0417\u0430\u0431\u0430\u043d\u0435\u043d\u0438\u0439 \u043d\u0430\u0437\u0430\u0432\u0436\u0434\u0438";
    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "\u0422\u0443\u043d\u0435\u043b\u0456, \u0442\u0440\u0438\u0432\u0430\u043b\u0456\u0441\u0442\u044c \u044f\u043a\u0438\u0445 \u043f\u0435\u0440\u0435\u0432\u0438\u0449\u0443\u0454 3 \u0441\u0442\u0440\u0438\u0431\u043a\u0438 (\u043d\u0430\u043f\u0440\u0438\u043a\u043b\u0430\u0434, 2 \u0441\u0442\u0440\u0438\u0431\u043a\u0438 0-2 \u0441\u0442\u0440\u0438\u0431\u043a\u0438, 3 \u0441\u0442\u0440\u0438\u0431\u043a\u0438 0-1 \u0441\u0442\u0440\u0438\u0431\u043a\u0438, 3 \u0441\u0442\u0440\u0438\u0431\u043a\u0438 0-2 \u0441\u0442\u0440\u0438\u0431\u043a\u0438) \u0430\u0431\u043e \u0432\u0435\u043b\u0438\u043a\u0430 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0440\u0435\u0437\u0435\u0440\u0432\u043d\u0438\u0445 \u043a\u043e\u043f\u0456\u0439 \u043c\u043e\u0436\u0443\u0442\u044c \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u043e \u0437\u043d\u0438\u0437\u0438\u0442\u0438 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u0438\u0432\u043d\u0456\u0441\u0442\u044c \u0430\u0431\u043e \u043d\u0430\u0434\u0456\u0439\u043d\u0456\u0441\u0442\u044c.";
    t[12022] = "Sidebar";
    t[12023] = "\u0411\u0456\u0447\u043d\u0430 \u043f\u0430\u043d\u0435\u043b\u044c";
    t[12024] = "A router that facilitates the connection to the network of another router that is behind a firewall.";
    t[12025] = "\u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440, \u044f\u043a\u0438\u0439 \u0441\u043f\u0440\u043e\u0449\u0443\u0454 \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u043e \u043c\u0435\u0440\u0435\u0436\u0456 \u0456\u043d\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430, \u044f\u043a\u0438\u0439 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u0437\u0430 \u0431\u0440\u0430\u043d\u0434\u043c\u0430\u0443\u0435\u0440\u043e\u043c.";
    t[12026] = "I2P FAQ";
    t[12027] = "\u041f\u043e\u0448\u0438\u0440\u0435\u043d\u0456 \u0437\u0430\u043f\u0438\u0442\u0430\u043d\u043d\u044f \u0449\u043e\u0434\u043e I2P";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "\u042f\u043a\u0449\u043e \u043d\u0430\u0432\u0435\u0441\u0442\u0438 \u0432\u043a\u0430\u0437\u0456\u0432\u043d\u0438\u043a \u043d\u0430 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a <i>\u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440</i>, \u0431\u0443\u0434\u0435 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u043e \u0441\u043a\u043e\u0440\u043e\u0447\u0435\u043d\u0443 \u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 (\u043f\u0435\u0440\u0448\u0456 \u0447\u043e\u0442\u0438\u0440\u0438 \u0441\u0438\u043c\u0432\u043e\u043b\u0438 (24 \u0431\u0456\u0442\u0430) \u0437 44-\u0441\u0438\u043c\u0432\u043e\u043b\u044c\u043d\u043e\u0433\u043e (256-\u0431\u0456\u0442\u043d\u043e\u0433\u043e) \u0445\u0435\u0448\u0430 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0443 Base64). \u041f\u043e\u0432\u043d\u0438\u0439 \u0445\u0435\u0448 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u0438\u0439 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href='netdb?r=.'>\u0437\u0430\u043f\u0438\u0441\u0443 \u0432 \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u0456\u0439 \u0431\u0430\u0437\u0456 \u0434\u0430\u043d\u0438\u0445</a>. \u041d\u0456\u043a\u043e\u043b\u0438 \u043d\u0456\u043a\u043e\u043c\u0443 \u043d\u0435 \u0440\u043e\u0437\u0433\u043e\u043b\u043e\u0448\u0443\u0439\u0442\u0435 \u0446\u0435, \u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c \u0432\u0430\u0448\u043e\u0433\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430 \u0443\u043d\u0456\u043a\u0430\u043b\u044c\u043d\u0438\u043c \u0447\u0438\u043d\u043e\u043c \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0430 \u0437 \u0432\u0430\u0448\u043e\u044e IP-\u0430\u0434\u0440\u0435\u0441\u043e\u044e \u0432 \u043c\u0435\u0440\u0435\u0436\u0435\u0432\u0456\u0439 \u0431\u0430\u0437\u0456 \u0434\u0430\u043d\u0438\u0445.";
    t[12030] = "Previous";
    t[12031] = "\u041f\u043e\u043f\u0435\u0440\u0435\u0434\u043d\u0456\u0439";
    t[12032] = "Stopped router";
    t[12033] = "\u0420\u043e\u0443\u0442\u0435\u0440 \u0437\u0443\u043f\u0438\u043d\u0435\u043d\u043e";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "\u0421\u043f\u0438\u0441\u043a\u0438 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456\u0432 (\u0456\u043d\u043e\u0434\u0456 \u0442\u0430\u043a\u043e\u0436 \u0437\u0432\u0430\u043d\u0438\u0445 \u0432\u0456\u0440\u0442\u0443\u0430\u043b\u044c\u043d\u0438\u043c\u0438 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0430\u043c\u0438) \u0443\u0432\u0456\u043c\u043a\u043d\u0435\u043d\u0456 \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c, \u0442\u043e\u0436 \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0445\u043e\u0441\u0442\u0438\u0442\u0438 \u0444\u0430\u0439\u043b\u0438 \u0437 \u043f\u0456\u0434\u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456\u0432 <code>docroot</code> \u0431\u0435\u0437 \u043d\u0430\u0434\u0430\u043d\u043d\u044f \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0438 \u0437 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f\u043c\u0438 \u043d\u0430 \u0444\u0430\u0439\u043b\u0438. \u0422\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u043d\u0430 \u043e\u0431\u0441\u043b\u0443\u0433\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043a\u043e\u043d\u0442\u0435\u043d\u0442 \u0437\u0430 \u043c\u0435\u0436\u0430\u043c\u0438 <code>docroot</code>, \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0447\u0438 <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>\u0441\u0438\u043c\u0432\u043e\u043b\u0456\u0447\u043d\u0435 \u043f\u043e\u0441\u0438\u043b\u0430\u043d\u043d\u044f</a> \u043d\u0430 \u0431\u0430\u0436\u0430\u043d\u0438\u0439 \u043a\u0430\u0442\u0430\u043b\u043e\u0433.";
    t[12044] = "You have configured I2P to share only {0} KBps.";
    t[12045] = "\u0412\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043b\u0438 I2P \u043d\u0430 \u0441\u043f\u0456\u043b\u044c\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f \u043b\u0438\u0448\u0435 \u0434\u043e {0} \u041a\u0431\u0456\u0442/\u0441.";
