    t[12047] = "\u041d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u043e URL";
    t[12054] = "SAM";
    t[12055] = "SAM";
    t[12056] = "Package / repository installation";
    t[12057] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u0430\u043a\u0435\u0442\u043e\u043c/\u0437 \u0440\u0435\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0456\u044e";
    t[12058] = "change requires restart to take effect";
    t[12059] = "\u0437\u043c\u0456\u043d\u0430 \u0432\u0438\u043c\u0430\u0433\u0430\u0454 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0443, \u0449\u043e\u0431 \u0432\u0441\u0442\u0443\u043f\u0438\u0442\u0438 \u0432 \u0441\u0438\u043b\u0443";
    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "\u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u044e\u0447\u0438 \u0434\u0438\u0440\u0435\u043a\u0442\u0438\u0432\u0443 <i class=example>explicit</i>, \u043f\u043e\u0440\u0456\u0433 \u043c\u043e\u0436\u043d\u0430 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u0442\u0438 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u043e\u0457 \u0446\u0456\u043b\u0456, \u044f\u043a\u0430 \u0432\u043a\u0430\u0437\u0430\u043d\u0430 \u0443 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u0456, \u0437 \u043c\u043e\u0436\u043b\u0438\u0432\u0456\u0441\u0442\u044e \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0432\u043b\u0430\u0441\u043d\u0456 \u043f\u043e\u0440\u043e\u0433\u0438 \u0434\u043b\u044f \u0434\u0435\u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0446\u0456\u043b\u0435\u0439. \u0412\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u0445 \u0446\u0456\u043b\u0435\u0439 \u0442\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u043d\u0430 \u0432\u0438\u043a\u043b\u044e\u0447\u0438\u0442\u0438 \u0437 \u0442\u0438\u043f\u043e\u0432\u043e\u0433\u043e \u043f\u043e\u0440\u043e\u0433\u0443 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u043a\u043b\u044e\u0447\u043e\u0432\u043e\u0433\u043e \u0441\u043b\u043e\u0432\u0430 <i class=example>allow</i>, \u0430\u0431\u043e \u0431\u043b\u043e\u043a\u0443\u0432\u0430\u0442\u0438 \u043d\u0430\u0437\u0430\u0432\u0436\u0434\u0438 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e <i class=example>deny</i>:";
    t[12064] = "Install failed";
    t[12065] = "\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043d\u0435\u0432\u0434\u0430\u043b\u0435";
