    t[12081] = "\u0414\u0430\u043d\u0456 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0456\u0457";
    t[12098] = "High CPU and/or high outbound bandwidth usage may result.";
    t[12099] = "\u0426\u0435 \u043c\u043e\u0436\u0435 \u043f\u0440\u0438\u0437\u0432\u0435\u0441\u0442\u0438 \u0434\u043e \u0432\u0438\u0441\u043e\u043a\u043e\u0433\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u043e\u0440\u0430 \u0442\u0430/\u0430\u0431\u043e \u0432\u0438\u0441\u043e\u043a\u043e\u0457 \u0432\u0438\u0445\u0456\u0434\u043d\u043e\u0457 \u0441\u043c\u0443\u0433\u0438 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u0430\u043d\u043d\u044f.";
    t[12100] = "Local web server for hosting your own content on I2P";
    t[12101] = "\u041b\u043e\u043a\u0430\u043b\u044c\u043d\u0438\u0439 \u0432\u0435\u0431-\u0441\u0435\u0440\u0432\u0435\u0440 \u0434\u043b\u044f \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u043d\u044f \u0432\u0430\u0448\u043e\u0433\u043e \u0432\u043b\u0430\u0441\u043d\u043e\u0433\u043e \u0432\u043c\u0456\u0441\u0442\u0443 \u043d\u0430 I2P";
