    t[12103] = "\u0425\u0435\u0448-\u0432\u0456\u0434\u0441\u0442\u0430\u043d\u044c";
    t[12114] = "Last heard from";
    t[12115] = "\u0412\u043e\u0441\u0442\u0430\u043d\u043d\u0454 \u0447\u0443\u0432";
    t[12116] = "Not to worry, but above routers are closer than average minimum distance";
    t[12117] = "\u041d\u0435 \u0445\u0432\u0438\u043b\u044e\u0439\u0442\u0435\u0441\u044f, \u0430\u043b\u0435 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0438 \u0432\u0438\u0449\u0435, \u043d\u0456\u0436 \u0441\u0435\u0440\u0435\u0434\u043d\u044f \u043c\u0456\u043d\u0456\u043c\u0430\u043b\u044c\u043d\u0430 \u0432\u0456\u0434\u0441\u0442\u0430\u043d\u044c";
    t[12118] = "Note that if the number of connections is 1 (e.g. <i class=example>1/60</i>), the first connection attempt will result in a breach.";
