    t[12151] = "\u041f\u043e\u043c\u0438\u043b\u043a\u0430 \u043e\u0441\u0442\u0430\u043d\u043d\u044c\u043e\u0433\u043e \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u043d\u043d\u044f";
    t[12152] = "Note: Many of the labels and options in the console have tooltips that indicate purpose or explain the meaning. Hover over the label or option to activate the tooltip.";
    t[12153] = "\u041f\u0440\u0438\u043c\u0456\u0442\u043a\u0430: \u0431\u0430\u0433\u0430\u0442\u043e \u043f\u0456\u0434\u043f\u0438\u0441\u0456\u0432 \u0456 \u043e\u043f\u0446\u0456\u0439 \u0443 \u043a\u043e\u043d\u0441\u043e\u043b\u0456 \u043c\u0430\u044e\u0442\u044c \u043f\u0456\u0434\u043a\u0430\u0437\u043a\u0438, \u0449\u043e \u0432\u043a\u0430\u0437\u0443\u044e\u0442\u044c \u043d\u0430 \u043f\u0440\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0430\u0431\u043e \u043f\u043e\u044f\u0441\u043d\u044e\u044e\u0442\u044c \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f. \u041d\u0430\u0432\u0435\u0434\u0456\u0442\u044c \u0432\u043a\u0430\u0437\u0456\u0432\u043d\u0438\u043a \u043d\u0430 \u043f\u0456\u0434\u043f\u0438\u0441 \u0430\u0431\u043e \u043e\u043f\u0446\u0456\u044e \u0434\u043b\u044f \u0430\u043a\u0442\u0438\u0432\u0430\u0446\u0456\u0457 \u043f\u0456\u0434\u043a\u0430\u0437\u043a\u0438.";
    t[12154] = "The plugins listed below are started by the webConsole client.";
    t[12155] = "\u041d\u0430\u0432\u0435\u0434\u0435\u043d\u0456 \u043d\u0438\u0436\u0447\u0435 \u043f\u043b\u0430\u0433\u0456\u043d\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u044e\u0442\u044c\u0441\u044f \u043a\u043b\u0456\u0454\u043d\u0442\u043e\u043c webConsole.";
    t[12156] = "Official I2P Git repository";
    t[12157] = "\u041e\u0444\u0456\u0446\u0456\u0439\u043d\u0435 \u0441\u0445\u043e\u0432\u0438\u0449\u0435 I2P Git";
    t[12160] = "Console";
    t[12161] = "\u041a\u043e\u043d\u0441\u043e\u043b\u044c";
    t[12164] = "Router Information";
    t[12165] = "\u0406\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u044f \u043f\u0440\u043e \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440";
    t[12166] = "Remove";
    t[12167] = "\u0412\u0438\u0434\u0430\u043b\u0438\u0442\u0438";
    t[12168] = "IPs Permanently Banned";
    t[12169] = "\u041d\u0430\u0437\u0430\u0432\u0436\u0434\u0438 \u0437\u0430\u0431\u043b\u043e\u043a\u043e\u0432\u0430\u043d\u0456 IPs \u0430\u0434\u0440\u0435\u0441\u0438";
    t[12174] = "No UPnP-compatible device present";
    t[12175] = "\u043d\u0435\u043c\u0430\u0454 UPnP-\u0441\u0443\u043c\u0456\u0441\u043d\u043e\u0433\u043e \u043f\u0440\u0438\u0441\u0442\u0440\u043e\u044e";
    t[12182] = "Reason";
    t[12183] = "\u041f\u0440\u0438\u0447\u0438\u043d\u0430";
    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "\u0426\u0435 \u043d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0438\u0437\u043d\u0430\u0447\u0430\u0454 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0441\u0435\u0433\u043c\u0435\u043d\u0442\u0456\u0432 DHT \u0432 NetDb, \u043d\u0430 \u044f\u043a\u0456 \u0431\u0443\u0434\u0435 \u043f\u043e\u0441\u0438\u043b\u0430\u0442\u0438\u0441\u044f \u0417\u0430\u0432\u0434\u0430\u043d\u043d\u044f \u0434\u043e\u0441\u043b\u0456\u0434\u0436\u0435\u043d\u043d\u044f \u043f\u0456\u0440\u0456\u0432 \u043f\u0440\u0438 \u0437\u0430\u043f\u0443\u0441\u043a\u0443. \u0417\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0441\u0435\u0433\u043c\u0435\u043d\u0442\u0456\u0432 \u0434\u043b\u044f \u0434\u043e\u0441\u043b\u0456\u0434\u0436\u0435\u043d\u043d\u044f \u0431\u0443\u0434\u0435 \u043a\u043e\u043b\u0438\u0432\u0430\u0442\u0438\u0441\u044f \u0432 \u0437\u0430\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0456 \u0432\u0456\u0434 \u0442\u043e\u0433\u043e, \u0447\u0438 \u043f\u0440\u0430\u0446\u044e\u0432\u0430\u0432 \u0440\u043e\u0443\u0442\u0435\u0440 \u0431\u0456\u043b\u044c\u0448\u0435 \u0433\u043e\u0434\u0438\u043d\u0438, \u0447\u0438 \u043f\u0435\u0440\u0435\u0431\u0443\u0432\u0430\u0454 \u0440\u043e\u0443\u0442\u0435\u0440 \u0432 \u043f\u0440\u0438\u0445\u043e\u0432\u0430\u043d\u043e\u043c\u0443 \u0440\u0435\u0436\u0438\u043c\u0456 \u0430\u0431\u043e \u0443 \u0441\u043c\u0443\u0437\u0456 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u043d\u043e\u0457 \u0437\u0434\u0430\u0442\u043d\u043e\u0441\u0442\u0456 \u00abK\u00bb, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0432\u0456\u0434 \u043a\u0456\u043b\u044c\u043a\u043e\u0441\u0442\u0456 \u0432\u0456\u0434\u043e\u043c\u0438\u0445 \u0440\u043e\u0443\u0442\u0435\u0440\u0456\u0432.";
    t[12186] = "threat points";
    t[12187] = "\u0442\u043e\u0447\u043a\u0438 \u0437\u0430\u0433\u0440\u043e\u0437\u0438";
    t[12194] = "Failed to stop systray";
    t[12195] = "\u041d\u0435 \u0432\u0434\u0430\u043b\u043e\u0441\u044f \u0437\u0443\u043f\u0438\u043d\u0438\u0442\u0438 \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u0443 \u043f\u0430\u043d\u0435\u043b\u044c";
    t[12196] = "Update failed";
    t[12197] = "\u041f\u043e\u043c\u0438\u043b\u043a\u0430 \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f";
    t[12198] = "Hostname Registration";
    t[12199] = "\u0420\u0435\u0454\u0441\u0442\u0440\u0430\u0446\u0456\u044f \u0456\u043c\u0435\u043d\u0456 \u0445\u043e\u0441\u0442\u0430";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "\u042f\u043a\u0449\u043e \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0432\u0456\u0434\u043e\u043c\u0438\u0445 \u043f\u0456\u0440\u0456\u0432 \u0441\u043f\u0430\u0434\u0435 \u043d\u0438\u0436\u0447\u0435 50, I2P \u0441\u043f\u0440\u043e\u0431\u0443\u0454 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0438\u0442\u0438\u0441\u044f \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e. \u042f\u043a\u0449\u043e \u0441\u043f\u0440\u043e\u0431\u0430 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u043d\u0435 \u0432\u0434\u0430\u0441\u0442\u044c\u0441\u044f, \u0437'\u044f\u0432\u0438\u0442\u044c\u0441\u044f \u043f\u043e\u0432\u0456\u0434\u043e\u043c\u043b\u0435\u043d\u043d\u044f \u0432 \u0431\u043e\u043a\u043e\u0432\u0456\u0439 \u043f\u0430\u043d\u0435\u043b\u0456 \u0437 \u043e\u043f\u0446\u0456\u0454\u044e \u0434\u043b\u044f \u0440\u0443\u0447\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f. \u041d\u0435\u0432\u0434\u0430\u043b\u0443 \u0441\u043f\u0440\u043e\u0431\u0443 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f \u043c\u043e\u0436\u0435 \u0441\u043f\u0440\u0438\u0447\u0438\u043d\u0438\u0442\u0438 \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u043d\u044f \u043c\u0456\u0441\u0446\u0435\u0432\u0438\u043c \u0444\u0430\u0439\u0440\u0432\u043e\u043b\u043e\u043c \u0432\u0438\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u0442\u0440\u0430\u0444\u0456\u043a\u0443, \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0438 \u0437 \u043c\u0435\u0440\u0435\u0436\u043d\u0438\u043c \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f\u043c \u0430\u0431\u043e \u043f\u043e\u0432\u043d\u0435 \u0431\u043b\u043e\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0437\u0430\u043f\u0438\u0442\u0443 \u043d\u0430 \u043f\u0435\u0440\u0435\u043d\u0430\u0441\u0456\u043d\u043d\u044f.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "\u0410\u043b\u044c\u0442\u0435\u0440\u043d\u0430\u0442\u0438\u0432\u043d\u0438\u0439 \u0437\u043e\u0432\u043d\u0456\u0448\u043d\u0456\u0439 \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441 Reddit, \u043e\u0440\u0456\u0454\u043d\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u043a\u043e\u043d\u0444\u0456\u0434\u0435\u043d\u0446\u0456\u0439\u043d\u0456\u0441\u0442\u044c";
    t[12224] = "Toggle Tunnels";
    t[12225] = "\u041f\u0435\u0440\u0435\u043c\u0438\u043a\u0430\u043d\u043d\u044f \u0422\u0443\u043d\u0435\u043b\u0456\u0432";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "\u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u0438\u0439 \u0443 \u0444\u0430\u0439\u043b\u0456 <code>clients.config</code>. \u0422\u0430\u043a\u043e\u0436 \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0440\u0438\u0454\u0434\u043d\u0430\u043d\u043d\u044f \u0434\u043e \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0443 \u0430\u0431\u043e \u0432\u0441\u0456\u0445 \u0456\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441\u0456\u0432 \u0443 \u0444\u0430\u0439\u043b\u0456 <code>jetty.xml</code>.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "\u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0438\u0437\u043d\u0430\u0447\u0438\u0442\u0438, \u044f\u043a\u0456 \u0441\u0435\u0440\u0432\u0456\u0441\u0438 \u0431\u0443\u0434\u0443\u0442\u044c \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0437\u0430\u043f\u0443\u0441\u043a\u0430\u0442\u0438\u0441\u044f \u043f\u0440\u0438 \u0441\u0442\u0430\u0440\u0442\u0456 \u0440\u043e\u0443\u0442\u0435\u0440\u0430, \u043a\u0435\u0440\u0443\u0432\u0430\u0442\u0438 \u0440\u043e\u0437\u043f\u043e\u0434\u0456\u043b\u043e\u043c \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0434\u043b\u044f \u043e\u043f\u0442\u0438\u043c\u0456\u0437\u0430\u0446\u0456\u0457 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0447\u0430\u0441\u0442\u043e \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u043d\u0438\u0445 \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432 \u0430\u0431\u043e \u043c\u0456\u043d\u0456\u043c\u0456\u0437\u0430\u0446\u0456\u0457 \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0435\u043d\u043d\u044f \u0426\u041f \u0456 \u043f\u0430\u043c'\u044f\u0442\u0456, \u0434\u043e\u0434\u0430\u0432\u0430\u0442\u0438 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u0456 \u0442\u0430 \u043a\u043b\u0456\u0454\u043d\u0442\u0441\u044c\u043a\u0456 \u0442\u0443\u043d\u0435\u043b\u0456 \u0434\u043b\u044f \u043f\u0440\u0438\u0439\u043c\u0430\u043d\u043d\u044f \u0430\u0431\u043e \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0434\u043e \u0441\u0435\u0440\u0432\u0456\u0441\u0456\u0432 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456, \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u044e\u0432\u0430\u0442\u0438 \u043b\u0456\u043c\u0456\u0442\u0438 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0456 \u0434\u0430\u043d\u0438\u0445 \u0442\u0430 \u0444\u0456\u043b\u044c\u0442\u0440\u0430\u0446\u0456\u044e \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0434\u043b\u044f \u0432\u0430\u0448\u0438\u0445 \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u0438\u0445 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0442\u0430 \u0456\u043d\u0448\u0435.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "\u041f\u0440\u0438\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043e \u0430\u0434\u0440\u0435\u0441\u0438 LAN. \u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0437\u043c\u0456\u043d\u0435\u043d\u0438\u0439 \u0437 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\u043c \u0440\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u043e\u0457 \u043a\u043e\u043d\u0444\u0456\u0433\u0443\u0440\u0430\u0446\u0456\u0457 <code>i2np.upnp.HTTPPort=nnnn</code>. \u041c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 \u0432\u0438\u043c\u043a\u043d\u0435\u043d\u0438\u0439 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u0446\u0456 <a href=/confignet>\u041d\u0430\u043b\u0430\u0448\u0442\u0443\u0432\u0430\u043d\u043d\u044f \u043c\u0435\u0440\u0435\u0436\u0456</a>.";
    t[12234] = "Data transferred";
    t[12235] = "\u0414\u0430\u043d\u0456 \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u043e";
    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "\u0423 \u043f\u043e\u043b\u0435 \u0437 \u043f\u043e\u0437\u043d\u0430\u0447\u043a\u043e\u044e <i>\u041d\u0435\u043c\u0430\u0454 \u043f\u0440\u043e\u043a\u0441\u0456-\u0441\u0435\u0440\u0432\u0435\u0440\u0430 \u0434\u043b\u044f</i> \u0434\u043e\u0434\u0430\u0439\u0442\u0435 \u0440\u044f\u0434\u043e\u043a <code>127.0.0.1,localhost</code>, \u0449\u043e\u0431 \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0438\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456\u0441\u0442\u044c \u043a\u043e\u043d\u0441\u043e\u043b\u0456 I2P \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0456\u0432, \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u0438\u0445 \u043d\u0430 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u0445\u043e\u0441\u0442\u0456.";
    t[12250] = "Sort by idle outbound";
