    t[12348] = "The unique cryptographic identity of the inbound endpoint of a tunnel providing access to a service on the I2P network, represented as a Base32 or Base64 hash of the public key. Equivalent to an IP address and port.";
    t[12349] = "\u0423\u043d\u0456\u043a\u0430\u043b\u044c\u043d\u0430 \u043a\u0440\u0438\u043f\u0442\u043e\u0433\u0440\u0430\u0444\u0456\u0447\u043d\u0430 \u0456\u0434\u0435\u043d\u0442\u0438\u0447\u043d\u0456\u0441\u0442\u044c \u0432\u0445\u0456\u0434\u043d\u043e\u0457 \u0442\u043e\u0447\u043a\u0438 \u0442\u0443\u043d\u0435\u043b\u044e, \u0449\u043e \u043d\u0430\u0434\u0430\u0454 \u0434\u043e\u0441\u0442\u0443\u043f \u0434\u043e \u0441\u0435\u0440\u0432\u0456\u0441\u0443 \u0432 \u043c\u0435\u0440\u0435\u0436\u0456 I2P, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0430 \u200b\u200b\u0443 \u0432\u0438\u0433\u043b\u044f\u0434\u0456 \u0445\u0435\u0448\u0430 \u0411\u0430\u0437\u0438 32 \u0430\u0431\u043e \u0411\u0430\u0437\u0438 64 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u043e\u0433\u043e \u043a\u043b\u044e\u0447\u0430. \u0415\u043a\u0432\u0456\u0432\u0430\u043b\u0435\u043d\u0442\u043d\u0438\u0439 IP-\u0430\u0434\u0440\u0435\u0441\u0456 \u0442\u0430 \u043f\u043e\u0440\u0442\u0443.";
