    t[12401] = "\u0427\u0438 \u043f\u0440\u0430\u0446\u044e\u0454 \u0456\u043d\u0448\u0438\u0439 \u0435\u043a\u0437\u0435\u043c\u043f\u043b\u044f\u0440 I2P? \u0417\u0443\u043f\u0438\u043d\u0456\u0442\u044c \u043a\u043e\u043d\u0444\u043b\u0456\u043a\u0442\u043d\u0443 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0443 \u0442\u0430 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0456\u0442\u044c I2P.";
    t[12404] = "The last router in a tunnel, which may be the <i>Outbound Endpoint</i>, where the client's tunnels meet the <i>Inbound Gateway</i> of the destination server's tunnels, or the <i>Inbound Endpoint</i> which is the final router in the chain that connects to the destination server.";
    t[12405] = "\u041e\u0441\u0442\u0430\u043d\u043d\u0456\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0432 \u0442\u0443\u043d\u0435\u043b\u0456, \u0449\u043e \u043c\u043e\u0436\u0435 \u0431\u0443\u0442\u0438 <i>\u041a\u0456\u043d\u0446\u0435\u0432\u043e\u044e \u0442\u043e\u0447\u043a\u043e\u044e \u0432\u0456\u0434\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044f</i>, \u0434\u0435 \u0442\u0443\u043d\u0435\u043b\u0456 \u043a\u043b\u0456\u0454\u043d\u0442\u0430 \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0430\u044e\u0442\u044c\u0441\u044f \u0437 <i>\u0412\u0445\u0456\u0434\u043d\u0438\u043c \u0448\u043b\u044e\u0437\u043e\u043c</i> \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0446\u0456\u043b\u044c\u043e\u0432\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430, \u0430\u0431\u043e <i>\u0412\u0445\u0456\u0434\u043d\u043e\u044e \u043a\u0456\u043d\u0446\u0435\u0432\u043e\u044e \u0442\u043e\u0447\u043a\u043e\u044e</i>, \u044f\u043a\u0430 \u0454 \u043e\u0441\u0442\u0430\u043d\u043d\u0456\u043c \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u043c \u0432 \u043b\u0430\u043d\u0446\u044e\u0436\u043a\u0443, \u0449\u043e \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u0434\u043e \u0446\u0456\u043b\u044c\u043e\u0432\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430. ";
